var book = {
	"name": "၂ မိစ့ၭ",
	"numChapters": 40,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭအယီၩမွဲၦအံၫစရ့လၭဖိၪလဖၪအမံၩ့, လၧအဂဲၫ နုၬလၧအံဇံၭအဖၧၩ့း လဂၩဒဲအၡၩဂံၪ့ဖိၪ, လဂၩဒဲအ",
			"2": "<sup>2</sup> ၡၩဂံၪ့ဖိၪဂဲၫဝ့ၫလၧစယၫကူၭအၥိၭလီၫ.- စရုဘံၫ့ စစံ",
			"3": "<sup>3</sup> မအၧၫ့, စလံဝဲၫ,စယုဒၫ,- စအံစခၫ, စဇ့ၭဘလၧၫ့ဒဲ စ",
			"4": "<sup>4</sup> ဘံၪ့ယမံၫ့,- စဒၫ့,ဒဲစနၭၥလဲၫ, စဂၭ,ဒဲစအၭၡၧၫလီၫ.",
			"5": "<sup>5</sup> တၭကယဲၦအၥၭလၧအဂဲၫလၩ့ လၧစယၫကူၭအယး ဒံၩ့နီၪ, မွဲၦအၥၭနွ့ၫဆံၫလီၫ. အဂဲးဘဲၫယီၩ စယိၥၭ",
			"6": "<sup>6</sup> အီၪယူၭဝ့ၫလၧခးအံဇံၭအဖၧၩ့လီၫ.- တၭစယိၥၭၥံၫ ဝ့ၫ,ဒဲအထၧၫ့ဖုဝဲထီးအလူၬ, ဒဲကယဲၦလဆိၩနီၪထီး",
			"7": "<sup>7</sup> အလူၬလီၫ.- တၭၦအံၫစရ့လၭဖိၪၥံၪၥၪထၪ့, ဒဲအၪထၪ့ ဝ့ၫအၪအၪလ့ၬတၭ, ဆီၪ့ထၪ့ဝ့ၫဒိၪဒိၪလ့ၬလီၫ. တၭ ထံၫၥံၪခးၥံၪနီၪဎွ့ၩလၧအဝ့ၫၥံၪလီၫ.",
			"8": "<sup>8</sup> တၭစဎွၩအၥၫ့လဂၩ အီၪထၪ့လၧအံဇံၭ အဖၫ့ခိၪ",
			"9": "<sup>9</sup> လၧအလၥ့ၪယၫဘၪစယိၥၭ,- တၭအဝ့ၫဒၪ စံၭအခ့ၫ အၡၩ,ယိခွါ, ၦခမျၧး, ၦအံၫစရ့လၭဖိၪ အၪနဲၪ့ဆီၪ့",
			"10": "<sup>10</sup> နဲၪ့ပဝ့ၫဒၪယီၩလီၫ.- ဂဲၫဘီၪ, မၩၡီၩ့အဝ့ၫၥံၪလၧဆၧ ကိၪ့ၥ့ၪဆံၭး အဝ့ၫၥံၪမိအၪထၪ့တၭ, ဆၧမိမၩဘၪခိၬ အၥၭလၧထီးဒၪဆၧဒုၭၥုၭမိအီၪထၪ့ လမံၩ့မံၩ့တၭ, အဝ့ၫၥံၪမိအီၪက့ၪကီၪ့လိၬအၥၭ လၧၦလၧအမ့ၬလဲၩ ပၧၩတၭ, ဒုၭဆၧထၫ့ဒုၪဒၩပၧၩတၭ, မိစဲၪ့ထၪ့ခွံၬလၧ",
			"11": "<sup>11</sup> ခးယီၩလီၫ.- တၭဆၧအီၪက့ၪၦအၪ့မၧၫ့ဆီၪ့ဝ့ၫ လၧအ ဝ့ၫၥံၪအဖၫ့ခိၪ, ဘဲၫၥိၭအမိမၩၡၪ့မၩနၭဝ့ၫ လၧအဆၧ အွံၪဆၧယိၭလီၫ. တၭအဝ့ၫၥံၪ ဘၪမၩကဲၪထၪ့ဆၧ အီၪက့ၪကီၪ့အလးအဒိၩ့လဖၪ လၧဖၫရိၫအဂး ဒိၩ့",
			"12": "<sup>12</sup> ပဲၥၫ့,ဒဲဒိၩ့ရမံစံၭလီၫ.- မွဲလါနၫ့တၭ, ဒံၩ့အမၩၡၪ့မၩ နၭဝ့ၫနီၪ, ဒံၩ့အဝ့ၫၥံၪ အၪထၪ့ဒဲဆီၪ့ထၪ့ လခီၫလီၫ. တၭအဝ့ၫၥံၪအၥၭဆၫဝ့ၫ လၧၦအံၫစရ့လၭဖိၪအကၠီၩ့",
			"13": "<sup>13</sup> လီၫ.- တၭၦအံဇံၭဖိၪၥံၪအၪ့မၧၫ့ ၦအံၫစရ့လၭဖိၪလ",
			"14": "<sup>14</sup> ဖၪမၩအဆၧဆီၪ့ဆီၪ့လ့ၬလီၫ.- တၭမၩခိမၩဝီၩၦလ ဖၪနီၪလၧဎီးအဆၧမၩ ဘၪဆဲၫ့လၧအၩ့ကတဲၩ, ဒဲၥယိၭ ဒဲကယဲဎီးအဆၧမၩ လၧဆံၬဖၧၩ့လမံၩ့လါလါလီၫ. အ ဝ့ၫၥံၪအဆၧမၩ လၧအဘၪဆၧအၪ့မၧၫ့ အမၩလမံၩ့ လါလါနီၪ, ဘၪမၩဝ့ၫဆီၪ့ဆီၪ့လ့ၬ ကိၭအမံၩ့ဒ့ၭဆ့ လီၫ.",
			"15": "<sup>15</sup> တၭအံဇံၭအစဎွၩ စံၭၦဟံဘြူၫအၡၩယိၦဂူၭ, အလ ဂၩအမံၩ့မွဲနးၡံၭဖၫ, ဒဲအဝ့ၫဒၪလဂၩ အမံၩ့ နးပူအၫ",
			"16": "<sup>16</sup> လီၫ.- တၭစံၭဝ့ၫဒၪ, ထီးနၥံၪမၩၦယိၦဂူၭ အလးလၧ ယဟိဝၩၦဟံဘြူၫမုၪအဂးတၭ, အီၪဒံၭလၧလးဆၧၫ့နၩ့ဖိၪအ ဖၫ့ခိၪတၭ, နၥံၪဘၪယိဆၧလီၫ. အ့ၪမွဲအဖိၪခွၫတၭ နၥံၪမိဘၪမၩၥံၫခွံၬဝ့ၫး အ့ၪမွဲအမုၪတၭ, မိမၧၫ့ဘၪဝ့ၫ",
			"17": "<sup>17</sup> လီၫ.- ၦယိၦဂူၭလဖၪနီၪ ၥၭမဲၪယွၩတၭ, မၩဝ့ၫဘဲၫအံ ဇံၭအစဎွၩ အၪ့မၧၫ့ဝ့ၫအၥိၭနီၪအ့ၬး အ့ၪမွဲအအီၪ",
			"18": "<sup>18</sup> က့ၪမၧၫ့ၦဖိၪၥၪအခွၫလဖၪလီၫ.- အံဇံၭစဎွၩကိၭထဲၩ့ ၦယိၦဂူၭတၭ, စံၭအဝ့ၫၥံၪ, နၥံၪမၩဆၧယီၩတၭ, ဒုၭ",
			"19": "<sup>19</sup> မၧၫ့ဒံၭၦဖိၪၥၪအခွၫ လဖၪနီၪမွဲဘၪလဲၪ.- တၭၦယိ ၦဂူၭစံၭဖၫရိၫ, အဂဲးဘဲၫယီၩ ၦဟံဘြူၫမုၪ မွဲဘဲၫၦအံ ဇံၭမုၪအၥိၭအ့ၬ. အဝ့ၫၥံၪအဂဲးဆီၪ့ အဘၭဆီၪ့တၭ, ၦယိၦဂူၭလချႃၭထီၩ့ဒံၭဘၪ လၧအအီၪတၭ, လၩ့ဖျဲၪ",
			"20": "<sup>20</sup> ဝ့ၫလီၫ.- ယွၩမၩဂ့ၩၦယိၦဂူၭတၭ, ၦခမျၧးအၪထၪ့ဒဲ",
			"21": "<sup>21</sup> ဆီၪ့ထၪ့ဆီၪ့မၬလီၫ.- မွဲၦယိၦဂူၭၥၭမဲၪယွၩ အကၠီၩ့",
			"22": "<sup>22</sup> တၭ,အဝ့ၫဒုၭအၪထၪ့ ၦခမျၧးအဂံၪ့ဖိၪလီၫ.- ဖၫရိၫမၪ လူၬအခ့ၫအၡၩ ထီးအလူၬတၭ, စံၭဝ့ၫဒၪ, ဖိၪခွၫလၧ အအီၪဖျဲၪလဖၪနီၪ, နၥံၪဘၪခွံၬၡိၭခွံၬ လၧထံၫမိၡါအ ဖၧၩ့ကိၭဂၩဒ့ၭလီၫ. အ့ၪမွဲအမုၪလဖၪနီၪ နၥံၪဘၪဒုၭ မၧၫ့ကိၭဂၩဒ့ၭလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> တၭၦလၧလံဝဲၫအဂံၪ့ဖိၪအကျၩ လဂၩလ့ၩန့မၫလၧ",
			"2": "<sup>2</sup> လံဝဲၫအဖိၪမုၪလဂၩလီၫ.- ၦမုၪနီၪဒၧၩ့ထၪ့တၭ, ဆီၫ့ အီၪန့အဖိၪခွၫတၭ, ဒၪဘၪဝ့ၫလၧအမွဲအဂ့ၩနီၪ, အီၪ",
			"3": "<sup>3</sup> က့ၪၥူၪခွံၬဝ့ၫလၩၥၧၫ့ဘံၪ့လီၫ.- ထီးအအီၪက့ၪၥူၪဝ့ၫ လၥ့ၪလၧၩ့ဘၪတၭ, အၪ့မၩန့ဆူၬ လၧၦထဲၫ့ဝ့ၫလၧခီၫ့ ဘီၩ့တၭ, ဂုၪဝ့ၫလၧကျဲၩ့တံၭခိလီၪ့, ဒဲၥံၪ့ထူၭတၭ, အီၪက့ၪဖိၪၥၪနီၪလၧအဖၧၩ့တၭ, အီၪက့ၪလၩ့ဝ့ၫလၧ",
			"4": "<sup>4</sup> ဖီးထံၫအကျၩ လၧထံၫမိၡါအနဲၩ့နီၪလီၫ.- ဆၧမိမၩအ ဝ့ၫဒၪဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ, ဘဲၫၥိၭအမိၥ့ၪယၫဝ့ၫ တၭ,အဝဲမုၪလဂၩဆၧၫ့ထုၪ့အီၪယဲၩ့ လၧအဝ့ၫဒၪလီၫ.",
			"5": "<sup>5</sup> ဖၫရိၫအဖိၪမုၪလဂၩ ဂဲၫလၩ့အၪ့လူထံၫလၧထံၫမိၡါ တၭ, အဎီးအၡၩအမုၪလဖၪ လ့ၩဆၧလၧထံၫမိၡါအ နဲၩ့တၭ, ထီးအဒၪဘၪဆူၬနီၪ အီၪလၧဖီးထံၫအကျၩ",
			"6": "<sup>6</sup> တၭ,အၪ့မၧၫ့အဎီးမုၪလဂၩ လ့ၩမၩန့ဝ့ၫလီၫ.- ထီးအ ဝဲထၪ့ဝ့ၫတၭ, ဒၪဘၪဖိၪၥၪတၭ, ယိခွါ, ဖိၪၥၪနီၪဂၪ့ဝ့ၫ ဒၪလီၫ. မွဲအယၫ့ၥၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ, အယီၩမွဲၦဟံ",
			"7": "<sup>7</sup> ဘြူၫဖိၪအဖိၪခွၫလဂၩလီၫ.- တၭအဝဲမုၪစံၭဖၫရိၫအ ဖိၪမုၪ,မွဲယမိဘၪ လ့ၩကိၭန့နၧၩ လၧၦဟံဘြူၫမုၪလၧ အဒုၭအၪ့နူလဂၩ, ဘဲၫၥိၭအမိဒုၭအၪ့နူဖိၪၥၪယီၩလၧ",
			"8": "<sup>8</sup> နဂးဆ့ဧၪ.- တၭဖၫရိၫအဖိၪမုၪစံၭအဝ့ၫနီၪ, လ့ၩကဒၪ ဘီၪ. တၭၦမုၪနၩ့လဂၩနီၪ လ့ၩကိၭန့ဖိၪၥၪအမိလီၫ.",
			"9": "<sup>9</sup> တၭဖၫရိၫအဖိၪမုၪနီၪ စံၭအဝ့ၫဒၪ, ထဲၩ့ဆိၬဖိၪၥၪလ ဂၩယီၩတၭ, ဒုၭအၪ့နူလၧယဂးဆံၭး တၭယမိဖ့ၪလၫ့ နလံၩ့နလဲၫလီၫ. ၦမုၪနီၪမၩန့ဖိၪၥၪတၭ, ဒုၭအၪ့နူဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- ဖိၪၥၪနီၪဒိၪထၪ့ဝ့ၫတၭ, အမိဂဲၫထဲၩ့ဆိၬဝ့ၫလၧ ဖၫရိၫအဖိၪမုၪအအီၪတၭ, ကဲၪထၪ့အဝ့ၫဒၪ အဖိၪခွၫ နီၪ,ဖျိၬဝ့ၫအမံၩ့စမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ ယကၠူၭထၪ့ခွံၬအဝ့ၫ လၧထံၫကျၩလီၫ.",
			"11": "<sup>11</sup> ဆၧမၩအၥၭ လၧမုနံၩလဖၪနီၪ စမိစ့ၭဒိၪထၪ့ယူၭ တၭ, လ့ၩထၪ့ဝ့ၫလၧအထၧၫ့ဖုဝဲ အအီၪတၭ, ဒၪဘၪဝ့ၫ လၧအဆၧအွံၪဆၧယိၭတၭ, ဒၪဘၪၦအံဇံၭဖိၪ ဖ့ၬၦ",
			"12": "<sup>12</sup> ဟံဘြူၫဖိၪအထၧၫ့ဖုဝဲလဂၩလီၫ.- ယိဝ့ၫလၧယီၩလခီၫ ဒဲလၧနီၪလခီၫတၭ, ဒၪဘၪၦၡၩနးဂၩအ့ၬတၭ, ဖ့ၬၥံၫၦအံ",
			"13": "<sup>13</sup> ဇံၭဖိၪနီၪခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧမ့ၭကျၩလီၫ.- တၭနံၫနံၩ လနံၩနီၪထီးအလ့ၩထၪ့ဝ့ၫ, ယိခွါ, ၦဟံဘြူၫဖိၪနံၫဂၩ မၩဒုၪ့လိၬအၥၭတၭ, အဝ့ၫဒၪစံၭ ၦလၧအမၩလတီၩ",
			"14": "<sup>14</sup> ဘၪလဂၩနီၪ, နကျီၪ့နၥိၭလဂၩနီၪမွဲဘၪလဲၪ.- တၭအ ဝ့ၫဒၪစံၭဆၧၫ့ဆၧ, မွဲပလၫအီၪက့ၪနၧၩလၧၦဒိၪဖၭဒိၪ ဒဲၦစ့ၩရၫ့ခွးလၧပဖၫ့ခိၪလဂၩလဲၪး နစံၭလၧနမိမၩၥံၫ ယၧၩဘဲၫနမၩၥံၫၦအံဇံၭဖိၪ အၥိၭဆ့ဧၪး စမိစ့ၭၥၭ မဲၪဆၧတၭ, စံၭဝ့ၫဒၪ မွဲမၬၦၥ့ၪယၫဆၧနီၪလမံၩ့လီၫ.",
			"15": "<sup>15</sup> ဖၫရိၫနါဂၧၫ့ဆၧလမံၩ့နီၪတၭ, အၪ့ဎၬမၩၥံၫစမိစ့ၭ လီၫ.စမိစ့ၭစဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအမ့ၬယၫတၭ, လ့ၩ အီၪဝ့ၫလၧခးမံဒအၫ့နီၪ ဆၧၫ့နၩ့ဝ့ၫလၧထံၫဖၧၩ့အနဲၩ့",
			"16": "<sup>16</sup> ထံၭလီၫ.- ခးမံဒအၫ့အၡၩလုဆၧ အီၪလၧအဖိၪမုၪနွ့ၫ ဂၩတၭ, အဝ့ၫၥံၪဂဲၫအၪ့ဒုၪ့ထံၫ, ဒဲမၩဎွ့ၩချိၭလၧထံၫ ဘဲၫၥိၭအမိဒုၭအီၩ အဖါအၥိၪ ဒဲအဘ့ၪလဖၪအထံၫ",
			"17": "<sup>17</sup> လီၫ.- တၭၦယိဆၧဖိၪလဖၪ ဂဲၫနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪတၭ, စမိစ့ၭဂဲထုၪ့မၩဘိၭမၩဆၧၩ့အဝ့ၫၥံၪ ဒဲဒုၭအီၩအၥိၪ",
			"18": "<sup>18</sup> ဒဲဘ့ၪၥံၪအထံၫလီၫ.- အဝ့ၫၥံၪနီၪဂဲၫလၧအဖါစရုၫအ့ လၭအအီၪတၭ, အဆၧစံၭဝ့ၫဒၪ, လၧမုလနံၩယီၩနၥံၪ",
			"19": "<sup>19</sup> ဂဲၫထဲၩ့ချဲၫ့ချဲၫ့လ့ၬမွဲဘၪလဲၪ.- အဝ့ၫၥံၪစံၭ, ၦအံဇံၭ ဖိၪလဂၩမၩဖီၩ့ဖျ့ၭပၧၩ လၧၦယိဆၧဖိၪ အစူၪဖၧၩ့ တၭ,အၪ့ဒုၪ့ထံၫ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ လၧပဂးတၭ, ဒုၭ",
			"20": "<sup>20</sup> အီၩၥိၪဒဲဘ့ၪလဖၪအထံၫလီၫ.- တၭအဝ့ၫဒၪ စံၭအဖိၪ မုၪလဖၪနီၪ, မွဲအအီၪခီၫခီၫလဲၪး နၥံၪဂဲၫထဲၩ့ဒုၭအီၪ လၩ့ထးၦလဂၩနီၪ မွဲဘၪလဲၪ. ကိၭန့အဝ့ၫဒၪ ဘဲၫၥိၭ",
			"21": "<sup>21</sup> အမိအၪ့ဆၧဘီၪ.- ဘၪစမိစ့ၭအၥၭလၧအမိအီၪဝ့ၫလၧ ၦလဂၩနီၪအၥိၭတၭ, အဝ့ၫနီၪဖ့ၪလၫ့စမိစ့ၭလၧအဖိၪ",
			"22": "<sup>22</sup> မုၪနးဇံၭပိရၫလီၫ.- အဝ့ၫဒၪဆီၫ့အီၪန့အဖိၪခွၫတၭ, ဖျိၬအမံၩ့စဂၧၡၧၫ့လီၫ. အဂဲးဘဲၫယီၩ စံၭဝ့ၫဒၪ, ယမွဲ ယူၭၦမွံၩလၧၦလခီၫဘၩ့မုးအဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> တၭလၧအၪနံၩအၪၥၫ့အထးဖၧၩ့နီၪ, ဆၧမၩအၥၭ လၧအံဇံၭ အစဎွၩ ၥံၫဝ့ၫလီၫ. တၭၦအံၫစရ့လၭဖိၪ ဂၪ့အုၩဂၪ့ထိၬ လၧအမၩဎီးအဆၧမၩအကၠီၩ့နီၪ, အ ဝ့ၫၥံၪကိၭၡၭထၪ့ဆၧတၭ, အဆၧအၪ့ကံၩ့အၪ့ယၫလၧ အမၩဎီးအဆၧမၩအကၠီၩ့နီၪ ထၪ့ဘၭလၧယွၩအအီၪ",
			"24": "<sup>24</sup> တၭ,- ယွၩနါဂၧၫ့အဂၪ့အုၩဂၪ့ထိၬဆၧတၭ, ယွၩနၪ့ ထၪ့ထဲၩ့အဆၧအုၩ့လၩ့ လၧစအၫဘြဟၫ့, ဒဲစအံစၭ,",
			"25": "<sup>25</sup> ဒဲစယၫကူၭနီၪ,- ယွၩယိလၩ့ၦအံစရ့လၭဖိၪတၭ, ယွၩ ယၫ့ၥၭဝ့ၫဒၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> စမိစ့ၭယိအမံၩ့ၡါခးမံဒအၫ့အၡၩလုဆၧ, စယံၭၥြိၫ အၥိၪဒဲဘ့ၪလဒီၪ့တၭ, ၥိၫ့ထၪ့ခွံၬၥိၪ ဒဲဘ့ၪလဒီၪ့လၧ မံၩ့လၬကျၩအဝါလခီၫတၭ, ဂဲၫထီၩ့လၧယွၩအခိၪလီၩ့",
			"2": "<sup>2</sup> ဟိရ့ၭလီၫ.- ယဟိဝၩအၥီၫ့လဂၩ နဲၪဖျီၪထၪ့အၥၭ လၧအဝ့ၫဒၪလၧမ့ၪခဲၩအဖၧၩ့ လၧဆၧၡိၬကျၩနီၪ, အ အဝ့ၫဒၪယိဝ့ၫတၭ, ယိခွါ, ဆၧဆူၭထၪ့ဆၧၡိၬနီၪလၧ",
			"3": "<sup>3</sup> မ့ၪလါနၫ့တၭ, အၪ့ဆၧၡိၬနီၪဆ့အ့ၬ.- စမိစ့ၭစံၭဝ့ၫဒၪ, ယမိကၠၪယၥၭ ဘိၩ့နဲၪ့ယီၩတၭ, ယိဆၧအီၪဖျီၪလၩ့ လၭယီၩ, လၧမ့ၪလအၪ့ဘၪ ဆၧၡိၬလဝၩ့နီၪ အဂဲး",
			"4": "<sup>4</sup> လီၫ.- တၭယဟိဝၩဒၪဘၪဝ့ၫ လၧအကၠၪအၥၭဘဲၫၥိၭ အမိယိဆၧတၭ, ယွၩကိၭထၪ့အဝ့ၫဒၪ လၧၥံၪ့ဆၧၡိၬ လဝၩ့အၥၭကျၩတၭ, စံၭဝ့ၫဒၪ, စမိစ့ၭဧ့ၬ စမိစ့ၭဧ့ၬ",
			"5": "<sup>5</sup> တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယအီၪထီးယီၩလီၫ.- တၭ စံၭဝ့ၫဒၪ,ၥုၭဘူၭနၥၭ ထီးယီၩလဂ့ၩ, ကွဲၪလၩ့ခွံၬနခၪ့ ဖံၭအဖျံၩတၭ, ဘဲၪ့လၩ့ခွံၬနခၪ့ဖံၭနီၪဆံၭ. အဂဲးဘဲၫ ယီၩဆၧအလးထီးနဆၧၫ့ထုၪ့နီၪ မွဲဂၪ့ခိၪဆံၫ့ဎံၪလီၫ.",
			"6": "<sup>6</sup> တၭစံၭဝ့ၫဒၪ, ယမွဲနဖါအယွၩ, စအၫဘြဟၫ့အယွၩ, စအံစၭ အယွၩ, ဒဲစယၫကူၭ အယွၩလီၫ. ထီးနီၪလ ဖၧၫ့ စမိစ့ၭချႃၬဘံၭအမ့ၬလီၫ. အဂဲးဘဲၫယီၩ မွဲအယိ ယွၩအမ့ၬနီၪ ၥၭမဲၪဝ့ၫဒၪလီၫ.",
			"7": "<sup>7</sup> တၭယဟိဝၩစံၭဝ့ၫ, ယဒၪဘၪတၡါယူၭ, ယခ့ၫယ ၡၩလဖၪလၧအံဇံၭအဖၧၩ့ အဆၧၡၪ့ဆၧနၭ, ဒဲယနါ ဂၧၫ့ယူၭ အဝ့ၫၥံၪ အဆၧကိၭၡၭထၪ့ယူၭ လၧကဆါ လၧအအၪ့မၧၫ့အဝ့ၫၥံၪအကၠီၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ",
			"8": "<sup>8</sup> ယၥ့ၪယၫအၥုၪ့ခိအၥၭဝီၩလီၫ.- တၭယဂဲၫလၩ့ဘဲၫ ၥိၭယမိမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪ လၧၦအံဇံၭဖိၪအစူၪ ဖၧၩ့,ဒဲဒုၭစဲၪ့ထၪ့ခွံၬ လၧခးလဘံၪ့နီၪအဖၧၩ့, ထီၩ့ လၧခးလဘံၪ့ လၧအဂ့ၩဒဲလၧအလဲ, ဒဲခးလဘံၪ့လၧ အယွၩဝ့ၫလၧဆၧနူထံၫဒဲန့ၫစၩ့, လၧၦကၫနအၫ့ဖိၪ, ဒဲၦဟ့ၥၭဖိၪ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦပံရ့ၭဖိၪ, ဒဲဟံဝဲၭဖိၪ ဒဲၦ",
			"9": "<sup>9</sup> ယ့ဘုၫဖိၪၥံၪအလးလီၫ.- တၭယိခွါ, ဘိၩ့နဲၪ့ယီၩ, ၦအံၫစရ့လၭဖိၪ အဆၧဂၪ့ကိၭဂၪ့ၡၭနီၪ ထၪ့ဘၭလၧ ယအီၪတၭ ယဒၪဆ့ယူၭ, အဝ့ၫၥံၪအဆၧအၧၩ့ဆၧၥၫ့ အဆၧၡၪ့ဆၧနၭ လၧၦအံဇံၭဖိၪလဖၪ မၩဝ့ၫလီၫ.",
			"10": "<sup>10</sup> တၭဘိၩ့နဲၪ့ယီၩ, ဂဲၫဘီၪ, ယမိအၪ့မၧၫ့လၩ့နလ့ၩလၧ ဖၫရိၫအအီၪဘဲၫၥိၭ နမိဒုၭစဲၪ့ထၪ့ ယခ့ၫယၡၩခမျၧး",
			"11": "<sup>11</sup> ၦအံၫစရ့လၭဖိၪလၧအံဇံၭအဖၧၩ့နီၪလီၫ.- တၭစမိစ့ၭ စံၭယွၩ, ယဝ့ၫဒၪယီၩ ယမွဲပလၫလၧအမိလ့ၩလၧဖၫ ရိၫအအီၪတၭ, ဒုၭစဲၪ့ထၪ့ခွံၬၦအံၫစရ့လၭဖိၪလၧအံ",
			"12": "<sup>12</sup> ဇံၭအဖၧၩ့လဂၩလဲၪ.- တၭအဆၧချဲၩ့ဆၧၫ့ဝ့ၫဒၪ, ယမိ အီၪတၡါလၧနၥိၭလီၫ. တၭအယီၩမွဲဆၧမၩနဲၪ့လၧ ယအၪ့မၧၫ့လၩ့နၧၩ, ထီးနဒုၭစဲၪ့ထၪ့ခွံၬ ၦခမျၧးလၧအံ ဇံၭအဖၧၩ့တၭ, နၥံၪမိမၩယွၩအဆၧလၧခိၪလီၩ့လဖျိၪ့ ယီၩအလီၩ့လီၫ.",
			"13": "<sup>13</sup> တၭစမိစ့ၭစံၭယွၩ,ယိခွါ, ယဝ့ၫဒၪယီၩယအ့ၪထီၩ့ လၧၦအံၫစရ့လၭဖိၪအအီၪတၭ, ယစံၭအဝ့ၫၥံၪ, နၥံၪ အဖါလဖၪအယွၩအၪ့မၧၫ့လၩ့န့ယၧၩ လၧနၥံၪအအီၪ တၭ,အဝ့ၫၥံၪမိစံၭယၧၩ, အမံၩ့, မွဲဆၧနီၪလမံၩ့လဲၪး",
			"14": "<sup>14</sup> တၭယမိဘၪစံၭဆၧၫ့အဝ့ၫၥံၪဘဲၫၥ့ၪလဲၪ.- တၭယွၩ စံၭစမိစ့ၭ, ယမွဲဆၧအီၪ, တၭအဝ့ၫနီၪ စံၭဝ့ၫဒၪ, နဘၪလီၩဘၪၦအံၫစရ့လၭဖိၪဘဲၫယီၩ, ယအီၪ အၪ့",
			"15": "<sup>15</sup> မၧၫ့လၩ့ယၧၩလၧနၥံၪအအီၪလီၫ.- တၭယွၩစံၭစမိစ့ၭ နဘၪစံၭၦအံၫစရ့လၭဖိၪဘဲၫယီၩ, ယဟိဝၩနၥံၪအဖါ ၥံၪအယွၩ, စအၫဘြဟၫ့အယွၩ, စအံစၭအယွၩ, စယၫ ကူၭအယွၩအၪ့မၧၫ့လၩ့ယၧၩ လၧနၥံၪအအီၪလီၫ. အ နီၪမွဲယမံၩ့အဆိၩဆိၩအကၠၪကၠၪ, ဒဲအနီၪ, မွဲဆၧဒုၭ",
			"16": "<sup>16</sup> နၪ့ထၪ့ထဲၩ့ယၧၩ အဆိၩဆိၩအကၠၪကၠၪလီၫ.- လ့ၩ ဘီၪ,တၭဒုၭအီၪကိၩ့အီၪကီၪ့ ၦအံၫစရ့လၭဖိၪ အၥုၪ့ က့ၭအၥၭၡါလဖၪတၭ, စံၭအဝ့ၫၥံၪ, ယဟိဝၩနၥံၪအဖါ လဖၪအယွၩ, စအၫဘြဟၫ့, စအံစၭ, စယၫကူၭအယွၩ နဲၪဖျီၪထၪ့အၥၭလၧယၧၩတၭ, စံၭဝ့ၫဒၪ, ယအီၪၡီၩ့ တၡါယူၭနၥံၪ, ဒဲဆၧလၧအမၩနၥံၪလၧအံဇံၭအဖၧၩ့",
			"17": "<sup>17</sup> ယဒၪဘၪယူၭ.- တၭယလီၩဘၪယူၭ, ယမိဒုၭလ့ၩထၪ့ ခွံၬနၥံၪ လၧအံဇံၭအဆၧၡၪ့ဆၧနၭအဖၧၩ့ ထီၩ့လၧၦ ကၫနအၫ့ဖိၪ, ဒဲၦဟ့ၥၭဖိၪ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦပံရ့ၭဖိၪ, ဒဲၦဟံဝဲၭ, ဒဲယ့ဘုၫဖိၪၥံၪအခး, ထီၩ့လၧခးလဘံၪ့လၧ",
			"18": "<sup>18</sup> အယွၩလၩ့လၧဆၧနူထံၫ, ဒဲန့ၫစၩ့လီၫ.- တၭအဝ့ၫၥံၪမိ ခိၭနၪနလူတၭ, နဘၪဂဲၫနဝ့ၫ, ဒဲၦအံၫစရ့လၭဖိၪအၥုၪ့ က့ၭအၥၭၡါ, လၧအံဇံၭအစဎွၩအအီၪတၭ, နၥံၪဘၪ စံၭအဝ့ၫ,ယဟိဝၩ, ၦဟံဘြူၫဖိၪအယွၩဒၪဘၪလိၬအ ၥၭလၧပၧၩတၭ, ဘိၩ့နဲၪ့ယီၩဒုၭလ့ၩလါပၧၩ ၥၧၫ့နံၩ ဖၧၩ့ၥၭ လၧမံၩ့လၬကျၩ, ဘဲၫၥိၭပမိလုထၪ့ဆၧလၧ",
			"19": "<sup>19</sup> ယဟိဝၩပယွၩနီၪဆံၭ.- တၭယၥ့ၪယၫယဝ့ၫလၧဆၧ အစူၪဆီၪ့အခၪ့ဆီၪ့အ့ၪလအီၪဘၪတၭ, အံဇံၭအစဎွၩ",
			"20": "<sup>20</sup> ဖ့ၪလၫ့နၥံၪလ့ၩအ့ၬ.- ယမိယၩ့ထၪ့ယစူၪတၭ, ထး အံဇံၭလၧဆၧလၩ့လိလၩ့လၭ, လၧယမိမၩလၧအၥၭခံ ဖၧၩ့ထီးအလူၬလီၫ. တၭဆၧလဖၪနီၪအလးခဲၫ့မွဲအမိ",
			"21": "<sup>21</sup> ကွဲၪဖျါနၥံၪလီၫ.- ယမိဖ့ၪလၫ့ၦခမျၧးနီၪ လၧဆၧအခိး အတၩလၧၦအံဇံၭဖိၪအမ့ၬယၫတၭ, ထီးနၥံၪအ့ၪလ့ၩ ထၪ့ခွံၬနီၪ, ဆၧမိမၩအၥၭလၧနၥံၪမိလ့ၩထၪ့ဘၪပျီၩ",
			"22": "<sup>22</sup> ပျီၩအ့ၬ,- တၭကယဲၦမုၪလဂၩလါလါ, မိအၪ့ကံၩ့က ယၧၩ့စ့ၩ ဒဲကယၧၩ့ထီၫ့, ဒဲဆၧကီၩ့ဆၧၥိၭ လၧၦအီၪ လၧအနဲၩ့ထံၭ, ဒဲၦအီၪမွံၩလၧအဂံၪ့ဖၧၩ့, ဒဲနၥံၪမိဒုၭ ကီၩ့ဒုၭၥိၭနၥံၪအဖိၪခွၫၥံၪ, ဒဲနၥံၪအဖိၪမုၪၥံၪ, ဒဲနၥံၪမိ အၪ့ဂူၬန့ၦအံဇံၭဖိၪအဆၧလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> တၭစမိစ့ၭစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ယိခွါ, အဝ့ၫ ၥံၪမိနဲၩယၧၩအ့ၬ. တၭမိခိၭနၪယလူအ့ၬ, အဂဲးဘဲၫ ယီၩမိစံၭဝ့ၫ, ယဟိဝၩနဲၪဖျီၪထၪ့အၥၭ လၧနၧၩအ့ၬ.",
			"2": "<sup>2</sup> တၭယဟိဝၩစံၭအဝ့ၫ, ဆၧအီၪလၧနစူၪဖၧၩ့မွဲဆၧနီၪ",
			"3": "<sup>3</sup> မံၩ့လဲၪး တၭအဝ့ၫဒၪစံၭ, မွဲနိၪထိၭဘီၩ့လီၫ.- တၭအ ဆၧစံၭဝ့ၫဒၪ, ခွံၬလၩ့ခွံၬလၧဂၪ့ခိၪဆံၭ. တၭအဝ့ၫနီၪ ခွံၬလၩ့ခွံၬဝ့ၫလၧဂၪ့ခိၪနီၪတၭ, ဆၧကဲၪထၪ့ဂူလဘီၩ့",
			"4": "<sup>4</sup> တၭ,စမိစ့ၭစဲၪ့ခွံၬလၧအမ့ၬယၫလီၫ.- ယဟိဝၩစံၭ စမိစ့ၭ, ယူၬထၪ့နစူၪတၭ, ဖီၪ့န့လၧအမ့နီၪဆံၭ. အ ဆၧယူၬထၪ့အစူၪတၭ, မၩန့ဝ့ၫနီၪ, ဆၧကဲၪထၪ့ထဲၩ့နိၪ",
			"5": "<sup>5</sup> ထိၭဘီၩ့လၧအစူၪဖၧၩ့,- ဘဲၫၥိၭအဝ့ၫၥံၪ မိနဲၩလၧ ယဟိဝၩ, အဖါလဖၪအယွၩ, စအၫဘြဟၫ့အယွၩ, စအံစၭအယွၩ, စယၫကူၭအယွၩနီၪ နဲၪဖျီၪထၪ့ယူၭ အၥၭလၧနမ့ၬယၫယူၭအဂဲးလီၫ.",
			"6": "<sup>6</sup> တၭယဟိဝၩစံၭအဝ့ၫဒၪ, အီၪက့ၪနစူၪလၧနၥၭနၫ ၡါအဖၧၩ့ဆံၭး အဝ့ၫဒုၭနုၬအစူၪ လၧအၥၭနၫၡါအ ဖၧၩ့တၭ,ထုၭထၪ့ဝ့ၫနီၪ, ယိခွါ, အစူၪခံၫထူၬထၪ့ကဲၪ",
			"7": "<sup>7</sup> ဘဲၫမူၭခိၪဖီၫအၥိၭနီၪလီၫ.- တၭအဆၧစံၭဝ့ၫဒၪ, အီၪ က့ၪထဲၩ့ဒီၭနစူၪလၧနၥၭနၫၡါအဖၧၩ့နီၪဆံၭ. တၭအ ဝ့ၫနီၪအီၪက့ၪထဲၩ့အစူၪ လၧအၥၭနၫၡါအဖၧၩ့တၭ, ထုၭထၪ့ထဲၩ့ဝ့ၫလၧအၥၭနၫၡါနီၪ, ယိခွါ, ကဲၪထဲၩ့ဝ့ၫ",
			"8": "<sup>8</sup> ဘဲၫအယၪအၥိၭနီၪလီၫ.- ဆၧမိမၩအၥၭလၧအဝ့ၫၥံၪ အ့ၪလနဲၩဘၪနၧၩတၭ, အ့ၪလနဲၩဘၪဆၧမၩနဲၪ့ အ ခၪ့ထံၭအလူတၭ, မိခိၭနၪဆၧမၩ နဲၪ့လၧခဲၫ့လမံၩ့အလူ",
			"9": "<sup>9</sup> နီၪလီၫ.- တၭဆၧမိမၩအၥၭ လၧအဝ့ၫၥံၪနီၪ, အ့ၪလ နဲၩဘၪဆၧမၩနဲၪ့ နံၫမံၩ့ယီၩတၭ, အ့ၪလခိၭနၪဘၪန လူနီၪ,နဘၪမၩန့ထံၫ လၧထံၫမိၡါအဖၧၩ့တၭ, လူၫလၩ့ လၧခီၫ့လီၫ. တၭထံၫလၧနမၩန့လၧထံၫမိၡါအဖၧၩ့နီၪ မိကဲၪထၪ့ဆၧၥွံၪလၧခီၫ့လီၫ.",
			"10": "<sup>10</sup> တၭစမိစ့ၭ စံၭယဟိဝၩ, ပျဲၩဒၪခလူၬဆံၭ, ယက ဆါဧ့,လၧအၥၫ့မွဲဂ့ၩ, လၧနချဲၩ့ဒုၪ့နဎီးနၡၩအလးခဲၫ့မွဲ ဂ့ၩ, ယမွဲၦလၧအချဲၩ့ဆၧၥ့ၪနီၪ, မွဲအ့ၬ,အဂဲးဘဲၫယီၩ",
			"11": "<sup>11</sup> ယဝ့ၫဒၪယီၩ, ယနိၭဒဲယဖျ့ၩယီၩ ဎၧၫ့ဝ့ၫဒၪလီၫ.- တၭ ယဟိဝၩစံၭအဝ့ၫ, မွဲပလၫအီၪက့ၪနိၭလၧၦၡၩလဂၩ လဲၪး ဒဲမွဲပလၫအီၪက့ၪၦချဲၩ့ဘုၭထၬ, ၦနါအၧၩ့, ၦဒၪ ဆၧၥ့ၪ, ၦမ့ၬဘျီၪနီၪလဂၩလဲၪး ယၧၩ, ယဟိဝၩမွဲအ့ၬ",
			"12": "<sup>12</sup> ဧၪ.- တၭဘိၩ့နဲၪ့ယီၩ, လ့ၩဘီၪ, ယမိအီၪလၧနနိၭတၭ, နမိချဲၩ့ဆၧ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ယမိၥီၪ့လိၪနၧၩ",
			"13": "<sup>13</sup> လီၫ.- တၭအဝ့ၫနီၪစံၭ, ကဆါဧ့, ယအၪ့ကံၩ့နၧၩအၪ့ မၧၫ့လၩ့လါၦလၧအဘၪနၥၭလဂၩနီၪဆံၭ.",
			"14": "<sup>14</sup> ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ၦလံဝဲၫဖိၪ, စအၫရၧၫ့နီၪ, မွဲနထၧၫ့ဖုဝဲအ့ၬဧၪ. ယၥ့ၪ ယၫလၧအဝ့ၫဒၪချဲၩ့ဆၧၥ့ၪလီၫ. လၧနီၪအမ့ၬယၫ, ယိ ခွါ,အဝ့ၫဒၪဂဲၫဆီးနၧၩတၭ, ထီးအဒၪဘၪနၧၩ, မိၥုၪ့",
			"15": "<sup>15</sup> ထိၬၥၭထိၬဝ့ၫလီၫ.- နဘၪချဲၩ့ဆၧလၧအဝ့ၫနီၪ, အီၪ က့ၪဆၧချဲၩ့လၧအနိၭဖၧၩ့တၭ, ယမိအီၪလၧနနိၭ, ဒဲအ ဝ့ၫဒၪအနိၭတၭ, နၥံၪမိမၩဆၧဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪ,",
			"16": "<sup>16</sup> ယမိၥီၪ့လိၪနၥံၪလီၫ.- အဝ့ၫဒၪနီၪမိချဲၩ့လၧၦခမျၧးလၧ နဂးတၭ, အဝ့ၫဒၪမိအီၪဘၪလၧနဂး, လၧနိၭအလး",
			"17": "<sup>17</sup> တၭနဝ့ၫဒၪ နမိကဲၪထၪ့ဘဲၫယွၩၥိၭ လၧအဂးလီၫ.- န ဘၪမၩန့နိၪထိၭဘီၩ့ လၧနစူၪဖၧၩ့တၭ, နဘၪမၩဆၧ လၩ့လၭလဖၪ လၧဆၧနီၪလီၫ.",
			"18": "<sup>18</sup> စမိစ့ၭလ့ၩထၪ့တၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအမံၩ့ၡါ, စယံၭ ၥြိၫအအီၪနီၪ,စံၭဝ့ၫ, ဒုၭစဲၪ့ထၪ့ခွံၬယၧၩတၭ, ဒုၭထဲၩ့ထဲၩ့ ယၧၩလၧယထၧၫ့ ဖုဝဲလဖၪအအီၪ, လၧအံဇံၭအဖၧၩ့တၭ, အဝ့ၫၥံၪမၧၫ့ဒံၭဧၪနီၪ, ယမိၥ့ၪယၫလီၫ. တၭစယံၭၥြိၫစံၭ စမိစ့ၭ, လ့ၩကဒၪမုၬမုၬဘီၪ.",
			"19": "<sup>19</sup> တၭယဟိဝၩစံၭစမိစ့ၭ လၧခးမံဒအၫ့အဖၧၩ့နီၪ,လ့ၩ ဘီၪ. ထဲၩ့ထဲၩ့လၧအံဇံၭအဖၧၩ့ဆံၭ, အဂဲးဘဲၫယီၩ, ၦလဖၪလၧအအၪ့ဎၬ နၥၭမၧၫ့နီၪ ၥံၫယူၭထီးအလူၬ",
			"20": "<sup>20</sup> ယူၭ.- စမိစ့ၭမၩန့အမၫ, ဒဲအဖိၪခွၫလဖၪတၭ, ဒုၭထူၬ ထၪ့အဝ့ၫၥံၪလၧကၥ့ၪယီၩ့တၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧခးအံ ဇံၭအဖၧၩ့လီၫ. တၭစမိစ့ၭအၪ့မၩန့ ယွၩအနိၪထိၭဘီၩ့",
			"21": "<sup>21</sup> လၧအစူၪဖၧၩ့လီၫ.- တၭယဟိဝၩစံၭစမိစ့ၭ, ထီးနအ့ၪ လ့ၩဆၧဘဲၫၥိၭနမိထဲၩ့ထဲၩ့ လၧခးအံဇံၭနီၪ, ယိခွါ,က ယဲဆၧလၩ့လၭ အဆၧမၩနဲၪ့ လၧယအီၪက့ၪ လၧနစူၪ ဖၧၩ့နီၪ, မၩလၧဖၫရိၫအမ့ၬယၫဆံၭ. ယမိဒုၭဆီၪ့ထၪ့",
			"22": "<sup>22</sup> အၥၭတၭ, လမိကွဲၪဖျါဘၪၦခမျၧးလီၫ. တၭနဘၪစံၭ ဖၫရိၫ,ယဟိဝၩစံၭဘဲၫယီၩ, ၦအံၫစရ့လၭမွဲယဖိၪ",
			"23": "<sup>23</sup> ခွၫ,ယဖိၪဝဲၡါလီၫ.- တၭယစံၭ, ကွဲၪဖျါခွံၬယဖိၪခွၫ, ဘဲၫၥိၭအမိမၩယဆၧဆံၭ. နအ့ၪလကွဲၪဖျါခွံၬဘၪနီၪ, ယိခွါ,ယမိမၩၥံၫနဖိၪခွၫ, နဖိၪဝဲၡါလီၫ.",
			"24": "<sup>24</sup> ဆၧမၩအၥၭလၧဖၧၩ့ၥၭ, ထီးအအီၪလၧၥရိၬဖၧၩ့ နီၪ,ယဟိဝၩဒၪဘၪအဝ့ၫတၭ, အၪ့ဎၬမၩၥံၫဝ့ၫလီၫ.",
			"25": "<sup>25</sup> တၭနးဇံၭပိရၫ အၪ့မၩန့ထၪ့လိး လၧအအဲၪ့ဝ့ၫတၭ, ကူၭတရံၭအဖိၪခွၫ အဆၧခိၪဖံၭတၭ, ခွံၬလၩ့ဝ့ၫလၧအ ခၪ့ထံၭ, စံၭဝ့ၫဒၪ, မွဲမၬ, နမွဲဝၩဘၪဆဲၫ့လၧဆၧၥွံၪလၧ",
			"26": "<sup>26</sup> ယဂးတၭး ဆၧဖျါခွံၬဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့နးဇံၭပိ ရၫစံၭဝ့ၫဒၪ, နမွဲဝၩဘၪဆဲၫ့လၧဆၧၥွံၪလၧဆၧကူၭတ ရံၭအကၠီၩ့လီၫ.",
			"27": "<sup>27</sup> တၭယဟိဝၩစံၭစအၫရၧၫ့, လ့ၩဆီးစမိစ့ၭ လၧမံၩ့ လၬကျၩအဖၧၩ့နီၪဆံၭ. တၭအဝ့ၫဒၪ လ့ၩဆီးဝ့ၫလၧ",
			"28": "<sup>28</sup> ယွၩအခိၪလီၩ့နီၪတၭ, အဲၪဂါဝ့ၫလီၫ.- တၭစမိစ့ၭလီၩ ဘၪစအၫရၧၫ့လၧယဟိဝၩအၪ့မၧၫ့လၩ့ဝ့ၫ လၧဆၧချဲၩ့ ထီးအလူၬ, ဒဲဆၧလၩ့လၭလဖၪ လၧအမၪလူၬဝ့ၫထီးအ လူၬလီၫ.",
			"29": "<sup>29</sup> တၭစမိစ့ၭဒဲစအၫရၧၫ့ လ့ၩဒုၭအီၪကီၪ့ၦအံၫစရ့လၭ",
			"30": "<sup>30</sup> ဖိၪအၥုၪ့က့ၭၥၭၡါထီးအလူၬလီၫ.- တၭစအၫရၧၫ့လီၩ လၩ့လၬလၩ့ဆၧချဲၩ့ လၧယဟိဝၩလီၩဘၪ စမိစ့ၭထီး အလူၬ, ဒဲမၩလၩ့လၭဆၧလဖၪ လၧၦခမျၧးအမ့ၬယၫ",
			"31": "<sup>31</sup> လီၫ.- ၦခမျၧးနဲၩထဲၩ့ဝ့ၫတၭ, နါဂၧၫ့ဝ့ၫလၧယဟိဝၩ အီၪၡီၩ့ယူၭအံၫစရ့လၭဖိၪနီၪ, ဒဲလၧအယိယူၭ အဆၧ ၡၪ့ဆၧနၭယူၭး ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪ ၡီၫ့လၩ့အခိၪ တၭဘိၪ့ထၪ့ဘၩထၪ့ဆၧလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> လၧခဲၫ့ထဲၩ့တၭ, စမိစ့ၭဒဲစအၫရၧၫ့လ့ၩနုၬတၭ, စံၭ ဖၫရိၫ, ယဟိဝၩၦအံၫစရ့လၭအယွၩ စံၭဘဲၫယီၩ, ကွဲၪ ဖျါခွံၬယၡၩခမျၧးဘဲၫၥိၭအမိလ့ၩမၩဘိၪ့ လၧယဂး,",
			"2": "<sup>2</sup> လၧမံၩ့လၬကျၩနီၪဆံၭ.- တၭဖၫရိၫစံၭဝ့ၫဒၪ, ဘဲၫၥိၭ ယမိခိၭနၪအလူတၭ, ကွဲၪဖျါခွံၬအံၫစရ့လၭနီၪ, ယဟိ ဝၩမွဲပလၫလဂၩလဲၪ. ယဟိဝၩယၥ့ၪယၫအ့ၬး တၭယ",
			"3": "<sup>3</sup> ကွဲၪဖျါခွံၬအံၫစရ့လၭဖိၪဆ့အ့ၬ.- တၭအဝ့ၫၥံၪစံၭဆၧၫ့, ၦဟံဘြူၫဖိၪအယွၩ အီၪၡီၩ့ယူၭပၧၩယူၭတၭး ဒုၭလ့ၩ လါပၧၩဘီၪး ဘဲၫၥိၭပမိလ့ၩ လၧမံၩ့လၬကျၩၥၧၫ့နံၩ ဖၧၩ့ၥၭနီၪ, ဒဲလုထၪ့ယဟိဝၩပယွၩနီၪဆံၭ. အ့ၪလမွဲ ဘၪဘဲၫနီၪတၭ, ဘၪလဘၪအဆၧမိဒုၭဘၪဘၪခိၬပၧၩ လၧဆၧၥံၫချဲၫ့မွဲဂ့ၩ, လၧဖၩ့ၥံၪ နၭၥံၪမွဲဂ့ၩနီၪလီၫ.",
			"4": "<sup>4</sup> တၭအံဇံၭအစဎွၩစံၭအဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪ, စမိ စ့ၭဒဲစအၫရၧၫ့ပဒၩ့ၦခမျၧး လၧအမၩဆၧနီၪလဲၪ. လ့ၩ",
			"5": "<sup>5</sup> မၩကဒၪနၥံၪအဆၧမၩနီၪအ့ၪဆီၪ့ဘီၪ.- တၭဖၫရိၫစံၭ ဝ့ၫဒၪ,ယိခွါ, ဘိၩ့နဲၪ့ယီၩထံၫၥံၪခးၥံၪအၡၩခမျၧးအီၪ အၪမၬလီၫ. တၭနၥံၪဒုၭအီၪထီအဝ့ၫၥံၪ လၧအဆၧဖံၭ ဆၧမၩနီၪကၨၬ",
			"6": "<sup>6</sup> တၭဆၧလၧမုလနံၩဎးနီၪ ဖၫရိၫမၪလူၬၦခမျၧးအက ဆါၥံၪအၪ့မၧၫ့ဆၧနီၪ, ဒဲၦကဲၪအခိၪလဖၪတၭ, စံၭဝ့ၫ",
			"7": "<sup>7</sup> ဒၪ,- ဖ့ၪလၫ့ၦခမျၧးလၧလီခၫ့ဘဲၫၥိၭ အမိမၩအၩ့က တဲၩလဖၪ, ဘဲၫလၧမုဂၪတဂၪအၥိၭနီၪလဂ့ၩ, မွဲအဝ့ၫ",
			"8": "<sup>8</sup> ၥံၪလ့ၩအၪ့ထုၫ့ကီၪ့ဒၪဝ့ၫ လၧအဂးဆံၭ.- တၭအၩ့က တဲၩလဖၪ, ဎွ့ၩဎီၩ့ဘဲၫဆၧစ့ၩရၫ့ လၧအမၩဝ့ၫလၧမုဂၪ တဂၪအၥိၭနီၪ, အၪ့မၧၫ့အမၩဆံၭး ထီးမၩၡၩလၩ့လ ဂ့ၩ,အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဆၧကၠႃၪ့အၥၭလီၫ. မၩအ ၥၭဘဲၫနီၪတၭ, ကိၭၡၭထၪ့ဆၧ, စံၭဝ့ၫ, ဒုၭလ့ၩလါပၧၩ",
			"9": "<sup>9</sup> ဘဲၫၥိၭပမိလုထၪ့ပယွၩနီၪဆံၭ.- မၩဎၧၫ့ထၪ့ၦလဖၪနီၪ အဆၧမၩတၭ, ဒုၭမၩအဝ့ၫၥံၪနီၪဆံၭ. မွဲအဝ့ၫၥံၪထီး ခိၭနၪဆၧချဲၩ့ပျီၩပျီၩနီၪလဂ့ၩ.",
			"10": "<sup>10</sup> ၦခမျၧးအကဆါအၪ့မၧၫ့ဆၧလဖၪနီၪ, ဒဲၦကဲၪအခိၪ လဖၪစဲၪ့ထၪ့ဝ့ၫတၭ, ချဲၩ့ဆၧလၧၦခမျၧးတၭ, စံၭဝ့ၫဒၪ, ဖၫရိၫစံၭဘဲၫယီၩ, ယမိဖ့ၪလၫ့နၥံၪ လၧလီခၫ့အ့ၬ.",
			"11": "<sup>11</sup> လ့ၩအၪ့မၩန့လီခၫ့ လၧနၥံၪမိဒၪန့လစီၪ့စီၪ့နီၪဆံၭ. မွဲ",
			"12": "<sup>12</sup> လါနၫ့ဆၧမိမၩၡၩလၩ့နၥံၪအဆၧမၩနးမံၩ့အ့ၬ.- တၭ ၦခမျၧးလၩ့မုလၩ့ဖၭ လၧအံဇံၭ ထၧၫ့ခးယၫ, ဘဲၫၥိၭ",
			"13": "<sup>13</sup> အမိအၪ့ထုၫ့လီထိၭနၫ လၧလီခၫ့အလးလီၫ.- ဆၧအွံၪ ဆၧယိၭအကဆါလဖၪနီၪ, အၪ့မၧၫ့ဝ့ၫဆီၪ့ဆီၪ့လ့ၬတၭ, စံၭဝ့ၫဒၪ, မၩနၥံၪအဆၧမၩ ထီးအဂီၩ့, နၥံၪအဆၧမၩ လၧလနံၩအဂးလနံၩအဂး ဘဲၫလၧလီခၫ့အီၪဝ့ၫအၥိၭ",
			"14": "<sup>14</sup> နီၪဆံၭ.- တၭၦအံၫစရ့လၭဖိၪအၡၩကဲၪအခိၪၥံၪလၧ ဖၫရိၫအဆၧအွံၪဆၧယိၭ အကဆါလဖၪ အီၪက့ၪလၧ အဝ့ၫၥံၪအဖၫ့ခိၪလဖၪနီၪ, ဘၪဆၧထးဝ့ၫတၭ, ဆၧစံၭ အဝ့ၫၥံၪ, လၧမုဂၪလနံၩ ဒဲလၧမုဆၫလနံၩယီၩ, နၥံၪမၩ အၩ့ကတဲၩလဖၪ လဎွ့ၩဎီၩ့ဘၪဘဲၫဆၧမၪလူၬနၥံၪလၧ မုဂၪတဂၪအၥိၭနီၪမွဲဘၪလဲၪ.",
			"15": "<sup>15</sup> တၭၦအံၫစရ့လၭဖိၪ လၧအကဲၪအခိၪၥံၪဂဲၫလၧဖၫရိၫ အအီၪကိၭထၪ့တၭ, စံၭဝ့ၫဒၪ, နမၩနဎီးနၡၩလဖၪဘဲၫ",
			"16": "<sup>16</sup> ယီၩမွဲဘၪလဲၪ.- ဆၧလဖ့ၪလၫ့ဘၪလီခၫ့ လၧနဎီးနၡၩ တၭ, အဝ့ၫၥံၪစံၭပၧၩ, မၩအၩ့ကတဲၩဆံၭ, တၭယိခွါ, နဎီးနၡၩၥံၪ ဘၪဆၧထးဝ့ၫတၭ, ဆၧဒဲၩဘၭအီၪလၧ",
			"17": "<sup>17</sup> နခ့ၫနၡၩခမျၧးဒၪနဝ့ၫအလီၩ့လီၫ.- တၭအဝ့ၫနီၪစံၭဝ့ၫ ဒၪ,ဆၧကၠႃၪ့နၥံၪအၥၭ, ဆၧကၠႃၪ့နၥံၪအၥၭလီၫ. အခိး မွဲဘဲၫနီၪတၭ, နၥံၪစံၭ, ဒုၭလ့ၩပၧၩဘဲၫၥိၭပမိလ့ၩလု",
			"18": "<sup>18</sup> ထၪ့ယဟိဝၩအၥိၭနီၪဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩလ့ၩမၩ ဆၧဆံၭ, တၭၦဘၪဖ့ၪလၫ့လီခၫ့လၧနၥံၪနးဂၩအ့ၬ, မွဲ လါနၫ့တၭ, နၥံၪဘၪဖ့ၪလၫ့အၩ့ကတဲၩ ဎွ့ၩဎီၩ့လၧဆၧ",
			"19": "<sup>19</sup> စ့ၩရၫ့လီၫ.- တၭၦစံၭဝ့ၫ, နၥံၪအအၩ့ကတဲၩလဖၪ, ဘၪ ဆဲၫ့လၧနၥံၪမၩဆၧလနံၩအဂးလနံၩအဂး လၩ့ၡၩဘၪ အ့ၬအကၠီၩ့နီၪတၭ, ၦအံၫစရ့လၭဖိၪလၧအကဲၪအခိၪ လဖၪဒၪဘၪဝ့ၫ လၧအအီၪ လၧဆၧအၧၩ့အဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> တၭလၧအဝ့ၫၥံၪစဲၪ့ထၪ့ လၧဖၫရိၫအအီၪနီၪ, ဘၪခီၩ့",
			"21": "<sup>21</sup> လၧစမိစ့ၭဒဲစအၫရၧၫ့အီၪ ဆၧၫ့ထုၪ့ဝ့ၫလၧဖၧၩ့ၥၭ,- တၭ စံၭအဝ့ၫၥံၪ, မွဲယဟိဝၩယိနၥံၪတၭစ့ၩရၫ့ဆၧဆံၭ. အ ဂဲးဘဲၫယီၩ ပဆၧနၧၫ့မၧၫ့နီၪ နၥံၪမၩကဲၪထၪ့ယူၭဆၧ နၧၫ့အုၪယူၭလၧဖၫရိၫအမ့ၬယၫ, ဒဲလၧအခ့ၫအၡၩၥံၪ အမ့ၬယၫ, ဒဲဖ့ၪလၫ့နၭလဘံၪ့လၧအဝ့ၫၥံၪ အစူၪဖၧၩ့, ဘဲၫအမိမၩၥံၫပၧၩအၥိၭလီၫ.",
			"22": "<sup>22</sup> စမိစ့ၭထဲၩ့ထဲၩ့ လၧယဟိဝၩ အအီၪတၭ, စံၭဝ့ၫ, ကဆါဧ့, နမၩအၧၩ့မၩနၭ ၦခမျၧးယီၩမွဲဘၪလဲၪ. မွဲ",
			"23": "<sup>23</sup> ဘၪနီၫနအၪ့မၧၫ့လၩ့ယၧၩလဲၪ.- လၧယဂဲၫချဲၩ့ဆၧလၧ နမံၩ့လၧဖၫရိၫအအီၪ လံၩလံၩနီၪ, အဝ့ၫဒၪမၩအၧၩ့ မၩနၭၦခမျၧးနီၪတၭ, နမၩဖီၩ့ဖျ့ၭနခ့ၫနၡၩ လၩလါ အ့ၬ."
		},
		"6": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ဘိၩ့နဲၪ့ယီၩယမိမၩဖၫရိၫ ဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ, နမိဒၪဘၪလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫဒၪ မိကွဲၪဖျါခွံၬအဝ့ၫၥံၪ လၧအစူၪဆီၪ့, ဒဲမိနၫ့ထၪ့ ခွံၬအဝ့ၫၥံၪလၧအခးဖၧၩ့လၧအစူၪဆီၪ့လီၫ.",
			"2": "<sup>2</sup> ယွၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭအဝ့ၫ, ယဝ့ၫဒၪယီၩ,",
			"3": "<sup>3</sup> ယမွဲ ယဟိဝၩ လီၫ.- တၭယနဲၪဖျီၪထၪ့ယၥၭလၧ စအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭ, လၧယမံၩ့, ယွၩၥ့ၪဆၧလူၬ လီၫ. အ့ၪမွဲလၧယမံၩ့, ယဟိဝၩ",
			"4": "<sup>4</sup> နီၪ,ယဒုၭၥ့ၪယၫအဝ့ၫၥံၪအ့ၬ.- တၭယအီၪက့ၪဂုးအီၪ က့ၪခၧၫ့ယူၭ ယဆၧအုၩ့လၩ့ လၧအဝ့ၫၥံၪ လၧယမိဖ့ၪ လၫ့အဝ့ၫၥံၪ လၧခးကၫနအၫ့ လၧအဝ့ၫၥံၪ အီၪမွံၩအ",
			"5": "<sup>5</sup> ခး, ထီးအအီၪမွံၩ လၧအဖၧၩ့လီၫ.- တၭယနါဂၧၫ့ဆ့ ယူၭၦအံၫစရ့လၭဖိၪ ဂၪ့အုၩဂၪ့ထိၬဆၧ, ၦလၧအံဇံၭ ဖိၪအၪ့မၧၫ့ဎီးဝ့ၫနီၪ ယနၪ့ထၪ့ထဲၩ့ယူၭ ယဆၧအုၩ့လၩ့",
			"6": "<sup>6</sup> ယူၭ.- မၩအၥၭဘဲၫနီၪတၭ, စံၭၦအံၫစရ့လၭဖိၪ, ယမွဲ ယဟိဝၩလီၫ. ယမိဒုၭစဲၪ့ထၪ့ခွံၬ နၥံၪလၧၦအံဇံၭဖိၪ အဆၧအွံၪဆၧယိၭအဖၫ့လၬတၭ, ယမိမၩဖီၩ့ဖျ့ၭနၥံၪ လၧဎီးအဆၧမၩတၭ, ယမိဎွ့ၩထဲၩ့နၥံၪ လၧယစူၪယူၬ",
			"7": "<sup>7</sup> ထၪ့အၥၭဒဲလၧဆၧစ့ၩရၫ့ဖၭဒိၪလဖၪ,- တၭယမိအီၪ က့ၪနၥံၪ လၧၦခမျၧးလၧယဂးတၭ, ယမိကဲၪယွၩလၧ နၥံၪအဂးတၭ, နၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩနၥံၪအ ယွၩလၧအဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧၦအံဇံၭဖိၪအဆၧအွံၪ",
			"8": "<sup>8</sup> ဆၧယိၭအဖၫ့လၬလီၫ.- တၭယမိဒုၭဂဲၫနၥံၪထီၩ့လၧ ခးလၧယယူၬထၪ့ယစူၪ, ဘဲၫၥိၭယမိဖ့ၪလၫ့လၧစအၫ ဘြဟၫ့, စအံစၭ, ဒဲစယၫကူၭ, ဒဲယမိဖ့ၪလၫ့လၧနၥံၪအ ဆၧန့ၥၫအဂးလီၫ. ဆၧလၧယၧၩယီၩ ယမွဲယဟိဝၩ လီၫ.",
			"9": "<sup>9</sup> စမိစ့ၭချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪနီၪတၭ, အဝ့ၫၥံၪ လခိၭနၪဘၪ စမိစ့ၭအလူလၧအၥုၪ့ခိအၥၭဝီၩအကၠီၩ့, ဒဲလၧဎီးအဆၧမၩဎၧၫ့အကၠီၩ့လီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"10": "<sup>10</sup> လ့ၩ နုၬ, စံၭအံဇံၭအစဎွၩ, ဖၫရိၫလဂၩနီၪ, လၧအမိဘၪ",
			"12": "<sup>12</sup> ကွဲၪဖျါခွံၬၦအံၫစရ့လၭဖိၪ လၧအခးဖၧၩ့လီၫ.- စမိစ့ၭ ချဲၩ့ဆၧလၧယဟိဝၩအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ယိခွါ, ၦအံၫစရ့လၭဖိၪ ခိၭနၪယလူအ့ၬး မွဲဖၫရိၫမိခိၭနၪယ လူဘဲၫၥ့ၪလဲၪး တၭယဝ့ၫဒၪယီၩ, ယနိၭဖံၭဘၪဆၧကူၭ",
			"13": "<sup>13</sup> တရံၭအ့ၬ.- ယဟိဝၩ ချဲၩ့ဆၧလၧစမိစ့ၭ ဒဲစအၫရၧၫ့ တၭ,မၪလူၬဝ့ၫလၧ ၦအံၫစရ့လၭဖိၪအဂး, ဒဲလၧအံဇံၭ အစဎွၩဖၫရိၫအဂး, ဘဲၫၥိၭအမိဒုၭစဲၪ့ထၪ့ခွံၬ ၦအံၫစရ့ လၭဖိၪလၧခးအံဇံၭအဖၧၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> အယီၩမွဲအဝ့ၫၥံၪအဖါလဖၪ အၡၩဂံၪ့ဖိၪအခိၪလဖၪ, စအံၫစရ့လၭအဖိၪဝဲၡါ, စရုဘံၫ့အဖိၪခွၫလဖၪ, စဟၫ နီၭ, စပၫလုၫ, ဒဲစဟ့ၫစရၧၫ့, ဒဲစကၫမဲၫလီၫ. အနီၪမွဲ",
			"15": "<sup>15</sup> စရုဘံၫ့အဂံၪ့ဒီၪ့လဖၪလီၫ.- တၭစစံမအၧၫ့အဖိၪခွၫလ ဖၪ,စယံမုၫအ့လၭ, ဒဲစယၫမံၫ့, ဒဲစအိဟၭ, ဒဲစယၫခံၫ့, ဒဲစဇိဟၫ, ဒဲၦကၫနအၫ့မုၪအဖိၪခွၫ, စၡၫအၧလၭလီၫ. အဝ့ၫၥံၪမွဲစစံမအၧၫ့အဂံၪ့ဒီၪ့လဖၪလီၫ.",
			"16": "<sup>16</sup> အယီၩမွဲစလံဝဲၫအဖိၪခွၫၥံၪအမံၩ့ ဘဲၫအဆိၩအၥိၭ နီၪစဂၧၡၧၫ့, ဒဲစကိဟၭ, ဒဲစမရၫရဲၫလီၫ. တၭစလံဝဲၫ အၥၭမၧၫ့ အနံၪ့လဖၪ မွဲလယၩ ၥၧၫ့ဆံၫ နွ့ၫနံၪ့လီၫ.",
			"17": "<sup>17</sup> စဂၧၡၧၫ့အဖိၪခွၫလဖၪ မွဲစလံဘနဲၫ, ဒဲစၡံမဲၫဘဲၫအဂံၪ့",
			"18": "<sup>18</sup> ဒီၪ့လဖၪအၥိၭနီၪလီၫ.- စကိဟၭအဖိၪခွၫၥံၪ မွဲစအၫ မရၫ့,ဒဲစအံဇဟၫ, ဒဲစဟံဘြၧၫ့, ဒဲစအၧၭဇအ့လၭလီၫ. တၭစကိဟၭ အၥၭမၧၫ့အနံၪ့လဖၪနီၪ, မွဲလယၩၥၧၫ့",
			"19": "<sup>19</sup> ဆံၫၥၧၫ့နံၪ့လီၫ.- တၭစမရၫရဲၫအဖိၪခွၫၥံၪ မွဲစမၭဟ လဲၫ,ဒဲစမုၡဲၫလီၫ. အဝ့ၫၥံၪနီၪမွဲစလံဝဲၫအဂံၪ့ဒီၪ့လဖၪ",
			"20": "<sup>20</sup> ဘဲၫအဆိၩအၥိၭနီၪလီၫ.- စအၫမရၫ့ န့မၫလၧအဖါ အထၧၫ့ဖုဝဲမုၪ နးယီၭကဘ့ၭတၭ, အဝ့ၫနီၪဆီၫ့အီၪန့ စအၫရၧၫ့ဒဲစမိစ့ၭလၧအဂးလီၫ. တၭစအၫမရၫ့အၥၭ",
			"21": "<sup>21</sup> မၧၫ့အနံၪ့လဖၪနီၪ မွဲလယၩၥၧၫ့ဆံၫနွ့ၫနံၪ့လီၫ.- တၭ စအံဇဟၫအဖိၪခွၫၥံၪမွဲစကိရၫ့, ဒဲစနံဖ့ၭ,ဒဲစဇံၭၥၥြဲၫ",
			"22": "<sup>22</sup> လီၫ.- တၭစအၧၭဇအ့လၭအဖိၪခွၫ, မွဲစမ့ၭၡအ့လၭ,",
			"23": "<sup>23</sup> ဒဲစအ့ၫလဇၫဖ့ၫဒဲစဇံၭၥၫလီၫ.- တၭစအၫရၧၫ့ န့မၫ လၧစနအၭၡၧၫ့အထၧၫ့ဖုဝဲမုၪ, စအမံနဒၭအဖိၪမုၪနး အလံၭၡဘၫလီၫ. တၭအဝ့ၫနီၪဆီၫ့အီၪန့စနၫဒၭဒဲစအ",
			"24": "<sup>24</sup> ဘဲဟုၫဒဲစအံၫလအ့ဇၫ, ဒဲစအံၥမၫလီၫ.- တၭစကိရၫ အဖိၪခွၫၥံၪမွဲစအၭစၧၫ ဒဲစအ့လကနၫ, ဒဲစအဘဲအစၭ",
			"25": "<sup>25</sup> လီၫ. အဝ့ၫၥံၪမွဲၦကိရၫဖိၪအဂံၪ့ဒီၪ့လီၫ.- စအၫရၧၫ့အ ဖိၪခွၫစအံၫလအ့ဇၫနီၪ, န့မၫလၧစပုၫတအ့လၭအဖိၪ မုၪလဂၩတၭ, အဝ့ၫနီၪဆီၫ့အီၪန့စဖံနအၭ လၧအဂး လီၫ.အဝ့ၫၥံၪမွဲ ၦလံဝဲၫဖိၪအဖါအခိၪလဖၪ ဘဲၫအဝ့ၫ ၥံၪအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪမွဲစအၫရၧၫ့, ဒဲစမိစ့ၭ, လၧယဟိဝၩစံၭဝ့ၫ, ဒုၭစဲၪ့ထၪ့ခွံၬၦအံၫစရ့လၭဖိၪ လၧခးအံဇံၭ အဖၧၩ့ ဘဲၫအၥုၭမုလဖၪအၥိၭနီၪလီၫ.",
			"27": "<sup>27</sup> အဝ့ၫၥံၪနီၪ, မွဲၦလၧအချဲၩ့ဆၧ လၧၦအံဇံၭအစဎွၩ ဖၫရိၫဘဲၫၥိၭ အမိဒုၭစဲၪ့ထၪ့ခွံၬၦအံၫစရ့လၭဖိၪ လၧအံဇံၭ နီၪလီၫ. အဝ့ၫၥံၪမွဲစမိစ့ၭ ဒဲစအၫရၧၫ့နီၪလီၫ.",
			"28": "<sup>28</sup> တၭဆၧမၩအၥၭလၧမုလနံၩ လၧယဟိဝၩချဲၩ့ဆၧ",
			"29": "<sup>29</sup> လၧစမိစ့ၭလၧခးအံဇံၭအဖၧၩ့နီၪ,- ယဟိဝၩချဲၩ့ဆၧ လၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩ လီၫ. ဆၧလၧယလီၩဘၪနၧၩ လမံၩ့လါလါနီၪ လီၩ ဘၪနဝ့ၫလၧအံဇံၭအစဎွၩ ဖၫရိၫအမ့ၬယၫနီၪဆံၭ.",
			"30": "<sup>30</sup> တၭစမိစ့ၭစံၭ လၧယဟိဝၩအမ့ၬယၫ, ယိခွါ, ယဝ့ၫဒၪ ယီၩ, ယနိၭဖံၭဘၪဆၧကူၭတရံၭအ့ၬ, တၭဖၫရိၫမိခိၭ နၪယလူဘဲၫၥ့ၪလဲၪ."
		},
		"7": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ယိခွါ, ယအီၪက့ၪနၧၩဘဲၫ ယွၩအၥိၭလၧဖၫရိၫအဂးတၭ, နထၧၫ့ဖုဝဲစအၫရၧၫ့မိ",
			"2": "<sup>2</sup> ကဲၪထၪ့ဝ့ၫ လၧနမီၪလဂၩနီၪလီၫ.- နဘၪချဲၩ့ဆၧဘဲၫ ယမၪလူၬနၧၩ ထီးအလူၬတၭ, နထၧၫ့ဖုဝဲစအၫရၧၫ့ ဘၪချဲၩ့ဆၧလၧ ဖၫရိၫဘဲၫၥိၭ အမိဖျါခွံၬၦအံၫစရ့လၭ",
			"3": "<sup>3</sup> ဖိၪလၧအခးဖၧၩ့လီၫ.- တၭယမိဒုၭဆီၪ့ထၪ့စဎွၩဖၫ ရိၫအၥၭတၭ, မၩအၪထၪ့ယဆၧလၩ့လၭ အဆၧမၩ နဲၪ့,ဒဲယဆၧလၩ့ လိလၩ့လၭ လၧခးအံဇံၭအဖၧၩ့",
			"4": "<sup>4</sup> လီၫ.- တၭဖၫရိၫမိခိၭနၪ နၥံၪအလူအ့ၬး တၭယမိအီၪ က့ၪလၩ့ယစူၪ လၧအံဇံၭအဖၫ့ခိၪတၭ, ယမိဒုၭစဲၪ့ထၪ့ ခွံၬယၥုၭမုလဖၪ, ယၡၩခမျၧးၦအံၫစရ့လၭဖိၪ, လၧ",
			"5": "<sup>5</sup> ဆၧစ့ၩရၫ့ဖၭဒိၪ လၧခးအံဇံၭအဖၧၩ့နီၪလီၫ.- တၭထီး ယအ့ၪယၩ့ထၪ့ယစူၪ လၧအံဇံၭ အဖၫ့ခိၪနီၪ, ဒုၭစဲၪ့ ထၪ့ခွံၬၦအံၫစရ့လၭဖိၪ လၧအကျၩတၭ, ၦအံဇံၭဖိၪ မိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.",
			"6": "<sup>6</sup> စမိစ့ၭဒဲစအၫရၧၫ့မၩဝ့ၫ, ဘဲၫယဟိဝၩမၪလူၬဝ့ၫအ",
			"7": "<sup>7</sup> ၥိၭနီၪတၭ, အဝ့ၫၥံၪမၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.- တၭလၧ အဝ့ၫၥံၪ ချဲၩ့ဆၧလၧဖၫရိၫနီၪ, စမိစ့ၭအၥၭၡါယူၭအ နံၪ့ဎိၭဆံၫတၭ, စအၫရၧၫ့အၥၭၡါယူၭ အနံၪ့ဎိၭဆံၫ ၥၧၫ့နံၪ့လီၫ.",
			"8": "<sup>8</sup> တၭယဟိဝၩစံၭစမိစ့ၭ ဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫဒၪ,",
			"9": "<sup>9</sup> ထီးဖၫရိၫအ့ၪချဲၩ့ဆၧလၧနၥံၪတၭ, စံၭဝ့ၫဖ့ၪလၫ့ဆၧ လၩ့လၭလမံၩ့မံၩ့ လၧနၥံၪ အဂးနီၪတၭ, နဘၪစံၭ စအၫရၧၫ့, အၪ့မၩန့နနိၪထိၭဘီၩ့တၭ, ခွံၬလၩ့ခွံၬလၧ ဖၫရိၫအမ့ၬယၫဆံၭ. တၭဆၧမိကဲၪထၪ့ ၡီၩ့လဘီၩ့",
			"10": "<sup>10</sup> လီၫ.- စမိစ့ၭဒဲစအၫရၧၫ့လ့ၩနုၬဝ့ၫ လၧဖၫရိၫ အအီၪ တၭ,မၩဝ့ၫ, ဘဲၫယဟိဝၩမၪလူၬဝ့ၫအၥိၭနီၪး စအၫ ရၧၫ့ခွံၬလၩ့ခွံၬအနိၪထိၭဘီၩ့ လၧဖၫရိၫ အမ့ၬယၫ, ဒဲလၧအခ့ၫအၡၩလဖၪအမ့ၬယၫတၭ, ကဲၪထၪ့ဝ့ၫၡီၩ့",
			"11": "<sup>11</sup> လဘီၩ့လီၫ.- ဖၫရိၫကိၭန့ဆ့ၦကိၪ့ဆၧၥ့ၪ, ဒဲၦလီးဆၧ ၥ့ၪလီၫ. တၭၦအံဇံၭဖိၪၥံၪ လၧအမၩကဒၩ ၦမ့ၬနီၪ မၩဝ့ၫဘဲၫနီၪၥိၭ လၧအဝ့ၫၥံၪအဆၧမၩလဖၪ အဖၧၩ့",
			"12": "<sup>12</sup> ဆ့လီၫ.- တၭအဝ့ၫၥံၪခွံၬလၩ့ခွံၬ လဂၩအနိၪထိၭဘီၩ့ ဒၪဝ့ၫ,လဂၩအနိၪထိၭဘီၩ့ဒၪဝ့ၫတၭ, ဆၧလဖၪနီၪကဲၪ ထၪ့ၡီၩ့ဆ့လီၫ. မွဲလါနၫ့တၭစအၫရၧၫ့ အနိၪထိၭဘီၩ့ နီၪအၪ့ယုလၩ့ခွံၬအဝ့ၫၥံၪအနိၪထိၭဘီၩ့လဖၪနီၪလီၫ.",
			"13": "<sup>13</sup> ဖၫရိၫအၥၭနီၩ့ထၪ့ဝ့ၫတၭ, ခိၭနၪအဝ့ၫၥံၪအလူအ့ၬ, ဘဲၫယဟိဝၩစံၭဝ့ၫအၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩစံၭစမိစ့ၭ ဖၫရိၫအၥုၪ့နီၩ့အၥၭနီၩ့တၭ, မိ",
			"15": "<sup>15</sup> ကွဲၪဖျါခွံၬၦခမျၧးနီၪအၥၭအီၪအ့ၬ.- ထီးဆၧဖၩ့ထၪ့နီၪ လ့ၩလၧဖၫရိၫအအီၪဆံၭး ယိခွါ, အဝ့ၫဒၪလ့ၩဆၧလၧထံၫ နဲၩ့လီၫ. တၭနဘၪဆၧၫ့ထုၪ့လၧထံၫမိၡါအနဲၩ့ လၧနမိ ဘၪခီၩ့အဝ့ၫဒၪတၭ, နိၪထိၭဘီၩ့လၧ အကဲၪထၪ့ၡီၩ့လဘီၩ့",
			"16": "<sup>16</sup> နီၪမၩန့လၧနစူၪဖၧၩ့ဆံၭ.- တၭနဘၪစံၭအဝ့ၫ, ယဟိ ဝၩၦဟံဘြူၫဖိၪအယွၩအၪ့မၧၫ့ယဂဲၫလၧနအီၪတၭ, စံၭ ဝ့ၫဒၪ,ကွဲၪဖျါခွံၬယၡၩခမျၧးဘဲၫၥိၭ အမိလ့ၩမၩယ ဆၧလၧမံၩ့လၬကျၩနီၪဆံၭး တၭယိခွါ, ခီးဘိၩ့နဲၪ့ယီၩ",
			"17": "<sup>17</sup> နခိၭနၪအလူအ့ၬ.- တၭယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪမိၥ့ၪ ယၫလၧယမွဲယဟိဝၩလၧဆၧယီၩ, ယိခွါ, ယမိဒိၪ ထံၫလၧထံၫမိၡါအဖၧၩ့ လၧနိၪထိၭဘီၩ့အီၪလၧယစူၪ",
			"18": "<sup>18</sup> ဖၧၩ့ယီၩတၭ မွဲအမိကဲၪထၪ့ဆၧၥွံၪလီၫ.- ဒ့ၪၥံၪယၪ ၥံၪအီၪလၧထံၫမိၡါ အဖၧၩ့မိၥံၫတၭ, ထံၫမိၡါမိနၧၫ့ အုၪဝ့ၫတၭ, ၦအံဇံၭဖိၪမိၥၭလိၪအီၩထံၫ လၧထံၫမိၡါ နီၪလီၫ.",
			"19": "<sup>19</sup> ယဟိဝၩ စံၭစမိစ့ၭ, လီၩဘၪစအၫရၧၫ့, အၪ့မၩန့ နနိၪထိၭဘီၩ့တၭ, ယၩ့ထၪ့နစူၪ လၧအံဇံၭအဖၫ့ခိၪ, လၧအထံၫချိၬၥံၪအဖၫ့ခိၪ, လၧအထံၫမိၡါၥံၪအဖၫ့ခိၪ, ဒဲလၧအကမၫၥံၪအဖၫ့ခိၪ, ဒဲလၧကယဲထံၫအီၪကီၪ့အ လး ထီးအလူၬအဖၫ့ခိၪ, ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧၥွံၪ, ဒဲဆၧၥွံၪမိအီၪ လၧအံဇံၭအခးထၧၫ့ဘံၪ့ယၫအဖၧၩ့, လၧဖၧၩ့ၥံၪ့ဒဲ လၧဖၧၩ့လိးအဖၧၩ့နီၪဆံၭ.",
			"20": "<sup>20</sup> စမိစ့ၭဒဲစအၫရၧၫ့မၩဝ့ၫဘဲၫနီၪ, ဘဲၫယဟိဝၩမၪလူၬ ဝ့ၫအၥိၭနီၪတၭ, ယၩ့ထၪ့အနိၪထိၭဘီၩ့နီၪတၭ, ဒိၪ ထံၫလၧထံၫမိၡါအဖၧၩ့ လၧဖၫရိၫအမ့ၬယၫ, ဒဲလၧအ ခ့ၫအၡၩလဖၪ အမ့ၬယၫတၭ, ထံၫအီၪလၧထံၫမိၡါ",
			"21": "<sup>21</sup> အဖၧၩ့ကဲၪထၪ့ ဆၧၥွံၪထီးအလူၬလီၫ.- တၭဒ့ၪၥံၪ ယၪၥံၪလၧထံၫမိၡါအဖၧၩ့ၥံၫဝ့ၫ, ဒဲထံၫမိၡါနၧၫ့အုၪဝ့ၫ တၭ,ၦအံဇံၭဖိၪ, အီၩထံၫလၧထံၫမိၡါအဖၧၩ့ ကဲၪ အ့ၬး တၭဆၧၥွံၪအီၪဝ့ၫ လၧအံဇံၭအခးထၧၫ့ခးယၫ",
			"22": "<sup>22</sup> လီၫ.- တၭၦအံဇံၭဖိၪၥံၪ လၧအမၩကဒၩ ၦမ့ၬနီၪမၩ ဝ့ၫဘဲၫနီၪၥိၭ လၧအဝ့ၫၥံၪ အဆၧမၩအဖၧၩ့ဆ့လီၫ. ဖၫ ရိၫအၥၭနီၩ့ထၪ့ဝ့ၫတၭ, လခိၭနၪဘၪအဝ့ၫၥံၪ အလူ",
			"23": "<sup>23</sup> ဘဲၫယဟိဝၩစံၭဝ့ၫအၥိၭနီၪလီၫ.- ဖၫရိၫကၠၪထဲၩ့အ ၥၭတၭ,ထဲၩ့ထဲၩ့ လၧအဂံၪ့လါနၫ့တၭ, အီၪက့ၪဆၧနီၪ",
			"24": "<sup>24</sup> လမံၩ့လၧအၥၭအ့ၬ.- တၭကယဲၦအံဇံၭဖိၪ ခုၪ့ဆၧ လၧထံၫမိၡါအနဲၩ့ထံၭ ဘဲၫၥိၭအမိန့ဘၪထံၫ လၧအ မိအီၩဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အီၩထံၫလၧထံၫမိၡါအ",
			"25": "<sup>25</sup> ဖၧၩ့ကဲၪအ့ၬ.- တၭယဟိဝၩအဆၧစ့ၩရၫ့ဒိၪထံၫမိၡါ နီၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ နွ့ၫနံၩအထးဖၧၩ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭ စမိစ့ၭ, လ့ၩလၧဖၫရိၫအအီၪနီၪ, စံၭအဝ့ၫ, ယဟိဝၩစံၭဘဲၫယီၩ, ကွဲၪဖျါခွံၬယခ့ၫယၡၩ",
			"2": "<sup>2</sup> ခမျၧးဘဲၫၥိၭအမိမၩယဆၧအၥိၭဆံၭ.- တၭနအ့ၪလ ကွဲၪဖျါခွံၬဘၪနီၪ, ယိခွါ, ယမိဒိၪနထံၫၥံၪခးၥံၪထီးအ",
			"3": "<sup>3</sup> လူၬမၩကဲၪထၪ့ဒ့ၪလဖၪနီၪ,- ထံၫမိၡါမိဆီၫ့အီၪန့ဒ့ၪ လဖၪအၪအၪလ့ၬ, လၧအမိဂဲၫထၪ့နုၬ လၧနဂံၪ့ဖၧၩ့, ဒဲလၧနလးမံၫအဒူၭဖၧၩ့, ဒဲလၧနလးမံၫအဖၫ့ခိၪ, ဒဲလၧ နခ့ၫနၡၩလဖၪအဂံၪ့ဖၧၩ့, ဒဲလၧနခ့ၫနၡၩ ခမျၧးလဖၪ အလီၩ့း ဒဲလၧနဖံၫ့ချၪလဖၪအဖၧၩ့ ဒဲထွ့ၫလၧနဘံၭကိၪ",
			"4": "<sup>4</sup> အလးလဖၪအဖၧၩ့လီၫ.- တၭဒ့ၪလဖၪနီၪ မိဂဲၫထၪ့လၧ နလီၩ့ ဒဲလၧနခ့ၫနၡၩခမျၧးအလီၩ့ ဒဲလၧနခ့ၫနၡၩဒၪန ဝ့ၫထီးအလူၬၥံၪအလီၩ့လီၫ.",
			"5": "<sup>5</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, လီၩဘၪစအၫရၧၫ့နီၪ, ယၩ့ ထၪ့နစူၪအီၪလၧနနိၪထိၭဘီၩ့ လၧထံၫချိၬၥံၪအဖၫ့ခိၪ, ဒဲလၧထံၫမိၡါၥံၪအဖၫ့ခိၪ, ဒဲလၧနီၪ့ၥံၪ အဖၫ့ခိၪတၭ, ဒုၭဂဲၫထၪ့ဒ့ၪလဖၪ လၧခးအံဇံၭ အဖၫ့ခိၪနီၪဆံၭ.",
			"6": "<sup>6</sup> တၭစအၫရၧၫ့ယၩ့ထၪ့အစူၪ လၧအံဇံၭအထံၫလဖၪ အဖၫ့ခိၪနီၪ, ဒ့ၪၥံၪဂဲၫထၪ့တၭမၩလၩ့ဘံၭ ခးအံဇံၭ",
			"7": "<sup>7</sup> နီၪလီၫ.- တၭၦမၩကဒၩၦမ့ၬမၩဝ့ၫဘဲၫနီၪၥိၭ လၧအ ဆၧမၩအဖၧၩ့ ဘဲၫၥိၭအမိဒုၭဂဲၫထၪ့ဒ့ၪလဖၪ လၧခး အံဇံၭအဖၫ့ခိၪအဂဲးလီၫ.",
			"8": "<sup>8</sup> ဖၫရိၫကိၭန့စမိစ့ၭဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫဒၪ, အၪ့ ကံၩ့ယဟိဝၩလၧ အမိဒုၭစဲၪ့ထၪ့ခွံၬဒ့ၪလဖၪ လၧယ အီၪ,ဒဲလၧယခ့ၫယၡၩခမျၧးအအီၪနီၪဆံၭ. တၭယမိ ကွဲၪဖျါခွံၬ ၦခမျၧးဘဲၫအမိလုထၪ့ ယဟိဝၩအၥိၭနီၪ",
			"9": "<sup>9</sup> လီၫ.- တၭစမိစ့ၭစံၭဖၫရိၫ, ဖၭနံၩဖၭၥၫ့ဘီၪး မွဲယမိ အၪ့ကံၩ့ဆၧလၧနဂး, ဒဲလၧနခ့ၫနၡၩၥံၪအဂး, ဒဲလၧန ၡၩခမျၧးအဂး, ဘဲၫၥိၭဆၧမိမၩဂၭဂီၩ့ခွံၬ ဒ့ၪလဖၪ လၧနလီၩ့, ဒဲလၧနဂံၪ့လဖၪအဖၧၩ့, လၧအမိအီၪဝ့ၫန့ၫ",
			"10": "<sup>10</sup> လၧထံၫမိၡါအဖၧၩ့နီၪဆံၭယံၬခိၬလဲၪ.- တၭအဝ့ၫဒၪ စံၭ,ကဲဂီၩခိၬလီၫ. တၭမွဲအစံၭဝ့ၫဒၪ, ဆၧမိမၩအၥၭ ဘဲၫနစံၭဆၧအၥိၭ, ဘဲၫၥိၭနမိၥ့ၪယၫ လၧၦဘဲၫယဟိ",
			"11": "<sup>11</sup> ဝၩပယွၩအၥိၭ, အီၪဝ့ၫနးဂၩအ့ၬ.- တၭဒ့ၪလဖၪမိစဲၪ့ ထၪ့ခွံၬလၧနလီၩ့ ဒဲလၧနဂံၪ့လဖၪအဖၧၩ့, ဒဲလၧနခ့ၫ နၡၩလဖၪအလီၩ့, ဒဲလၧနၡၩခမျၧးလဖၪ အလီၩ့ တၭ,မိအီၪလၩ့ထးဝ့ၫန့ၫ လၧထံၫမိၡါအဖၧၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> စမိစ့ၭ ဒဲစအၫရၧၫ့ စဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအအီၪတၭ, စမိစ့ၭကိၭထၪ့ယွၩလၧဒ့ၪလဖၪအကၠီၩ့, လၧအဒုၭဂဲၫ",
			"13": "<sup>13</sup> ထၫ့ဒုၪဒၩဖၫရိၫနီၪလီၫ.- တၭယဟိဝၩမၩဝ့ၫဘဲၫစမိ စ့ၭအဆၧချဲၩ့အၥိၭနီၪတၭ, ဒ့ၪလဖၪၥံၫခွံၬ လၧအဂံၪ့",
			"14": "<sup>14</sup> ဖၧၩ့,ဒဲလၧတဝၫ့ၥံၪအဖၧၩ့, ဒဲလၧခီၫ့လခီၫလီၫ.- တၭ ၦအၪ့ထုၫ့ကီၪ့ဝ့ၫ လစီၪ့ဘၪလစီၪ့တၭ, ထံၫၥံၪခးၥံၪ",
			"15": "<sup>15</sup> နၧၫ့အုၪဝ့ၫဒၪလီၫ.- အ့ၪမွဲထီးဖၫရိၫဒၪဘၪဝ့ၫလၧဆၧ ၥၪထၪ့အလးအီၪလဆံၭတၭ, အၥၭနီၪနီၩ့ထၪ့ဒီၭဝ့ၫ တၭ, ခိၭနၪလၧၩ့အဝ့ၫၥံၪအလူအ့ၬ. ဘဲၫယဟိဝၩစံၭ ဝ့ၫအၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, လီၩဘၪစအၫရၧၫ့, ယၩ့ ထၪ့နနိၪထိၭဘီၩ့, ဒိၪဂၪ့ခိၪအမုၬဘဲၫၥိၭအမိကဲၪထၪ့",
			"17": "<sup>17</sup> ဆၧဎါလၧခးအံဇံၭထၧၫ့ခးယၫအဖၧၩ့ဆံၭ.- မၩအၥၭ ဘဲၫနီၪတၭ, စအၫရၧၫ့ယၩ့ထၪ့အစူၪအီၪ လၧနိၪထိၭ ဘီၩ့တၭ, ဒိၪဂၪ့ခိၪအမုၬတၭ, အဆၧကဲၪထၪ့ဆၧဎါ လၧၦၡၩအလီၩ့ ဒဲလၧဆၧဖိၪဆၧဎါ အလီၩ့လီၫ. ဂၪ့ ခိၪအမုၬ လၧခးအံဇံၭ ထၧၫ့ခးယၫ ကဲၪထၪ့ ဆၧဎါ",
			"18": "<sup>18</sup> ထီးအလူၬလီၫ.- တၭၦမၩကဒၩၦမ့ၬ မၩဝ့ၫဘဲၫနီၪၥိၭ လၧအဆၧမၩအဖၧၩ့ဘဲၫၥိၭ အမိဒုၭဂဲၫထၪ့ဆၧဎါဆ့ တၭ,မၩဝ့ၫၥ့ၪအ့ၬ. တၭဆၧဎါအီၪ လၧၦၡၩအလီၩ့,ဒဲ",
			"19": "<sup>19</sup> လၧဆၧဖိၪဆၧဎါ အလီၩ့လီၫ.- တၭၦမၩကဒၩၦမ့ၬ လဖၪစံၭဖၫရိၫ, ဆၧလမံၩ့ယီၩ, မွဲယွၩအစူၪနိၩ့လီၫ. ဖၫရိၫအၥၭနီၩ့ထၪ့တၭ, ခိၭနၪအဝ့ၫၥံၪအလူအ့ၬ, ဘဲၫ ယဟိဝၩစံၭဝ့ၫ အၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩစံၭစမိစ့ၭ, ကဲဂီၩခိၬဂဲထုၪ့ ဂီၩဂီၩလ့ၬ တၭ,ဆၧၫ့ထုၪ့လၧဖၫရိၫအမ့ၬယၫး ယိခွါး အဝ့ၫဒၪ ဂဲၫလၧထံၫနဲၩ့တၭ, လီၩဘၪဝ့ၫ, ယဟိဝၩစံၭဘဲၫယီၩ, ကွဲၪဖျါခွံၬယၡၩခမျၧး ဘဲၫအမိမၩယဆၧအၥိၭဆံၭ.",
			"21": "<sup>21</sup> အ့ၪလမွဲဘၪတၭ, နအ့ၪလကွဲၪဖျါခွံၬ ဘၪယၡၩခမျၧး တၭ,ယိခွါ, ယမိအၪ့မၧၫ့လၩ့ဒူၩလၫ အဒီၪ့ၥံၪလၧန လီၩ့,ဒဲလၧနခ့ၫနၡၩအလီၩ့, ဒဲလၧနဂံၪ့ၥံၪအဖၧၩ့လီၫ. တၭၦအံဇံၭဖိၪ အဂံၪ့ၥံၪမိဎွ့ၩ လၧဒူၩလၫလဖၪ, ဒဲ",
			"22": "<sup>22</sup> ဂၪ့ခိၪလၧအအီၪဝ့ၫ လၧအဖၫ့ခိၪဆ့လီၫ.- တၭဆၧ လၧမုလနံၩနီၪ ယမိမၩလၩ့မဲၩ ခးဂိၡံၫ့, လၧယၡၩ ခမျၧးအီၪလၧအဖၧၩ့ ဘဲၫၥိၭဒူၩလၫလဖၪ ထီးအီၪထီး နီၪလဂ့ၩး ဘဲၫၥိၭနမိၥ့ၪယၫ လၧယမွဲယဟိဝၩ လၧ",
			"23": "<sup>23</sup> ဂၪ့ခိၪချိၫ့နီၪလီၫ.- တၭယမိအီၪက့ၪ ယၡၩခမျၧး ဒဲန ၡၩခမျၧးအဆၧၫ့လီၫ. ကဲဂီၩခိၬ ဆၧလၩ့လၭအဆၧ",
			"24": "<sup>24</sup> မၩနဲၪ့ယီၩမိကဲၪထၪ့ဝ့ၫလီၫ.- ယဟိဝၩမၩဝ့ၫဘဲၫနီၪ တၭ,ဒူၩလၫခမျၧး ဂဲၫနုၬလၧဖၫရိၫအဂံၪ့ဖၧၩ့, ဒဲလၧ အခ့ၫအၡၩလဖၪအဂံၪ့ဖၧၩ့ ဒဲလၧခးအံဇံၭ အဖၧၩ့ ထီးအလူၬလီၫ. တၭခးထၧၫ့ခးယၫနီၪ ဂၭဂီၩ့ဝ့ၫလၧ ဒူၩလၫအဒီၪ့လဖၪနီၪ အကၠီၩ့လီၫ.",
			"25": "<sup>25</sup> ဖၫရိၫကိၭထဲၩ့စမိစ့ၭ, ဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫဒၪ,",
			"26": "<sup>26</sup> လ့ၩလုထၪ့နၥံၪ အယွၩလၧခးအဖၧၩ့ဆံၭ.- တၭစမိ စ့ၭစံၭဝ့ၫဒၪ, ဆၧစ့ၩရၫ့ဝဲၩဝ့ၫ လၧပမိမၩဘဲၫနီၪအ့ၬ. အဂဲးဘဲၫယီၩ ပမိလုထၪ့ဘၪၦအံဇံၭဖိၪ အဆၧဘၪၥၭ လိၪလၧယဟိဝၩပယွၩလီၫ, ယိခွါ,ပမိလုထၪ့ၦအံဇံၭ ဖိၪအဆၧဘၪၥၭလိၪ လၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, အ",
			"27": "<sup>27</sup> ဝ့ၫၥံၪမိခွံၬပၧၩ လၧလိးမွဲအ့ၬဧၪ.- ပမိလ့ၩလၧမံၩ့လၬ ကျၩၥၧၫ့နံၩဖၧၩ့ၥၭတၭ, လုထၪ့ဆၧ လၧယဟိဝၩပ",
			"28": "<sup>28</sup> ယွၩဘဲၫအမၪလူၬပၧၩအၥိၭနီၪလီၫ.- တၭဖၫရိၫစံၭဝ့ၫ ဒၪ,ယမိဖျါခွံၬနၥံၪ, ဘဲၫၥိၭနၥံၪမိလုထၪ့ဆၧ လၧယဟိ ဝၩနၥံၪအယွၩ လၧမံၩ့လၬကျၩလီၫ. မွဲလါနၫ့နၥံၪ လ့ၩ ဘၪဆၧယဲၩ့ယဲၩ့လ့ၬအ့ၬး တၭအၪ့ကံၩ့ဆၧလၧယဂး",
			"29": "<sup>29</sup> ဆံၭ.- စမိစ့ၭစံၭဝ့ၫဒၪ, ယိခွါ, ယမိစဲၪ့ထၪ့ခွံၬလၧနအီၪ တၭ, ယမိအၪ့ကံၩ့ဆၧလၧယဟိဝၩ ဘဲၫၥိၭဒူၩလၫအ ဒီၪ့လဖၪမိစဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအလီၩ့, ဒဲလၧအခ့ၫအ ၡၩအလီၩ့, ဒဲလၧအၡၩခမျၧးအလီၩ့ ကဲဂီၩခိၬလီၫ. မွဲ လါနၫ့တၭ, မွဲဖၫရိၫထီးအၪ့လီၫဆၧ လၧအလကွဲၪဖျါ ဘၪၦခမျၧး ဘဲၫၥိၭအမိလ့ၩလုထၪ့ လၧယဟိဝၩ အ",
			"30": "<sup>30</sup> ၥိၭနီၪလဂ့ၩ.- စမိစ့ၭစဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအအီၪတၭ,",
			"31": "<sup>31</sup> အၪ့ကံၩ့ဆၧလၧယဟိဝၩလီၫ.- ယဟိဝၩမၩဝ့ၫဘဲၫစ မိစ့ၭအလူအၥိၭနီၪတၭ, ဒုၭစဲၪ့ထၪ့ခွံၬ ဒူၩလၫလဖၪ လၧဖၫရိၫအလီၩ့, ဒဲလၧအခ့ၫအၡၩအလီၩ့, ဒဲလၧၦ",
			"32": "<sup>32</sup> ခမျၧးအလီၩ့တၭ, အီၪလၩ့ထးနးဘံၪ့အ့ၬ.- တၭဖၫရိၫ မၩနီၩ့ ထၪ့အၥၭအယီၩ လဖၧၫ့ဆ့တၭ, မိကွဲၪဖျါခွံၬ ဘၪအၥၭ ၦခမျၧးနီၪဆ့အ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩစံၭစမိစ့ၭ, လ့ၩနုၬလၧဖၫရိၫ အအီၪတၭ, စံၭအဝ့ၫဒၪ, ယဟိဝၩၦဟံဘြူၫဖိၪအယွၩ စံၭဝ့ၫဘဲၫယီၩ, ကွဲၪဖျါခွံၬယၡၩခမျၧး ဘဲၫအမိမၩယ",
			"2": "<sup>2</sup> ဆၧအၥိၭဆံၭ.- အဂဲးဘဲၫယီၩ နအ့ၪလကွဲၪဖျါခွံၬဘၪ",
			"3": "<sup>3</sup> နီၪ,နအ့ၪဖီၪ့ထၬဒံၭအဝ့ၫၥံၪတၭ,- ယိခွါ, ယဟိဝၩ အစူၪမိအီၪလၧနဆၧဖိၪဆၧဎါ လၧအအီၪလၧဆံၬဖၧၩ့ နၩဖၧၩ့အလီၩ့, လၧကၥ့ၪလဖၪအလီၩ့, ဒဲလၧကၥ့ၪ ယီၩ့ၥံၪအလီၩ့, လၧကလအူၭၥံၪအလီၩ့, လၧချီၥံၪအ လီၩ့, ဒဲၥိၪဒဲဘ့ၪလဖၪအလီၩ့တၭ, မိဘၪဆၧၥံၫခမျၧး",
			"4": "<sup>4</sup> ဒိၪမၬလီၫ.- တၭယဟိဝၩမိမၩ ၦအံၫစရ့လၭဖိၪအဆၧ ဖိၪဆၧဎါအဒိၩ့ လၩ့မဲၩလၧအံဇံၭဖိၪ အဆၧဖိၪဆၧ ဎါအဒိၩ့နီၪလီၫ. တၭဆၧလၧၦအံၫစရ့လၭဖိၪ ထီးအ",
			"5": "<sup>5</sup> လူၬအကျၩနီၪ အဆၧၥံၫဘၪဝ့ၫနးဒုၩအ့ၬ.- ယဟိဝၩ ဖၭနံၩဖၭၥၫ့တၭ, စံၭဝ့ၫဒၪ, ကဲဂီၩခိၬယဟိဝၩ မိမၩ ဆၧနီၪလမံၩ့ လၧခးဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> ဆၧဖၩ့ထၪ့လနံၩနီၪ ယဟိဝၩမၩဆၧနီၪလမံၩ့တၭ, ၦအံဇံၭဖိၪအဆၧဖိၪဆၧဎါအဒိၩ့နီၪ ၥံၫဝ့ၫထီးအလူၬ လီၫ.အ့ၪမွဲၦအံၫစရ့လၭဖိၪ အဆၧဖိၪဆၧဎါနီၪၥံၫဝ့ၫ",
			"7": "<sup>7</sup> နးဒုၩအ့ၬ.- ဖၫရိၫအၪ့မၧၫ့လၩ့ဆၧတၭ, ယိခွါ, ၦအံၫ စရ့လၭဖိၪ အဆၧဖိၪဆၧဎါနီၪ ၥံၫဘၪနးဒုၩအ့ၬ. တၭ ဖၫရိၫအၥၭနီၩ့ထၪ့ဝ့ၫတၭ, ကွဲၪဖျါၦခမျၧးအ့ၬ.",
			"8": "<sup>8</sup> တၭယဟိဝၩစံၭစမိစ့ၭဒဲစအၫရၧၫ့, အၪ့မၩန့ဖံၫ့ချၪ အမုၬဎွ့ၩစူၪလဖၪတၭ, မွဲစမိစ့ၭဎွံၪထၪ့ လၧမူၭခိၪလၧ",
			"9": "<sup>9</sup> ဖၫရိၫအမ့ၬယၫနီၪဆံၭ.- ဆၧမိကဲၪထၪ့ဆၧအမုၬလၧ ခးအံဇံၭ ထၧၫ့ခးယၫအဖၧၩ့တၭ, မိကဲၪထၪ့ ဆၧဝံၫ့ ဖၭဒိၪဖၭထီၫ ဒဲဆၧဖၧၩ့လး လၧၦၡၩအလီၩ့, ဒဲလၧ ဆၧဖိၪဆၧဎါအလီၩ့, လၧခးအံဇံၭထၧၫ့ခးယၫအဖၧၩ့",
			"10": "<sup>10</sup> လီၫ.- အဝ့ၫၥံၪအၪ့မၩန့ဖံၫ့ချၪအမုၬတၭ, ဆၧၫ့ထုၪ့ လၧဖၫရိၫအမ့ၬယၫတၭ, စမိစ့ၭ ဎွံၪထၪ့ဝ့ၫလၧမူၭခိၪ နီၪးဆၧကဲၪထၪ့ဝ့ၫလၧဝံၫ့, ဒဲဆၧဖၧၩ့လး, လၧၦၡၩ",
			"11": "<sup>11</sup> အလီၩ့,ဒဲလၧဆၧဖိၪဆၧဎါအလီၩ့လီၫ.- တၭၦမၩက ဒၩၦမ့ၬလဖၪနီၪ ဆၧၫ့ထုၪ့ဝ့ၫ လၧစမိစ့ၭ အမ့ၬယၫလ ကဲၪဘၪလၧဆၧဝံၫ့အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧဝံၫ့ နီၪအီၪဝ့ၫ လၧၦမၩကဒၩၦမ့ၬၥံၪအလီၩ့, ဒဲလၧၦအံဇံၭ",
			"12": "<sup>12</sup> ဖိၪထီးအလူၬလဖၪအလီၩ့လီၫ.- ယဟိဝၩဒုၭနီၩ့ထၪ့ ဖၫရိၫအၥၭတၭ, အဝ့ၫလခိၭနၪဘၪအလူ ဘဲၫယဟိဝၩ လီၩဘၪဝဲၩစမိစ့ၭအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩစံၭစမိစ့ၭ ကဲဂီၩခိၬဂဲထုၪ့ဂီၩဂီၩတၭ,ဆၧၫ့ ထုၪ့လၧဖၫရိၫအမ့ၬယၫတၭ, စံၭအဝ့ၫ, ယဟိဝၩၦဟံ ဘြူၫဖိၪအယွၩစံၭဘဲၫယီၩ, ကွဲၪဖျါခွံၬ ယၡၩခမျၧးဘဲၫ",
			"14": "<sup>14</sup> အမိမၩယဆၧမၩအၥိၭဆံၭ.- အဂဲးဘဲၫယီၩအယီၩ လဖၧၫ့ယမိဒုၭဘၪနၥၭ ဒဲနခ့ၫနၡၩၥံၪ, ဒဲၦခမျၧးလၧယ ဆၧၡၪ့ဆၧနၭထီးအလူၬ, ဘဲၫၥိၭနမိၥ့ၪယၫလၧၦဘဲၫ ယၧၩအၥိၭ လၧဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫ အီၪနးဂၩအ့ၬ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩ ဘိၩ့နဲၪ့ယီၩ, ယမိယၩ့ထၪ့ယစူၪဘဲၫ ၥိၭယမိကျီၪ့နၧၩ ဒဲနၡၩခမျၧး လၧဆၧဆၫဖျဲၪတၭ, နမိ",
			"16": "<sup>16</sup> ဂၭဂီၩ့ခွံၬ လၧဂၪ့ခိၪချိၫ့လီၫ.- တၭမွဲမၬ, ယအီၪက့ၪ ထၪ့ထီၫနၧၩ လၧဆၧအဂဲးယီၩ, ဘဲၫၥိၭယမိဒုၭနဲၪယ စီၩ့ယမၩ့လၧနၧၩ, ဒဲဘဲၫၥိၭဆၧမိလီၩလၩ့လၬလၩ့ယ",
			"17": "<sup>17</sup> မံၩ့လၧဂၪ့ခိၪချိၫ့ယီၩ ထၧၫ့ဖျိၪ့ယၫလီၫ.- နအီၪက့ၪထၪ့ ထီၫနၥၭ လၧယခ့ၫယၡၩခမျၧးအဖၫ့ခိၪ, လၧနလကွဲၪ",
			"18": "<sup>18</sup> ဖျါဘၪဝ့ၫဆ့ဧၪ.- ယိခွါ, ကဲဂီၩခိၬဆၧၫ့အလးဘိၩ့နဲၪ့ ယီၩ,ယမိအၪ့မၧၫ့ဆၧဂဲၫဆၧၩ့လၩ့န့ မုၥၪဎၧၫ့ဎၧၫ့လ့ၬ နီၪ,တၭလၧမုလနံၩ လၧအခၪ့ထံၭအီၪထၪ့ခီးဘိၩ့နဲၪ့ ယီၩ ဆၧမၩအၥၭဘဲၫနီၪ လၧအံဇံၭအဖၧၩ့ နးဆိၭ",
			"19": "<sup>19</sup> အ့ၬ.- ဘိၩ့နဲၪ့ယီၩအၪ့မၧၫ့လၩ့ဆၧတၭ, နဆၧဖိၪဆၧ ဎါအဒိၩ့လၧအအီၪ လၧခီၫ့ထီးအလူၬနီၪ, ဒုၭအီၪကီၪ့ ဝ့ၫချဲၫ့ချဲၫ့ဆံၭ, ကယဲၦၡၩဒဲဆၧဖိၪဆၧဎါ လၧဆၧမိဒၪ န့ဝ့ၫလၧခီၫ့နီၪ, လအီၪကီၪ့ဘၪလၧဂံၪ့ဖၧၩ့တၭ, မုၥၪ မိဂဲၫလၩ့ဘၪဝ့ၫတၭ, မိၥံၫဝ့ၫကိၭဒုၩကိၭဂၩဒ့ၭလီၫ.",
			"20": "<sup>20</sup> တၭၦလၧအၥၭမဲၪ ယဟိဝၩအလူ လၧဖၫရိၫအခ့ၫ အၡၩအကျၩနီၪ, အၪ့မၧၫ့အဎီးအၡၩ ဒဲအဆၧဖိၪဆၧ",
			"21": "<sup>21</sup> ဎါအဒိၩ့လဖၪ, စဲၪ့နုၬလၧအဂံၪ့ဖၧၩ့လီၫ.- တၭၦလၧ အလအီၪက့ၪဘၪ ယဟိဝၩ အလူအထၫ လၧအၥၭခံ ဖၧၩ့နီၪ, ဒုၭအီၪလၩ့ထးအဎီးအၡၩ ဒဲအဆၧဖိၪဆၧဎါ",
			"22": "<sup>22</sup> အဒိၩ့လၧခီၫ့လီၫ.- တၭယဟိဝၩစံၭစမိစ့ၭ, ယၩ့ထၪ့ နစူၪလၧမူၭခိၪ, ဘဲၫၥိၭမုၥၪမိလၩ့ လၧခးအံဇံၭထၧၫ့ ခးယၫအဖၧၩ့, လၧၦၡၩအဖၫ့ခိၪ, ဒဲလၧဆၧဖိၪဆၧ ဎါအဖၫ့ခိၪ, ဒဲလၧကယဲဆၧမဲၪထၪ့ လၧခီၫ့လၧခးအံ ဇံၭထၧၫ့ခးယၫအဖၧၩ့ လၧဆၧကိၭအမံၩ့ဒ့ၭ အဖၫ့ခိၪ",
			"23": "<sup>23</sup> ဆံၭ.- စမိစ့ၭယၩ့ထၪ့အနိၪထိၭဘီၩ့ လၧမူၭခိၪတၭ, ယဟိဝၩအၪ့မၧၫ့လၫ့ဎွံၩ့ ဒဲမုၥၪလၩ့း ဒဲမ့ၪၥံၪလ့ၩဝံၩ့ဝၩ့ လၧဂၪ့ခိၪအဖၫ့ခိၪတၭ, ယဟိဝၩအၪ့မၧၫ့ဆၧဂဲၫဆၧၩ့",
			"24": "<sup>24</sup> လၩ့န့မုၥၪ လၧခးအံဇံၭအဖၫ့ခိၪလီၫ.- တၭမုၥၪအီၪ လၧမ့ၪလၪနီၪ ကျီၪမွံၩအၥၭ လၧမုၥၪလၩ့နီၪ နၭမၬ လီၫ.ဆၧဘဲၫနီၪၥိၭ လအီၪဘၪလၧအံဇံၭအဖၧၩ့း ခီၫ",
			"25": "<sup>25</sup> ဒၪလၧအကဲၪထၪ့, ၦလဆၨၩခီးဘိၩ့ယီၩလီၫ.- တၭမု ၥၪနီၪ လၩ့ဘၪဆၧအီၪ လၧခးအံဇံၭ ထၧၫ့ခးယၫ အ ဖၧၩ့,ကယဲဆၧအီၪ လၧခီၫ့လၧၦၡၩဖိး လၧဆၧဖိၪဆၧ ဎါအဒိၩ့, ဒဲမုၥၪနီၪ ဘၪကယဲဆၧမဲၪထၪ့လၧခီၫ့, ဒဲမၩ",
			"26": "<sup>26</sup> ခါလၩ့ၥံၪ့ၥံၪဝၪၥံၪ လၧခီၫ့ကိၭအမံၩ့ဒ့ၭလီၫ.- အ့ၪမွဲ လၧခးဂိၡံၫ့, လၧၦအံၫစရ့လၭဖိၪ အီၪဝ့ၫနီၪ မုၥၪအီၪ အ့ၬ.",
			"27": "<sup>27</sup> ဖၫရိၫအၪ့မၧၫ့လၩ့ဆၧတၭ, ကိၭထဲၩ့စမိစ့ၭ, ဒဲစအၫ ရၧၫ့တၭ, စံၭအဝ့ၫၥံၪ, အယီၩလဖၧၫ့ယမၩမၪဘၪယူၭ ဆၧယူၭ. ယဟိဝၩမွဲဆၧတီၩဆၧလီၩ့လဂၩနီၪ, အ့ၪမွဲ ယၧၩ, ဒဲယခ့ၫယၡၩခမျၧးလဖၪနီၪ, မွဲၦအတီၩအလီၩ့",
			"28": "<sup>28</sup> အ့ၬ.- ဘိၩ့နဲၪ့ယီၩ, ဘၪယူၭ, အၪ့ကံၩ့ယဟိဝၩ, ဘဲၫ ၥိၭယွၩအလၫ့ဎွံၩ့ ဒဲမုၥၪလၩ့နီၪ ထီးအီၪလၧၩ့လဂ့ၩ တၭ,ယမိကွဲၪဖျါခွံၬနၥံၪတၭ, နၥံၪအီၪဘၪလၧၩ့ထီး",
			"29": "<sup>29</sup> ယီၩအ့ၬ.- တၭစမိစ့ၭစံၭအဝ့ၫ, ထီးယအ့ၪစဲၪ့ထၪ့ခွံၬ လၧဒိၩ့ဖၧၩ့တၭ, ယမိယူၬထၪ့ယစူၪ လၧယဟိဝၩအ အီၪတၭး လၫ့ဎွံၩ့မိထုၬဝ့ၫဒဲမုၥၪအီၪလၧၩ့ဝ့ၫအ့ၬး ဘဲၫ ၥိၭနမိၥ့ၪယၫ လၧဂၪ့ခိၪအီၪလၧယဟိဝၩ အစူၪဖၧၩ့",
			"30": "<sup>30</sup> လီၫ.- မွဲလါနၫ့တၭ, နၧၩဒဲနခ့ၫနၡၩလဖၪယီၩ, ယၥ့ၪ ယၫလၧနၥံၪလၥၭမဲၪဒံၭဘၪ ယဟိဝၩယွၩလီၫ.",
			"31": "<sup>31</sup> တၭဆၧဘၪၥီၫကဘၩ့, ဒဲမုယီၩလီၫ. အဂဲးဘဲၫယီၩ မုယီၩအဆဲၩ အီၪထၪ့ယူၭ, ဒဲၥီၫကဘၩ့ၥၪထၪ့ယူၭ.",
			"32": "<sup>32</sup> အ့ၪမွဲဘုၪကၠိၩ့ဒဲဘုၪကူၭစမ့ၭနီၪ မုၥၪဘၪဝ့ၫအ့ၬ. အဂဲး ဘဲၫယီၩ မွဲအလဒိၭထၪ့ဒံၭဘၪလီၫ.",
			"33": "<sup>33</sup> စမိစ့ၭစဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအအီၪ လၧဒိၩ့ဖၧၩ့နီၪ, ယူၬထၪ့အစူၪၥံၪ လၧယဟိဝၩအအီၪတၭ, လၫ့ဎွံၩ့ဒဲမု ၥၪလၩ့နီၪထုၬဝ့ၫဒၪတၭ, ဆၧဂဲၫဆၧၩ့လၩ့လၧၩ့လၧဂၪ့",
			"34": "<sup>34</sup> ခိၪချိၫ့ယီၩအ့ၬ.- ဖၫရိၫဒၪဘၪဝ့ၫ လၧဆၧဆၧၩ့ဒဲမုၥၪ လၩ့ဒဲလၫ့ဎွံၩ့နီၪထုၬဝ့ၫတၭ, မၩအၪထၪ့အဆၧဒဲၩဘၭ",
			"35": "<sup>35</sup> တၭ,မၩနီၩ့ထၪ့အၥၭ, အဝ့ၫဒၪဒဲအခ့ၫအၡၩလီၫ.- ဖၫ ရိၫ အၥၭနီၩ့ထၪ့တၭ, ကွဲၪဖျါၦအံၫစရ့လၭဖိၪအ့ၬ, ဘဲၫယဟိဝၩလီၩဘၪယူၭ စမိစ့ၭအၥိၭနီၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> တၭယဟိဝၩ စံၭစမိစ့ၭ, လ့ၩနုၬလၧဖၫရိၫအအီၪ နီၪဆံၭး အဂဲးဘဲၫယီၩ ယမၩနီၩ့ထၪ့အၥၭ ဒဲအခ့ၫအ ၡၩလဖၪအၥၭ, ဘဲၫၥိၭ ယမိအီၪက့ၪယဆၧလၩ့လၭ",
			"2": "<sup>2</sup> အဆၧမၩနဲၪ့လဖၪယီၩလၧအမ့ၬယၫ,- တၭဘဲၫၥိၭ နမိလီၩလၩ့လၬလၩ့ ဆၧလၧနဖိၪခွၫ ဒဲလၧနဖိၪခွၫအ ဖိၪခွၫၥံၪအနါဖၧၩ့, လၧဆၧလၧယမၩ လၧအံဇံၭအ အဖၧၩ့, ဒဲဆၧမၩနဲၪ့အဆၧလၩ့လၭလဖၪ လၧယမၩ လၧအကျၩနီၪ, တၭနၥံၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩ လီၫ.",
			"3": "<sup>3</sup> စမိစ့ၭဒဲစအၫရၧၫ့ လ့ၩနုၬလၧဖၫရိၫ အအီၪတၭ, စံၭဝ့ၫ, ယဟိဝၩၦဟံဘြူၫဖိၪအယွၩစံၭဘဲၫယီၩ, နလ ခိၭနၪဘၪဆၧ, နလဆၪ့လၩ့ဘၪ နၥၭလၧယမ့ၬယၫ နီၪ,မွဲနမိအီၪဒံၭဆံၭယံၬလဲၪး ကွဲၪဖျါခွံၬယၡၩခမျၧး",
			"4": "<sup>4</sup> ဘဲၫၥိၭအမိမၩ ယဆၧဆံၭ.- နအ့ၪလကွဲၪဖျါဘၪယ ၡၩခမျၧးနီၪ, ယိခွါ, ကဲဂီၩခိၬယမိဒုၭဂဲၫထၪ့ထွ့ၥံၪ",
			"5": "<sup>5</sup> လၧနခးဖၧၩ့,- အဝ့ၫၥံၪမိမၩဘံၭဂၪ့ခိၪ ထီးၦၡၩဒၪ ဘၪဂၪ့ခိၪလၥ့ၪဘၪတၭ, မိအၪ့ဆၧအီၪလၩ့ထးလၧ အဖီၩ့ဖျ့ၭ, ဆၧအီၪလၩ့ထး လၧနၥံၪအဂးလၧမုၥၪနီၪ တၭ,မိအၪ့ကယဲၥံၪ့ လၧအမဲၪထၪ့ လၧနၥံၪအဂး လၧ",
			"6": "<sup>6</sup> မံၩ့လၬကျၩကိၭထံၭဒ့ၭ,- တၭအဝ့ၫၥံၪမိမၩဎွ့ၩနဂံၪ့, ဒဲနခ့ၫနၡၩၥံၪအဂံၪ့ထီးအလူၬ, ဒဲကယဲၦအံဇံၭဖိၪအ ဂံၪ့ထီးအလူၬလီၫ. အနီၪနဖါၥံၪ, ဒဲနဖါအဖါအဂံၪ့ၥံၪ လဒၪဘၪလၧမုနံၩ လၧအအီၪထၪ့ လၧဂၪ့ခိၪချိၫ့ယီၩ, ထီးမုလနံၩယီၩလီၫ. အဝ့ၫကၠၪကဒၩထဲၩ့အၥၭတၭ, စဲၪ့ထၪ့ခွံၬလၧဖၫရိၫအအီၪလီၫ.",
			"7": "<sup>7</sup> ဖၫရိၫအခ့ၫအၡၩစံၭဝ့ၫ, ဆၧယီၩမိကဲၪဖျံၩခွၩ့လၧ ပဂးဆံၭယံၬလဲၪ. ကွဲၪဖျါလါၦခွၫလဖၪ ဘဲၫအမိမၩ ယဟိဝၩ, အဝ့ၫၥံၪအယွၩအဆၧနီၪဆံၭး အံဇံၭဂၭဂီၩ့",
			"8": "<sup>8</sup> ယူၭနီၪနၥ့ၪယၫအ့ၬဧၪ.- ၦဒုၭဂဲၫထၪ့စမိစ့ၭ, ဒဲစအၫ ရၧၫ့လၧဖၫရိၫအအီၪတၭ, အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, လ့ၩ မၩယဟိဝၩနၥံၪအယွၩ အဆၧနီၪဆံၭ. မွဲပလၫမိလ့ၩ",
			"9": "<sup>9</sup> လဖၪလဲၪ.- စမိစ့ၭစံၭဝ့ၫဒၪ, ပမိလ့ၩလၧၦၡၩၥၭဘၪ့ ၥံၪ, ဒဲၦၡၩၥၭၡါၥံၪ, ဒဲပဖိၪခွၫၥံၪ, ဒဲပဖိၪမုၪၥံၪ, ဒဲပ ၥိၪဒဲပဘ့ၪအဒီၪ့ၥံၪ, ဒဲပချီလဖၪနီၪ ပမိလ့ၩပဝ့ၫလီၫ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩ ပဘၪမၩဘိၪ့ယဟိဝၩလီၫ. တၭအဝ့ၫ ဒၪစံၭအဝ့ၫၥံၪ, မွဲယဟိဝၩအီၪလၧနၥံၪဘဲၫယကွဲၪဖျါ နၥံၪဒဲနၥံၪအဖိၪဆံၭအၥိၭနီၪဆံၭး အဂဲးဘဲၫယီၩဆၧ",
			"11": "<sup>11</sup> အၧၩ့ဆၧၥၫ့အီၪဝ့ၫ လၧနၥံၪအမ့ၬယၫလီၫ.- ဘဲၫနီၪမွဲ အ့ၬ, နၥံၪဝ့ၫၦခွၫ လဖၪလ့ၩဆၧတၭမၩ ယဟိဝၩအ ဆၧမၩဆံၭ. အဂဲးဘဲၫယီၩ နၥံၪအၪ့ဎၬယူၭဆၧနီၪလ မံၩ့လီၫ. တၭၦနၫ့ထၪ့ခွံၬဝ့ၫ လၧဖၫရိၫအမ့ၬယၫလီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩစံၭစမိစ့ၭယၩ့ထၪ့နစူၪ လၧအံဇံၭအဖၫ့ခိၪ လၧ ထွ့ၥံၪ အဂး, ဘဲၫၥိၭ အမိ ဂဲၫထၪ့ လၧခးအံဇံၭ အဖၧၩ့တၭ, အၪ့ခွံၬကယဲနၪ့ၥံၪမံၩ့ၥံၪ, ဘုၪၥံၪဂူၫၥံၪ လၧခးဖၧၩ့နီၪ, ဒဲကယဲ ဆၧလၧမုၥၪဒုၭအီၪ လၩ့ထး",
			"13": "<sup>13</sup> နီၪဆံၭ.- တၭစမိစ့ၭ ယၩ့ထၪ့ အနိၪထိၭဘီၩ့ လၧခး အံဇံၭအဖၫ့ခိၪတၭ, ယဟိဝၩဒုၭဂဲၫလံၩ လၧမုထၪ့လ ခီၫလၧခးနီၪ အဖၫ့ခိၪ ၥံၫ့နံၩ ချီၩ့ ဒဲၥၫ့နၩ ချီၩ့ လီၫ. ထီးဆၧဖၩ့ထၪ့ ကဲဂီၩလခီၫနီၪလံၩ လၧမုထၪ့လခီၫဂဲၫ",
			"14": "<sup>14</sup> ဆိၬထွ့ၥံၪလီၫ.- ထွ့နီၪလ့ၩထၪ့လၧခးအံဇံၭထၧၫ့ခး ယၫအဖၫ့ခိၪတၭ, ဆီးလၩ့ဝ့ၫလၧ အံဇံၭအလးအဖၧၩ့ ထီးအလူၬတၭ, အီၪဝ့ၫအၪမၬလီၫ. လၧဖျိၩ့ထွ့ဘဲၫအ ဝ့ၫၥံၪအၥိၭနီၪ, အီၪနးဆိၭအ့ၬး တၭလၧခဲၫ့ဘဲၫနီၪၥိၭ",
			"15": "<sup>15</sup> မိအီၪဝ့ၫနးဆိၭလၧၩ့အ့ၬ.- မွဲအမၩလၩ့ဘံၭခွံၬ ခးနီၪ ထၧၫ့ခးယၫတၭ, ခးနီၪခံၭလၩ့ဝ့ၫတၭ, အဝ့ၫၥံၪအၪ့ ခွံၬကယဲနၪ့ၥံၪမံၩ့ၥံၪ ဘုၪၥံၪဂူၫၥံၪ လၧခးဖၧၩ့နီၪ, ဒဲၥံၪ့ အၥၪထီးအလူၬ, လၧမုၥၪအီၪက့ၪလၩ့ထးဝ့ၫ လၧၥံၪ့ အလီၩ့, တၭလၧၥံၪ့အလီၩ့, ဒဲလၧနၪ့ၥံၪမံၩ့ၥံၪ ဘုၪၥံၪ ဂူၫၥံၪ လၧဆၧပျၩ့ဖၧၩ့ အလီၩ့, လၧခးအံဇံၭ အဖၧၩ့ ထၧၫ့ခးယၫနီၪ ဆၧလၪယ့ၫအီၪလၧၩ့ နးမံၩ့အ့ၬ.",
			"16": "<sup>16</sup> ဖၫရိၫမၩဝ့ၫချဲၫ့ချဲၫ့တၭ, ကိၭထဲၩ့စမိစ့ၭဒဲစအၫရၧၫ့ တၭ,စံၭဝ့ၫဒၪ, ယမၩမၪဘၪယူၭ ယဟိဝၩနၥံၪအယွၩ",
			"17": "<sup>17</sup> ယူၭ, ဒဲယမၩမၪဘၪယူၭနၥံၪယူၭ.- တၭဘိၩ့နဲၪ့ယီၩ ကွဲၪဖျါလါယဆၧမၪ န့ၫအယီၩလဖၧၫ့ဘီၪး တၭအၪ့ ကံၩ့အၪ့ယၫ ယဟိဝၩနၥံၪအယွၩ ဘဲၫၥိၭအမိဒုၭစဲၪ့",
			"18": "<sup>18</sup> ထၪ့ခွံၬကယဲဆၧၥံၫ လမံၩ့ယီၩလၧယၧၩဆံၭ.- အဝ့ၫ နီၪစဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအအီၪတၭ, အၪ့ကံၩ့အၪ့ယၫ",
			"19": "<sup>19</sup> ယဟိဝၩလီၫ.- ယဟိဝၩကၠၪထဲၩ့လံၩမုဂဲၫ လၧမုနုၬ လခီၫတၭ, ဆိၬထၪ့ခွံၬထွ့ၥံၪတၭ ခွံၬၡိၭခွံၬဝ့ၫ လၧမၫ ဆမံၭဝီၩအဖၧၩ့တၭ, အီၪလၩ့ထးလၧၩ့ လၧအံဇံၭ",
			"20": "<sup>20</sup> အလးလဖၪအဖၧၩ့နးဘံၪ့အ့ၬ.- ယဟိဝၩဒုၭနီၩ့ထၪ့ ဖၫရိၫအၥၭတၭ, အဆၧကွဲၪဖျါၦအံၫစရ့လၭဖိၪအ့ၬ.",
			"21": "<sup>21</sup> ယဟိဝၩစံၭစမိစ့ၭ, ယၩ့ထၪ့နစူၪ လၧမူၭခိၪတၭ, ဆၧခံၭမိလၩ့ဘၪခးအံဇံၭတၭ, မွဲဆၧခံၭလၧၦလုးဝ့ၫ",
			"22": "<sup>22</sup> ၥ့ၪလီၫ.- စမိစ့ၭ ယၩ့ထၪ့အစူၪ လၧမူၭခိၪတၭ, ဆၧ ခံၭလၩ့တၪ့ဝ့ၫ လၧခးအံဇံၭအဖၧၩ့ ၥၧၫ့နံၩယၫလီၫ.",
			"23": "<sup>23</sup> တၭၦဒၪဘၪလိၬအၥၭနးဂၩအ့ၬ. တၭလၧၥၧၫ့နံၩယၫ နီၪၦလၧအအီၪလၧအလး ဂဲထုၪ့ဝ့ၫနးဂၩအ့ၬ. အ့ၪမွဲ ၦအံၫစရ့လၭဖိၪထီးအလူၬ အီၪလၧဆၧဖၩ့လၧအအီၪ ဝ့ၫအလးလီၫ.",
			"24": "<sup>24</sup> ဖၫရိၫကိၭန့စမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လ့ၩမၩယဟိဝၩ အဆၧမၩဆံၭ. ဒုၭအီၪလၩ့ထးကယဲနၥံၪ အၥိၪဒဲဘ့ၪ လဖၪ,ဒဲချီလဖၪနီၪဆံၭ. နၥံၪအဖိၪဒံၩဖိၪၥၪၥံၪလ့ၩဒၪ",
			"25": "<sup>25</sup> ဝ့ၫလၧနၥံၪအၥိၭဆံၭ.- စမိစ့ၭစံၭဝ့ၫဒၪ, နဘၪဖ့ၪလၫ့ ပၧၩဆ့လၧဆၧလုလဖၪ ဒဲဆၧလုမ့ၪလဖၪ လၧပစူၪဖၧၩ့",
			"26": "<sup>26</sup> ဘဲၫၥိၭပမိလုထၪ့ဆၧလၧ ယဟိဝၩပယွၩလီၫ.- တၭပ ဆၧဖိၪဆၧဎါ အဒိၩ့ဘၪလ့ၩ လၧပၥိၭလီၫ. ဆၧဖိၪ ဆၧဎါအခၪ့မံၪအီၪလၩ့ထးဘၪနးဘံၪ့အ့ၬ. အဂဲးဘဲၫ ယီၩပဘၪမၩန့ လၧဆၧလဖၪနီၪအကျၩ ဘဲၫၥိၭပမိမၩ ယဟိဝၩ, ပယွၩ, အဆၧမၩတၭ, ပဘၪမၩယဟိဝၩ နီၪအဆၧလၧဆၧနီၫလဲၪ နီၫလဲၪနီၪ ပလချႃၭထီၩ့ဒံၭ ဘၪထီးနီၪ, ပၥ့ၪယၫဒံၭအ့ၬ.",
			"27": "<sup>27</sup> ယဟိဝၩဒုၭနီၩ့ထၪ့ဖၫရိၫအၥၭတၭ, ဘဲၫၥိၭအမိ",
			"28": "<sup>28</sup> ကွဲၪဖျါဝ့ၫနီၪအၥၭအီၪအ့ၬ.- တၭဖၫရိၫစံၭအဝ့ၫ, စဲၪ့ ထၪ့ခွံၬ လၧယအီၪဆံၭ. ထီးလၩ့ နၥၭဆံၭ, ထီးယိ လၧၩ့ယမ့ၬလဂ့ၩ, အဂဲးဘဲၫယီၩ မုလနံၩ လၧနဒၪဘၪ",
			"29": "<sup>29</sup> ယမ့ၬနီၪနမိၥံၫလီၫ.- တၭစမိစ့ၭ စံၭဝ့ၫဒၪ, နချဲၩ့ဆၧ ဘၪယူၭ, ယမိယိဒီၭနမ့ၬ နးဖၧၫ့ဒီၭလၧၩ့အ့ၬ."
		},
		"11": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ယမိဒုၭဂဲၫထၪ့ဘၪဒံၭဖၫရိၫ ဒဲအံဇံၭ လၧဆၧနၭဆၧၡၪ့ လမံၩ့ဒံၭလီၫ. ဆၧနီၪအ လးခဲၫ့အဝ့ၫမိကွဲၪဖျါခွံၬနၥံၪ ထီးယီၩလီၫ. တၭထီး အကွဲၪဖျါနၥံၪနီၪ, မွဲအမိနၫ့ထၪ့ခွံၬတၡါနၥံၪ ထီးအ",
			"2": "<sup>2</sup> လူၬလီၫ.- တၭချဲၩ့ဆၧလၧၦခမျၧးအနါဖၧၩ့ဆံၭ. ၦမုၪ မွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ, မိအၪ့ကံၩ့ကယၧၩ့စ့ၩ, ဒဲကယၧၩ့ထီၫ့, လၧကယဲၦအီၪဝ့ၫ လၧအနဲၩ့ထံၭနီၪ ဆုၬဆုၬလီၫ.",
			"3": "<sup>3</sup> တၭယဟိဝၩဖ့ၪလၫ့ၦခမျၧး လၧဆၧအခိးအတၩလၧ ၦအံဇံၭဖိၪအမ့ၬယၫလီၫ. တၭစမိစ့ၭလဂၩနီၪ မွဲၦဒိၪ လၧခးအံဇံၭအဖၧၩ့, လၧဖၫရိၫအခ့ၫအၡၩ အမ့ၬယၫ, ဒဲလၧၦခမျၧးအမ့ၬယၫလီၫ.",
			"4": "<sup>4</sup> တၭစမိစ့ၭစံၭဝ့ၫဒၪ, ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ကဲမု နၩဖိၭဖၫ့မုအခၫနီၪ, ယမိလ့ၩထၪ့လၧအံဇံၭအကျၩ,",
			"5": "<sup>5</sup> တၭကယဲ ၦအဖိၪဝဲၡါ လၧခးအံဇံၭအဖၧၩ့ မိၥံၫဝ့ၫ, လၧဖၫရိၫလၧအဆၧၫ့နၩ့ လၧအလးဆီၩ့ဆီ အဖၫ့ခိၪ အဖိၪဝဲၡါ, ထီၩ့လၩ့လၧၦဎီးမုၪ လၧအအီၪဝ့ၫလၧဆုၪ့ ဂူၬအချိၫ့အဖိၪဝဲၡါ, ဒဲဆၧဖိၪဆၧဎါအဒိၩ့ အဖိၪဝဲၡါ",
			"6": "<sup>6</sup> ထီးအလူၬလီၫ.- တၭဆၧကိၭၡၭထၪ့ဖၭဒိၪ မိအီၪထၪ့ လၧခးအံဇံၭအဖၧၩ့လီၫ. ဆၧဘဲၫနီၪၥိၭ အီၪဒံၭ နး",
			"7": "<sup>7</sup> ဆိၭဒံၭအ့ၬ, ဒဲမိအီၪလၧၩ့နးဆိၭဆ့အ့ၬ.- တၭၦၡၩမွဲ ဂ့ၩ, ဆၧဖိၪဆၧဎါအဒိၩ့မွဲဂ့ၩ, ကယဲထွံၪလဒုၩ လဲၪ့ ထၪ့အဖျ့ၩ လၧၦအံၫစရ့လၭဖိၪ အအီၪနးဒုၩအ့ၬ. ဘဲၫ ၥိၭနၥံၪမိၥ့ၪယၫ လၧယဟိဝၩမၩလၩ့မဲၩ ၦအံၫစရ့လၭ",
			"8": "<sup>8</sup> ဖိၪလၧအံဇံၭဖိၪနီၪလီၫ.- တၭနခ့ၫနၡၩ ထီးအလူၬမိဂဲၫ လၩ့လၧယအီၪတၭ, မိထွံၩလၩ့လၧယမ့ၬယၫတၭ, မိ စံၭဝ့ၫ, စဲၪ့ထၪ့ခွံၬ, ဒဲၦခမျၧးလၧအဖိၬနခဲၫ့ ထီးအလူၬ နီၪဆံၭ. တၭလၧဆၧနီၪအလးခဲၫ့ ယမိစဲၪ့ထၪ့ခွံၬလီၫ. တၭအဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬ လၧဖၫရိၫအအီၪ, လၧအၥၭထၪ့ ခဲၩထၪ့ဝ့ၫနီၪလီၫ.",
			"9": "<sup>9</sup> တၭယဟိဝၩစံၭစမိစ့ၭ ဖၫရိၫလမိခိၭနၪဘၪနၥံၪအ လူဘဲၫၥိၭယဆၧလၩ့လၭ မိအၪထၪ့ လၧခးအံဇံၭအ",
			"10": "<sup>10</sup> ဖၧၩ့လီၫ.- တၭစမိစ့ၭဒဲစအၫရၧၫ့ မၩဆၧလၩ့လၭလဖၪ နီၪထီးအလူၬ လၧဖၫရိၫအမ့ၬယၫတၭ, ယဟိဝၩဒုၭ နီၩ့ထၪ့ဖၫရိၫအၥၭတၭ, အဝ့ၫနီၪကွဲၪဖျါခွံၬ ၦအံၫစရ့ လၭဖိၪ လၧအခးဖၧၩ့အ့ၬ."
		},
		"12": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဒုၪ့စမိစ့ၭ ဒဲစအၫရၧၫ့ လၧခးအံဇံၭအ",
			"2": "<sup>2</sup> ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,- လၩလဘံၪ့ယီၩ, မိကဲၪထၪ့လၩလ ဖၪအခိၪ, မွဲလၧနံၪ့အဖၧၩ့ လၩအခၪ့ထံၭ လၧနၥံၪအဂး လီၫ.",
			"3": "<sup>3</sup> ချဲၩ့ထၪ့နၥံၪ လၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီး အလူၬတၭ, စံၭ, လၩလဘံၪ့ယီၩ ထၪ့ဆံၫနံၩလနံၩနီၪ ၦဘၪအၪ့မၩန့ဝ့ၫ လၧၥိၪဒဲဘ့ၪအကျၩ အဖိၪလၧအဂး, လဂၩအဖိၪလဒုၩ, လဂၩအဖိၪလဒုၩ, ဘဲၫအဖါအဂံၪ့",
			"4": "<sup>4</sup> အၥိၭ, အဖိၪလဒုၩလၧဂံၪ့လဖျိၪ့အဂးနီၪလီၫ.- တၭၦ ဂံၪ့ဖိၪအ့ၪၡၩ လၧဆၧဖိၪလဒုၩအဂးတၭ, မွဲအဝ့ၫဒၪ ဒဲၦလၧအအီၪဘူၭ လၧအဂံၪ့နီၪ မၩန့ဝ့ၫဘဲၫၦၡၩအၥၭ အဆၧဝံအီၪဝ့ၫ အၥိၭနီၪဆံၭး နၥံၪဘၪဝံထၪ့နၬထၪ့ၦ ၡၩ ဘဲၫအနိၭအၪ့ဆၧအၥိၭ လၧဆၧအဖိၪအဂး ကိၭ",
			"5": "<sup>5</sup> ဂၩဒ့ၭလီၫ.- နၥံၪအဆၧဖိၪလဒုၩ ဘၪလၧၫ့ထၪ့ဎွ့ၩထၪ့, အဖၫလနံၪ့အဖိၪလီၫ. လၧၥိၪလဖၪအကျၩမွဲဂ့ၩ, လၧ",
			"6": "<sup>6</sup> ဘ့ၪလဖၪအကျၩမွဲဂ့ၩ, နၥံၪဘၪမၩန့ဝ့ၫလီၫ.- တၭန ၥံၪဘၪအီၪက့ၪခိၭထၬဝ့ၫ ထီၩ့လၧလၩထၪ့ လဆံၫလံ နံၩလနံၩ လၧလၩလဘံၪ့ဎးနီၪလီၫ. တၭၦအံၫစရ့လၭ အဆၧအီၪကီၪ့ထီးအလူၬနီၪ မိဘၪမၩၥံၫဝ့ၫ လၧမုဂၪ လၩ့နံၫဆၫ့အဘိၩ့ဆၧၩ့နီၪလီၫ.",
			"7": "<sup>7</sup> တၭအဝ့ၫၥံၪမိဘၪမၩန့အၥွံၪနီၪတၭ, အီၪက့ၪဝ့ၫလၧ တရၫ့အထုၪ့လီၩ့နီၪနံၫခီၫ, ဒဲလၧတရၫ့အခိၪထိၭ အ",
			"8": "<sup>8</sup> လီၩ့,ထီးဂံၪ့လဖၪ လၧအမိအၪ့ဝ့ၫနီၪလီၫ.- တၭဆၧ လၧမုလနၩနီၪ အဝ့ၫၥံၪမိဘၪအၪ့အယၪအၪ့ ကၪလၧ မ့ၪး ဒဲကိၪလအီၪဘၪလၧမံၪတၭ, မိဘၪအၪ့ဝ့ၫ လၧ",
			"9": "<sup>9</sup> ဆၧအခၪလီၫ.- ထီးအၪ့ၥံၫ့လဂ့ၩ, အၪ့ဎွံလၧထံၫလ ဂ့ၩးအၪ့ကၪလၧမ့ၪ, အခိၪ, ဒဲအခၪ့လဖၪ, ဒဲဆၧအီၪ",
			"10": "<sup>10</sup> လၧအအီၩ့ဖၧၩ့နီၪဆံၭ.- တၭထီးဒုၭအီၪလၩ့ထးထီး ဆၧဖၩ့ထၪ့နးဆံၭလဂ့ၩး တၭဆၧလၧအအီၪလၩ့ထး",
			"11": "<sup>11</sup> ထီၩ့လၧမုဂီၩနီၪ, နၥံၪဘၪဆူၭထၪ့ခွံၬ လၧမ့ၪလီၫ.- တၭ နၥံၪဘၪအၪ့ဝ့ၫဘဲၫယီၩ, လၧနၥံၪအယးဒံၩ့ ခဲးထူၬအ ၥၭ,နၥံၪအခၪ့ဖံၭအီၪ လၧနၥံၪအခၪ့လီၩ့, ဒဲနၥံၪအနိၪ ထိၭဘီၩ့လၧနၥံၪအစူၪဖၧၩ့လီၫ. တၭနၥံၪဘၪအၪ့ဝ့ၫ ချဲၫ့ချဲၫ့လီၫ. မွဲယဟိဝၩအဆၧလ့ၩဖၬလီၫ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩ ဆၧလနၩယီၩ, ယမိလ့ၩခၫ့ဂၬခးအံ ဇံၭတၭ, ယမိကျီၪ့ၥံၫခွံၬ ကယဲဆၧအဖိၪဝဲၡါ လၧခး အံဇံၭအဖၧၩ့ လၧၦၡၩထီၩ့လၩ့ လၧဆၧဖိၪဆၧဎါအ ဒိၩ့းဒဲအံဇံၭအယွၩၥံၪ ထီးအလူၬနီၪ, ယမိမၩဝ့ၫလၧ",
			"13": "<sup>13</sup> ဆၧစ့ၩရၫ့လီၫ. ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩလီၫ.- တၭ ဆၧၥွံၪနီၪမိကဲၪထၪ့ဆၧမၩနဲၪ့ လၧနၥံၪအဂး, ထီးဂံၪ့ အလီၩ့လၧနၥံၪအီၪလၧအဖၧၩ့နီၪ, ယမိဒၪဘၪဆၧၥွံၪ နီၪတၭ,ယမိလ့ၩဖၬနၥံၪ, ထီးယကျီၪ့ခွံၬ ခးအံဇံၭနီၪ, ဆၧၥံၫချဲၫ့ဘၪနၥံၪ လၧဆၧမၩဂၭဂီၩ့နီၪဆ့အ့ၬ.",
			"14": "<sup>14</sup> တၭဆၧလၧမုလနံၩယီၩ, မိကဲၪထၪ့ဆၧနၪ့ထၪ့ထဲၩ့ လၧနၥံၪအဂး, ဒဲနၥံၪဘၪထီးန့ဝ့ၫ လၧဆၧမၩဘိၪ့ယ ဟိဝၩမိလၩ့လၧနၥံၪ အဆၨၩအဆၬလီၫ. နၥံၪဘၪမၩ ဝ့ၫလၧဆၧမၩဘိၪ့အဂး လၧဆၧအထူၫအရူၫ အဆိၩ ဆိၩအကၠၪကၠၪလီၫ.",
			"15": "<sup>15</sup> နွ့ၫနံၩနီၪနၥံၪဘၪအၪ့ကိၪလၧ အလအီၪဘၪလၧမံၪနီၪ လီၫ. မုခၪ့ထံၭလနံၩနီၪဒၪလ့ၬ နၥံၪဘၪအီၪက့ၪခွံၬမံၪလၧ နၥံၪအဂံၪ့ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ၦလၧအအၪ့ကိၪအီၪ လၧမံၪလၧမုခၪ့ထံၭထီၩ့ လၧမုနွ့ၫနံၩလနံၩလဂၩဂၩနီၪ,",
			"16": "<sup>16</sup> မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧအံၫစရ့လၭလီၫ.- တၭလၧမု ခၪ့ထံၭနီၪဆၧကိၭကီၪ့ဆံၫ့ဎံၪ, ဒဲလၧမုနွ့ၫနံၩလနံၩနီၪ ဆၧကိၭကီၪ့ဆံၫ့ဎံၪ မိအီၪလၧနၥံၪအဂးလီၫ. ဆၧလဖၪ နီၪအထးဖၧၩ့နၥံၪမၩဘၪဆၧနးမံၩ့အ့ၬ. မၩကယဲဆၧ လၧၦဘၪအၪ့လမံၩ့လီၫ. အ့ၪမွဲဆၧနီၪလမံၩ့ မိဘၪမၩအ",
			"17": "<sup>17</sup> ၥၭလၧနၥံၪလီၫ.- တၭနၥံၪဘၪထီးန့ဆၧလၧကိၪလအီၪ ဘၪလၧမံၪနီၪလီၫ. အဂဲးဘဲၫယီၩ ဆၧလၧမုလနံၩယီၩ ယဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ အၥုၭမုလဖၪ လၧခးအံဇံၭအဖၧၩ့တၭ, နၥံၪဘၪထီးန့မုလနံၩယီၩ, လၧနၥံၪအဆၨၩအဆၬ",
			"18": "<sup>18</sup> လၧဆၧမၪလူၬ အဆိၩအကၠၪလီၫ.- ဆၧလၧအခၪ့ထံၭ နီၪ လၩထၪ့လဆံၫလံနံၩလနံၩ မုဂၪလၩ့နီၪ နၥံၪဘၪ အၪ့ကိၪလအီၪဘၪလၧမံၪ ထီၩ့လၧလၩထၪ့နံၫဆံၫလ",
			"19": "<sup>19</sup> နံၩလၧမုဂၪလၩ့နီၪလီၫ.- နွ့ၫနံၩအထးဖၧၩ့မံၪနီၪအီၪ ဘၪလၧနၥံၪအဂံၪ့ဖၧၩ့နးဆံၭအ့ၬ. အဂဲးဘဲၫယီၩက ယဲၦလၧအအၪ့ဆၧအီၪ လၧမံၪလဂၩလါလါနီၪ ၦလခီၫ ဘၩ့မုးဖိၪမွဲဂ့ၩ, ၦအီၪဖျဲၪလၧခးဖၧၩ့မွဲဂ့ၩ အဝ့ၫဒၪမိ ဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪ",
			"20": "<sup>20</sup> ကီၪ့နီၪလီၫ.- ဆၧအီၪလၧမံၪနီၪ နၥံၪအၪ့ဘၪနးမံၩ့အ့ၬ. နၥံၪဘၪအၪ့ကိၪလအီၪဘၪလၧမံၪ လၧနၥံၪအီၪအလး ကိၭစီၪ့ဒ့ၭလီၫ.",
			"21": "<sup>21</sup> တၭစမိစ့ၭကိၭန့ ၦအံၫစရ့လၭဖိၪအၥုၪ့က့ၭ ၥၭၡါ ထီးအလူၬတၭ, စံၭဝ့ၫ, မီၩ့ထၪ့ဒဲအၪ့မၩန့ဆၧ အဖိၪ လၧၥိၪဒဲဘ့ၪအကျၩ ဘဲၫနၥံၪအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ",
			"22": "<sup>22</sup> တၭ,မၩၥံၫဆၧလ့ၩဖၬဆံၭ.- တၭနၥံၪဘၪမၩန့ဟံစိၭ လထူတၭ, စုၪလၩ့လၧဆၧၥွံၪအကျၩ လၧလိးဖၧၩ့တၭ, ဖူၬဘၪတရၫ့အခိၪ ဒဲအထုၪ့လီၩ့နံၫခီၫ လၧဆၧၥွံၪအီၪ လၧလိၫ့ဖၧၩ့နီၪလီၫ. တၭဆၧလချႃၭဖၩ့ထၪ့ဒံၭဘၪကဲ ဂီၩနီၪ ၦစဲၪ့ထၪ့ခွံၬဘၪ လၧအဂံၪ့ဖၧၩ့ လၧခီၫ့နီၪနးဂၩ",
			"23": "<sup>23</sup> အ့ၬ.- တၭယဟိဝၩမိလ့ၩဖၬခွံၬ ဆၧဘဲၫၥိၭအမိကျီၪ့ ခွံၬၦအံဇံၭဖိၪတၭ, ထီးအဒၪဆၧၥွံၪ လၧတရၫ့အခိၪ ထိၭလီၩ့ဒဲလၧတရၫ့အထုၪ့နံၫခီၫအလီၩ့နီၪ, ယဟိဝၩ မိလ့ၩဖၬခွံၬတရၫ့နီၪတၭ, ဖ့ၪလၫ့ဆၧမၩဂၭဂီၩ့လ့ၩနုၬ",
			"24": "<sup>24</sup> လၧနၥံၪအဂံၪ့ဖၧၩ့, ဘဲၫၥိၭအမိကျီၪ့ခွံၬဆၧအ့ၬ.- တၭ နၥံၪဘၪထီးန့ဆၧလမံၩ့နီၪ လၧဆၧအထူၫအရူၫလၧန",
			"25": "<sup>25</sup> ဂးဒဲလၧနဖိၪနလံၩအဂး အဆိၩအကၠၪလီၫ.- တၭဆၧမိ မၩအၥၭထီးနၥံၪထီၩ့ လၧခးလဘံၪ့ လၧယဟိဝၩဖ့ၪ လၫ့နၥံၪ, ဘဲၫအစံၭဝ့ၫအၥိၭနီၪတၭ, နၥံၪဘၪထီးန့ဆၧ",
			"26": "<sup>26</sup> လမံၩ့ယီၩလီၫ.- တၭဆၧမိမၩအၥၭထီးနၥံၪအဖိၪအ လံၩစံၭနၥံၪ, ဆၧမၩလမံၩ့ယီၩနၥံၪမၩနီၪ မွဲအဂဲးဘဲၫ",
			"27": "<sup>27</sup> ၥ့ၪလဲၪ,- တၭနၥံၪဘၪစံၭ, အယီၩ, မွဲယဟိဝၩလ့ၩဖၬ ဆၧအဆၧလုထၪ့လီၫ. ထီးအကျီၪ့ခွံၬ ၦအံဇံၭဖိၪနီၪ, လ့ၩဖၬၦအံၫစရ့လၭဖိၪအဂံၪ့လဖၪ, လၧအံဇံၭအဖၧၩ့ တၭ,မၩဖီၩ့မၩဖျ့ၭ ပဂံၪ့လဖၪလီၫ. တၭၦခမျၧး ၡီၫ့ လၩ့အခိၪတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ဆၧလီၫ.",
			"28": "<sup>28</sup> ၦအံၫစရ့လၭဖိၪလ့ၩမၩဆၧ ဘဲၫယဟိဝၩ မၪလူၬ စမိစ့ၭဒဲစအၫရၧၫ့အၥိၭနီၪတၭ, မၩဝ့ၫဘဲၫနီၪၥိၭလီၫ.",
			"29": "<sup>29</sup> တၭဆၧ မၩအၥၭ လၧမုနၩဖိၭဖၫ့မုနီၪ ယဟိဝၩ ကျီၪ့ၥံၫခွံၬကယဲၦအဖိၪဝဲၡါ လၧခးအံဇံၭအဖၧၩ့, လၧ ဖၫရိၫလၧအဆၧၫ့နၩ့ လၧအလးဆီၩ့ဆီအဖၫ့ခိၪ အဖိၪ ဝဲၡါ, ထီၩ့လၩ့လၧၦဘၪဆၧဖီၪ့န့ဝ့ၫ, လၧအဘၪဆၧ ဒူၭထၬလၧထီၫ့ဖၧၩ့အဖိၪဝဲၡါ, ဒဲကယဲဆၧဖိၪဆၧဎါ",
			"30": "<sup>30</sup> အဒိၩ့ အဖိၪဝဲၡါ ထီးအလူၬလီၫ.- တၭဖၫရိၫဂဲထုၪ့ လၧမုနၩလခီၫ, အဝ့ၫဒၪဒဲအခ့ၫအၡၩထီးအလူၬ, ဒဲၦ အံဇံၭဖိၪထီးအလူၬတၭ, ဆၧဂၪ့ကိၭၡၭထၪ့ ဖၭဒိၪ အီၪဝ့ၫလၧခးအံဇံၭအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ဂံၪ့လၧ",
			"31": "<sup>31</sup> ၦလၥံၫဘၪလၧအဖၧၩ့နီၪ အီၪဝ့ၫနးဖျိၪ့အ့ၬ.- တၭအ ဆၧကိၭထဲၩ့စမိစ့ၭဒဲစအၫရၧၫ့ လၧမုနၩလခီၫတၭ, စံၭ ဝ့ၫဒၪ, ဂဲထုၪ့စဲၪ့ခွံၬလၧယၡၩခမျၧးအကျၩ, နၥံၪဝ့ၫမွဲ ဂ့ၩ, ၦအံၫစရ့လၭဖိၪမွဲဂ့ၩတၭ, လ့ၩမၩယဟိဝၩအ",
			"32": "<sup>32</sup> ဆၧဘဲၫနၥံၪစံၭယူၭနီၪဆံၭ.- တၭမၩန့နၥံၪအၥိၪ, ဒဲ ဘ့ၪဒဲနၥံၪအချီ ဘဲၫနၥံၪစံၭအၥိၭနီၪတၭ, စဲၪ့ထၪ့ခွံၬ တၭ,ဆိၪဂ့ၩယၧၩဆ့ဆံၭ.",
			"33": "<sup>33</sup> တၭၦအံဇံၭဖိၪမၩဆီၪ့ၦခမျၧး ဘဲၫၥိၭ အမိဒုၭစဲၪ့ ထၪ့ခွံၬချဲၫ့ချဲၫ့ လၧခးဖၧၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫ",
			"34": "<sup>34</sup> ၥံၪစံၭ, ပမွဲၦၥံၫထီးအလူၬလီၫ.- တၭၦခမျၧးအၪ့မၩန့ ကိၪအၥံၫ့, လၧအလချႃၭမၩဒံၭဘၪ လၧမံၪနီၪ, ဒဲအဆၧ အီၪလၩ့ထးအီၪဘီၪ့ထၬအၥၭ လၧအဖၬဘဲၩ့အဖၧၩ့",
			"35": "<sup>35</sup> လၧအခိၬထံၭခိၪနီၪလီၫ.- ၦအံၫစရ့လၭဖိၪမၩဝ့ၫဘဲၫ စမိစ့ၭ အလူအထၫအၥိၭတၭ, အၪ့ကံၩ့ကယၧၩ့စ့ၩ,",
			"36": "<sup>36</sup> ကယၧၩ့ထီၫ့ ဒဲအကီၩ့အၥိၭ လၧၦအံဇံၭဖိၪလီၫ.- တၭ ယဟိဝၩဖ့ၪလၫ့ၦခမျၧး လၧဆၧအခိးအတၩ လၧၦ အံဇံၭဖိၪအမ့ၬယၫတၭ, အဝ့ၫၥံၪအၪ့ကံၩ့ဆၧလီၫ. တၭအဝ့ၫၥံၪမၩန့ ၦအံဇံၭဖိၪအဆၧလီၫ.",
			"37": "<sup>37</sup> တၭၦအံၫစရ့လၭဖိၪ စဲၪ့ထၪ့ခွံၬ လၧဒိၩ့ရမံစံၭ,ထီၩ့ လၧစၧကီၭလီၫ. တၭလၧဖိၪဒံၩဖိၪၥၪ အမ့ၬယၫနီၪ, ၦၡၩန့ၫအခွၫ လၧအလ့ၩဆၧ လၧအခၪ့နီၪ အီၪဝ့ၫဎူၫ",
			"38": "<sup>38</sup> ကုၬယၫလီၫ.- တၭၦခမျၧးကျီၪမွံၩအၥၭ လ့ၩထၪ့ဆ့ လၧအဝ့ၫၥံၪအၥိၭ, ဒဲၥိၪဒဲဘ့ၪ, ဒဲချီလဖၪ, ဒဲဆၧဖိၪဆၧ",
			"39": "<sup>39</sup> ဎါအဒိၩ့အၪအၪလ့ၬလီၫ.- တၭအဝ့ၫၥံၪ ၥၪလၩ့ကိၪ အဘံၪ့ လၧအလအီၪဘၪ လၧမံၪကိၪအၥံၫ့ လၧအဂဲၫ ဆိၬဝ့ၫလၧခးအံဇံၭအဖၧၩ့လီၫ. မွဲအဘၪ ဆၧနၫ့ထၪ့ ခွံၬဝ့ၫ လၧအံဇံၭတၭ, အီၪဝ့ၫ လၥ့ၪဘၪနီၪ, တဲၩ့ဝဲၩ ဘၪဆၧအၪ့ လၧအဂးအ့ၬ.",
			"40": "<sup>40</sup> တၭၦအံၫစရ့လၭဖိၪ အီၪဝ့ၫအဆၧၫ့ အထီလၧအ အီၪ လၧအံဇံၭအဖၧၩ့နီၪ, မွဲအနံၪ့ လံယၩၥၧၫ့ဆံၫ",
			"41": "<sup>41</sup> လီၫ.- တၭလၧအနံၪ့လံယၩၥၧၫ့ဆံၫအထုၬနီၪ ဆၧမၩ အၥၭလၧမုလနံၩဎးနီၪ ယဟိဝၩ အၥုၭမု ထီးအလူၬ စဲၪ့ထၪ့ခွံၬဝ့ၫ လၧခးအံဇံၭလီၫ.",
			"42": "<sup>42</sup> မွဲမုနၩဘၪဆဲၫ့ လၧဆၧမိဘၪထီးနဲၪ့ လၧယဟိဝၩ အဂး လၧအဒုၭစဲၪ့ထၪ့ခွံၬ အဝ့ၫၥံၪ လၧခးအံဇံၭ အကၠီၩ့နီၪလီၫ. ဆၧလၧမုလနၩယီၩ, မိဘၪဆၧထီးနဲၪ့ ဝ့ၫလၧယဟိဝၩ အဂးလၧကယဲၦအံၫစရ့လၭ ဖိၪထီၩ့ လၩ့လၧအဆၨၩ အဆၬထီးအလူၬလီၫ.",
			"43": "<sup>43</sup> တၭယဟိဝၩစံၭစမိစ့ၭဒဲစအၫရၧၫ့း အယီၩ, မွဲဆၧ လ့ၩဖၬအထူၫအရူၫလီၫ. ၦလခီၫဘၩ့မုးဖိၪ အၪ့ဘၪ",
			"44": "<sup>44</sup> ဝ့ၫအ့ၬ.- တၭကယဲၦအဎီးအၡၩ လၧအဘၪဆၧဎွ့ၩ ဝ့ၫလၧစ့ၩ လဂၩလါလါနီၪ, နကူၭတရံၭထီးအဂီၩ့",
			"45": "<sup>45</sup> တၭ, မိအၪ့ဘၪဝ့ၫလီၫ.- အ့ၪမွဲၦမွံၩဒဲၦထိးအၪ့လံၩ့",
			"46": "<sup>46</sup> အၥၭအၪ့ ဘၪဆၧနီၪအ့ၬ.- မိဘၪအၪ့ဝ့ၫ လၧဂံၪ့လ ဖျိၪ့ဎးလီၫ. နဘၪဒုၭဆိၬထၪ့ခွံၬ ဆၧယၪလၧဂံၪ့ဖၧၩ့",
			"47": "<sup>47</sup> လၧခီၫ့အ့ၬ. ဒဲနၥံၪမၩခါဘၪအဎွံၪအ့ၬ.- ကယဲအံၫ",
			"48": "<sup>48</sup> စရ့လၭ အဆၧအီၪကီၪ့ဘၪထီးန့ဝ့ၫလီၫ.- တၭထီး ၦလခီၫ ဘၩ့မုးဖိၪ အီၪလၧနၥိၭတၭ, မိဘၪထီးန့ဆၧ လ့ၩဖၬလၧယဟိဝၩအဂးတၭ, အခွၫ လဖၪမွဲအဒိၭ ဆၧကူၭတရံၭကိၭဂၩဒ့ၭဆံၭ. ထီးနီၪလဖၧၫ့ မိဂဲၫဘူၭ ဒၪဝ့ၫဘဲၫၥိၭ အမိထီးန့ဝ့ၫဆံၭ. တၭမိကဲၪထၪ့ဝ့ၫဘဲၫ ၦလၧအအီၪဖျဲၪ လၧခးဖၧၩ့အၥိၭနီၪလီၫ. တၭၦလၧ အလဒိၭဘၪဆၧကူၭတရံၭနီၪ, အၪ့ ဘၪ ဝ့ၫ နး ဂၩ",
			"49": "<sup>49</sup> အ့ၬ.- ၦလၧအအီၪဖျဲၪဝ့ၫ လၧခးဖၧၩ့, ဒဲၦလခီၫဘၩ့ မုးဖိၪ လၧအအီၪလၧနၥံၪ အကျၩနီၪ မိအီၪ လၧဆၧ ၥနိၫလမံၩ့ဎးလီၫ.",
			"50": "<sup>50</sup> တၭၦအံၫစရ့လၭဖိၪထီးအလူၬ မၩဝ့ၫဘဲၫယဟိဝၩ မၪလူၬစမိစ့ၭ ဒဲစအၫရၧၫ့အၥိၭနီၪ, မၩဝ့ၫဘဲၫနီၪၥိၭ လီၫ.",
			"51": "<sup>51</sup> တၭဆၧမၩအၥၭ လၧမုလနံၩဎးနီၪ, ယဟိဝၩဒုၭ စဲၪ့ထၪ့ခွံၬအံၫစရ့လၭဖိၪ လၧအၥုၭမုလဖၪ လၧခးအံ ဇံၭအဖၧၩ့လီၫ."
		},
		"13": {
			"1": "<sup>1</sup> တၭယဟိဝၩ ချဲၩ့ဆၧလၧစမိစ့ၭ တၭ စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> အီၪက့ၪဆံၫ့ဎံၪ ကယဲဆၧအဝဲၡါထီးအလူၬ လၧယဂး ဆံၭ. ကယဲဆၧလၧအဝဲထၪ့ဆိၫဆၧဒၧၩ့လး လၧၦ အံၫစရ့လၭဖိၪအကျၩ, ၦၡၩမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါအ ဒိၩ့မွဲဂ့ၩ, မွဲယဆၧလီၫ.",
			"3": "<sup>3</sup> တၭစမိစ့ၭ စံၭၦခမျၧး, နၪ့ထၪ့ထဲၩ့မုလနံၩယီၩ, လၧ နၥံၪစဲၪ့ထၪ့ လၧခးအံဇံၭအဖၧၩ့, လၧၦဎီးဖိၪအဂံၪ့ ဖၧၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭစဲၪ့ထၪ့ခွံၬ နၥံၪလၧဆၧအလးယီၩ, လၧအစူၪဆီၪ့လီၫ. ကိၪအီၪ",
			"4": "<sup>4</sup> လၧမံၪနီၪထီးအၪ့လဂ့ၩ.- ဆၧလၧမုလနံၩယီၩ နၥံၪ",
			"5": "<sup>5</sup> စဲၪ့ထၪ့ခွံၬလၧလၩအၫဘံၭအဖၧၩ့လီၫ.- တၭထီးယ ဟိဝၩဒုၭဂဲၫနုၬနၧၩ လၧၦကၫနအၫ့ဖိၪ, ဒဲၦဟ့ၥၭဖိၪ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦဟံဝဲၭဖိၪ, ဒဲယ့ဘူၫဖိၪ အခးဖၧၩ့, လၧအဆိၪလၩ့အၥၭ လၧနဖါလဖၪ, လၧအမိဖ့ၪလၫ့ နၧၩ ခးလဘံၪ့ လၧအယွၩဝ့ၫ လၧဆၧနူထံၫ ဒဲန့ၫစၩ့ နီၪတၭ ဆၧမိမၩအၥၭ, လၧနၥံၪ ဘၪမၩ ဆၧ ယီၩ,",
			"6": "<sup>6</sup> လၧလၩ လဘံၪ့ယီၩအဖၧၩ့လီၫ.- နဘၪအၪ့ကိၪလ အီၪဘၪလၧ မံၪနီၪနွ့ၫနံၩတၭ, နွ့ၫနံၩလနံၩနီၪ မိအီၪ",
			"7": "<sup>7</sup> လၧဆၧမၩဘိၪ့ လၧယဟိဝၩလီၫ.- ၦဘၪ အၪ့ကိၪ လအီၪ ဘၪလၧမံၪနွ့ၫနံၩတၭ, မွဲကိၪလၧ အအီၪလၧ မံၪနီၪထီးအီၪလၧနၧၩ လဂ့ၩတၭ, မွဲဆၧ ထီးဒၪန့မံၪ",
			"8": "<sup>8</sup> လၧနလးလဖၪ နးစီၪ့လဂ့ၩ.- ဆၧလၧမုနံၩနီၪ, နဘၪ ဒုၭနဲၪနဖိၪခွၫတၭ, စံၭ, မွဲဆၧလၧယဟိဝၩ မၩယၧၩ",
			"9": "<sup>9</sup> လၧယဂဲၫစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭအဂဲးလီၫ.- တၭဆၧမိ ကဲၪထၪ့ဆၧမၩနဲၪ့ လၧနစူၪလီၩ့ ဒဲဆၧနၪ့ထၪ့ထဲၩ့လၧ နမ့ၬၥၪအဘိၩ့ဆၧၩ့, ဘဲၫၥိၭယဟိဝၩ အဆၧၥီၪ့ဆၧ ၥၫ့မိအီၪလၧနနိၭလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭစဲၪ့ ထၪ့ခွံၬနၧၩ လၧအံဇံၭအဖၧၩ့ လၧအစူၪဆီၪ့လီၫ.",
			"10": "<sup>10</sup> တၭနဘၪထီးန့ဆၧအထူၫအရူၫယီၩ, လနံၪ့ ဘၪလ နံၪ့လနံၪ့ဘၪလနံၪ့, လၧအဆၧၫ့အထီဒၪဝ့ၫလီၫ.",
			"11": "<sup>11</sup> တၭထီးယဟိဝၩ ဒုၭဂဲၫထၪ့နၧၩ လၧၦကၫနအၫ့ဖိၪ အခးဖၧၩ့ ဘဲၫအဆိၪလၩ့အၥၭလၧနၧၩ, ဒဲနဖါလဖၪ",
			"12": "<sup>12</sup> အၥိၭနီၪ, လၧအမိဖ့ၪလၫ့နၧၩတၭ,- ဆၧမိမၩအၥၭ လၧနဘၪအီၪက့ၪ ကယဲဆၧလၧအဝဲထၪ့ ဆိၫဒၧၩ့လး, ဒဲကယဲဆၧအဝဲၡါ လၧဆၧဖိၪဆၧဎါအဒိၩ့ လၧအအီၪ လၧနစူၪဖၧၩ့နီၪ လၧယဟိဝၩအဂးလီၫ. အဖၫလဖၪ",
			"13": "<sup>13</sup> မွဲယဟိဝၩအဆၧလီၫ.- တၭကယဲကၥ့ၪယီၩ့ဖိၪ အဝဲ ၡါလဒုၩလါလါနီၪ, နဘၪဎွ့ၩန့ထဲၩ့ လၧၥိၪဖိၪလဒုၩ လီၫ. တၭနအ့ၪလဎွ့ၩန့ထဲၩ့ဘၪဝ့ၫနီၪ, နဘၪဒၪ့ထ့ၬ အခိၬလီၫ. ကယဲၦၡၩအဝဲၡါ လၧနဖိၪလဖၪ အကျၩ နီၪနဘၪဎွ့ၩန့ထဲၩ့အဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ထီးနဖိၪခွၫအ့ၪအၪ့စၪ့နၧၩ ကဲခိၬနီၪတၭ, စံၭ, ဆၧ ယီၩမွဲဆၧနီၪလဲၪ. ဆၧမိမၩအၥၭ လၧနဘၪစံၭအဝ့ၫ, ယဟိဝၩ ဒုၭဂဲၫထၪ့ပၧၩ လၧအံဇံၭအဖၧၩ့, လၧၦဎီး",
			"15": "<sup>15</sup> ဖိၪအဂံၪ့ဖၧၩ့ လၧအစူၪဆီၪ့လီၫ.- ထီးဖၫရိၫမၩကၪ အၥၭ, ဘဲၫၥိၭအထီးကွဲၪဖျါပၧၩလဂ့ၩတၭ, ဆၧမၩ အၥၭလၧယဟိဝၩမၩၥံၫ ဆၧဝဲၡါ လၧခးအံဇံၭအဖၧၩ့ လၧၦၡၩအဖိၪဝဲၡါ ထီၩ့လၩ့လၧဆၧဖိၪဆၧဎါအဖိၪဝဲ ၡါလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယလုထၪ့ယဟိဝၩလၧ ကယဲဆၧအဖၫ လၧအဝဲထၪ့ဆိၫ ဆၧဒၧၩ့လးလီၫ.အ့ၪ မွဲဆၧအဝဲၡါ လၧယဖိၪၥံၪအကျၩနီၪ, ယဎွ့ၩန့ထဲၩ့ဝ့ၫ",
			"16": "<sup>16</sup> လီၫ.- တၭဆၧမိကဲၪထၪ့ဝ့ၫ လၧဆၧမၩနဲၪ့လၧနစူၪ လီၩ့နီၪ, ဒဲလၧဆၧကွ့ၭနဲၪ့ လၧနမ့ၬၥၪ အဘိၩ့ဆၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭစဲၪ့ထၪ့ခွံၬပၧၩ လၧခးအံ ဇံၭအဖၧၩ့ လၧအစူၪဆီၪ့လီၫ.",
			"17": "<sup>17</sup> ထီးဖၫရိၫကွဲၪဖျါခွံၬ ၦခမျၧးတၭ, ဆၧမၩအၥၭလၧ ၦဖလံၡၩဖိၪအခး အီၪဘူၭလါနၫ့တၭ, ယွၩၥိၫ့အဝ့ၫၥံၪ လၧခးနီၪအဖၧၩ့ၥၭအ့ၬ, အဂဲးဘဲၫယီၩ ယွၩစံၭဝ့ၫဒၪ, ထီးၦခမျၧးဒၪဘၪ ဆၧဒုၭဆၧယၩတၭ, မိနီၫ့ယါလၩ့ ထဲၩ့ဘၪခိၬ အၥၭတၭ, မိထဲၩ့ထဲၩ့ဘၪခိၬ လၧအံဇံၭ",
			"18": "<sup>18</sup> လီၫ.- တၭယွၩၥိၫ့ဝံၩ့ဝၩ့ၦခမျၧး လၧမံၩ့လၬကျၩဘၪ ဆဲၫ့လၧမၫဆမံၭအံဒၧၫ့လီၫ. တၭၦအံၫစရ့လၭဖိၪတဲၩ့ ဝဲၩအၥၭတၭ, စဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> တၭစမိစ့ၭအၪ့မၩန့စယိၥၭအဎွံၪ လၧအၥိၭ, အဂဲး ဘဲၫယီၩ အဝ့ၫဒၪဒုၭဆိၪလၩ့ ၦအံၫစရ့လၭဖိၪ အၥၭတ ၡါတၭ, စံၭဝ့ၫဒၪ, ယွၩမိဂဲၫအီၪၡီၩ့ နၥံၪတၡါၡါတၭ, န ၥံၪဘၪဆိၬထၪ့ခွံၬ ယဎွံၪလဖၪ လၧနၥံၪအၥိၭလီၫ.",
			"20": "<sup>20</sup> တၭအဝ့ၫၥံၪ စဲၪ့ထၪ့လၧစၧကီၭနီၪတၭ, ၥုၪ့အတဲၩ လၧအံၥၫ့အလး လၧမံၩ့လၬကျၩ အနဲၩ့ထံၭနီၪလီၫ.",
			"21": "<sup>21</sup> တၭလၧမုဆၫနီၪ ယဟိဝၩ လ့ၩလၧအဝ့ၫၥံၪအမ့ၬယၫ လၧဆၧအုၪ့အထုၪ့ ဘဲၫၥိၭအမိၥိၫ့ဝ့ၫ လၧဖၧၩ့ၥၭလီၫ. ဒဲလၧမုနၩနီၪ လၧမ့ၪအထုၪ့ ဘဲၫၥိၭအမိဒုၭဖၩ့ထၪ့ဆၧ လၧအဝ့ၫၥံၪအဂးနီၪ, လၧအမိလ့ၩဆၧလၧမုဆၫ, ဒဲလၧ",
			"22": "<sup>22</sup> မုနၩအဂးလီၫ.- တၭဆၧအုၪ့အထုၪ့ လၧမုဆၫလခီၫ မွဲဂ့ၩ, မ့ၪအထုၪ့လၧမုနၩလခီၫမွဲဂ့ၩ, မၩန့ခွံၬဝ့ၫလၧ ၦခမျၧးအမ့ၬယၫအ့ၬ."
		},
		"14": {
			"1": "<sup>1</sup> လီၩ ဘၪၦအံၫစရ့လၭဖိၪ ဘဲၫၥိၭအမိကၠၪအၥၭ, ဒဲၥုၪ့အတဲၩ လၧပဲၫဟဟဲရီၭ, လၧမံဂဒီၫလၭ ဒဲမၫဆမံၭ အဘိၩ့ ဆၧၩ့, လၧဘၫအလၭဇံၭဖိၫ့ အမ့ၬယၫနီၪဆံၭ. နၥံၪ ဘၪၥုၪ့တဲၩဆဲၫဎၩ့ လၧအလးနီၪ လၧမၫဆမံၭနဲၩ့နီၪ",
			"3": "<sup>3</sup> လီၫ.- အဂဲးဘဲၫယီၩ ဖၫရိၫမိစံၭ လၧၦအံၫစရ့လၭဖိၪ အဂဲးနီၪ, အဝ့ၫၥံၪအီၪကထံၬကထူၬ လၧခးဖၧၩ့ယူၭး မံၩ့လၬကျၩ ဖၭဒိၪနီၪ ကၭဘံၭထၬ အလးခဲၫ့ယူၭ.",
			"4": "<sup>4</sup> တၭယမိဒုၭနီၩ့ထၪ့ဖၫရိၫအၥၭတၭ, အဝ့ၫနီၪမိလီၩ့ဆီး အဝ့ၫၥံၪတၭ, ယမိဘၪ ဆၧလၩဆၧဖၩ့ လၧဖၫရိၫအ ကၠီၩ့, ဒဲလၧအၥုၭမုထီးအလူၬအကၠီၩ့တၭ, ၦအံဇံၭဖိၪ မိၥ့ၪယၫ လၧယမွဲယဟိဝၩလီၫ. တၭအဝ့ၫၥံၪမၩဘဲၫ နီၪၥိၭလီၫ.",
			"5": "<sup>5</sup> တၭၦဒုၭနဲၪအံဇံၭအစဎွၩ လၧၦခမျၧးစဲၪ့ထၪ့ခွံၬ ယူၭ. တၭဖၫရိၫအၥၭ ဒဲအခ့ၫအၡၩအၥၭ ထၫ့ဒုၪဒၩ ၦခမျၧးတၭ, စံၭဝ့ၫဒၪ, မွဲဘၪနီၫလၧပမၩဆၧယီၩ, လၧ ပကွဲၪဖျါခွံၬ ၦအံၫစရ့လၭဖိၪ လၧအမၩပဆၧနီၪလဲၪ.",
			"6": "<sup>6</sup> တၭအဝ့ၫဒၪတဲၩ့ဝဲၩ အလဲၪ့ၥုၭတၭ, အၪ့မၩန့အၡၩ",
			"7": "<sup>7</sup> ခမျၧးလၧအၥိၭလီၫ.- တၭမၩန့လဲၪ့ၥုၭ လၧဆၧရွံန့ဝ့ၫ ဎူၫယၩ, ဒဲကယဲအံဇံၭ အလဲၪ့ၥုၭၥံၪ, ဒဲၦၥုၭဖိၪလၧ",
			"8": "<sup>8</sup> လဲၪ့ၥံၪအခိၪ ကိၭဖျိၪ့ဒ့ၭအဂးလီၫ.- ယဟိဝၩဒုၭနီၩ့ ထၪ့အံဇံၭအစဎွၩ ဖၫရိၫအၥၭတၭ, အဝ့ၫဒၪလီၩ့ဆီး ၦအံၫစရ့လၭဖိၪလီၫ. တၭၦအံၫစရ့လၭဖိၪ စဲၪ့ထၪ့လၧ",
			"9": "<sup>9</sup> ဆၧအစူၪထၪ့ထီၫလီၫ.- အ့ၪမွဲၦအံဇံၭဖိၪ လီၩ့ဆီးဝ့ၫ, ကယဲဖၫရိၫအကၥ့ၪလဖၪ, ဒဲအလဲၪ့ၥုၭၥံၪ, ဒဲအၡၩ ထူၬကၥ့ၪ, ဒဲၥုၭမုခမျၧးတၭ, ချႃၭန့ဝ့ၫလၧအၥုၪ့တဲၩ အလးလၧမၫဆမံၭအနဲၩ့ လၧပဲၫဟဟဲရီၭအနဲၩ့ထံၭ လၧဘၫအလၭဇံၭဖိၫ့အမ့ၬယၫလီၫ.",
			"10": "<sup>10</sup> ထီးဖၫရိၫဂဲၫဘူၭတၭ, ၦအံၫစရ့လၭဖိၪယိထၪ့ဆၧ တၭ, ယိခွါ, ၦအံဇံၭဖိၪဂဲၫလီၩ့ဆီးဝ့ၫတၭ, အဝ့ၫၥံၪၥၭ မဲၪထၪ့ဝ့ၫဒိၪဒိၪလ့ၬတၭ, ၦအံၫစရ့လၭဖိၪကိၭထၪ့ယ",
			"11": "<sup>11</sup> ဟိဝၩလီၫ.- တၭအဝ့ၫၥံၪစံၭစမိစ့ၭ, မွဲဆၧၥွၪခိၪလအီၪ ဘၪလၧခးအံဇံၭအဖၧၩ့အကၠီၩ့နီၪ, နဂဲၫဆိၬထၪ့ခွံၬ ပၧၩဘဲၫၥိၭပမိၥံၫ လၧမံၩ့လၬကျၩယီၩဆ့ဧၪး မွဲဘၪနီၫ လၧနမၩပၧၩလၧဆၧယီၩ, လၧနဒုၭစဲၪ့ထၪ့ခွံၬပၧၩလၧ",
			"12": "<sup>12</sup> အံဇံၭအဖၧၩ့နီၪလဲၪ.- ဆၧချဲၩ့လၧပစံၭနၧၩလၧအံဇံၭ အဖၧၩ့နီၪ, မွဲအယီၩ, ပစံၭ, ဒုၭအီၪဒၪပၧၩဆံၭ, ဘဲၫၥိၭ ပမိမၩၦအံဇံၭဖိၪ အဆၧမၩနီၪမွဲအ့ၬဧၪ. အဂဲးဘဲၫ ယီၩပမၩ ၦအံဇံၭဖိၪအဆၧနီၪ ဂ့ၩနဲၪ့ဒံၭလၧပၥံၫလၧ မံၩ့လၬကျၩယီၩလီၫ.",
			"13": "<sup>13</sup> တၭစမိစ့ၭစံၭ ၦခမျၧးနီၪ ၥၭမဲၪလဂ့ၩ, အီၪဂုးအီၪ ခၧၫ့တၭ, ဒၪဘၪယဟိဝၩအဆၧမၩဖီၩ့မၩဖျ့ၭ လၧအ မိဒုၭနဲၪနၥံၪ လၧမုဆၫလနံၩယီၩဆံၭ. အဂဲးဘဲၫယီၩ ၦအံဇံၭဖိၪလဖၪ လၧနၥံၪဒၪဘၪ လၧမုဆၫလနံၩယီၩ, စူၩယၫအဆိၩဆိၩအကၠၪကၠၪ နၥံၪဒၪဘၪလၧၩ့အဝ့ၫ",
			"14": "<sup>14</sup> ၥံၪအ့ၬ.- ယဟိဝၩမိဒုၭဆၧ လၧနၥံၪအဂးတၭ, နၥံၪ မိဘၪအီၪလၩ့မါပံၭလီၫ.",
			"15": "<sup>15</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, မွဲဘၪနီၫလၫလၧနကိၭထၪ့ ယၧၩလဲၪ. စံၭၦအံစရ့လၭဖိၪ လၧအဘၪလ့ၩ လၧ",
			"16": "<sup>16</sup> ယၫလီၫ.- တၭနဝ့ၫဒၪယီၩ, ဆိၬထၪ့နနိၪထိၭဘီၩ့တၭ, ယၩ့ထၪ့နစူၪလၧ မၫဆမံၭအဖၫ့ခိၪတၭ, ဒုၭအၪ့နၩ့ဖၭ အဝ့ၫဆံၭ. တၭၦအံၫစရ့လၭဖိၪ မိလ့ၩဆၧလၧခီၫ့လၧ",
			"17": "<sup>17</sup> မၫဆမံၭအကျၩနီၪလီၫ.- တၭယဝ့ၫဒၪယီၩ, ယိခွါ, ယမိဒုၭနီၩ့ထၪ့ ၦအံဇံၭဖိၪအၥၭတၭ, အဝ့ၫၥံၪမိလီၩ့ ဆီးဝ့ၫလီၫ. တၭယမိဒိၭန့ဆၧလၩဆၧဖၩ့ လၧဖၫရိၫ အကၠီၩ့, ဒဲလၧအၥုၭမုခမျၧးထီးအလူၬအကၠီၩ့, ဒဲလၧ",
			"18": "<sup>18</sup> အၡၩထူၬကၥ့ၪလဖၪအကၠီၩ့လီၫ.- တၭထီးယအ့ၪ ဒိၭန့ယူၭဆၧလၩဖၩ့ လၧဖၫရိၫအကၠီၩ့, ဒဲအလဲၪ့ၥုၭ ၥံၪအကၠီၩ့, ဒဲလၧအၡၩထူၬ ကၥ့ၪလဖၪအကၠီၩ့တၭ, ၦ အံဇံၭဖိၪ မိၥ့ၪယၫ လၧယမွဲ ယဟိဝၩလီၫ.",
			"19": "<sup>19</sup> တၭယွၩအၥီၫ့ လၧအလ့ၩလၧၦအံစရ့လၭ ၥုၪ့တဲၩ အမ့ၬယၫနီၪ, ဂဲၫလၧအလးခဲၫ့, ဒဲဆၧအုၪ့အထုၪ့ၥုၭ ခွံၬအလး လၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, ဆၧၫ့ထုၪ့လၧအ",
			"20": "<sup>20</sup> လးခဲၫ့လီၫ.- တၭဂဲၫဝ့ၫလၧ ၦအံဇံၭဖိၪ ၥုၪ့တဲၩအလး ဒဲၦအံၫစရ့လၭဖိၪ ၥုၪ့တဲၩအဘိၩ့ဆၧၩ့တၭ, မွဲဆၧအုၪ့ ဒဲဆၧခံၭ လၧအဝ့ၫၥံၪအဂးလါနၫ့တၭ, ဖၩ့ထၪ့ဝ့ၫလၧ ၦလဖၪယီၩအဂး လၧမုနၩလီၫ. တၭၥၫ့နၩချီၩ့နီၪ, အ ဝ့ၫၥံၪ ဂဲၫဘူၭလိၬအၥၭအ့ၬ.",
			"21": "<sup>21</sup> စမိစ့ၭ ယၩ့ထၪ့အစူၪ လၧမၫဆမံၭ အဖၫ့ခိၪတၭ, ယဟိဝၩဒုၭဂဲၫထၪ့ လံၩဆီၪ့လၧမုထၪ့လခီၫ ၥၫ့နၩချီၩ့ နီၪ, ဒုၭထဲၩ့ထဲၩ့မၫဆမံၭ ထီးမၫဆမံၭ ကဲၪထၪ့ခီၫ့တၭ,",
			"22": "<sup>22</sup> ထံၫနီၪလၩ့ဖၭဝ့ၫဒၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪ လ့ၩ လၩ့လၧမၫဆမံၭအကျၩ လၧခီၫ့တၭ, ထံၫနီၪကဲၪထၪ့ ဆၧအဒီၪ့ လၧအစူၪထွ့ၪဒဲ လၧအစူၪစ့ၪ လၧအဝ့ၫၥံၪ အဂးလီၫ.",
			"23": "<sup>23</sup> ၦအံဇံၭဖိၪလဖၪ လီၩ့ဆီးအဝ့ၫၥံၪတၭ, လ့ၩနုၬဖိၬ အခဲၫ့လၧမၫဆမံၭအကျၩ, ကယဲဖၫရိၫအကၥ့ၪ ဒဲအ",
			"24": "<sup>24</sup> လဲၪ့ၥုၭၥံၪ, ဒဲၦထူၬကၥ့ၪထီးအလူၬလီၫ.- ဆၧမၩအ ၥၭလၧၦခိၭဆၧအထီ လၧမုဂီၩလခီၫနီၪ ယဟိဝၩယိ ဖျီၫ့မ့ၪဒဲဆၧအုၪ့အထုၪ့နီၪတၭ, ဒၪဘၪအံဇံၭအၡၩၥုၭ မုခမျၧးတၭ, မၩထံၬထၬၦအံဇံၭ အၥုၭမုခမျၧးနီၪ,",
			"25": "<sup>25</sup> ထုၭလၩ့ခွံၬဝ့ၫ အလဲၪ့ပၪတၭ, အဝ့ၫၥံၪလ့ၩဘုၭထံၬ ဘုၭထၬတၭ ၦအံဇံၭဖိၪစံၭဝ့ၫ, မွဲပစဲၪ့ခွံၬၡီၩ့လၧအံၫ စရ့လၭအမ့ၬယၫဆံၭ, အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭၥုၭ လၧအဝ့ၫၥံၪအဂးတၭ, ထၫ့ဒုၪဒၩၦအံဇံၭဖိၪ လခီၫ",
			"26": "<sup>26</sup> လီၫ.- တၭယဟိဝၩစံၭစမိစ့ၭ ယၩ့ထၪ့နစူၪလၧမၫဆ မံၭအဖၫ့ခိၪ ဘဲၫၥိၭထံၫလဖၪနီၪ မိဂဲၫထဲၩ့ကဒၩထဲၩ့ လၧၦအံဇံၭဖိၪအဖၫ့ခိၪ, လၧအလဲၪ့ၥုၭအဖၫ့ခိၪ, လၧ",
			"27": "<sup>27</sup> အၡၩထူၬကၥ့ၪအဖၫ့ခိၪနီၪဆံၭ.- စမိစ့ၭယၩ့ထၪ့အစူၪ လၧမၫဆမံၭအဖၫ့ခိၪတၭ, ထီးဆၧဖၩ့ထၪ့တၭ, မၫဆ မံၭနီၪဂဲၫထဲၩ့ထဲၩ့ဝ့ၫ လၧအဂဲးအဘၭတၭ, ၦအံဇံၭဖိၪ စဲၪ့ဝ့ၫလၧအမ့ၬယၫတၭ, ယဟိဝၩဒုၭချႃၬလၩ့ခွံၬ ၦ",
			"28": "<sup>28</sup> အံဇံၭဖိၪလၧမၫဆမံၭအဖၧၩ့နီၪလီၫ.- တၭထံၫလဖၪနီၪ ဂဲၫထဲၩ့ထဲၩ့တၭ, မၩလၩ့ဘၧၩ့ခွံၬ လဲၪ့ၥုၭၥံၪ, ဒဲၦထူၬ ကၥ့ၪ, ကယဲဖၫရိၫအၥုၭမုခမျၧးထီးအလူၬ လၧအဂဲၫ လီၩ့ဆီးအဝ့ၫၥံၪ လၧမၫဆမံၭဖၧၩ့နီၪလီၫ. အီၪလၩ့",
			"29": "<sup>29</sup> ထးဝ့ၫနးဂၩအ့ၬ.- အ့ၪမွဲၦအံၫစရ့လၭဖိၪ လ့ၩဆၧလၧ ခီၫ့လၧမၫဆမံၭအကျၩတၭ, ထံၫလဖၪနီၪ ကဲၪထၪ့ဆၧ အဒီၪ့လၧအစူၪထွ့ၪ ဒဲလၧအစူၪစ့ၪ လၧအဝ့ၫၥံၪအဂး လီၫ.",
			"30": "<sup>30</sup> တၭလၧမုလနံၩနီၪ ယဟိဝၩမၩဖီၩ့မၩဖျ့ၭၦအံၫ စရ့လၭဖိၪလၧၦအံဇံၭဖိၪ အစူၪဖၧၩ့လီၫ. တၭၦအံၫစရ့ လၭဒၪဘၪၦအံဇံၭဖိၪ လၧအၥံၫ လၧမၫဆမံၭနဲၩ့နီၪ လီၫ.",
			"31": "<sup>31</sup> တၭအံၫစရ့လၭ ဒၪဘၪ ဆၧမၩဖၭဒိၪ လၧယဟိဝၩ မၩၦအံဇံၭဖိၪတၭ, ၦခမျၧးၥၭမဲၪယဟိဝၩတၭ ဆူထဲၩ့ နဲၩထဲၩ့ ယဟိဝၩ ဒဲအခ့ၫအၡၩ စမိစ့ၭနီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စမိစ့ၭ ဒဲၦအံၫစရ့လၭဖိၪ ၥံၫကျံၩဆၧ ထၭခိၪယီၩ, လၧယဟိဝၩအဂဲးနီၪ, ချဲၩ့ဆၧတၭ, စံၭ ဝ့ၫဒၪး ယမိၥံၫကျံၩထၪ့ယဟိဝၩ, အကယးဒိၪအကဖးဒိၪအ ဂဲးနီၪတၭ, ကၥ့ၪဒဲၦထူၬကၥ့ၪနီၪ, မွဲအခွံၬလၩ့ခွံၬဝ့ၫ",
			"2": "<sup>2</sup> လၧမၫဆမံၭအဖၧၩ့လီၫ.- ယဂဲးယဘၭ ဒဲယဆၧၥံၫ ကျံၩယီၩ မွဲယဟိဝၩတၭကဲၪထၪ့ဝ့ၫ လၧဆၧမၩဖီၩ့ မၩဖျ့ၭယၧၩ, အဝ့ၫဒၪနီၪမွဲယယွၩတၭ, ယမိစံၭထၪ့ အၪ့အူၭ, မွဲယဖါလဖၪအယွၩတၭ, ယမိအီၪက့ၪထၪ့ ထီၫအဝ့ၫလီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩမွဲၦဒုၭၥုၭ, အမံၩ့မွဲယဟိဝၩတၭ ခွံၬလၩ့ ခွံၬဖၫရိၫ အလဲၪ့ၥုၭၥံၪ, ဒဲအၥုၭမုခမျၧး လၧမၫဆမံၭ",
			"4": "<sup>4</sup> ဖၧၩ့,- ဒဲအၥုၭဖိၪအခိၪ လၧအဘၪဆၧရွံန့ဝ့ၫလဖၪလၩ့",
			"5": "<sup>5</sup> အုၭၥံၫလၧမၫဆမံၭအံဒံၫ့အဖၧၩ့,- ဆၧယိၬ အထံၫမၩ ဘံၭမၩဘၧၩ့အဝ့ၫၥံၪ, မွဲအလၩ့ဒၭဝ့ၫဘဲၫလိးအၥိၭနီၪ",
			"6": "<sup>6</sup> လီၫ.- နစူၪထွ့ၪယဟိဝၩဧ့, အီၪလၧအကယးကဖးလၧ ဆၧအစီၩ့အမၩ့, နစူၪထွ့ၪ, ယဟိဝၩဧ့, မၩလၩ့ဘျ့ၭ",
			"7": "<sup>7</sup> ဆၧအဒုၪအဒၩ,- တၭနမၩဂၭဂီၩ့ခွံၬ ၦလၧအထၫ့ဒုၪ ဒၩနၧၩ လၧနကယးကဖးအဒိၪအထီၫနီၪ, နအၪ့မၧၫ့ လၩ့နဆၧၥၭထၪ့, လၧအအၪ့ခွံၬအဝ့ၫၥံၪ ဘဲၫလီခၫ့အ",
			"8": "<sup>8</sup> ၥိၭတၭ,- ထံၫအီၪကီၪ့လၧနနၫၡိၫထၪ့ခွံၬ ဆၧအကၠီၩ့ နီၪ,ထံၫလဖၪ ဆၧၫ့ထုၪ့ဘဲၫဆၧစီၩ့ထၪ့အၥိၭး ဆၧယိၬ",
			"9": "<sup>9</sup> အထံၫနီၩ့ထၪ့ လၧမၫဆမံၩ့အကျၩ,- ဆၧအဒုၪအဒၩ စံၭဝ့ၫ, ယမိလီၩ့ဆီးဝ့ၫတၭ, ယမိချႃၭန့ဝ့ၫ, ယမိအၪ့နၩ့ ဖၭဆၧအၪ့ဂူၬန့, ယၥၭမိမံၫ့လၧအဂဲး, ယမိထုၭထၪ့နၭ, ယစူၪမိမၩဂၭဂီၩ့ခွံၬ အဝ့ၫၥံၪလီၫ.",
			"10": "<sup>10</sup> နအူၪဆၧလၧနလံၩ, မၫဆမံၭမၩလၩ့ဘံၭခွံၬအဝ့ၫ ၥံၪတၭ, အဝ့ၫၥံၪလၩ့ဒၭဝ့ၫဘဲၫၡၬၥၧၫ့အၥိၭ လၧထံၫဖၭ",
			"11": "<sup>11</sup> ဒိၪအဖၧၩ့,- ယဟိဝၩဧ့, မွဲပလၫမိလၩ့ဂၬနၧၩ လၧကဆါ လဖၪအကျၩလဂၩလဲၪး မွဲပလၫ မိလၩ့ဂၬနၧၩ လ ဂၩလဲၪး အီၪလၧဆၧလၩဖၩ့ လၧဆၧဆံၫ့ဎံၪအဖၧၩ့, ဆၧၥၭမဲၪအလး လၧဆၧ စံၭထၪ့အၪ့အူၭအဖၧၩ့, မၩ ဆၧလၩ့လၭလဖၪလီၫ.",
			"12": "<sup>12</sup> နယၩ့ထၪ့နစူၪထွ့ၪတၭ, ဂၪ့ခိၪယုလၩ့ခွံၬအဝ့ၫၥံၪ, လီၫ. ၦခမျၧးလၧနဎွ့ၩန့ထဲၩ့နီၪ, နမီၩ့ထၪ့လၧနဆၧယၫ့",
			"13": "<sup>13</sup> ၥၭအဖၧၩ့,- နၥိၫ့အဝ့ၫၥံၪ လၧနဂဲးနဘၭ လၧနအီၪအ",
			"14": "<sup>14</sup> လးဆံၫ့ဎံၪလီၫ.- ၦခမျၧးမိနါဂၧၫ့, မိၥၭမဲၪဝ့ၫ, ဆၧၥၭ",
			"15": "<sup>15</sup> အုၭမိဖီၪ့ထၬ ၦဖလံၡၫဖိၪလီၫ.- ထီးနီၪလဖၧၫ့ ခးအံ ဒၧၫ့အစခၩ့လဖၪ မိထီၫမံၫထီၫမၪ, မိအၭအၦဒိၪလဖၪ နီၪ, ဆၧဝၭထိၬမိဖီၪ့ထၬအဝ့ၫၥံၪ, ၦကၫနအၫ့ဖိၪၥံၪမိ",
			"16": "<sup>16</sup> ဖံထၪ့ခွံၬဝ့ၫ ထီးအလူၬတၭ,- ဆၧၥၭမဲၪၥၭဖျဲၩ့မိဘၪအ ဝ့ၫၥံၪ, လၧနစူၪဒူၪအဒိၪအကၠီၩ့နီၪ အဝ့ၫၥံၪမိအီၪဂုး ဖုးဘဲၫလိးအၥိၭနီၪလီၫ. ထီးနၡၩခမျၧး ခၫ့ဂၬဆၧ, ယ ဟိဝၩဧ့, ထီးၦခမျၧး လၧနဎွ့ၩန့ထဲၩ့ဝ့ၫ မိခၫ့ဂၬယူၭဝ့ၫ",
			"17": "<sup>17</sup> လီၫ.- နမိဒုၭဂဲၫနုၬဝ့ၫ, ဒဲၥုၪ့လၩ့အဝ့ၫၥံၪ, လၧနဆၧန့ၥၫ အခိၪလီၩ့အလီၩ့, ထီးနအီၪက့ၪ လၧနအီၪအလး,ယ ဟိဝၩဧ့, ဆၧအလးဆံၫ့ဎံၪ, လၧနစူၪတဲၩ့ဝဲၩဝ့ၫ, ယဟိ",
			"18": "<sup>18</sup> ဝၩဧ့,- ယဟိဝၩ မိကဲၪစဎွၩ အဆိၩဆိၩအကၠၫကၠၫ လီၫ.",
			"19": "<sup>19</sup> အဂဲးဘဲၫယီၩ ဖၫရိၫအကၥ့ၪ ဒဲအလဲၪ့ၥုၭၥံၪ, ဒဲအ ၡၩထူၬကၥ့ၪလ့ၩနုၬ လၧမၫဆမံၭဖၧၩ့တၭ, ယဟိဝၩ ဒုၭဂဲၫထဲၩ့ဒီၭ မၫဆမံၭထံၫ လၧအဝ့ၫၥံၪ အဖၫ့ခိၪလီၫ. အ့ၪမွဲၦအံၫစရ့လၭဖိၪ လ့ၩလၧခီၫ့ လၧမၫဆမံၭအကျၩ နီၪလီၫ.",
			"20": "<sup>20</sup> တၭမီၪအမုၪစအၫရၧၫ့အထၧၫ့ဖုဝဲမုၪ, နးမံရအၫ့အၪ့ မၩန့ဖီၩ့ကုၭ လၧအစူၪဖၧၩ့တၭ, ၦမုၪထီးအလူၬ လ့ၩ ဖိၬထၪ့အခဲၫ့ လၧဖီၩ့ကုၭလဖၪ, ဒဲဆၧဂဲထုၪ့လံလီၫ.",
			"21": "<sup>21</sup> တၭနးမံရအၫ့စံၭဆၧၫ့အဝ့ၫၥံၪ, ၥံၫကျံၩထၪ့ယဟိဝၩ နီၪဆံၭ. မွဲအကယးဒိၪကဖးဒိၪအဂဲးလီၫ. အၥ့ၪဒဲၦ ထူၬကၥ့ၪနီၪ, အဝ့ၫဒၪခွံၬလၩ့ခွံၬ လၧမၫဆမံၭဖၧၩ့ လီၫ.",
			"22": "<sup>22</sup> တၭစမိစ့ၭဒုၭစဲၪ့ထၪ့ ၦအံၫစရ့လၭဖိၪ လၧမၫဆမံၭ အံဒၧၫ့တၭ, လ့ၩဝ့ၫလၧမံၩ့လၬကျၩၡၧၫတၭ, လ့ၩဝ့ၫ ၥၧၫ့နံၩဖၧၩ့ၥၭ လၧမံၩ့လၬကျၩနီၪတၭ, ဒၪန့ထံၫအ့ၬ.",
			"23": "<sup>23</sup> တၭအဝ့ၫၥံၪ ထီၩ့ဝ့ၫလၧမၫရၫတၭ, အီၩမၫရၫအထံၫ နီၪကဲၪအ့ၬ, အဂဲးဘဲၫယီၩ မွဲအခၪလီၫ. မၩအၥၭဘဲၫ",
			"24": "<sup>24</sup> နီၪတၭ, ကိၭဝ့ၫအမံၩ့လၧမၫရၫလီၫ.- တၭၦခမျၧးၥံၪ ၥူၭဝံၪၥူၭလၩ လၧစမိစ့ၭ အလီၩ့စံၭဝ့ၫဒၪ, မွဲပမိအီၩ",
			"25": "<sup>25</sup> ဆၧနီၪလဲၪ.- စမိစ့ၭကိၭထၪ့ယဟိဝၩတၭ, ယဟိဝၩ ဒုၭနဲၪအဝ့ၫ လၧၥံၪ့လထံၭလီၫ. အဝ့ၫဒၪ ခွံၬလၩ့ဝ့ၫ လၧထံၫကျၩတၭ, ထံၫနီၪဆၧၫ့ထၪ့ဝ့ၫဒၪလီၫ. ထီးနီၪ အီၪက့ၪလၩ့ၥနိၫ, ဒဲဆၧစ့ၩရၫ့လမံၩ့ လၧအဝ့ၫၥံၪအဂး",
			"26": "<sup>26</sup> တၭ,ထီးနီၪမၩယိခွါအဝ့ၫၥံၪလီၫ.- တၭစံၭဝ့ၫဒၪ နအ့ၪ ခိၭနၪယဟိဝၩနယွၩအလူ လၩ့ထံးလၩ့ဆ့ၭ, ဒဲမၩဆၧ တီၩဆၧလီၩ့ လၧအမ့ၬယၫ, ဒဲဒိၭနနါလၧအဆၧမၪလူၬ လဖၪ, ဒဲထီးန့ဖံၭထၬအၥနိၫလဖၪ ထီးအလူၬတၭ,ဆၧ စူၭဆၧဆၫလၧယဒုၭဘၪ ၦအံဇံၭဖိၪနီၪ, ယအီၪက့ၪ လၧနလီၩ့နးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ယမွဲယဟိဝၩလၧ အမၩဘျၪထဲၩ့နၧၩလီၫ.",
			"27": "<sup>27</sup> တၭအဝ့ၫၥံၪ ဂဲၫထီၩ့လၧအံလံၫ့, ထီးထံၫဖၧၩ့အီၪ လဆံၫနံၫဖၧၩ့, ဒဲစီၩ့မလီၫ့အထံၭအီၪ နွ့ၫဆံၫတၭ, အ ဝ့ၫၥံၪၥုၪ့အတဲၩ လၧထံၫဖၧၩ့အနဲၩ့ထံၭနီၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> တၭအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအံလံၫ့တၭ, လၧလၩနံၫ ဘံၪ့လဘံၪ့ လၩထၪ့လဆံၫယဲနံၩလနံၩ လၧအစဲၪ့ထၪ့ ခွံၬလၧခးအံဇံၭအလးခဲၫ့နီၪ, ၦအံၫစရ့လၭဖိၪအဆၧ အီၪကီၪ့ထီးအလူၬ ဂဲၫထီၩ့လၧမံၩ့လၬကျၩဇံၫ့, လၧ",
			"2": "<sup>2</sup> အအီၪလၧအံလံၫ့ဒဲစဲနၫအဘိၩ့ဆၧၩ့လီၫ.- တၭၦအံၫ စရ့လၭဖိၪ အဆၧအီၪကီၪ့ ထီးအလူၬ ၥူၭဝံၪၥူၭလၩ လၧစမိစ့ၭ, ဒဲစအၫရၧၫ့အလီၩ့ လၧမံၩ့လၬကျၩနီၪလီၫ.",
			"3": "<sup>3</sup> တၭၦအံၫစရ့လၭဖိၪ စံၭအဝ့ၫၥံၪ, လၧပဆၧၫ့နၩ့လၧ ဆၧယၪဖၧၩ့ၥၧၫ့အနဲၩ့ထံၭ, လၧပအၪ့ကိၪ ဘျဲၩအၪ့ နီၪ, မွဲပၥံၫလါပဝ့ၫလၧယဟိဝၩအစူၪ လၧခးအံဇံၭအ ဖၧၩ့နီၪ, ဂ့ၩဒၪဆၧဒံၭလီၫ. အဂဲးဘဲၫယီၩ နၥံၪဒုၭဂဲၫ ထၪ့ပၧၩလၧမံၩ့လၬကျၩယီၩ, ဘဲၫၥိၭနၥံၪမိဒုၭၥံၫခွံၬ ဆၧအီၪကီၪ့ထီးအလူၬ လၧဆၧၥၭဝံလၩ့ဒိၩလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩစံၭစမိစ့ၭ, ယိခွါ,ယမိဒုၭဂဲၫ ဆၧၩ့လၩ့ကိၪ လၧမူၭခိၪလၧနၥံၪအဂးတၭ, ၦခမျၧးမိ လ့ၩအၪ့ထုၫ့ထၪ့လနံၩ အဆၧလၧအဂးဒၪဝ့ၫ, လနံၩ လၧအဂးဒၪဝ့ၫ, အဝ့ၫၥံၪမိလ့ၩလၧယဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့ဧၪ, လလ့ၩဘၪဧၪနီၪ, ဘဲၫၥိၭယမိၥ့ၪယၫတၭ,",
			"5": "<sup>5</sup> ယမိမၩခွါအဝ့ၫၥံၪလီၫ.- ဎူၫနံၩလနံၩနီၪ ဆၧမိမၩအ ၥၭလၧအဝ့ၫၥံၪ ဘၪတဲၩ့ဝဲၩဆၧ လၧအဂဲၫထဲၩ့ဆိၬဝ့ၫ တၭ,မိဘၪအီၪအၪနဲၪ့ အအၪ့ထုၫ့ထၪ့ဝ့ၫလနံၩအဂး, လနံၩအဂးနီၪ, နံၫစၩလီၫ.",
			"6": "<sup>6</sup> တၭစမိစ့ၭ ဒဲစအၫရၧၫ့ စံၭၦအံၫစရ့လၭဖိၪ ထီးအ လူၬ,ကဲမုဂၪနီၪ, နၥံၪမိၥ့ၪယၫ လၧယဟိဝၩဒုၭစဲၪ့ထၪ့",
			"7": "<sup>7</sup> ခွံၬယူၭနၥံၪ လၧခးအံဇံၭအဖၧၩ့လီၫ.- တၭထီးဆၧဖၩ့ ထၪ့နီၪ နၥံၪမိဒၪဘၪယဟိဝၩအလၩအဖၩ့, လၧအနါ ဂၧၫ့နၥံၪၥူၭဝံၪၥူၭလၩဆၧ လၧယဟိဝၩ အလီၩ့အကၠီၩ့ နီၪလီၫ. တၭလၧနၥံၪၥူၭဝံၪၥူၭလၩဆၧ ထၫ့ဒုၪဒၩပၧၩ",
			"8": "<sup>8</sup> အကၠီၩ့ယီၩ, ပဝ့ၫဒၪပမွဲပလၫလဖၪလဲၪ.- တၭစမိစ့ၭ စံၭဝ့ၫဒၪ, မုဂၪလၩ့ယဟိဝၩမိဖ့ၪလၫ့နၥံၪ လၧဆၧယၪ လၧနၥံၪအၪ့ဆၧအဂးတၭ, ဆၧဖၩ့ထၪ့နီၪ ကိၪလၧန ၥံၪဘျဲၩအၪ့အဂး, လၧယဟိဝၩ နါဂၧၫ့နၥံၪၥူၭဝံၪၥူၭ လၩဆၧ, လၧနၥံၪၥူၭဝံၪၥူၭလၩ ဆၧလၧအနၫ့ဆါအ လီၩ့အကၠီၩ့လီၫ. တၭပဝ့ၫဒၪယီၩ, ပမွဲပလၫလဖၪလဲၪ. နၥံၪၥူၭဝံၪၥူၭလၩဆၧနီၪ ဘၪပၧၩအ့ၬ, မွဲအဘၪယဟိ",
			"9": "<sup>9</sup> ဝၩလခီၫလီၫ.- တၭစမိစ့ၭစံၭစအၫရၧၫ့, လီၩဘၪၦအံၫ စရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬ, ၥုၭဘူၭနၥံၪအ ၥၭလၧယဟိဝၩအမ့ၬယၫဆံၭ. အဂဲးဘဲၫယီၩ နၥံၪၥူၭ ဝံၪၥူၭလၩဆၧနီၪ မွဲအနါဂၧၫ့ယူၭဝ့ၫယူၭ.",
			"10": "<sup>10</sup> ဆၧမၩအၥၭ လၧစအၫရၧၫ့ချဲၩ့ဆၧ လၧၦအံၫစရ့လၭ ဖိၪအဆၧအီၪကီၪ့ ထီးအလူၬအထီနီၪတၭ, အဝ့ၫၥံၪယိ စိၩဆၧလၧမံၩ့လၬကျၩတၭ, ယိခွါ, ယဟိဝၩအလၩ",
			"11": "<sup>11</sup> အဖၩ့ဖျီၪထၪ့ဝ့ၫ လၧဆၧအုၪ့အလီၩ့နီၪလီၫ.- ယဟိဝၩ ချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ၦအံၫစရ့လၭဖိၪၥူၭ",
			"12": "<sup>12</sup> ဝံၪၥူၭလၩဆၧနီၪ ယနါဂၧၫ့ယူၭ.- လီၩဘၪအဝ့ၫၥံၪ တၭ,စံၭ, ထီးမုဂၪလၩ့နီၪ, နၥံၪမိအၪ့ဆၧယၪတၭ, ဆၧ ဖၩ့ထၪ့လခီၫနီၪ နၥံၪမိဘျဲၩအၪ့လၧကိၪလီၫ. တၭနၥံၪ မိၥ့ၪယၫလၧ ယမွဲ ယဟိဝၩ နၥံၪအယွၩလီၫ.",
			"13": "<sup>13</sup> ဆၧမၩအၥၭ လၧမုဂၪလၩ့နီၪ, ထိၪဝံၪဂဲၫထၪ့တၭ, မၩဘံၭခွံၬ ၦၥုၪ့တဲၩအလးတၭး လၧဆၧဖၩ့ထၪ့နီၪ,",
			"14": "<sup>14</sup> ဆၩ့ထံၫအီၪဝၬဖီၩ့ အတဲၩအလးလီၫ.- ထီးဆၩ့ထံၫၥွံၪ ထၪ့ဝ့ၫတၭ, ယိခွါ, ဆၧဖျိၪ့လွံၩပွံၪအီၪဝ့ၫ လၧမံၩ့လၬ ကျၩအလး, ဘဲၫဆၩ့ထံၫလၩ့ဒၭ လၧဂၪ့ခိၪ အၥိၭနီၪ",
			"15": "<sup>15</sup> လီၫ.-တၭထီးၦအံၫစရ့လၭဖိၪဒၪဘၪတၭ, စံၭလိၬအ ၥၭလဂၩဒဲလဂၩ, ဆၧယီၩမွဲဆၧနီၪလဲၪ, အဂဲးဘဲၫယီၩ မွဲဆၧနီၪလဲၪနီၪ, ၥ့ၪယၫဝ့ၫဒၪအ့ၬ. တၭစမိစ့ၭစံၭဝ့ၫ, အယီၩ, မွဲကိၪလၧယဟိဝၩဖ့ၪလၫ့ လၧနၥံၪအၪ့အဂး",
			"16": "<sup>16</sup> နီၪလီၫ.- တၭအယီၩ, မွဲဆၧလၧယဟိဝၩမၪလူၬ, အၪ့ ထုၫ့ထၪ့န့ဘဲၫအအၪ့ဆၧအၥိၭ လဂၩအဂးလအိမၧၫ, (ဘဲၫပစံၭဆၧအၥိၭလတလိၭ) လဂၩအဂးလအိမၧၫ နီၪ ဆုၬဆုၬဆံၭ. အၪ့မၩန့ဆၧ ဘဲၫဆၧဝံဆၧနၬထၪ့ ၦၡၩအီၪဝ့ၫ လၧအတဲၩဖၧၩ့အၥိၭနီၪ ဆုၬဆုၬဆံၭ.",
			"17": "<sup>17</sup> ၦအံၫစရ့လၭဖိၪ မၩဝ့ၫဘဲၫနီၪတၭ, အၪ့ထုၫ့ထၪ့န့ဆၧ,",
			"18": "<sup>18</sup> အၪလနၩ့ၡၩလနၩ့လီၫ.- တၭတိၪ့ဝ့ၫလအိမၧၫ (တ လိၭ) လဖျိၪ့တၭ, ၦလၧအအၪ့ထုၫ့ထၪ့န့ ဆၧအၪလ ဂၩနီၪအဆၧအီၪဘျဲၪအ့ၬ. တၭၦလၧအအၪ့ထုၫ့ထၪ့ န့ဆၧၡၩလဂၩနီၪ, အဆၧၡၩလၨၪအ့ၬၦအၪ့ထုၫ့န့",
			"19": "<sup>19</sup> ဆၧဘဲၫအအၪ့ဝ့ၫအၥိၭ ဆုၬဆုၬလီၫ.- တၭစမိစ့ၭစံၭ ဝ့ၫဒၪ,ၦထီးအီၪက့ၪလၩ့ထး ထီးဆၧဖၩ့ထၪ့နးဆံၭလ",
			"20": "<sup>20</sup> ဂ့ၩ.- တၭအဝ့ၫၥံၪခိၭနၪစမိစ့ၭအလူအ့ၬး တၭၦလနၩ့ နၩ့လၧအကျၩအီၪက့ၪဝ့ၫ ထီးဆၧဖၩ့ထၪ့တၭ, လိၪ့အီၪ ထၪ့လၧအဖၧၩ့ဒဲနၧၫ့အုၪဝ့ၫတၭ, စမိစ့ၭၥၭထၪ့အဝ့ၫ",
			"21": "<sup>21</sup> ၥံၪလီၫ.- တၭၦအၪ့ထုၫ့ဝ့ၫကိၭဂီၩဒ့ၭ ဘဲၫအအၪ့ဆၧ အၥိၭ, လဂၩဘဲၫအအၪ့ဆၧအၥိၭလီၫ. ထီးဆၧခိထၪ့ တၭ, ဖံထၪ့ခွံၬဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> တၭလၧဎူၫနံၩလနံၩနီၪ ဆၧမၩအၥၭ လၧၦအၪ့ထုၫ့ ကီၪ့နံၫအိမၧၫ (နံၫတလိၭ) မွဲလၧလဂၩအဂးအၪ့နဲၪ့ အလးနံၫစၩလီၫ. တၭဆၧအီၪကီၪ့အၦဒိၪ ထီးအလူၬ",
			"23": "<sup>23</sup> ဂဲၫလီၩဘၪစမိစ့ၭနီၪလီၫ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, အယီၩမွဲဆၧလၧယဟိဝၩ လီၩဘၪဝ့ၫ, ကဲဂီၩခိၬလနံၩ နီၪမွဲမးၥံၫအနံၩ, ဆၧအီၩပွံၭဆံၫ့ဎံၪ လၧယဟိဝၩအ ဂးတၭ, ဆၧလၧနၥံၪမိအၪ့ဎိၪနီၪ အၪ့ဎိၪဆံၭ. တၭဆၧ လၧနၥံၪမိအၪ့ဎွံနီၪအၪ့ဎွံဆံၭ. တၭဆၧလၧအအီၪလၩ့ ထးနီၪ အီၪက့ၪလၧနၥံၪအဂး ဘဲၫၥိၭအမိအီၪထီးဆၧ",
			"24": "<sup>24</sup> ဖၩ့ထၪ့ဆံၭ.- တၭအဝ့ၫၥံၪ အီၪက့ၪဝ့ၫထီးဆၧဖၩ့ထၪ့ ဘဲၫစမိစ့ၭမၪလူၬဝ့ၫအၥိၭနီၪတၭ, နၧၫ့အုၪလၧၩ့အ့ၬ,",
			"25": "<sup>25</sup> ဒဲလိၪ့အီၪလၧအဖၧၩ့နးဘီၩ့ဆ့အ့ၬ.- တၭစမိစ့ၭစံၭဝ့ၫ ဒၪ,အၪ့ဆၧနီၪ လၧမုလနံၩယီၩ, အဂဲးဘဲၫယီၩမွဲမးၥံၫ အနံၩ လၧယဟိဝၩအဂးလီၫ. လၧမုဆၫလနံၩယီၩ,",
			"26": "<sup>26</sup> နၥံၪဒၪဘၪလၧၩ့ဆၧနီၪ လၧဆၧပျၩ့ဖၧၩ့အ့ၬ.- နၥံၪဘၪ အၪ့ထုၫ့ထၪ့ဝ့ၫ ဎူၫနံၩလီၫ. အ့ၪမွဲမုနွ့ၫနံၩလနံၩ, မးၥံၫ",
			"27": "<sup>27</sup> အနံၩနီၪ, အီၪဘၪနးဆံၭအ့ၬ.- တၭဆၧမၩအၥၭလၧ ၦလနၩ့နၩ့ လ့ၩထၪ့ဝ့ၫ လၧမုနွ့ၫနံၩလနံၩ ဘဲၫၥိၭအမိ",
			"28": "<sup>28</sup> အၪ့ထုၫ့ဆၧတၭ, ဒၪန့ဝ့ၫအ့ၬ.- တၭယဟိဝၩစံၭစမိစ့ၭ, မွဲနၥံၪလခိၭနၪဘၪ ယဆၧမၪလူၬလဖၪနီၪ, နၥံၪမိဂဲး",
			"29": "<sup>29</sup> လိၬဆံၭယံၬလဲၪ.- ယိခွါ, မွဲယဟိဝၩ ဖ့ၪလၫ့နၥံၪလၧ မးၥံၫအနံၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, လၧမုဎူၫနံၩလ နံၩနီၪဖ့ၪလၫ့နၥံၪ အကိၪလၧနံၫနံၩအဂးလီၫ. မွဲၦၡၩ အီၪလၧအအီၪအလးဆံၭ. မွဲၦထီးစဲၪ့ထၪ့ လၧမုနွ့ၫ",
			"30": "<sup>30</sup> နံၩနီၪနးဂၩလဂ့ၩ.- တၭၦခမျၧးအီၪပွံၭဝ့ၫ လၧမုနွ့ၫနံၩ",
			"31": "<sup>31</sup> နီၪလီၫ.- တၭၦအံၫစရ့လၭအဂံၪ့ဖိၪ ကိၭဆၧနီၪအမံၩ့ လၧမၪ့နၫလီၫ. တၭမၩအၥၭဘဲၫနၪ့နၪ့အချံၫအၥိၭဘွၩ ဝ့ၫတၭ, ၦထဲးယိနီၪ, မၩအၥၭဘဲၫကိၪအပၪပဲၪလၧအ အီၪလၧန့ၫစၩ့အၥိၭနီၪလီၫ.",
			"32": "<sup>32</sup> တၭစမိစ့ၭစံၭဝ့ၫ, အဝ့ၫဒၪယီၩ, မွဲဆၧလၧယဟိဝၩ မၪလူၬဝ့ၫ, မၩဎွ့ၩထၪ့လအိမၧၫ (တလိၭ) လဖျိၪ့လၧ ဆၧယီၩဘဲၫၥိၭဆၧမိအီၪက့ၪထၬ လၧနၥံၪအဆၨၩအ ဆၬအဂး, ဘဲၫၥိၭအမိဒၪဘၪကိၪ လၧယဒုၭအၪ့နၥံၪ လၧမံၩ့လၬကျၩနီၪ, လၧယဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးအံ",
			"33": "<sup>33</sup> ဇံၭအဖၧၩ့နီၪလီၫ.- တၭစမိစ့ၭစံၭစအၫရၧၫ့, အၪ့မၩ န့ဖၧၩ့လဖျိၪ့တၭ, ဒုၭနုၬမၪ့နၫလအိမၧၫ (တလိၭ) လၧ အဖၧၩ့တၭ, အီၪက့ၪလၧယဟိဝၩအမ့ၬယၫ လၧဆၧမိ",
			"34": "<sup>34</sup> အီၪက့ၪထၬလၧနၥံၪ အဆၨၩအဆၬအဂးနီၪဆံၭ.- ဘဲၫ ယဟိဝၩ မၪလူၬစမိစ့ၭအၥိၭနီၪ, စအၫရၧၫ့အီၪက့ၪ ဝ့ၫလၧဆၧအုၩ့လၩ့ အမ့ၬယၫ, ဘဲၫအမိဘၪဆၧအီၪ",
			"35": "<sup>35</sup> က့ၪထၬဝ့ၫအၥိၭလီၫ.- တၭၦအံၫစရ့လၭဖိၪ အၪ့မၪ့ နၫအနံၪ့လံဆံၫ ထီးအထီၩ့လၧခးလဘံၪ့ အီၪလၧၦၡၩ ၥံၪလီၫ. မွဲအအၪ့မၪ့နၫ ထီးအထီၩ့ လၧခးကၫနအၫ့",
			"36": "<sup>36</sup> အနဲၩ့ထံၭနီၪလီၫ.- တၭဆၧလၧအိမၧၫ (တလိၭ) လ ဖျိၪ့နီၪမွဲအန့ၫဎီၩ့ လၧအ့ဖၭဆံၫပိၩ့လပိၩ့လီၫ."
		},
		"17": {
			"1": "<sup>1</sup> တၭကယဲ ၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအ လူၬစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧမံၩ့လၬကျၩဇံၫ့အဖၧၩ့, ဘဲၫအ လ့ၩဆၧအၥိၭ ထီးဒၪယဟိဝၩမၪလူၬဝ့ၫနီၪတၭ, ၥုၪ့ အတဲၩလၧရဖံဒံၫ့အဖၧၩ့တၭ, ထံၫလၧၦခမျၧးမိအီၩဝ့ၫ",
			"2": "<sup>2</sup> အဂးနီၪအီၪအ့ၬ.- ၦခမျၧးအဲၪ့လိၬစမိစ့ၭတၭ, စံၭဝ့ၫ ဒၪ,ဖ့ၪလၫ့ပၧၩလၧထံၫဘဲၫၥိၭပမိအီၩဆံၭ. တၭစမိစ့ၭ စံၭအဝ့ၫၥံၪမွဲဘၪနီၫ လၧနၥံၪအဲၪ့လိၬယၧၩလဲၪး တၭ",
			"3": "<sup>3</sup> နၥံၪကျဲၩ့ဖစီၩ့ ယဟိဝၩနီၪမွဲဘၪလဲၪ.- ၦခမျၧးၥံၪၥၭဝံ အၥၭလၧထံၫထီးနီၪတၭ, ၦခမျၧးၥူၭဝံၪၥူၭလၩထၫ့ဒုၪ ဒၩစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ဆၧယီၩမွဲဘၪနီၫလၧနဒုၭစဲၪ့ ထၪ့ခွံၬပၧၩ လၧအံဇံၭအဖၧၩ့ ဘဲၫၥိၭနမိမၩၥံၫပၧၩ ဒဲပဖိၪပလံၩ, ဒဲပဆၧဖိၪဆၧဎါအဒိၩ့ လၧဆၧၥၭဝံအ ၥၭလၧထံၫနီၪလဲၪ.",
			"4": "<sup>4</sup> စမိစ့ၭကိၭထၪ့ယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, ယမိမၩၦ ခမျၧးယီၩဘဲၫၥ့ၪလဲၪ, ဘူၭလၧအဝ့ၫၥံၪ မိခွံၬယၧၩလၧ",
			"5": "<sup>5</sup> လိးလီၫ.- ယွၩစံၭစမိစ့ၭ, လ့ၩလၧၦခမျၧးအမ့ၬယၫ တၭ, အၪ့မၩန့ၦၡၩ လၧအံၫစရ့လၭ အၥုၪ့က့ၭၥၭၡါ အကျၩလနၩ့တၭ, မၩန့ထၪ့နနိၪထိၭဘီၩ့ လၧနဒိၪထံၫ",
			"6": "<sup>6</sup> မိၡါနီၪ လၧနစူၪဖၧၩ့တၭ, လ့ၩဆၧဆံၭ.- ယိခွါ, ယမိ ဆၧၫ့ထုၪ့ လၧနမ့ၬယၫထီးနီၪ, ထီးလိးအဖၫ့ခိၪ လၧ ဟိရ့ၭအလီၩ့တၭ, နဘၪဒိၪလိးနီၪတၭ, ထံၫမိဂဲၫထၪ့ လၧအဖၧၩ့, ဘဲၫၦခမျၧးမိအီၩဝ့ၫအၥိၭလီၫ. တၭစမိစ့ၭ မၩဝ့ၫဘဲၫနီၪ လၧအံၫစရ့လၭ အၥုၪ့က့ၭၥၭၡါၥံၪအ",
			"7": "<sup>7</sup> မ့ၬယၫလီၫ.- တၭဆၧအလးနီၪ ကိၭဝ့ၫအမံၩ့ မၭစၫဒဲ မ့ၫရဘၫ, လၧၦအံၫစရ့လၭဖိၪ အဆၧအဲၪ့လိၬအၥၭ အကၠီၩ့,ဒဲလၧအကျဲၩ့ဖစီၩ့ ယဟိဝၩအကၠီၩ့ထီးအစံၭယ ယဟိဝၩအီၪလၧပကျၩ, လအီၪဘၪလဲၪနီၪလီၫ.",
			"8": "<sup>8</sup> တၭၦအၫမလ့ၭဖိၪဂဲၫဒုၭၥုၭ လၧအံၫစရ့လၭလၧရ",
			"9": "<sup>9</sup> ဖံဒံၫ့အဖၧၩ့နီၪလီၫ.- တၭစမိစ့ၭစံၭ စယီရှုၫအ့ၫရွံန့ၦ ၡၩလဖၪ လၧပဂးတၭ, လ့ၩထၪ့ဒုၭၥုၭ လၧၦအၫမလ့ၭ ဖိၪနီၪဆံၭ. တၭကဲဂီၩခိၬ ယမိအီၪဆၧၫ့ထုၪ့ လၧခိၪ လီၩ့အဒၩ့ခိၪနီၪ အီၪလၧယွၩအနိၪထိၭဘီၩ့ လၧယစူၪ",
			"10": "<sup>10</sup> ဖၧၩ့လီၫ.- တၭစယီရှုၫအ့ၫနီၪ မၩဝ့ၫဘဲၫစမိစ့ၭမၪလူၬ ဝ့ၫအၥိၭတၭ, ဒုၭၥုၭလၧၦအၫမလ့ၭဖိၪနီၪ စမိစ့ၭ, ဒဲ စအၫ့ရၧၫ့, ဒဲစဟၧၫ လ့ၩထၪ့လၧခိၪလီၩ့ အဒၩ့ခိၪနီၪ",
			"11": "<sup>11</sup> လီၫ.- တၭထီးစမိစ့ၭယူၬထၪ့အစူၪတၭ, ဆၧမၩအၥၭ လၧအံၫစရ့လၭ မၩနၧၩ့ဆၧတၭ, ထီးအအီၪက့ၪလၩ့",
			"12": "<sup>12</sup> ထဲၩ့အစူၪတၭ, ၦအၫမလ့ၭဖိၪမၩနၧၩ့ဝ့ၫလီၫ.- စမိစ့ၭ အစူၪၡၪတၭ, အဝ့ၫၥံၪမၩန့လိးလဖျိၪ့တၭ, အီၪက့ၪ လၩ့ဝ့ၫလၧ အဖၫ့လၬတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧအဖၫ့ခိၪနီၪ, စအၫရၧၫ့ဒဲစဟၧၫနံၫဂၩ ဆိၬထၪ့ဆၧၩ့ အစူၪလဂၩလ ခီၫလဂၩလခီၫ တၭအစူၪအီၪဂုးအီၪခၧၫ့ဝ့ၫ ထီးမုလၩ့",
			"13": "<sup>13</sup> နုၬလီၫ.- တၭစယီရှုၫအ့ၫမၩနၧၩ့မၩစၪ ၦအၫမလ့ၭဖိၪ",
			"14": "<sup>14</sup> လၧနၭအနါလီၫ.- ယဟိဝၩစံၭစမိစ့ၭ, ကွ့ၭဆၧနီၪလၧ ဆၧနၪ့ထၪ့ထဲၩ့အဂး လၧလံၬဖၧၩ့တၭ, လီၩလၩ့လၬ လၩ့အဝ့ၫ လၧစယီရှုၫအ့ၫအနါဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ယမိထူၭခွံၬ ၦအၫမလ့ၭဖိၪအဆၧနၪ့ထၪ့ထဲၩ့ လၩ့ထံး",
			"15": "<sup>15</sup> လၩ့ဆ့ၭ လၧမူၭခိၪအဖၫ့လၬယီၩလီၫ.- စမိစ့ၭမၩဆၧ",
			"16": "<sup>16</sup> လုအလးတၭ, ကိၭဝ့ၫအမံၩ့ယဟိဝၩနံစံၫလီၫ.- အဂဲး ဘဲၫယီၩ စံၭဝ့ၫဒၪ, ဆၧအစူၪအီၪလၧယဟိဝၩအလး ဆီၩ့ဆီ အဖၫ့ခိၪတၭ, ယဟိဝၩမိဒုၭၥုၭ လၧၦအၫမ လ့ၭဖိၪလဆိၩဘၪလဆိၩ ထီၩ့လၧလဆိၩဘၪလဆိၩ လီၫ."
		},
		"18": {
			"1": "<sup>1</sup> တၭထီးခးမံဒအၫ့ အၡၩလုဆၧ, စမိစ့ၭ အမံၩ့ၡါ စယံၭၥြိၫလဂၩနီၪ, နါဂၧၫ့ကယဲဆၧလၧ ယွၩမၩဆၧ လၧစမိစ့ၭအဂး, ဒဲလၧအၡၩခမျၧး အံၫစရ့လၭအဂး, လၧယဟိဝၩ ဒုၭစဲၪ့ထၪ့ခွံၬ အံၫစရ့လၭလၧအံဇံၭ အ",
			"2": "<sup>2</sup> ဖၧၩ့နီၪ,- တၭစမိစ့ၭအမံၩ့ၡါ စယံၭၥြိၫမၩန့စမိစ့ၭအ မၫ, နးဇံၭပိရၫ, လၧအအၪ့မၧၫ့ဝ့ၫ အထဲၩ့အလးခဲၫ့",
			"3": "<sup>3</sup> နီၪ,- ဒဲအဖိၪခွၫနံၫဂၩလီၫ. အလဂၩအမံၩ့မွဲ စဂၧၡၧၫ့ လီၫ. အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, ယမွဲယူၭၦမွံၩ လၧၦလ",
			"4": "<sup>4</sup> ခီၫဘၩ့မုးအဖၧၩ့လီၫ.- တၭအလဂၩဒၪအမံၩ့မွဲ စအံၫ လအ့ဇၫလီၫ အဂဲးဘဲၫယီၩ စံၭဝ့ၫဒၪ, ယဖါအယွၩ မွဲဆၧမၩဘိၭမၩဆၧၩ့ယၧၩ, ဒဲမၩဖီၩ့မၩဖျ့ၭယၧၩလၧ",
			"5": "<sup>5</sup> ဖၫရိၫအဖၩ့အနၭလီၫ.- တၭစမိစ့ၭအမံၩ့ၡါ စယံၭၥြိၫ နီၪ, ဂဲၫန့စမိစ့ၭအဖိၪခွၫၥံၪ, ဒဲအမၫလၧစမိစ့ၭအအီၪ လၧၡါမုနၧၫ့ဖၫ, ထီးအၥုၪ့တဲၩ လၧယွၩအခိၪလီၩ့အ",
			"6": "<sup>6</sup> လးနီၪလီၫ.- တၭအဝ့ၫဒၪစံၭစမိစ့ၭ, ယဝ့ၫဒၪနမံၩ့ၡါ စယံၭၥြိၫယီၩ, ယဂဲၫန့နမၫ ဒဲနဖိၪခွၫနံၫဂၩ လၧနအီၪ",
			"7": "<sup>7</sup> လီၫ.- စမိစ့ၭလ့ၩထၪ့အၪ့ဂၬ အမံၩ့ၡါတၭ, ထွံၩလၩ့ လၧအမ့ၬယၫတၭ, အဲၪဂါဝ့ၫ အၪ့စၪ့လိၬအၥၭလဂၩ ဒဲလဂၩ, လၧအဆၧမုၬ အဂဲးအကၠီၪ့တၭ, ဂဲၫထဲၩ့နုၬ ထဲၩ့ဝ့ၫလၧတဲၩဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭစမိစ့ၭ လီၩဘၪအမံၩ့ၡါ လၧကယဲဆၧလၧယ ဟိဝၩမၩဘၪဖၫရိၫ, ဒဲၦအံဇံၭဖိၪ လၧအံၫစရ့လၭအ ကၠီၩ့,ကယဲဆၧၡၪ့ဆၧနၭ လၧအဘၪအဝ့ၫၥံၪ လၧဖၧၩ့",
			"9": "<sup>9</sup> ၥၭ,ဒဲယဟိဝၩ မၩဖီၩ့ဖျ့ၭဝ့ၫနီၪလီၫ.- စယံၭၥြိၫအၥုၪ့ ဎွံၫအၥၭယီၫ လၧကယဲဆၧဂ့ၩအကၠီၩ့ လၧယဟိဝၩဒုၭ ဘၪအံၫစရ့လၭ လၧအမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪ လၧၦအံ",
			"10": "<sup>10</sup> ဇံၭဖိၪအစူၪဖၧၩ့လီၫ.- တၭစယံၭၥြိၫစံၭဝ့ၫဒၪ, ယဟိ ဝၩ,လၧအမၩဖီၩ့မၩဖျ့ၭနၥံၪ လၧၦအံဇံၭဖိၪ အစူၪ ဖၧၩ့,ဒဲလၧဖၫရိၫအစူၪဖၧၩ့, လၧအမၩဖီၩ့မၩဖျ့ၭၦခ မျၧးလၧၦအံဇံၭဖိၪ အစူၪဖၫ့လၬ လဂၩနီၪ, မွဲအဘၪ",
			"11": "<sup>11</sup> ဆၧဆိၪဂ့ၩဆံၭ.- ဘိၩ့နဲၪ့ယီၩ, ယၥ့ၪယၫ လၧယဟိဝၩ ဒိၪနဲၪ့ ကယဲယွၩ ထီးအလူၬဒံၭလီၫ. မွဲအဂဲးဘဲၫၥ့ၪ လဲၪမွဲဆၧလၧ အဝ့ၫၥံၪအီၪက့ၪထၪ့ထီၫ အၥၭတၭ,အ",
			"12": "<sup>12</sup> ဝ့ၫဒၪအီၪလၧအဖၫ့ခိၪနီၪ အဂဲးလီၫ.- တၭစမိစ့ၭအမံၩ့ ၡါစယံၭၥြိၫ အၪ့မၩန့ဆၧလုလဖၪ လၧယွၩအဂးတၭ, စအၫရၧၫ့ဂဲၫ, ဒဲအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါ ထီးအ လူၬဘဲၫအမိအၪ့ကိၪ လၧစမိစ့ၭအမံၩ့ၡါ အၥိၭ လၧ ယွၩအမ့ၬယၫလီၫ.",
			"13": "<sup>13</sup> ဆၧမၩအၥၭ လၧဆၧဖၩ့ထၪ့လနံၩနီၪ, စမိစ့ၭဆၧၫ့ နၩ့စ့ၩရၫ့ ၦခမျၧးတၭ, ၦခမျၧးဆၧၫ့ထုၪ့ လၧစမိစ့ၭ",
			"14": "<sup>14</sup> အနဲၩ့ထံၭ လၧမုဂီၩထီၩ့လၩ့လၧမုဂၪလၩ့လီၫ.- ထီး စမိစ့ၭအမံၩ့ၡါ ဒၪဘၪလၧကယဲဆၧလၧ အမၩၦခမျၧး ထီးအလူၬတၭ, စံၭဝ့ၫဒၪ, နမၩဆၧယီၩ, လၧၦခမျၧး ဘဲၫၥ့ၪလဲၪ, နဆၧၫ့နၩ့လဂၩဎးတၭ, ၦခမျၧးဆၧၫ့ထုၪ့ လၧနနဲၩ့ထံၭ လၧဆၧဖၩ့ထၪ့ထီၩ့လၩ့လၧ မုလၩ့နုၬနီၪ",
			"15": "<sup>15</sup> မွဲဘၪလဲၪ.- တၭစမိစ့ၭစံၭအမံၩ့ၡါ, ၦခမျၧးဂဲၫလၧ",
			"16": "<sup>16</sup> ယအီၪဘဲၫၥိၭ အမိအၪ့စၪ့ဆၧ လၧယွၩအဂဲးလီၫ.- ထီး အချဲၩ့ခွးအလးအ့ၪအီၪတၭ အဝ့ၫၥံၪဂဲၫ လၧယအီၪ တၭ,ယစ့ၩရၫ့ဆၧ လဂၩဒဲလဂၩ အဘိၩ့ဆၧၩ့နီၪ, ဒဲယ ဒုၭၥ့ၪယၫယွၩအဆၧမၪလူၬ ဒဲအဆၧၥီၪ့ဆၧၥၫ့လီၫ.",
			"17": "<sup>17</sup> တၭစမိစ့ၭအမံၩ့ၡါ စံၭအဝ့ၫဒၪ, ဆၧလၧနမၩဆၧ",
			"18": "<sup>18</sup> နီၪဂ့ၩအ့ၬ.- နဝ့ၫဒၪမွဲဂ့ၩ, ၦခမျၧးမွဲဂ့ၩ,မိလၩ့ပွံၭလၩ့ ထၩ့ဝ့ၫတၡါလီၫ. အဂဲးဘဲၫယီၩ ဆၧလမံၩ့ယီၩ, ဎၧၫ့",
			"19": "<sup>19</sup> လၨၪလၧနဂးလီၫ. နမၩလဂၩဎးကဲၪအ့ၬ.- ဘိၩ့နဲၪ့ ယီၩ,ခိၭနၪယလူနးထံၪဘီၪ. ယမိဖ့ၪလၫ့ဆၧကိၪ့လၧ နၧၩတၭ, ယွၩမိအီၪလၧနၥိၭလီၫ. အီၪနဝ့ၫလၧၦခမျၧး အဂးလၧယွၩ အမ့ၬယၫတၭ, ဒုၭဂဲၫထၪ့ အဆၧလၧ",
			"20": "<sup>20</sup> ယွၩအအီၪနီၪဆံၭ.- တၭနဘၪၥီၪ့လိၪ အဝ့ၫၥံၪ လၧ ဆၧမၪလူၬ, ဒဲဆၧၥီၪ့ဆၧၥၫ့တၭ, နဘၪဒုၭၥ့ၪယၫအ ဝ့ၫၥံၪလၧဖၧၩ့ ၥၭလၧအဘၪလီၩ့ဖိၬဝ့ၫနီၪ, ဒဲဆၧမၩ",
			"21": "<sup>21</sup> လၧအဘၪမၩနီၪလီၫ.- တၭနဘၪအၪ့ဎၬန့ ၦလၧအ မၩဆၧၥ့ၪ, လၧအၥၭမဲၪယွၩ, ၦအမွဲအတီၩ, ၦလၧအ ၥၭဂဲၫ့ဆၧလီၫ့ကီၩ့ ၥၭကွံၩ ဆၧလဖၪ လၧၦခမျၧးအ ကျၩလီၫ. တၭနဘၪအီၪက့ၪအဝ့ၫၥံၪ လၧၦလထီၫ့အခိၪး ၦလယၩအခိၪး ၦယဲဆံၫအခိၪး ၦလဆံၫအခိၪး လၧ",
			"22": "<sup>22</sup> အဖၫ့ခိၪလီၫ.- တၭမွဲအဝ့ၫၥံၪမိစ့ၩရၫ့ ၦခမျၧးကိၭအ ဆၧၫ့အထီဒ့ၭဆံၭ. တၭဆၧမိမၩအၥၭ လၧအမိဘၪ ဒုၭဂဲၫထၪ့ဆၧအဒိၪ ကိၭအမံၩ့ဒ့ၭလၧနအီၪ, အ့ၪမွဲဆၧ အဆံၭလဖၪ ကိၭအမံၩ့ဒ့ၭနီၪ, အဝ့ၫၥံၪမိစ့ၩရၫ့ဝ့ၫ လီၫ.မိယီၫဒံၭလၧနဂးတၭ, ၦမိထိးဎုၬဆၧ လၧနၥိၭ",
			"23": "<sup>23</sup> လီၫ.- နအ့ၪမၩဆၧယီၩ, ဒဲယွၩမၪလူၬဝ့ၫတၭ, နထိးမိ ကဲၪတၭ, ၦခမျၧးထီးအလူၬယီၩ, မိထဲၩ့ထဲၩ့လၧအ လးလဖၪ မုၬမုၬဆ့လီၫ.",
			"24": "<sup>24</sup> တၭစမိစ့ၭခိၭနၪအမံၩ့ၡါအလူတၭ, မၩကယဲဆၧ",
			"25": "<sup>25</sup> လၧအစံၭဝ့ၫနီၪလီၫ.- တၭစမိစ့ၭအၪ့ရွံန့ ၦလၧအမၩ ဆၧၥ့ၪလၧအံၫစရ့လၭဖိၪ ထီးအလူၬအကျၩတၭ, အီၪ က့ၪဝ့ၫလၧၦလထီၫ့အခိၪး ၦလယၩအခိၪး ၦယဲဆံၫအ",
			"26": "<sup>26</sup> ခိၪး ၦလဆံၫအခိၪး လၧၦခမျၧးအဖၫ့ခိၪလီၫ.- တၭအ ဝ့ၫၥံၪစ့ၩရၫ့ ၦခမျၧးကိၭအဆၧၫ့အထီဒ့ၭတၭ, ဒုၭဂဲၫ ထၪ့ဆၧအကၪလမံၩ့ လါလါနီၪ လၧစမိစ့ၭအအီၪ,အ့ၪ မွဲဆၧအဆံၭလမံၩ့လါလါနီၪ အဝ့ၫ ၥံၪ စ့ၩ ရၫ့ ဒၪ ဝ့ၫ",
			"27": "<sup>27</sup> လီၫ.- စမိစ့ၭဖျါခွံၬအမံၩ့ၡါတၭ, အဝ့ၫနီၪထဲၩ့ထဲၩ့လၧ အခးဒၪဝ့ၫနီၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့ခွံၬယူၭ လၧခးအံဇံၭအဖၧၩ့ အလးခဲၫ့တၭ, လၩၥၧၫ့ဘံၪ့လဘံၪ့ ဎွ့ၩထၪ့ဝ့ၫလနံၩ",
			"2": "<sup>2</sup> နီၪ,အဝ့ၫၥံၪ လ့ၩထီၩ့လၧၡါမုနၧၫ့ဖၫ စဲနၫနီၪလီၫ. အ ဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬယူၭ လၧရဖံဒံၫ့တၭ, ဂဲၫထီၩ့ယူၭလၧ စဲနၫအမံၩ့လၬကျၩနီၪ, ဒဲအီၪတဲၩ့ဝဲၩဆၧလၧၡါမုနၧၫ့ ဖၫတၭ,အံၫစရ့လၭဖိၪၥံၪ ၥုၪ့အတဲၩထီးနီၪ လၧခိၪလီၩ့",
			"3": "<sup>3</sup> လဖျိၪ့နီၪ အမ့ၬယၫလီၫ.- စမိစ့ၭလ့ၩထၪ့လၧယွၩအ အီၪတၭ, ယဟိဝၩကိၭထၪ့ဝ့ၫ လၧခိၪလီၩ့အခိၪနီၪတၭ, စံၭဝ့ၫဒၪ, နဘၪလီၩစယၫကူၭအဂံၪ့ဖိၪတၭ, ဒုၭနဲၪၦ",
			"4": "<sup>4</sup> အံၫစရ့လၭဖိၪဘဲၫယီၩ,- ဆၧမၩဘၪၦအံဇံၭဖိၪဘဲၫ အံၩဘဲၫအိၩနီၪ, နၥံၪဒၪဘၪယူၭ, ဒဲလၧယဆိၬထၪ့နၥံၪ လၧလံၬကျီၫ့ကျီၫ့အဒံၭအဖၫ့ခိၪတၭ, ဒုၭဂဲၫထၪ့နၥံၪလၧ",
			"5": "<sup>5</sup> ယအီၪဒၪယဝ့ၫယီၩလီၫ.- ဘိၩ့နဲၪ့ယီၩနၥံၪအ့ၪခိၭနၪ တၡါယလူ, ဒဲထီးန့ယဆၧအုၩ့လၩ့တၭ, နၥံၪမိကဲၪ ထၪ့ဆၧလူဒိၪဎွ့ၩဒိၪ လၩ့မဲၩဒၪဆၧလၧယဂး ဒိၪနဲၪ့ ၦဆၨၩထီးအလူၬလီၫး အဂဲးဘဲၫယီၩ ဂၪ့ခိၪထၧၫ့ဖျိၪ့",
			"6": "<sup>6</sup> ယၫမွဲယဆၧလီၫ.- တၭနၥံၪမိကဲၪ ထၪ့ၦလုဆၧလဖၪ အဘၩ့အမုး, ဒဲၦဆံၫ့ဎံၪလဆၨၩလီၫ. အယီၩမွဲဆၧချဲၩ့ လဖၪလၧနဘၪလီၩ ဘၪၦအံၫစရ့လၭဖိၪလီၫ.",
			"7": "<sup>7</sup> စမိစ့ၭဂဲၫထီၩ့တၭ, ကိၭၦခမျၧးအၥုၪ့က့ၭၥၭၡါတၭ အီၪက့ၪကယဲဆၧချဲၩ့လဖၪ လၧယဟိဝၩမၪလူၬဝ့ၫလၧ",
			"8": "<sup>8</sup> အဝ့ၫၥံၪအမ့ၬယၫလီၫ.- ၦခမျၧးၥံၪချဲၩ့ဆၧၫ့ဆၧလဖၧၫ့ ဎးတၭ, စံၭဝ့ၫဒၪ, ကယဲဆၧလၧယဟိဝၩ စံၭဆၧနီၪပမိ မၩလီၫ. တၭစမိစ့ၭၥိၫ့ထဲၩ့ၦခမျၧး အဆၧချဲၩ့လဖၪ လၧယဟိဝၩ အအီၪနီၪလီၫ.",
			"9": "<sup>9</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ယိခွါ,ယဂဲၫလၧနအီၪလၧ ဆၧအုၪ့တၪ့အဖၧၩ့, ဘဲၫၦခမျၧးမိနါဂၧၫ့ယချဲၩ့ဆၧ လၧနၧၩ,ဒဲနဲၩထဲၩ့နၧၩဆ့အဆိၩအကၠၪလီၫ. တၭစမိစ့ၭ",
			"10": "<sup>10</sup> လီၩဘၪထဲၩ့ၦခမျၧးအဆၧချဲၩ့ လၧယဟိဝၩလီၫ.-ယ ဟိဝၩစံၭစမိစ့ၭ, လ့ၩလၧၦခမျၧးအအီၪတၭ, အီၪက့ၪ ဆံၫ့ဎံၪအဝ့ၫၥံၪ လၧမုလနံၩယီၩ, ဒဲကဲဂီၩခိၬနးနံၩဆံၭ.",
			"11": "<sup>11</sup> မွဲအအၪ့ဆူၫဝၭအကီၩ့အၥိၭဆံၭ.- ဒဲအီၪတဲၩ့ဝဲၩဆၧ လၧၥၧၫ့နံၩလနံၩ အဂးဆံၭ. အဂဲးဘဲၫယီၩ ၥၧၫ့နံၩလ နံၩနီၪယဟိဝၩမိဂဲၫလၩ့ လၧၦခမျၧးထီးအလူၬ အမ့ၬ",
			"12": "<sup>12</sup> ယၫလၧခိၪလီၩ့ စဲနၫအလီၩ့လီၫ.- တၭ နဘၪအီၪ က့ၪဆၧဝၬဖီၩ့ၦခမျၧးတၭ, စံၭထီးလၩ့နၥံၪအၥၭလၧ နၥံၪထီးလ့ၩထၪ့လၧခိၪလီၩ့, ဒဲထိၭဘၪအနဲၩ့ထံၭနီၪ လဂ့ၩး ထီးဒၪၦလၧအထိၭဘၪခိၪလီၩ့ လဂၩလါလါ",
			"13": "<sup>13</sup> နီၪ,မိဘၪၥံၫတၡါလီၫ.- တၭဆၧအစူၪထိၭဘၪဝ့ၫအ့ၬ, အဂဲးဘဲၫယီၩ မိဘၪဆၧခွံၬဝ့ၫလၧလိးလီၫ. အ့ၪလမွဲ ဘၪဘဲၫနီၪတၭ, မိဘၪဆၧခၭဖျီၫ့ၥံၫခွံၬဝ့ၫ တၡါလီၫ. ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, ၦၡၩမွဲဂ့ၩ, မၧၫ့ဘၪအ့ၬ. တၭထီး ခွ့ၩအ့ၪၥီၫထၪ့ယံၬယံၬတၭ, အဝ့ၫၥံၪမိဂဲၫထၪ့ဘၪဝ့ၫ လၧခိၪလီၩ့ထံၭနီၪလီၫ.",
			"14": "<sup>14</sup> စမိစ့ၭထဲၩ့လၩ့ထဲၩ့လၧခိၪလီၩ့ခိၪ, ထီၩ့လၧၦခမျၧး အအီၪတၭ, မၩဆံၫ့ဎံၪၦခမျၧးတၭ, အဝ့ၫၥံၪအၪ့ဆူၫ",
			"15": "<sup>15</sup> ဝၭအကီၩ့အၥိၭလီၫ.- တၭအဝ့ၫနီၪစံၭၦခမျၧးနီၪ, တဲၩ့ ဝဲၩနၥံၪအၥၭ လၧမုၥၧၫ့နံၩလနံၩအဂးဆံၭ. တၭထီး ၥုၭဘူၭနၥံၪအၥၭ လၧနၥံၪအမၫလဖၪ အအီၪလဂ့ၩ.",
			"16": "<sup>16</sup> တၭမုၥၧၫ့နံၩလနံၩ ဆၧဖၩ့ထၪ့နီၪ ဆၧမၩအၥၭလၧ ဆၧၥီၫလဖၪ, အီၪဒဲလၫ့ဝဲအဒံၭလဖၪ, ဒဲဆၧအုၪ့တၪ့ အီၪလၧခိၪလီၩ့ အလီၩ့နီၪ, ဒဲအခွ့ၩၥီၫ ဆီၪ့ဆီၪ့လ့ၬ တၭ,ကယဲၦခမျၧး လၧအအီၪလၧၥုၪ့တဲၩ အလးဖၧၩ့",
			"17": "<sup>17</sup> ထီးအလူၬနီၪ ဝၭထိၬဝ့ၫဒၪလီၫ.- တၭစမိစ့ၭဒုၭစဲၪ့ထၪ့ ခွံၬၦခမျၧး လၧၥုၪ့တဲၩအလး ဘဲၫၥိၭအမိဒၪဘၪလိၬ အၥၭလၧယွၩတၭ, အဝ့ၫၥံၪဆၧၫ့ထုၪ့ အီၪလၧခိၪလီၩ့",
			"18": "<sup>18</sup> အဖၫ့လၬနီၪလီၫ.- တၭခိၪလီၩ့စဲနၫအီၪလၧမ့ၪခူၪလၧ အလီၩ့ထၧၫ့ဖျိၪ့ယၫလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩဂဲၫ လၩ့လၧအလီၩ့ လၧမ့ၪအကျၩတၭ, အခူၪထၪ့ဘဲၫမ့ၪ လၧဖံၫ့ချၪဖၧၩ့ အၥိၭနီၪတၭ, ခိၪလီၩ့ဝၭဝ့ၫထၧၫ့ဖျိၪ့",
			"19": "<sup>19</sup> ယၫစွၪမၬလီၫ.- ဆၧမၩအၥၭ ထီးအခွ့ၩၥီၫထၪ့ယံၬ တၭ,ဒံၩ့ယံၬဒံၩ့ၥီၫ ဒံၩ့ယံၬဒံၩ့ၥီၫနီၪ, စမိစ့ၭချဲၩ့ဆၧ",
			"20": "<sup>20</sup> တၭ,ယွၩချဲၩ့ဆၧၫ့လၧဆၧအလူလီၫ.- ယဟိဝၩဂဲၫ လၩ့လၧခိၪလီၩ့စဲနၫအလီၩ့ လၧခိၪလီၩ့ဒၩ့ခိၪနီၪတၭ, ယဟိဝၩကိၭထၪ့စမိစ့ၭ လၧခိၪလီၩ့အဒၩ့ခိၪနီၪတၭ, စမိစ့ၭလ့ၩထၪ့ဝ့ၫဒၪလီၫ.",
			"21": "<sup>21</sup> တၭယဟိဝၩစံၭစမိစ့ၭထဲၩ့လၩ့ မၪလူၬၦခမျၧးဘီၪ, ဘၪလဘၪ အဝ့ၫၥံၪ မိမၩဖိးဆၧထီးယဟိဝၩ အအီၪ ဘဲၫၥိၭအမိယိဖၧၩ့ဆၧတၭ, မိၥံၫဘၪခိၬ လၧအကျၩ",
			"22": "<sup>22</sup> အၪဂၩလီၫ.- တၭၦလုဆၧလဖၪလၧအဂဲၫဘူၭဆ့လၧ ယဟိဝၩနီၪ, မွဲအဝ့ၫၥံၪမၩဆံၫ့ဎံၪ ဒၪအၥၭဆံၭ. တၭ",
			"23": "<sup>23</sup> ယဟိဝၩမိမၩဖျီၫ့ဆီၪ့ဘၪခိၬ ဆၧလၧအအီၪလီၫ.- တၭ စမိစ့ၭစံၭယဟိဝၩ, ၦခမျၧးၥံၪဂဲၫထၪ့ လၧခိၪလီၩ့စဲနၫ အလီၩ့ယီၩၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ နမၪလူၬပၧၩတၭ, စံၭ,မၩဝၬဖီၩ့ထၬခိၪလီၩ့ ဒဲအီၪက့ၪဆံၫ့ဎံၪဝ့ၫနီၪဆံၭ.",
			"24": "<sup>24</sup> တၭယဟိဝၩစံၭဝ့ၫဒၪ, လ့ၩ, ထဲၩ့လၩ့နဝ့ၫဘီၪ. တၭနမိ ဂဲၫထၪ့နဝ့ၫဒၪ, ဒဲစအၫရၧၫ့လၧနၥိၭဆ့လီၫ. အ့ၪမွဲဘဲၫ ၥိၭအမိဂဲၫ လၧယဟိဝၩအအီၪနီၪ, မွဲၦလုဆၧလဖၪ ဒဲၦခမျၧးၥံၪ ထီးဘုၪ့ဖိးဆၧလဂ့ၩ ဘၪလဘၪအဝ့ၫနီၪ",
			"25": "<sup>25</sup> မိဘုၪ့ဖိးဘၪခိၬ လၧအဝ့ၫၥံၪအလီၩ့နီၪလီၫ.- စမိစ့ၭ ထဲၩ့လၩ့ လၧၦခမျၧးအအီၪတၭ, လီၩလၩ့ဆၧလၧအ ဝ့ၫၥံၪလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ယွၩချဲၩ့ဆၧချဲၩ့လဖၪယီၩ ထီးအလူၬတၭစံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩ နယွၩလၧအဒုၭစဲၪ့ထၪ့ ခွံၬနၧၩလၧခးအံဇံၭအဖၧၩ့, လၧၦဎီးဖိၪအဂံၪ့ဖၧၩ့နီၪ လီၫ.",
			"3": "<sup>3</sup> အ့ၪလမွဲဘၪယၧၩတၭ, ထီးအီၪလၧနယွၩအဂူၫဂၩ",
			"4": "<sup>4</sup> လဖၪနးဂၩလဂ့ၩ.- ထီးတဲၩ့ဆၧဂၩ့ဆၧဖၪ့ လၧနဂး လဂ့ၩ, ဆၧအီၪလၧမူၭခိၪထၭမွဲဂ့ၩ, ဆၧအီၪလၧဂၪ့ ခိၪချိၫ့မွဲဂ့ၩ, ဆၧအီၪလၧထံၫကျၩ လၧဂၪ့ခိၪအဖၫ့လၬ",
			"5": "<sup>5</sup> မွဲဂ့ၩ, ထီးတဲၩ့အခံးအဂၩ့ လၧနဂးနးမံၩ့လဂ့ၩ,-ထီး ဘၩထၪ့လဂ့ၩ, ထီးမၩအဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယဟိဝၩ နယွၩယီၩ, ယမွဲယွၩလၧအၥၭကဲၪ့ ဆၧ,လၧအဒုၭအီၪထၪ့ဖါလဖၪ အဆၧဒဲၩဘၭ, လၧဖိၪ လဖၪအလီၩ့ ထီၩ့လၩ့လၧၦၥၭဂဲၫ့ယၧၩ ၥၧၫ့ဆိၩလ",
			"6": "<sup>6</sup> ဆိၩဒဲလံဆိၩလဆိၩ,- ဒဲလၧအမၩခိးမၩတၩၦအထီၫ့ ၥံၪ, လၧအအဲၪယၧၩ ဒဲထီးန့ယဆၧမၪလူၬ လဖၪနီၪ လီၫ.",
			"7": "<sup>7</sup> ထီးကိၭထၪ့ ယဟိဝၩ နယွၩအမံၩ့ ပျီၩပျီၩလဂ့ၩ, အဂဲးဘဲၫယီၩ ၦလၧအကိၭထၪ့အမံၩ့ ပျီၩပျီၩနီၪ, ယ ဟိဝၩအီၪက့ၪအဝ့ၫ ဘဲၫၦလၧအဆၧဒဲၩဘၭ လအီၪဘၪ အၥိၭနီၪ, မွဲအ့ၬ.",
			"8": "<sup>8</sup> နၪ့ထၪ့ထဲၩ့ မးၥံၫအနံၩ, ဘဲၫနမိအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ",
			"9": "<sup>9</sup> အၥိၭနီၪဆံၭ.- နမိဘၪမၩဆၧဎူၫနံၩတၭ, မၩနဆၧမၩ",
			"10": "<sup>10</sup> ထီးအလူၬလီၫ.- အ့ၪမွဲမုနွ့ၫနံၩလနံၩနီၪ, မွဲယဟိဝၩ နယွၩအမးၥံၫအနံၩလီၫ. နဝ့ၫဒၪမွဲဂ့ၩ, နဖိၪခွၫမွဲဂ့ၩ, နဖိၪမုၪမွဲဂ့ၩ, နဎီးနၡၩခွၫမွဲဂ့ၩ, နဎီးနၡၩမုၪမွဲဂ့ၩ,နဆၧ ဖိၪဆၧဎါအဒိၩ့မွဲဂ့ၩ, ၦမွံၩဖိၪ လၧအအီၪလၧနတရၫ့",
			"11": "<sup>11</sup> အဖၧၩ့မွဲဂ့ၩ, နၥံၪထီးမၩဆၧနးမံၩ့လဂ့ၩ,- အဂဲးဘဲၫ ယီၩဎူၫနံၩအထးဖၧၩ့နီၪ, ယဟိဝၩမၩကဲၪထၪ့မူၭခိၪ ဒဲဂၪ့ခိၪ,မၫဆမံၭ, ဒဲကယဲဆၧအီၪ လၧအဝ့ၫၥံၪအဖၧၩ့ တၭ, အီၪပွံၭဝ့ၫလၧမုနွ့ၫနံၩလနံၩနီၪလီၫ. မၩအၥၭ ဘဲၫနီၪတၭ, ယဟိဝၩဆိၪဂ့ၩ မုနွ့ၫနံၩလနံၩနီၪ, အီၪ က့ၪဆံၫ့ဎံၪဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> ဘဲၫၥိၭနမုနံၩလဖၪ မိအၪထၪ့လၧခးဖၧၩ့ လၧယဟိ ဝၩနယွၩဖ့ၪလၫ့နၧၩတၭ, ယူၭယၪ့နမိနဖါဆံၭ.",
			"13": "<sup>13</sup> ထီးမၩၥံၫၦၡၩလဂ့ၩ.",
			"14": "<sup>14</sup> ထီးအဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩလဂ့ၩ.",
			"15": "<sup>15</sup> ထီးအၪ့ဂူၪဆၧလဂ့ၩ.",
			"16": "<sup>16</sup> ထီးထိးနၥၭလၧဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪ ထၫ့ဒုၪဒၩၦလၧ နနဲၩ့ထံၭလဂ့ၩ.",
			"17": "<sup>17</sup> ထီးၥၭကွံၩၦလၧနနဲၩ့ထံၭအဂံၪ့လဂ့ၩ, ၦလၧနနဲၩ့ ထံၭအမၫမွဲဂ့ၩ, အဎီးအၡၩခွၫမွဲဂ့ၩ, အဎီးအၡၩမုၪ မွဲဂ့ၩ,အချီမွဲဂ့ၩ, အကၥ့ၪယီၩမွဲဂ့ၩ, ထီးဒၪၦလၧနနဲၩ့ ထံၭအဆၧလမံၩ့လါလါမွဲဂ့ၩတၭ, ထီးၥၭကွံၩလဂ့ၩ.",
			"18": "<sup>18</sup> တၭကယဲၦခမျၧးထီးအလူၬ, ဒၪဘၪလၫ့ဎွံၩ့, ဒဲလၫ့ ဝဲအဒံၭ, ဒဲခွ့ၩအၥီၫ, ဒဲမ့ၪခူၪထၪ့ဝ့ၫလၧခိၪလီၩ့နီၪတၭ, ထီးၦခမျၧးဒၪဘၪဝ့ၫနီၪ ၥုၭအလးတၭ, ဆၧၫ့ထုၪ့ဝ့ၫ",
			"19": "<sup>19</sup> လၧအယဲၩ့လီၫ.- တၭအဝ့ၫၥံၪစံၭစမိစ့ၭ ချဲၩ့နဝ့ၫလၧ ပၧၩဘီၪး တၭပမိခိၭနၪလီၫ. အ့ၪမွဲယွၩလဂၩနီၪထီး",
			"20": "<sup>20</sup> ချဲၩ့လၧပၧၩလဂ့ၩး ပမိၥံၫဘၪခိၬလီၫ.- တၭစမိစ့ၭ စံၭၦခမျၧးနီၪ, ထီးၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩယွၩဂဲၫ လၩ့မၩယိခွါနၥံၪ, ဘဲၫၥိၭအဆၧၥၭမဲၪမိအီၪလၧနၥံၪ",
			"21": "<sup>21</sup> အမ့ၬယၫ, လၧနၥံၪထီးမၩမၪဘၪဆၧလဂ့ၩလီၫ.- ၦ ခမျၧးဆၧၫ့ထုၪ့လၧအယဲၩ့တၭ, စမိစ့ၭ ၥုၭဘူၭအၥၭ လၧဆၧခံၭတၪ့ ထီးယွၩအီၪဝ့ၫ အလးနီၪလီၫ.",
			"22": "<sup>22</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, နဘၪလီၩဘၪၦအံၫစရ့လၭ ဖိၪဘဲၫယီၩ, နၥံၪဒၪဘၪယူၭ လၧယချဲၩ့ဆၧလၧနၥံၪ",
			"23": "<sup>23</sup> လၧမူၭခိၪလီၫ.- တၭထီးမၩကဲၪထၪ့ယွၩၥံၪ လၧစ့ၩ လၧယၥိၭနးဂၩလဂ့ၩး တၭထီးမၩကဲၪထၪ့ ယွၩၥံၪ",
			"24": "<sup>24</sup> လၧထီၫ့လၧနၥံၪအဂးလဂ့ၩ,- နဘၪမၩဆၧလုအလး လၧဂၪ့ခိၪလၧယဂးတၭ, နဘၪလုထၪ့ နဆၧလုမ့ၪဒဲန ဆၧလုဘၪလိၬအိၭလိၬ, နၥိၪဒဲဘ့ၪ, ဒဲနချီလဖၪအဖၫ့ ခိၪလီၫ. ကယဲဆၧအလး ထီးယအီၪက့ၪ ဆၧနၪ့ထၪ့ ထဲၩ့ယမံၩ့လစီၪ့လါလါနီၪ ယမိဂဲၫလၧနအီၪလၧယ",
			"25": "<sup>25</sup> မိဆိၪဂ့ၩနၧၩလီၫ.- နအ့ၪမၩကဲၪထၪ့ ဆၧလုအလး လၧလိးလၧယဂးတၭ မၩလၧလိးစိၭအၥၭလဂ့ၩ, အ ဂဲးဘဲၫယီၩနအ့ၪတဲၩ့ ဆၧလၧလိးစိၭအၥၭနီၪတၭ, န",
			"26": "<sup>26</sup> မၩၥၭလိၪဝ့ၫလီၫ.- တၭနထၪ့ဘၪ, ယဆၧလုအလးလၧ ဎၫ့အ့ၬ, ဘဲၫၥိၭနဆၧအီၪဘိၪ့ ထီးအီၪဖျီၪလၧအဖၫ့ခိၪ နီၪလဂ့ၩလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭအယီၩမွဲဆၧစ့ၩရၫ့လဖၪ လၧနဘၪအီၪက့ၪလၧ အဝ့ၫၥံၪအမ့ၬယၫလီၫ.",
			"2": "<sup>2</sup> နအ့ၪဎွ့ၩဎီးလၧၦဟံဘြူၫဖိၪလဂၩတၭ, အဝ့ၫမိဘၪ မၩနဆၧဎူၫနံၪ့တၭ, နွ့ၫနံၪ့လနံၪ့နီၪ, အဝ့ၫမိဂၭဖျ့ၭ",
			"3": "<sup>3</sup> ထၪ့ပျီၩပျီၩလီၫ.- အ့ၪဂဲၫနုၬန့ၫအနၫ့ဆါဒၪဝ့ၫလဂၩ နီၪ မိစဲၪ့ထၪ့ခွံၬ န့ၫအနၫ့ဆါဒၪဝ့ၫ လဂၩဆ့လီၫ. အ့ၪ အီၪလၧအမၫနီၪ အမၫမိစဲၪ့ထၪ့လၧ အၥိၭဆ့လီၫ.",
			"4": "<sup>4</sup> အကဆါအ့ၪဒုၭခၫ အမၫတၭ, အဝ့ၫဒၪအ့ၪအီၪဖျဲၪန့ ဝ့ၫလၧအဖိၪခွၫၥံၪမွဲဂ့ၩ, ဖိၪမုၪၥံၪမွဲဂ့ၩတၭ, အမၫဒဲ အဖိၪလဖၪ မိကဲၪထၪ့အကဆါအဆၧတၭ, ၦလဂၩ",
			"5": "<sup>5</sup> နီၪမိစဲၪ့ထၪ့န့ၫအနၫ့ဆါဒၪဝ့ၫလဂၩနီၪလီၫ.- ဎီးလဂၩ နီၪအ့ၪလီၩဘၪဆၧတီၩတီၩ, ယအဲၪယကဆါ, ယမၫ,",
			"6": "<sup>6</sup> ဒဲယဖိၪလဖၪတၭး ယမိစဲၪ့ဖျ့ၭထၪ့ပျီၩပျီၩအ့ၬ.- ထီး နီၪလဖၧၩ့ အကဆါဘၪၥိၫ့ဝ့ၫ လၧယွၩအအီၪ, လၧတ ရၫ့မွဲဂ့ၩ, တရၫ့အထုၪ့မွဲဂ့ၩ, ဘၪၥိၫ့ဆ့ထီးနီၪတၭ, အ ကဆါဘၪဖျံၬဖိးအနါ လၧထၭဖျံၭတၭး အဝ့ၫဒၪဘၪ မၩအဆၧ အဆိၩအကၠၪလီၫ.",
			"7": "<sup>7</sup> ၦၡၩအ့ၪအၪ့ဆၫခွံၬအဖိၪမုၪ ဘဲၫၥိၭအမိကဲၪဎီးမုၪ တၭ, အဝ့ၫဒၪမိစဲၪ့ထၪ့ခွံၬဘဲၫဎီးအခွၫ စဲၪ့ထၪ့ခွံၬအ",
			"8": "<sup>8</sup> ၥိၭအ့ၬ.- အ့ၪလဘၪဘၪကဆါအၥၭ လၧအဘၪအဲၪ တၩ့ဝ့ၫလၧအနၫ့ဆါဒၪဝ့ၫနီၪ, ထီးနီၪလဖၧၫ့ အဝ့ၫနီၪ ဘၪဖ့ၪလၫ့ဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫလီၫ. ဘဲၫၥိၭအမိအၪ့ဆၫ ဝ့ၫလၧၦလဆၨၩဒၪနီၪ, အစီၩ့အမၩ့အီၪအ့ၬ, အဂဲး",
			"9": "<sup>9</sup> ဘဲၫယီၩမၩယူၭဝ့ၫ လၧဆၧအၪ့လီၫဝ့ၫလီၫ.- အဝ့ၫအ့ၪ ဒုၭအဲၪတၩ့အဝ့ၫနီၪ လၧအဖိၪခွၫတၭ, ဘၪမၩဝ့ၫဘဲၫ",
			"10": "<sup>10</sup> ဆၧစ့ၩရၫ့ဖိၪမုၪလဖၪအၥိၭနီၪလီၫ.- အဝ့ၫဒၪအ့ၪမၩ န့အမၫလဂၩဒၪတၭ, မၩလၩ့ၡၩဘၪအယီၩ အဆၧ အၪ့ဆၧအီၩ, အကီၩ့အၥိၭ, ဒဲဆၧအီၪဎုၬအၥနိၫနီၪဆ့",
			"11": "<sup>11</sup> အ့ၬ.- အ့ၪလမၩဘၪဝ့ၫ လၧဆၧၥၧၫ့မံၩ့နီၪတၭ, ၦမုၪ လဖ့ၪလၫ့ဘၪစ့ၩတၭ, မိစဲၪ့ထၪ့ပျီၩဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ၦလၧအဖ့ၬၦၡၩလဂၩထီးအၥံၫနီၪ, အဝ့ၫဒၪမိဘၪ",
			"13": "<sup>13</sup> ဆၧမၩၥံၫတၡါဝ့ၫလီၫ.- ၦလၧအလအီၪခိၭၥူၪဘၪ နီၪ,အ့ၪမွဲယွၩဖ့ၪလၫ့ဝ့ၫလၧအစူၪဖၧၩ့တၭ, ထီးနီၪလ ဖၧၫ့ ယမိအီၪက့ၪဆၧအလး လၧနဂး ဘဲၫၥိၭအမိစဲၪ့",
			"14": "<sup>14</sup> လၧအအီၪနီၪလီၫ.- အ့ၪမွဲၦၡၩ အ့ၪအီၪက့ၪထၪ့ထီၫ အၥၭလၧၦဂူၫဂၩအဖၫ့ခိၪ ဘဲၫၥိၭအမိမၩၥံၫဝ့ၫလၧအ ဆၧအၪ့လီၫတၭ, နမိဘၪမၩန့ခွံၬဝ့ၫ လၧယဆၧလုလး",
			"15": "<sup>15</sup> အဖၫ့ခိၪဒၪလ့ၬဘဲၫၥိၭဆၧမိမၩၥံၫဝ့ၫလီၫ.- တၭၦလၧ အထးအမိမွဲဂ့ၩ အဖါမွဲဂ့ၩလဂၩနီၪ, မိဘၪဆၧမၩၥံၫ တၡါဝ့ၫလီၫ.",
			"16": "<sup>16</sup> ၦလၧအအၪ့ဂူၪန့ၦၡၩ ဒဲအၪ့ဆၫခွံၬဝ့ၫမွဲဂ့ၩ, ဆၧ အ့ၪဒၪန့ဝ့ၫ လၧအစူၪဖၧၩ့မွဲဂ့ၩတၭ, အဝ့ၫလဂၩနီၪ မိဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ၦလၧအဆိၪအၧၩ့အမိမွဲဂ့ၩ အဖါမွဲဂ့ၩလဂၩနီၪ,မိ ဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ၦၡၩၥံၪအ့ၪမၩဒုၪ့လိၬအၥၭတၭ, အလဂၩအ့ၪထံၭ ဘၪဂူၫဂၩလၧလိးမွဲဂ့ၩ, အ့ၪမ့ၭဘၪဝ့ၫလၧအစူၪခိၪမွဲ ဂ့ၩတၭ, ၦလဂၩနီၪအ့ၪလၥံၫဘၪတၭ, အ့ၪမွဲဘၪအီၪ",
			"19": "<sup>19</sup> လၧအလးမံၫတၭ,- လၧခဲၫ့အ့ၪဂဲထုၪ့ထၪ့ထဲၩ့လ့ၩထၪ့ လၧခီၫ့လၧအနိၪထိၭဘီၩ့တၭ, ၦလၧအထံၭဆၧ, မ့ၭ ဆၧလဂၩနီၪမိဖီၩ့ဖျ့ၭလီၫ. မွဲလါနၫ့ဘၪဖ့ၪလၫ့လၧအ ဆၧမၩဂၭဂီၩ့အဂး, ဒဲဘၪဒုၭဘျၪထဲၩ့ဝ့ၫတၡါဆ့လီၫ.",
			"20": "<sup>20</sup> တၭၦအ့ၪထးဎီးခွၫမွဲဂ့ၩ ဎီးမုၪမွဲဂ့ၩ လၧနိၪထးထီး အၥံၫလၧအစူၪဖၧၩ့တၭ, မိဘၪထိးဆၧစ့ၩရၫ့ တၡါ",
			"21": "<sup>21</sup> လီၫ.- မွဲလါနၫ့အ့ၪမၧၫ့ဒံၭလနံၩနံၫနံၩတၭ, ဘၪဆၧ စ့ၩရၫ့အ့ၬး အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမွဲအဆၧလီၫ.",
			"22": "<sup>22</sup> ၦၡၩအ့ၪထးလိၬအၥၭတၭ ဘၪၦမုၪလၧအဒၧၩ့ထၪ့ တၭ, အဂူၭလၩ့ဎွံၪ ဒဲလဘၪလၧၩ့ဘၪ ဆၧနးမံၩ့တၭ, ၦလဂၩနီၪ ဘၪလိၭစ့ၩတၡါ ဘဲၫၦမုၪအဝၩ မိအီၪက့ၪ လၧအလီၩ့အၥိၭတၭ, မိဘၪဖ့ၪလၫ့ဆၧထီးဒၪ ၦစ့ၩ",
			"23": "<sup>23</sup> ရၫ့ခွးအၥၭလီၫ.- တၭၦမုၪအ့ၪဘၪဆၧ လမံၩ့မံၩ့နီၪ,",
			"24": "<sup>24</sup> နဘၪဖ့ၪလၫ့ၥၭမၧၫ့ လၧၥၭမၧၫ့အဂး,- မ့ၬၥၪလၧမ့ၬၥၪ အဂး, ၥွၫလၧၥွၫအဂး, စူၪလၧစူၪအဂး, ခၪ့လၧခၪ့",
			"25": "<sup>25</sup> အဂး,- ခိဎီၩလၧခိဎီၩအဂး, ဆၧဘၪထူၬ လၧဆၧဘၪ ထူၬအဂး ထးလၧထးအလး အဂးလီၫ.",
			"26": "<sup>26</sup> တၭၦအ့ၪထး အဎီးခွၫ အမ့ၬၥၪမွဲဂ့ၩ, အဎီးမုၪအ မ့ၬၥၪမွဲဂ့ၩ ထီးအဂၭဂီၩ့ဝ့ၫတၭ, မိဘၪကွဲၪဖျါခွံၬဝ့ၫ",
			"27": "<sup>27</sup> လၧအမ့ၬၥၪအဂးလီၫ.- ၦအ့ၪမၩဖိၬခွံၬ အဎီးခွၫအ ၥွၫမွဲဂ့ၩ အဎီးမုၪအၥွၫမွဲဂ့ၩတၭ, မိဘၪကွဲၪဖျါခွံၬဝ့ၫ လၧအၥွၫအဂးလီၫ.",
			"28": "<sup>28</sup> ချီအ့ၪဘျႃၪ့ၦမုၪမွဲဂ့ၩ ၦခွၫမွဲဂ့ၩ ထီးအၥံၫဝ့ၫတၭ, ချီနီၪမိဘၪဆၧခွံၬဝ့ၫ လၧလိးတၡါတၭ, ၦၡၩအၪ့ဘၪ",
			"29": "<sup>29</sup> အယၪအ့ၬး အ့ၪမွဲချီအကဆါမိဖီၩ့ဖျ့ၭဝ့ၫလီၫ.- မွဲလါ နၫ့ချီနီၪ အ့ၪဘျႃၪ့ယုၩယါဆၧလၧအခီၩတၭ, ၦဒုၭၥ့ၪ ယၫဝ့ၫအကဆါနီၪ, အဝ့ၫဒၪ အ့ၪလယိဘၪဝ့ၫ အ့ၪမွဲ ထီးလၧချီမၩၥံၫယူၭ ၦမုၪမွဲဂ့ၩၦခွၫမွဲဂ့ၩတၭ, ချီနီၪမိ ဘၪဆၧခွံၬဝ့ၫလၧလိး, ဒဲအကဆါ မိဘၪဆၧမၩၥံၫဝ့ၫ",
			"30": "<sup>30</sup> ဆ့လီၫ.- ဆၧအ့ၪအီၪက့ၪဆၧဖီၩ့ဖျ့ၭအဎွ့ၩ လၧအဂး တၭ,အဝ့ၫမိဘၪဖ့ၪလၫ့ အၥၭမၧၫ့အဎွ့ၩ ထီးဒၪဆၧ",
			"31": "<sup>31</sup> အီၪက့ၪလၧအလီၩ့ထီးအလူၬလီၫ.- အ့ၪဘျႃၪ့ယူၭဖိၪ ခွၫလဂၩမွဲဂ့ၩ, ဖိၪမုၪလဂၩမွဲဂ့ၩ, ဘဲၫဆၧစ့ၩရၫ့ဝ့ၫအ",
			"32": "<sup>32</sup> ၥိၭၦၡၩဘၪမၩလီၫ.- ချီအ့ၪဘျႃၪ့ဆၧအဎီးခွၫမွဲဂ့ၩ, ဆၧအဎီးမုၪမွဲဂ့ၩတၭ, ဘၪဖ့ၪလၫ့အကဆါနီၪ စ့ၩၡက့ လၭ ဎလဘၭၭ ၥၧၫ့ဆံၫတၭ, ချီနီၪမိဘၪဆၧခွံၬဝ့ၫလၧ လိးလီၫ.",
			"33": "<sup>33</sup> ၦၡၩအ့ၪဝဲထၪ့ ဆၧဖၧၩ့မွဲဂ့ၩ အ့ၪခုၪ့ဆၧဖၧၩ့မွဲဂ့ၩ တၭ, အ့ၪလချႃၬဘံၭထၬဘၪနီၪ, ချီမွဲဂ့ၩကၥ့ၪယီၩ့",
			"34": "<sup>34</sup> မွဲဂ့ၩ, အ့ၪလၩ့ထ့ၬလၧအဖၧၩ့တၭ,- ဆၧဖၧၩ့အက ဆါဘၪလိၭအဎွ့ၩတၭ, ဆၧအစွၪနီၪမိကဲၪထၪ့အဆၧ ဒၪဝ့ၫလီၫ.",
			"35": "<sup>35</sup> ၦလဂၩအချီထီးအဘျႃၪ့ ၦလဂၩဒၪအချီထီးအ ၥံၫဝ့ၫတၭ,အဝ့ၫၥံၪဘၪအၪ့ဆၫချီ လၧအမၧၫ့ဒံၭလဒုၩတၭ, အၪ့နၩ့ဖၭစ့ၩ လၧအန့နီၪတၭ, ဘၪအၪ့နၩ့ဖၭဆၧအ",
			"36": "<sup>36</sup> စွၪနီၪဆ့လီၫ.- မွဲလါနၫ့ၦၡၩအ့ၪၥ့ၪယၫလၧချီနီၪဘျႃၪ့ ယုၩယါဆၧလၧအခီၩတၭ, အကဆါအ့ၪလယိဘၪဝ့ၫ နီၪ, ဘၪဖ့ၪထဲၩ့တၡါချီလဒုၩ လၧချီလဒုၩအဂး, ဆၧ အစွၪနီၪမိကဲၪထၪ့အဆၧဒၪဝ့ၫလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ၦလဂၩဂၩအ့ၪအၪ့ဂူၪချီလဒုၩမွဲဂ့ၩး ၥိၪလဒုၩမွဲဂ့ၩ, ဒဲမၩၥံၫဝ့ၫမွဲဂ့ၩ, အၪ့ဆၫခွံၬဝ့ၫမွဲဂ့ၩ, ဘၪဖ့ၪထဲၩ့ချီ ယဲဒုၩလၧချီလဒုၩအဂး, ဒဲၥိၪလံဒုၩလၧၥိၪလဒုၩအ ဂးလီၫ.",
			"2": "<sup>2</sup> ၦလၧအအၪ့ဂူၪဆၧအ့ၪဘၪဆၧဒၪန့ဝ့ၫ လၧအဘုၪ့ဖိး ဆၧအဘိၩ့ဘၭတၭ, ဘၪဆၧဖ့ၬဝ့ၫနီၪ ထီးအၥံၫတၭ,",
			"3": "<sup>3</sup> ဘၪၥံၫဝ့ၫလၧအလးအ့ၬ.- မုအ့ၪထၪ့ချႃၭန့ဝ့ၫတၭ, ဆၧၥွံၪမိအီၪလၧအကၠီၩ့လီၫ. မွဲအဘၪဖ့ၪထဲၩ့ဆၧဎွ့ၩ ဎီၩ့လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩဆ့လီၫ. အဆၧအ့ၪလအီၪဘၪ တၭၦဘၪအၪ့ဆၫခွံၬဝ့ၫ လၧအအၪ့ဂူၪဆၧအကၠီၩ့လီၫ.",
			"4": "<sup>4</sup> ဆၧအ့ၪဒၪန့ ဆၧလၧအအၪ့ဂူၪဆၧမၧၫ့ဝ့ၫ လၧအစူၪ ဖၧၩ့တၡါတၭ, ချီမွဲဂ့ၩ, ကၥ့ၪယီၩ့မွဲဂ့ၩ, ၥိၪမွဲဂ့ၩ,အဝ့ၫ ဘၪဖ့ၪထဲၩ့ဆၧနံၫစၩလီၫ.",
			"5": "<sup>5</sup> ၦၡၩအ့ၪဒုၭအၪ့ခွံၬဘၪဆံၬမွဲဂ့ၩ, စဘံၭမုအလးမွဲ ဂ့ၩ,ဒဲဒုၭနုၬအဆၧဖိၪဆၧဎါလၧအဖၧၩ့, ဒဲဒုၭအၪ့ဝ့ၫ လၧၦဂူၫဂၩအဆံၬဖၧၩ့တၭ, ဆၧအဂ့ၩထုၬလၧအဆံၬ ဖၧၩ့ဒၪဝ့ၫမွဲဂ့ၩ, ဆၧအဂ့ၩထုၬ လၧအစဘံၭမုအလး ဒၪဝ့ၫအဖၧၩ့မွဲဂ့ၩ, ဘၪဖ့ၪထဲၩ့ဝ့ၫဆ့လီၫ.",
			"6": "<sup>6</sup> မ့ၪအ့ၪခဲၩထၪ့တၭ, ဘၪလၧဆၧဆူၪဆၧမဲၪ, ဒဲဘုၪ ထူအီၪကီၪ့မွဲဂ့ၩ, ဘုၪလကူၭဒံၭဘၪမွဲဂ့ၩ, ဆံၬမွဲဂ့ၩ, မ့ၪအ့ၪအၪ့ခွံၬဝ့ၫတၭ, ၦလၧအဆူၭထၪ့မ့ၪလဂၩနီၪ, မိဘၪဖ့ၪထဲၩ့ဆၧဎွ့ၩအလးလီၫ.",
			"7": "<sup>7</sup> ၦအ့ၪအီၪက့ၪဆၧလမံၩ့မံၩ့ လၧၦၡၩလၧအနဲၩ့ထံၭ အစူၪဖၧၩ့, စ့ၩမွဲဂ့ၩ, ဆၧဖိၪဆၧလံၩမွဲဂ့ၩ, ဘဲၫၥိၭအမိ ယိဝ့ၫတၭ, ၦအ့ၪအၪ့ဂူၪဝ့ၫလၧၦလဂၩနီၪ အဂံၪ့ဖၧၩ့ တၭ, ဆၧအ့ၪဒၪန့ၦအၪ့ဂူၪဆၧလဂၩနီၪတၭ, ဘၪဖ့ၪ",
			"8": "<sup>8</sup> ထဲၩ့ဆၧနံၫစၩလီၫ.- ဆၧအ့ၪလဒၪန့ဘၪၦအၪ့ဂူၪဆၧ လဂၩနီၪတၭ, ဂံၪ့ကဆါဘၪဂဲၫ လၧယွၩအအီၪနီၪ,ဘဲၫ ၥိၭဆၧမိဖျီၪထၪ့ လၧအနၫ့ဆါမၩန့ ၦလၧအနဲၩ့ထံၭ",
			"9": "<sup>9</sup> အဆၧဖိၪဆၧလံၩဧၪ, လမၩန့ဘၪဧၪနီၪလီၫ.- လၧက ယဲဆၧမၩမၪဆၧအဂဲး, လၧချီအကၠီၩ့မွဲဂ့ၩ, လၧကၥ့ၪ ယီၩ့အကၠီၩ့မွဲဂ့ၩ, လၧၥိၪအကၠီၩ့မွဲဂ့ၩ, လၧဆၧကီၩ့ ဆၧၥိၭအကၠီၩ့မွဲဂ့ၩ, လၧကယဲဆၧလၧအလၩ့မါလၧ ၦၡၩစံၭ လၧအမွဲအဆၧအကၠီၩ့မွဲဂ့ၩ, ၦနံၫဂၩလူၬအ ခွး ဘၪဂဲၫလၧယွၩအအီၪလီၫ. ၦလၧယွၩမိစ့ၩရၫ့စၪ ဝ့ၫလဂၩနီၪ ဘၪဖ့ၪလၫ့ထဲၩ့ၦလၧ အနဲၩ့ထံၭအဆၧနံၫ စၩလီၫ.",
			"10": "<sup>10</sup> ကၥ့ၪယီၩ့မွဲဂ့ၩ, ချီမွဲဂ့ၩ,ၥိၪမွဲဂ့ၩ, ထီးဒၪဆၧဖိၪဆၧ ဎါလဒုၩဒုၩမွဲဂ့ၩ, ၦအ့ၪအီၪက့ၪလၧၦၡၩ လၧအနဲၩ့ ထံၭအစူၪဖၧၩ့ဘဲၫၥိၭအမိယိဝ့ၫတၭ, ၥံၫမွဲဂ့ၩ, ဘၪထံၭ မွဲဂ့ၩ,ဆၧဖီၪ့န့ဝ့ၫမွဲဂ့ၩ, ၦၡၩအ့ၪလဒၪဘၪနးဂၩတၭ,",
			"11": "<sup>11</sup> ဆၧဆိၪလၩ့အၥၭ ဘၪဆဲၫ့လၧယဟိဝၩ ဘၪအီၪလၧ ၦနံၫဂၩအဘိၩ့ဆၧၩ့ လၧအလမၩဘၪၦလၧအနဲၩ့ထံၭ အဆၧဖိၪဆၧလံၩလီၫ. တၭအကဆါဘၪထိးဆၧၫ့ဝ့ၫ တၭ,အဝ့ၫလဂၩနီၪ ဘၪဖ့ၪထဲၩ့ ဆၧလၧအဂးအ့ၬ.",
			"12": "<sup>12</sup> ဆၧအ့ၪအၪ့ဂူၪတၡါတၭ, ဘၪဖ့ၪထဲၩ့ ဆၧလၧအက",
			"13": "<sup>13</sup> ဆါနီၪထီးအဎွ့ၩထၪ့လီၫ.- ဆၧအ့ၪအဲၪ့ယၬခွံၬဝ့ၫတ ၡါတၭ, မွဲအဂဲၫဆိၬအကုၭအကျၩ့ လၧဆၧထိးအၥၭ အဂးဆံၭ. ဘၪဖ့ၪထဲၩ့ လၧဆၧအဲၪ့ယၬဝ့ၫအဂးအ့ၬ.",
			"14": "<sup>14</sup> တၭၦအ့ၪအၪ့လံၩ့ဆၧလၧၦၡၩ လၧအနဲၩ့ထံၭတၭ, ဘၪဒိၪဘၪထံၭမွဲဂ့ၩ, ၥံၫဝ့ၫမွဲဂ့ၩ, အကဆါလအီၪဘၪ ဝ့ၫတၭ, ဘၪဖ့ၪထဲၩ့ဆၧန့ၫဎီၩ့လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩလီၫ.",
			"15": "<sup>15</sup> အ့ၪမွဲအကဆါအ့ၪအီၪဝ့ၫလၧအၥိၭတၭ, ဘၪဖ့ၪထဲၩ့ ဆၧလၧအဂးအ့ၬ. ဘၪဆၧအၪ့လံၩ့အၥၭတၭ, ဂဲၫဝ့ၫ လၧဆၧအလံၩ့အလဲၫအဂးလီၫ.",
			"16": "<sup>16</sup> တၭၦအ့ၪအၪ့လံၬၦမုၪနၩ့ လၧအလဘၪအဲၪတၩ့လိၬ ဘၪအၥၭလဂၩ, ဒဲမံၫဎုၬဝ့ၫတၭ, အဝ့ၫဒၪဘၪဎွ့ၩန့ဝ့ၫ",
			"17": "<sup>17</sup> လၧအမၫအဂးတၡါလီၫ.- အဖါအ့ၪလမိဖ့ၪလၫ့ဘၪ ဝ့ၫလၧအမၫအဂးနီၪ, ဒဲပဒၩ့ထၬဝ့ၫတၡါတၭ, ဆၧဘၪ လိၭစ့ၩအလယၧးန့ၫဎီၩ့ ၦမုၪနၩ့အဎွ့ၩနီၪလီၫ.",
			"18": "<sup>18</sup> ၦမုၪလၧအအီၪ လၧအယူၬနီၪ ထီးဒုၭမၧၫ့လဂ့ၩ.",
			"19": "<sup>19</sup> ထီးဒၪၦလၧအမံၫဎုၬ လၧဆၧဖိၪဆၧဎါ လဂၩလါ လါနီၪ, မိဘၪဆၧမၩၥံၫဝ့ၫတၡါလီၫ.",
			"20": "<sup>20</sup> ၦလၧအလုထၪ့ဆၧလၧကဆါလဂၩဂၩလၧအလမွဲ ဘၪယဟိဝၩလဂၩနီၪ, မိဘၪဆၧမၩဂၭဂီၩ့ခွံၬဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ၦလခီၫဘၩ့မုးဖိၪနီၪ ထီးမၩအၧၩ့မၩၥၫ့ဘၪလဂ့ၩး အဂဲးဘဲၫယီၩ နၥံၪမွဲယူၭ ၦလခီၫဘၩ့မုးဖိၪ လၧခးအံ ဇံၭအဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> ၦမုၪမဲၫမွဲဂ့ၩ, ၦဖိၪဎွ့ၪမွဲဂ့ၩ, နၥံၪထီးမၩနၭမၩၡၪ့",
			"23": "<sup>23</sup> လဂ့ၩ.- နအ့ၪမၩနၭမၩၡၪ့လမံၩ့မံၩ့တၭ, အဝ့ၫၥံၪအ့ၪ ကိၭထၪ့ယၧၩတီၩတီၩ, ယမိခိၭနၪတၡါ အဆၧကိၭ",
			"24": "<sup>24</sup> နီၪလီၫ.- တၭယၥၭထၪ့မိခဲၩထၪ့တၭ, ယမိမၩၥံၫနၥံၪ လၧနၭတၭ, နၥံၪအမၫမိကဲၪထၪ့ၦမုၪမဲၫတၭ, နၥံၪအ ဖိၪလဖၪမိကဲၪထၪ့ ၦဖိၪဎွ့ၪလီၫ.",
			"25": "<sup>25</sup> နအ့ၪဒုၭအၪ့လီးစ့ၩ လၧၦၡၩခမျၧး ဒဲၦၡၪ့ဖိၪအီၪ လၧနၥိၭတၭ, ကဲၪထၪ့ဘဲၫၦလၧအအၪ့စ့ၩအအ့ၪလၧ အဂးလဂ့ၩ, အီၪက့ၪစ့ၩအအ့ၪ လၧအလီၩ့လဂ့ၩ.",
			"26": "<sup>26</sup> နအ့ၪမၩန့ၦလၧနနဲၩ့ထံၭ အကီၩ့အၥိၭ လၧဆၧပီၩ့လၩ့",
			"27": "<sup>27</sup> ဝ့ၫအဂးနီၪ, ထီးမုလၩ့နုၬတၭ, နဘၪဖ့ၪထဲၩ့လီၫ.-အ ဂဲးဘဲၫယီၩဆၧလုၬဘံၭအၥၭနီၪ, မွဲန့ၫအဝ့ၫဒၪနီၪလီၫ. မွဲအကီၩ့အၥိၭလၧအဖံၭအဂးတၭ, မိမံၫလၧဆၧနီၪလ မံၩ့လဲၪ. တၭထီးအကိၭထၪ့ယၧၩနီၪ, ဆၧမိမၩအၥၭ လၧယမိခိၭနၪလီၫ. အဂဲးဘဲၫယီၩယဝ့ၫဒၪယီၩယဖ့ၪ ခိးဖ့ၪတၩလီၫ.",
			"28": "<sup>28</sup> ထီးဒုၪဒွ့ၪယွၩလဂ့ၩ. ဆိၪအၧၩ့နၡၩခမျၧးအၦဒိၪ လဂ့ၩ.",
			"29": "<sup>29</sup> ဘဲၫၥိၭနမိမၩဘိၪ့နဆၧဎွ့ၩ, နဆၧၥၪမံၫ့အဆိၫ, နစဘံၭၥၪဆိၫအထံၫ, ထီးၥုၭနံၩၥုၭၥၫ့လဂ့ၩး နဖိၪခွၫဝဲ",
			"30": "<sup>30</sup> ၡါလဂၩနီၪနဘၪဖ့ၪလၫ့ယၧၩလီၫ.- ဘဲၫနီၪအၥိၭနဘၪ မၩလၧနချီၥံၪ, နၥိၪၥံၪလီၫ. နွ့ၫနံၩမိအီၪလၧအမိၡါ အၥိၭတၭ, ဎိၭနံၩလနံၩနီၪ နဘၪဖ့ၪလၫ့ယၧၩလီၫ.",
			"31": "<sup>31</sup> တၭနၥံၪမိဘၪကဲၪထၪ့ၦဆံၫ့ဎံၪ လၧယဂးလီၫ. ဆၧ ယၪလၧဆၧဖိၪဆၧဎါ အဲၪ့ၡၫ့ဝ့ၫနီၪ, ထီးအၪ့လဂ့ၩ,ခွံၬ ၡိၭခွံၬလၧထွံၪလဖၪ အအီၪဆံၭ."
		},
		"23": {
			"1": "<sup>1</sup> ဆၧပရၧၫ့ကဘျံၭကဘျၪနီၪ, ထိးဆၧၫ့လဂ့ၩ. အီၪ က့ၪဎုၬနစူၪ လၧၦလတီၩလလီၩ့ဘၪအၥိၭ ဘဲၫၥိၭနမိ ကဲၪထၪ့ ၦလၧအထိးအၥၭ လၧဆၧအၪ့လီၫလဂ့ၩ.",
			"2": "<sup>2</sup> ထီးဖိၬ ၦခမျၧးအခဲၫ့ ဘဲၫနမိမၩဆၧအၧၩ့ အၥိၭနီၪလ ဂ့ၩး ဘဲၫၥိၭဆၧမိဘိၭကၠၪခွံၬဆၧတၭ, ထီးလီၩဆၧၫ့ ဆၧဘၪဆဲၫ့ လၧအခွး ဖိၬထွ့ၫၦအၪဂၩ အခဲၫ့လဂ့ၩ.",
			"3": "<sup>3</sup> ထီးမၩလၩမၩဖၩ့ ၦဘၪၡၪ့ဘၪယၬ လၧဆၧဘၪဆဲၫ့",
			"4": "<sup>4</sup> လၧအခွးနီၪလဂ့ၩ.- နအ့ၪဘၪခီၩ့နဒုၪနဒၩအချီမွဲဂ့ၩ, အကၥ့ၪယီၩ့မွဲဂ့ၩ, လၧအဂၭဖျိၭဖၧၩ့ၥၭတၭ, ဒုၭဂဲၫ ထဲၩ့ထဲၩ့ဝ့ၫ လၧအအီၪတၡါဆံၭ.",
			"5": "<sup>5</sup> နအ့ၪဒၪဘၪ ၦလၧအၥၭဂဲၫ့နၧၩလဂၩ အကၥ့ၪယီၩ့ လၩ့ထံၩဖါဝ့ၫ လၧအဆၧဎၧၫ့အဖၫ့လၬနီၪ, နလမၩ ဆၧၩ့ဘၪတၭ, ထီးအီၪလဂ့ၩ, မၩဆၧၩ့တၡါဆံၭ.",
			"6": "<sup>6</sup> ထီးဘိၭကၠၪခွံၬနၡၩၡၪ့ဖိၪယၬဖိၪ လၧအဆၧစ့ၩရၫ့",
			"7": "<sup>7</sup> ဘၪဆဲၫ့ လၧအခွးလဂ့ၩ.- အီၪယဲၩ့ လၧဆၧလမွဲလ တီၩဘၪနီၪဆံၭ. တၭထီးမၩၥံၫ ၦလၧအဆၧဒဲၩဘၭ လအီၪ, ၦအတီၩအလီၩ့နီၪလဂ့ၩ. အဂဲးဘဲၫယီၩယ",
			"8": "<sup>8</sup> အီၪက့ၪတီၩၦအၧၩ့ဖိၪလဖၪအ့ၬ.- ထီးထိးဆၧၫ့လၬ ဆီၪ့လဂ့ၩး အဂဲးဘဲၫယီၩ လၬဆီၪ့နီၪမၩကဒုၩၦၥုၪ့ ဆၭၥၭဆၭအမ့ၬၥၪတၭ, ဘိၭကၠၪခွံၬၦအတီၩအလီၩ့ လဖၪအဆၧချဲၩ့လီၫ.",
			"9": "<sup>9</sup> ထီးမၩနၭမၩၡၪ့ၦလခီၫဘၩ့မုးဖိၪလဂ့ၩး အဂဲးဘဲၫ ယီၩနၥံၪၥ့ၪယၫၦလခီၫဘၩ့မုးဖိၪအၥၭလီၫ. နၥံၪမွဲၦ လခီၫဘၩ့မုးဖိၪ လၧခးအံဇံၭအဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> တၭနမိဎွံၪဘၪဆၧလၧနဂၪ့ခိၪဎူၫနံၪ့, ဒဲအၪ့ထုၫ့ကီၪ့",
			"11": "<sup>11</sup> အဆၧၥၪလီၫ.- အ့ၪမွဲနွ့ၫနံၪ့လနံၪ့နီၪ, နဘၪဒုၭအီၪပွံၭ ဝ့ၫဒဲအီၪဒၪအဆၧ, ဘဲၫၥိၭၦၡၩခမျၧးအၡၪ့ဖိၪယၬဖိၪ မိအၪ့ဆၧ ဒဲဆၧလၧအဝ့ၫၥံၪအီၪက့ၪလၩ့ထးနီၪ, ဆၧ ဖိၪဆၧဎါအမံၩ့လၧမံၩ့လၬကျၩ မိအၪ့ဘၪဝ့ၫလီၫ.ဘဲၫ နီၪအၥိၭ နဘၪမၩနစဘံၭအလး ဒဲနအလဲအိၫ့ အလး နီၪလီၫ.",
			"12": "<sup>12</sup> ဎူၫနံၩအထးဖၧၩ့နီၪ နမိဘၪမၩနဆၧမၩတၭ,နွ့ၫနံၩ လနံၩနီၪနဘၪအီၪပွံၭ, ဘဲၫၥိၭနချီဒဲနကၥ့ၪယီၩ့မိအီၪ ပွံၭ, ဒဲနဎီးမုၪအဖိၪခွၫ, ဒဲၦလခီၫဘၩ့မုးဖိၪအၥၭမိဎွံၫ ထၪ့မိမုၬထၪ့လီၫ.",
			"13": "<sup>13</sup> ထီးလၩ့နၥံၪအၥၭ လၧကယဲဆၧလၧယစံၭယူၭနၥံၪ ဆံၭး တၭထီးကိၭထၪ့ ယွၩအဂူၫဂၩလဖၪ အမံၩ့လ ဂ့ၩ,မွဲဆၧထီးနါဂၧၫ့ဘၪ လၧအဂဲၫထၪ့လၧနနိၭလဂ့ၩ.",
			"14": "<sup>14</sup> လနံၪ့အထးဖၧၩ့နီၪ ထီးန့ဆၧမၩဘိၪ့လၧယဂးၥၧၫ့ ဖၧၫ့ဆံၭ.",
			"15": "<sup>15</sup> နဘၪထီးန့ဘိၪ့ကိၪလဘၪဘၪလၧမံၪ (နဘၪအၪ့ကိၪ လဘၪဘၪလၧမံၪနီၪနွ့ၫနံၩ, ဘဲၫယမၪလူၬနၧၩအၥိၭ ထီးအဆၧၫ့ အထီလၧလၩအၫ ဘံၭနီၪလီၫ. အဂဲးဘဲၫ ယီၩ လၧလၩနီၪအထးဖၧၩ့ နၥံၪစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭ တၭ,ၦၡၩဂဲၫထၪ့ဘၪ လၧယမ့ၬယၫလၧအအီၪပျီၩပျီၩ",
			"16": "<sup>16</sup> နီၪအ့ၬ.-) ဒဲဘိၪ့ကူၭဆၧ, နမၩဆၧအၥၪဆိၫဘၪဆဲၫ့ လၧနဎွံၪဆၧလၧဆံၬဖၧၩ့း ဒဲဘိၪ့အၪ့ထုၫ့ကီၪ့ဆၧ, ထီး နအၪ့ထုၫ့ကီၪ့နဆၧမၩ လၧဆံၬဖၧၩ့, ဒဲလၧနံၪ့အထုၬ",
			"17": "<sup>17</sup> လီၫ.- လနံၪ့အထးဖၧၩ့နီၪ ကယဲနၥံၪအခွၫထီးအလူၬ ဘၪဂဲၫထၪ့လၧ ယဟိဝၩအမ့ၬယၫ ၥၧၫ့ဖၧၫ့လီၫ.",
			"18": "<sup>18</sup> ထီးလုထၪ့ယဆၧလုအၥွံၪ ဒဲကိၪအီၪ လၧမံၪနီၪလ ဂ့ၩး တၭယဆၧမၩဘိၪ့ အဆၧၥိၪနီၪ ထီးအီၪက့ၪဝ့ၫ ၥၫ့နၩချီၩ့ထီးမုဆဲၪ့ထၪ့နီၪလဂ့ၩ.",
			"19": "<sup>19</sup> နဂၪ့ခိၪအၥၪဆိၫအဝံခိၪလဖၪနီၪ, ဂဲၫဆိၬလၧယဟိ ဝၩနယွၩအဂံၪ့ဖၧၩ့ဆံၭ. ထီးအၪ့ဎွံထၪ့ဘ့ၪဖိၪ လၧအ မိအနူထံၫဖၧၩ့နီၪလဂ့ၩ.",
			"20": "<sup>20</sup> ယိခွါ,ယအၪ့မၧၫ့လၩ့အၥီၫ့လဂၩ လၧနမ့ၬယၫလၧ အမိယိနၧၩလၧဖၧၩ့ၥၭ, ဒဲမိဒုၭဂဲၫနုၬနၧၩ လၧဆၧအ",
			"21": "<sup>21</sup> လးလစီၪ့လၧယတဲၩ့ဝဲၩယူၭလီၫ.- ထီးလၩ့နၥၭလၧ အဝ့ၫဒၪအကၠီၩ့ဒဲခိၭနၪအလူဆံၭ. မၩၥၭထၪ့အဝ့ၫနီၪ လဂ့ၩ. အဂဲးဘဲၫယီၩ မိကွဲၪဖျါခွံၬနၥံၪအဆၧမၪအ့ၬ.",
			"22": "<sup>22</sup> မွဲယမံၩ့အီၪလၧအဖၧၩ့အဂဲးလီၫ.- အ့ၪမွဲနအ့ၪခိၭနၪ အလူလၩ့ထံးလၩ့ဆ့ၭ, ဒဲထီးန့ကယဲယချဲၩ့ဆၧတၭ, ယမိကဲၪထၪ့နဒုၪနဒၩလဖၪအဒုၪအဒၩ, ဒဲၦမၩခိမၩ ဝီၩနၧၩလဖၪ အဆၧမၩခိမၩဝီၩဝ့ၫလီၫ.",
			"23": "<sup>23</sup> အဂဲးဘဲၫယီၩယၥီၫ့နီၪ မိလ့ၩလၧနမ့ၬယၫဒဲဒုၭလ့ၩ နၧၩလၧၦအၫမိၫဖိၪ, ဒဲၦဟ့ၥၭဖိၪ, ဒဲၦပံရ့ၭဖိၪ,ဒဲၦကၫ နအၫ့ဖိၪ, ဒဲၦဟ့ဝဲၭဖိၪ, ဒဲၦယ့ဘူၫဖိၪလဖၪအအီၪတၭ,",
			"24": "<sup>24</sup> ယမိမၩဂၭဂီၩ့အဝ့ၫၥံၪလီၫ.- ထီးဘိၪ့ထၪ့ဘၩထၪ့အ ဝ့ၫၥံၪအယွၩလဖၪလဂ့ၩး မၩအဆၧလဂ့ၩး မၩဆၧဘဲၫ အဝ့ၫၥံၪ မၩဝ့ၫအၥိၭနီၪလဂ့ၩ, အ့ၪမွဲနဘၪမၩဂၭဂီၩ့",
			"25": "<sup>25</sup> ဒဲမၩလၩ့ဘျ့ၭအဆၧဂၩ့လဖၪနီၪလီၫ.- နၥံၪဘၪမၩ ယဟိဝၩနၥံၪအယွၩအဆၧတၭ, အဝ့ၫနီၪမိဆိၪဂ့ၩနၥံၪ အကိၪ, ဒဲနၥံၪအထံၫလီၫ. တၭယမိအၪ့မၩန့ထၪ့ခွံၬ",
			"26": "<sup>26</sup> ဆၧစူၭဆၧဆၫလၧနၥံၪအကျၩလီၫ.- ဆၧအဂူၭလၩ့ ဎွံၪဘၪအ့ၬး ဆၧထူၬဖိၪအီၪဘၪလၧနခးဖၧၩ့နးမံၩ့အ့ၬ.",
			"27": "<sup>27</sup> နနံၩနၥၫ့ဎွ့ၩအံၩဎွ့ၩအိၩ ယမိမၩဎွ့ၩထၪ့လီၫ.- ယမိ အၪ့မၧၫ့ယဆၧၥၭမဲၪ လ့ၩလၧနမ့ၬယၫတၭ, ကယဲၦ ခမျၧးလၧနမိလ့ၩ လၧအအီၪထီးအလူၬနီၪ ယမိမၩဂၭ ဂီၩ့ဝ့ၫတၭ, ယမိအၪ့မၧၫ့နဒုၪနဒၩ ကၠၪဒိၭချိၫ့အၥၭလၧ",
			"28": "<sup>28</sup> နအီၪလီၫ.- တၭယမိအၪ့မၧၫ့ဖျၧၫ့ၥံၪ လ့ၩလၧနမ့ၬယၫ လၧအမိနၫ့ထၪ့ခွံၬ ၦဟ့ဝဲၭဖိၪ, ၦကၫနအၫ့ဖိၪ, ဒဲၦဟ့",
			"29": "<sup>29</sup> ၥၭဖိၪ လၧနမ့ၬယၫလီၫ.- ယမိနၫ့ထၪ့ခွံၬဝ့ၫ လၧနမ့ၬ ယၫလၧလနံၪ့ဎးအ့ၬး အ့ၪမွဲဘဲၫနီၪတၭ, ခးမိအီၪယူ ဘၪခိၬတၭ, ဆၧဖိၪဆၧဎါအမံၩ့လၧမံၩ့လၬကျၩမိအၪ",
			"30": "<sup>30</sup> ထၪ့ထၫ့ဒုၪဒၩနၧၩလီၫ.- ယမိနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪလၧ နမ့ၬယၫလဆံၭဘၪလဆံၭ ထီးနမိအၪထၪ့ဒဲန့ၥၫထံၫ ၥံၪခးၥံၪနီၪလီၫ.",
			"31": "<sup>31</sup> တၭယမိအီၪက့ၪနနဲၩ့ထံၭ လၧမၫဆမံၭဝီၩ ဖိးလၧ ဖလံၡၫဖိၪအမၫဆမံၭ, ဒဲလၧၡါမုနၧၫ့ဖၫ ဖိးလၧထံၫမိ ၡါလီၫ. အဂဲးဘဲၫယီၩယမိဖ့ၪလၫ့ခွံၬပခးဖိၪလၧနစူၪ ဖၧၩ့တၭ, နမိဘၪနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧနမ့ၬယၫလီၫ.",
			"32": "<sup>32</sup> တၭလၧအဝ့ၫၥံၪမွဲဂ့ၩ, ဒဲအယွၩလဖၪမွဲဂ့ၩ, ထီးအုၩ့",
			"33": "<sup>33</sup> လၩ့ဆၧလၧအဝ့ၫၥံၪနးမံၩ့လဂ့ၩ,- အဝ့ၫၥံၪမိအီၪဘၪ လၧနခးဖၧၩ့အ့ၬ. မွဲအမိအၪ့မၧၫ့နမၩမၪဘၪခိၬယၧၩ လီၫ. အဂဲးဘဲၫယီၩ နအ့ၪမၩအဝ့ၫၥံၪအယွၩလဖၪအ ဆၧတၭ, ဆၧမိကဲၪထၪ့ဖျံၩခွၩ့ လၧနဂးလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪစံၭစမိစ့ၭ, ဂဲၫထၪ့လၧယဟိဝၩအအီၪ, နဝ့ၫဒၪဒဲစအၫရၧၫ့, စနၫဒၭ, ဒဲစအဘဲဟုၫ, ဒဲအံၫစရ့ လၭအၡၩၥုၪ့က့ၭၥၭၡါၥံၪ နွ့ၫဆံၫတၭ, မွဲနၥံၪဘိၪ့ထၪ့",
			"2": "<sup>2</sup> ဘၩထၪ့ဆၧအီၪလၧအယဲၩ့ဆံၭ.- တၭစမိစ့ၭ, မိၥုၭ ဘူၭအၥၭလၧယဟိဝၩအအီၪ န့ၫလဂၩဎးနီၪလီၫ.အ ဝ့ၫၥံၪမိၥုၭဘူၭအၥၭအ့ၬး ဒဲၦခမျၧးလ့ၩထၪ့ဘၪလၧ အဝ့ၫဒၪအၥိၭဆ့အ့ၬ.",
			"3": "<sup>3</sup> စမိစ့ၭဂဲၫဝ့ၫတၭ, လီၩဘၪၦခမျၧး လၧကယဲယဟိ ဝၩအဆၧချဲၩ့လဖၪ, ဒဲကယဲအစ့ၩရၫ့ဆၧထီးအလူၬ တၭ,ၦခမျၧးလီၩဆၧၫ့ဆၧ လၧအလူလဖၧၫ့ဎးထီးအ လူၬတၭ, စံၭဝ့ၫဒၪ, ကယဲဆၧချဲၩ့လၧယဟိဝၩချဲၩ့ဆၧ နီၪပမိထီးန့ထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> စမိစ့ၭကွ့ၭလၩ့ ကယဲယဟိဝၩအဆၧချဲၩ့လဖၪထီး အလူၬတၭ, လၧမုဂီၩနီၪဂဲထုၪ့ဂီၩဂီၩလ့ၬတၭ, မၩဆၧ လုအလးလၧခိၪလီၩ့ခၪ့ထံၭနီၪ, ဒဲဆၧအထုၪ့လဆံၫနံၫ ထုၪ့ဎွ့ၩဎီၩ့လၧၦအံၫစရ့လၭဖိၪ လဆံၫနံၫဒီၪ့နီၪလီၫ.",
			"5": "<sup>5</sup> အဝ့ၫဒၪအၪ့မၧၫ့ ၦၥၭဘၪ့လၧအံၫစရ့လၭဖိၪ အကျၩ တၭ,အဝ့ၫၥံၪလုထၪ့ဆၧလုမ့ၪ, ဒဲလုထၪ့ယဟိဝၩလၧ",
			"6": "<sup>6</sup> ဆၧလုဘၪလိၬအိၭလိၬဆၧအချီဖၫၥံၪနီၪလီၫ.- စမိစ့ၭ မၩန့ဆၧၥွံၪနံၫပိၩ့လပိၩ့တၭ, ဒုၭနုၬဝ့ၫလၧလိၫ့လဖၪ အဖၧၩ့တၭ, ဆၧၥွံၪနံၩပိၩ့လပိၩ့နီၪ ဎွံၪဝ့ၫလၧဆၧလု",
			"7": "<sup>7</sup> လးအဖၫ့ခိၪနီၪလီၫ.- မၩန့လံၬဆၧအုၩ့လၩ့တၭ, ဖီဝ့ၫ လၧၦခမျၧးအနါဖၧၩ့တၭ, အဝ့ၫၥံၪစံၭ, ကယဲဆၧလၧ",
			"8": "<sup>8</sup> ယဟိဝၩချဲၩ့ဆၧနီၪပမိထီးန့ဒဲခိၭနၪလီၫ.- စမိစ့ၭမၩ န့ဆၧၥွံၪတၭ, ဎွံၪဝ့ၫလၧၦခမျၧးအလီၩ့တၭ, စံၭဝ့ၫဒၪ, ယိခွါ,ဆၧၥွံၪဘၪဆဲၫ့ လၧဆၧအုၩ့လၩ့လၧယဟိဝၩ အုၩ့လၩ့လၧနၥံၪ လၧဆၧချဲၩ့ယီၩ ထီးအလူၬအဂဲးအ ကၠီၪ့လီၫ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့ စမိစ့ၭ ဒဲစအၫရၧၫ့ ဒဲစနၫဒၭ, စအဘဲ ဟုၫ, ဒဲအံၫစရ့လၭ အၡၩအၥုၪ့က့ၭၥၭၡါ နွ့ၫဆံၫလ",
			"10": "<sup>10</sup> ဖၪလ့ၩထၪ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪဒၪဘၪအံၫစရ့လၭအယွၩ တၭ, ဆၧအလးလၧအခၪ့အဖၫ့လၬ မၩအၥၭဘဲၫထၫ့ မျါနံလၫအၥိၭနီၪ, မၩအၥၭဘဲၫမူၭခိၪအလးဒၪဝ့ၫလၧ",
			"11": "<sup>11</sup> အဆံၫ့အၥိၭနီၪလီၫ.- အဝ့ၫဒၪယၩ့ထၪ့အစူၪလၧအံၫ စရ့လၭအခိၪလဖၪအ့ၬ. တၭအဝ့ၫၥံၪဒၪဘၪယွၩတၭ, အၪ့ဆၧဒဲအီၩဆၧလီၫ.",
			"12": "<sup>12</sup> တၭယဟိဝၩ စံၭစမိစ့ၭ ဂဲၫထၪ့လၧယအီၪလၧခိၪ လီၩ့အလီၩ့နီၪတၭ, အီၪထီးနီၪဆံၭ. တၭယမိဖ့ၪလၫ့ နၧၩလၧလိးပၪလဖၪ, ဒဲဆၧၥီၪ့ဆၧၥၫ့, ဒဲဆၧမၪလူၬလၧ",
			"13": "<sup>13</sup> ယကွ့ၭယူၭနီၪ, ဘဲၫၥိၭနမိၥီၪ့လိၪအဝ့ၫၥံၪလီၫ.- တၭ စမိစ့ၭဂဲထုၪ့ဒဲအခ့ၫအၡၩ စယီရှုၫအ့ၫတၭ, စမိစ့ၭလ့ၩ",
			"14": "<sup>14</sup> ထၪ့လၧယွၩအခိၪလီၩ့နီၪလီၫ.- အဝ့ၫဒၪစံၭၦၥုၪ့က့ၭ ၥၭၡါ,အီၪခိၭပၧၩထီးယီၩ, ထီးပဂဲၫထဲၩ့ကဒၩထဲၩ့ လၧနၥံၪအအီၪဆံၭ. တၭယိခွါ, စအၫရၧၫ့ ဒဲစဟၧၫ အီၪလၧနၥံၪအၥိၭလီၫ. ၦလဂၩဂၩအမူၭ အ့ၪအီၪနီၪ မွဲအလ့ၩလၧအဝ့ၫၥံၪအအီၪဆံၭ.",
			"15": "<sup>15</sup> စမိစ့ၭလ့ၩထၪ့လၧခိၪလီၩ့ခိၪနီၪတၭ, ဆၧအုၪ့ချႃၬ",
			"16": "<sup>16</sup> ဘံၭခိၪလီၩ့နီၪလီၫ.- တၭယဟိဝၩအလၩအဖၩ့အီၪ ဝ့ၫလၧခိၪလီၩ့စဲနၫအလီၩ့, ဆၧအုၪ့ချႃၬဘံၭဝ့ၫဎူၫနံၩ တၭ,နွ့ၫနံၩလနံၩနီၪမွဲအကိၭထၪ့စမိစ့ၭ လၧဆၧအုၪ့",
			"17": "<sup>17</sup> အၥၭခံဖၧၩ့လီၫ.- တၭၦယိယဟိဝၩအလၩအဖၩ့နီၪ, လၧၦအံၫစရ့လၭဖိၪအမ့ၬယၫ မၩအၥၭဘဲၫမ့ၪအၪ့ဆၧ",
			"18": "<sup>18</sup> လၧခိၪလီၩ့ အဒၩ့ခိၪအၥိၭလီၫ.- စမိစ့ၭလ့ၩနုၬလၧ ဆၧအုၪ့အၥၭခံဖၧၩ့တၭ, လ့ၩထၪ့လၧခိၪလီၩ့ ခိၪနီၪ လီၫ. တၭစမိစ့ၭအီၪဝ့ၫ လၧခိၪလီၩ့အလီၩ့ အနံၩလံ ဆံၫ, ဒဲအနၩလံဆံၫလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, စံၭၦအံၫ စရ့လၭဖိၪ လၧအမိဘၪဂဲၫဆိၬအ့ၪယၧၩ လၧဆၧမၩ",
			"2": "<sup>2</sup> ဘိၪ့ဆံၭ.- ကယဲၦလၧအဖ့ၪဒၪဆၧ လၧအၥၭလဂၩလါ လါနီၪ,နၥံၪဘၪမၩန့ဆၧမၩဘိၪ့ယၧၩ လၧအဝ့ၫၥံၪဆုၬ",
			"3": "<sup>3</sup> ဆုၬလီၫ.- တၭအယီၩမွဲဆၧမၩဘိၪ့လၧနၥံၪဘၪမၩန့ လၧအစူၪဖၧၩ့,ထီၫ့ၥံၪလွ့ၫၥံၪ, ကျိၪၥံၪစ့ၩၥံၪ, ဒဲထီးဝီၩ",
			"4": "<sup>4</sup> ၥံၪ,- ဒဲဆၧလၫ, ဒဲဆၧအလုၭဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫ",
			"5": "<sup>5</sup> လံၬကံၭ,ဒဲဘ့ၪအဆီၪ့,- ဒဲၥိၪဖၫအဖံၭဝီၩ, ဒဲတဟၫၡၭ",
			"6": "<sup>6</sup> အဖံၭ, ဒဲၥံၪ့ၡံၭတၫ,- ဒဲၥိၪလၧမ့ၪဒိၩ့အဂး, ဒဲဆၧနၧၫ့ မၧၫ့ လၧၥိၪဂုၪဆၧအဂး, ဒဲဆၧဆူၭခဲၩမ့ၪ နၧၫ့မၧၫ့အ",
			"7": "<sup>7</sup> ဂး.- ထၫ့မျါမဟူယါ, ဒဲလိးမၩဎွ့ၩဆၧလၧအ့ဖိၭအ",
			"8": "<sup>8</sup> ဖၧၩ့,ဒဲလၧၥၭနၫပဒၩ့အဖၧၩ့လီၫ.- ဘဲၫၥိၭယမိအီၪလၧ အဝ့ၫၥံၪအကျၩတၭ, မွဲအမၩဆၧအလးဆံၫ့ဎံၪလၧယ",
			"9": "<sup>9</sup> ဂးဆံၭ.- ဘဲၫကယဲဆၧလၧယဒုၭဒၪဘၪနၧၩ တဲၩဆံၫ့ ဎံၪအဒီၩ့အထ့ၬ, ဒဲအဆၧဖိၪဆၧလံၩ အဒီၩ့အထ့ၬအၥိၭနီၪ, နၥံၪဘၪမၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.",
			"10": "<sup>10</sup> တၭအဝ့ၫၥံၪ ဘၪမၩတလၫ လၧၥံၪ့ၡံၭတၫလဖျိၪ့ လီၫ. အဖၭထီၫနံၫဖျါထၫ, ဒဲအဒၪ့ဎၩ့လဖျါထၫ, ဒဲအ",
			"11": "<sup>11</sup> ဆီၩ့ဆီထၪ့လဖျါထၫလီၫ.- တၭနဘၪဖၩ့ဝ့ၫလၧထီၫ့ ဆံၫ့, လၧအချိၫ့မွဲဂ့ၩ, အဖၧၩ့မွဲဂ့ၩ, နဘၪဖၩ့အလီၩ့, ဒဲနဘၪမၩဆၧခွၩ့ထၬ ထီၫ့ဝၬဖီၩ့ လၧအဖၫ့ခိၪလီၫ.",
			"12": "<sup>12</sup> တၭနဘၪၥိၫ့အခွၩ့ထီၫ့လံခွၩ့လၧအဂး ဒဲအီၪက့ၪဝ့ၫအ နိၪ့လံနိၪ့တၭ, ခွၩ့နံၫခွၩ့ မိအီၪလၧလခီၫ, ဒဲခွၩ့နံၫခွၩ့",
			"13": "<sup>13</sup> မိအီၪလၧလခီၫဒၪလီၫ.- တၭနဘၪမၩနိၪယိၭဘီၩ့နံၫ",
			"14": "<sup>14</sup> ဘီၩ့လၧၥံၪ့ၡံၭတၫ, ဒဲဖၩ့ဝ့ၫလၧထီၫ့လီၫ.- တၭနဘၪ ဒုၭနုၬနိၪယိၭဘီၩ့လဖၪ လၧအခွၩ့ဖၧၩ့လၧတလၫအ နဲၩ့ထံၭ,ဘဲၫၥိၭၦၡၩမိဆိၬတလၫ လၧအဝ့ၫၥံၪနီၪလီၫ.",
			"15": "<sup>15</sup> တၭနိၪယိၭဘီၩ့လဖၪမိအီၪဒၪအဆၧ လၧတလၫအခွၩ့ ဖၧၩ့လီၫ. တၭၦၡၩထုၭထၪ့ခွံၬဘၪ လၧအဖၧၩ့အ့ၬ.",
			"16": "<sup>16</sup> တၭနဘၪဒုၭနုၬ ဆၧအုၩ့လၩ့ လၧယမိဖ့ၪလၫ့နၧၩ လၧ တလၫအဖၧၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> တၭနဘၪမၩဆၧယၫ့ၥၭအလး လၧထီၫ့ဆံၫ့ထုၬလီၫ.",
			"18": "<sup>18</sup> အဖၭထီၫနံၫဖျါထၫဒဲအဒၪ့ဎၩ့လဖျါထၫလီၫ.- တၭန ဘၪတဲၩ့ခ့ၫရူၬနံၫဒုၩလၧထီၫ့လလီၪ့ဎးနီၪ နဘၪတဲၩ့ဝ့ၫ,",
			"19": "<sup>19</sup> ထီးဆၧယၫ့ၥၭအလးအထိၭနၫနံၫခီၫလူၬလီၫ.- တဲၩ့ ခ့ၫရူၬလဒုၩလၧထိၭနၫလခီၫ, ဒဲခ့ၫရူၬအဝ့ၫလဒုၩလၧ အထိၭနၫလခီၫဒၪလီၫ. နၥံၪဘၪတဲၩ့ခ့ၫရူၬလဖၪထီး",
			"20": "<sup>20</sup> ဆၧယၫ့ၥၭအလးအထိၭနၫနံၫခီၫလီၫ.- ခ့ၫရူၬလဖၪ မိအီၪလၧအဒံၭယၩ့ထၪ့အၥၭ, အဒံၭလဖၪမိချႃၬဘံၭ ဆၧယၫ့ၥၭ အလးအဖၫ့ခိၪတၭ အမ့ၬမိယိလိၬအၥၭ လီၫ. ခ့ၫရူၬလဖၪ အမ့ၬမိအီၪ တီၩလၧဆၧယၫ့ၥၭအ",
			"21": "<sup>21</sup> လးလီၫ.- နဘၪအီၪက့ၪဆၧယၫ့ၥၭအလး လၧတလၫ အဖၫ့ခိၪတၭ, နဘၪဒုၭနုၬဆၧအုၩ့လၩ့လၧယမိဖ့ၪလၫ့",
			"22": "<sup>22</sup> နၧၩ လၧတလၫဖၧၩ့လီၫ.- ယမိဒၪလိၬယၥၭလၧနၧၩ ထီးနီၪတၭ, ယမိချဲၩ့ဆၧလၧနၧၩ လၧဆၧယၫ့ၥၭ အ လးအဖၫ့ခိၪတၭ, လၧခ့ၫရူၬလဖၪ အဘိၩ့ဆၧၩ့ လၧ အအီၪလၧတလၫအဖၫ့ခိၪဘၪဆဲၫ့ လၧဆၧအုၩ့လၩ့ လၧဆၧထီးအလူၬ လၧယမိမၪလူၬနၧၩ လၧၦအံၫစရ့ လၭဖိၪအဂးလီၫ.",
			"23": "<sup>23</sup> နဘၪမၩဆ့ စပွဲနးဒုၩလၧၥံၪ့ၡံၭတၫလီၫ. အဖၭထီၫ နံၫဖျါ, ဒဲအဒၪ့ဎၩ့လဖျါ, ဒဲအဆီၩ့ဆီထၪ့လဖျါထၫလီၫ.",
			"24": "<sup>24</sup> တၭနဘၪဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့ထုၬ ဒဲမၩဆၧခွၩ့ထၬထီၫ့",
			"25": "<sup>25</sup> ဝၬဖီၩ့ဝ့ၫလီၫ.- နဘၪမၩအခိၪဖဲၩ့လဖံၭဝၬဝၬတၭ,နဘၪ",
			"26": "<sup>26</sup> မၩခွၩ့ထၬထီၫ့လၧအခိၪဖဲၩ့ဖၫ့ခိၪဝၬဝၬလီၫ.- နဘၪမၩခွၩ့ ထီၫ့လံခွၩ့လၧအဂးတၭ,နဘၪအီၪက့ၪဆၧခွၩ့ လၧအနိၪ့",
			"27": "<sup>27</sup> လံနိၪ့လၧအအီၪလၧအခၪ့လံခီၫအလီၩ့လီၫ.- ခွၩ့လဖၪ နီၪဘၪအီၪဎၩ့လၧအခိၪဖဲၩ့ လၧနိၪယိၭဘီၩ့အဂးလၧ",
			"28": "<sup>28</sup> ၦၡၩမိယိၭထၪ့စပွဲနီၪအဂးလီၫ.- နဘၪမၩနိၪယိၭဘီၩ့ လၧၥံၪ့ၡံၭတၫတၭ, ဖၩ့ဝ့ၫလၧထီၫ့, ဘဲၫၥိၭၦၡၩမိဆိၬထၪ့",
			"29": "<sup>29</sup> စပွဲလၧအဝ့ၫၥံၪလီၫ.- တၭနဘၪမၩအထွ့ၫလဖၪ, အနိၪ ထိၩ့လဖၪ, ဒဲအခိၪချႃၬလဖၪ, ဒဲအလိၫ့လၧၦလူၫလၩ့ ဆၧလၧအဝ့ၫလဖၪလီၫ. နဘၪမၩလၧထီၫ့ဆံၫ့ထုၬလီၫ.",
			"30": "<sup>30</sup> တၭနဘၪအီၪက့ၪထၪ့ ဆၧမ့ၬယၫအကိၪလၧစပွဲခိၪ လၧယမ့ၬယၫ လထံၪဎးလီၫ.",
			"31": "<sup>31</sup> တၭနဘၪတဲၩ့မ့ၪဒိၩ့မိၡါ လၧထီၫ့ဆံၫ့ထုၬလီၫ.မ့ၪဒိၩ့ မိၡါနီၪမိဘၪမၩဝ့ၫလၧထီၫ့လလီၪ့ဎးနီၪး အဘီၩ့ဒဲအ ထဲၩ့လဖၪ, အခိၪမၪ့လဖၪ, အမိၬလဖၪ,အဖီၫလဖၪမိ",
			"32": "<sup>32</sup> ဘၪမၩဝ့ၫ လၧဆၧနီၪလမံၩ့ဎးလီၫ.- တၭအထဲၩ့ဎူၫ ထဲၩ့မိဂဲၫထၪ့လၧအပၪထံၭလဖၪလီၫ. မ့ၪဒိၩ့မိၡါအ ထဲၩ့ၥၧၫ့ထဲၩ့လၧအနီၪလခီၫ, ဒဲမ့ၪဒိၩ့မိၡါအထဲၩ့ၥၧၫ့",
			"33": "<sup>33</sup> ထဲၩ့လၧအယီၩလခီၫလီၫ.- အခိၪမၪ့လၩ့ဂၬၡါကၭၥၪ ၥၧၫ့ဖျိၪ့, အဒိၪမိၬလဖျိၪ့, ဒဲဖီၫလမုၫအီၪလၧအဝ့ၫလ ထဲၩ့လီၫ. ဒဲအခိၪမၪ့လၩ့ဂၬၡါကၭၥၪၥၧၫ့ဖျိၪ့, အဒိၪမိၬ လဖျိၪ့,ဒဲဖီၫလမုၫအီၪဝ့ၫ လၧအဝ့ၫလထဲၩ့လီၫ. ဘဲၫနီၪ အၥိၭ လၧထဲၩ့ဎူၫထဲၩ့ လၧအဂဲၫထၪ့ လၧမ့ၪဒိၩ့မိၡါ",
			"34": "<sup>34</sup> လီၫ.- တၭမ့ၪဒိၩ့မိၡါနီၪမိဘၪအီၪ လၧအခိၪ မၪ့လၩ့ ဂၬၡါကၭၥၪလံဖျိၪ့အဒိၪမိၬလဖၪ, ဒဲအဖီၫလဖၪလီၫ.",
			"35": "<sup>35</sup> အဒိၪမိၬလဖျိၪ့ မိအီၪလၧထဲၩ့နံၫထဲၩ့ အဖၫ့လၬ လၧ ဆၧလမံၩ့ဎးတၭ, အဒိၪမိၬလဖျိၪ့ မိအီၪလၧထဲၩ့နံၫ ထဲၩ့အဖၫ့လၬလၧဆၧလမံၩ့ဎးတၭ, အဒိၪမိၬလဖျိၪ့မိ အီၪလၧထဲၩ့ နံၫထဲၩ့အဖၫ့လၬ လၧဆၧလမံၩ့ဎးတၭ, ဘဲၫအထဲၩ့ ဎူၫထဲၩ့လၧအဂဲၫထၪ့ လၧမ့ၪဒိၩ့ မိၡါအ",
			"36": "<sup>36</sup> လီၩ့အၥိၭနီၪလီၫ.- အဒိၪမိၬလဖၪ, ဒဲအထဲၩ့လဖၪ မိ ဘၪအီၪဝ့ၫလၧဆၧ လမံၩ့ဎးလီၫ. အဆၧထီးအလူၬမိ",
			"37": "<sup>37</sup> ဘၪအီၪဝ့ၫလၧထီၫ့ဆံၫ့ထုၬလမံၩ့ဎးလီၫ.- နဘၪတဲၩ့ အမ့ၪဒိၩ့နွ့ၫဖျိၪ့တၭ, ၦဘၪစီၩ့ထၪ့မ့ၪဒိၩ့ လဖၪနီၪ,",
			"38": "<sup>38</sup> ဘဲၫၥိၭအမိဖၩ့ထၪ့ဆဲၫဎၩ့လၧအမ့ၬယၫလီၫ.- တၭအ နိၪထံၬမ့ၪ, ဒဲနိၪထံၬအထွ့ၫလဖၪ ဆၧဘၪမၩဝ့ၫ လၧ",
			"39": "<sup>39</sup> ထီၫ့ဆံၫ့ထုၬလီၫ.- တၭဘၪတဲၩ့ဝ့ၫလၧဆၧဖိၪဆၧလံၩ လဖၪထီးအလူၬ လၧထီၫ့ဆံၫ့ထုၬ အလယၧးလကံကၫ",
			"40": "<sup>40</sup> လီၫ.- တၭထီးလၩ့နၥၭမၩဝ့ၫ ဘဲၫဆၧအဒီၩ့အထ့ၬ လၧဆၧဒုၭဒၪဘၪနၧၩ လၧခိၪလီၩ့ခိၪနီၪဆံၭ."
		},
		"26": {
			"1": "<sup>1</sup> တၭနဘၪမၩတဲၩဆံၫ့ဎံၪနီၪ အီၪလၧကလကၫဆၧ ဘွၩဖျ့ၫလံၭကံၭအလူၪဝံၭဎဲၩ့အၥၭ, ဒဲဆၧလၫ,ဒဲဆၧဝီၩ လုၭ ဒဲဆၧဝီၩနီၪဆံၫဘံၪ့လီၫ. နဘၪမၩဝ့ၫလၧခ့ၫရူၬ",
			"2": "<sup>2</sup> လၧၦၡၩ မၩဆၧၥ့ၪအဆၧမၩလီၫ. ကလကၫလဘံၪ့ အဖၭထီၫနံၫဆံၫဎိၭဖျါ, ဒဲကလကၫလဘံၪ့အဒၪ့ဎၩ့ လံဖျါတၭ, ကလကၫလဖၪနီၪဘၪအီၪန့ၫဎီၩ့လိၬအၥၭ",
			"3": "<sup>3</sup> ကိၭဘံၪ့ဒ့ၭလီၫ.- တၭကလကၫယဲဘံၪ့နီၪ ဘၪဘုၭ ထၬလိၬအၥၭလဘံၪ့ဒဲလဘံၪ့, ဒဲဂူၫဂၩယဲဘံၪ့ဘၪဘုၭ",
			"4": "<sup>4</sup> ထၬလိၬအၥၭလဘံၪ့ဒဲလဘံၪ့လီၫ.- တၭနဘၪမၩအနါ လဖၪလၧဆၧလၫလၧကလကၫလဘံၪ့အနဲၩ့ထံၭ, လၧ အအီၪထီးဆၧဘုၭထၬလိၬအၥၭ ထီးအထုၬလီၫ.ဒဲန ဘၪမၩဆၧဘဲၫနီၪၥိၭလၧကလကၫလဘံၪ့ လၧအအီၪ လၧဆၧဘုၭထၬလိၬအၥၭ နံၫဘံၪ့လဘံၪ့ ထီးအထုၬ",
			"5": "<sup>5</sup> နီၪလီၫ.- နဘၪမၩအနါယဲဆံၫလၧကလကၫလဘံၪ့အ လီၩ့တၭ, ဆဲၫဎၩ့လိၬအၥၭလၧအဝ့ၫၥံၪနီၪနဘၪမၩအ နါယဲဆံၫ လၧကလကၫလဘံၪ့အလီၩ့ လၧအအီၪလၧ ဆၧဘုၭထၬလိၬအၥၭနံၫဘံၪ့လဘံၪ့ ထီးအထုၬလီၫ.",
			"6": "<sup>6</sup> တၭနဘၪမၩနိၪပုၭထီၫ့ယဲဆံၫ, ဒဲဒုၭဘုၭထၬကလကၫ လဖၪ လၧနိၪပုၭတၭ, မိကဲၪထၪ့တဲၩဆံၫ့ဎံၪ လဖျိၪ့ လီၫ.",
			"7": "<sup>7</sup> တၭနဘၪမၩကလကၫလဖၪ လၧဘ့ၪအဆီၪ့လၧတဲၩ ဆံၫ့ဎံၪအဖၫ့ခိၪအဂးလီၫ. နဘၪမၩကလကၫဆံၫလ",
			"8": "<sup>8</sup> ဘံၪ့လီၫ.- တၭကလကၫလဘံၪ့အဖၭထီၫနီၪအဖျါၥၧၫ့ ဆံၫ,ဒဲအဒၪ့ဎၩ့လံဖျါတၭ, ကလကၫလဆံၫလဘံၪ့နီၪ",
			"9": "<sup>9</sup> မိဘၪအီၪန့ၫဎီၩ့လိၬအၥၭလီၫ.- တၭနဘၪမၩဘုၭထၬ လိၬအၥၭ လၧကလကၫ ယဲဘံၪ့လစီၪ့ ဒဲကလကၫဎူၫ ဘံၪ့လစီၪ့ဒၪနီၪတၭ, နဘၪခါချံၭကလကၫဎူၫဘံၪ့ လ",
			"10": "<sup>10</sup> ဘံၪ့ဆဲၫဎၩ့လၧတဲၩဆံၫ့ဎံၪအမ့ၬယၫလီၫ.- တၭနဘၪ မၩအနါယဲဆံၫ လၧကလကၫလဘံၪ့အနဲၩ့ထံၭလၧအ အီၪလၧဆၧဘုၭထၬလိၬအၥၭ ထီးအထုၬလီၫ. တၭန ဘၪမၩအနါယဲဆံၫ လၧကလကၫလဘံၪ့ အနဲၩ့ထံၭ လၧအအီၪ လၧဆၧဘုၭထၬလိၬ အၥၭ နံၫဘံၪ့ထီးအ",
			"11": "<sup>11</sup> ထုၬလီၫ.- တၭနဘၪမၩနိၪပုၭထီးဝီၩ, ဒဲပုၭထၪ့အနါ လၧနိၪပုၭလဖၪနီၪ, ဒဲမၩဘုၭထၬတဲၩတၭ, မိကဲၪထၪ့",
			"12": "<sup>12</sup> ဆၧလဖျိၪ့ဎးလီၫ.- တၭဆၧအီၪလၨၪဒံၭ, ကလကၫ လၧအအီၪလၩ့ထးလၧတဲၩနီၪ, ဒဲကလကၫလခီၫလၧ အအီၪလၨၪဒံၭနီၪမိလၩ့ဆဲၩဝ့ၫ လၧတဲၩဆံၫ့ဎံၪ အချိၫ့",
			"13": "<sup>13</sup> နီၪလီၫ.- တၭလၧအဝ့ၫလခီၫလဖျါ, ဒဲလၧအလခီၫဒၪ လဖျါလၧအအီၪလၨၪဒံၭလၧတဲၩ အကလကၫလဖၪအ ဖၭထီၫနီၪမိလၩ့ဆဲၩလၧတဲၩဆံၫ့ဎံၪအပၪ လၧအယီၩ လခီၫ, ဒဲလၧအနီၪလခီၫ, ဘဲၫၥိၭအမိချႃၬဘံၭဝ့ၫလီၫ.",
			"14": "<sup>14</sup> တၭနဘၪမၩဆၧချႃၬဘံၭ လၧၥိၪဖၫအဖံၭဆၧ မၩ ဝီၩဝ့ၫလၧတဲၩအဂး, ဒဲဆၧချႃၬဘံၭလၧအဖၫ့ခိၪလၧတ ဟၫၡၭအဖံၭလီၫ.",
			"15": "<sup>15</sup> တၭနဘၪမၩၥံၪ့ပၪ လၧၥံၪ့ၡံၭတၫအီၪဆၧၫ့ထုၪ့အ",
			"16": "<sup>16</sup> ၥၭလၧတဲၩဆံၫ့ဎံၪအဂးနီၪလီၫ.- ၥံၪ့ပၪလဘံၪ့နီၪအ",
			"17": "<sup>17</sup> ဖၭထီၫအဖျါလဆံၫ, ဒဲအဒၪ့ဎၩ့လဖျါထၫလီၫ.- ၥံၪ့ပၪ လဘံၪ့မိအီၪလၧအခၪ့နံၫခီၫဆဲၫဎၩ့လိၬအၥၭလီၫ. န ဘၪမၩတဲၩဆံၫ့ဎံၪ အၥံၪ့ပၪဘဲၫနီၪအၥိၭ ထီးအလူၬ လီၫ.",
			"18": "<sup>18</sup> တၭနဘၪမၩၥံၪ့ပၪအဘံၪ့နံၫဆံၫ, လၧတဲၩဆံၫ့ဎံၪ",
			"19": "<sup>19</sup> လၧမုခံၫ့လခီၫလီၫ.- တၭလၧၥံၪ့ပၪအဘံၪ့နံၫဆံၫအဖၫ့ လၬနီၪနဘၪတဲၩ့အခၪ့ဖျၪ့စ့ၩအဖျိၪ့ လံဆံၫလီၫ. အခၪ့ ဖျၪ့နံၫဖျိၪ့ လၧၥံၪ့ပၪလဘံၪ့အဖၫ့လၬ လၧအခၪ့နံၫခီၫ အဂး, ဒဲအခၪ့ဖျၪ့နံၫဖျိၪ့ လၧၥံၪ့ပၪလဘံၪ့ဒၪ လၧအ",
			"20": "<sup>20</sup> ခၪ့နံၫခီၫအဂးလီၫ.- တၭတဲၩဆံၫ့ဎံၪ အပၪနံၫခီၫလ",
			"21": "<sup>21</sup> ခီၫလၧမုဖၩနီၪဘၪအီၪ လၧၥံၪ့ပၪအဘံၪ့နံၫဆံၫ,- ဒဲအ ခၪ့ဖျၪ့အဖျိၪ့လံဆံၫလီၫ. ၥံၪ့ပၪလဘံၪ့အီၪ လၧအခၪ့ ဖျၪ့စ့ၩနံၫဖျိၪ့လၧအဖၫ့လၬ, ၥံၪ့ပၪလဘံၪ့ဒၪ အီၪလၧ",
			"22": "<sup>22</sup> အခၪ့ဖျၪ့စ့ၩနံၫဖျိၪ့ လၧအဖၫ့လၬလီၫ.- တၭနဘၪမၩ ၥံၪ့ပၪဎူၫဘံၪ့လၧတဲၩဆံၫ့ဎံၪ အပၪလၧမုနုၬ လခီၫအ",
			"23": "<sup>23</sup> ဂးလီၫ.- တၭနဘၪမၩၥံၪ့ပၪနံၫဘံၪ့ လၧတဲၩဆံၫ့ဎံၪအ",
			"24": "<sup>24</sup> နိၪ့လဖၪ လၧအပၪနံၫခီၫလီၫ.- တၭဘၪအီၪထံးကံၭ လၧအဖၫ့လၬတၭ, ဘၪအီၪထံးကံၭလၧအခိၪအဖၫ့ခိၪ လၧခွၩ့လခွၩ့ဎးလီၫ. နံၫဘံၪ့လူၬဘၪအီၪဘဲၫနီၪလီၫ.",
			"25": "<sup>25</sup> အဝ့ၫၥံၪနီၪမိအီၪလၧနံၫနိၪ့အဂးလီၫ.- တၭၥံၪ့ပၪဎိၭ ဘံၪ့, ဒဲအခၪ့ဖျၪ့စ့ၩလဆံၫဎူၫဖျိၪ့ မိဘၪအီၪလီၫ. ၥံၪ့ ပၪလဘံၪ့အီၪလၧအခၪ့ဖျၪ့နံၫဖျိၪ့ လၧအဖၫ့လၬ, ၥံၪ့ ပၪဂူၫဂၩလဘံၪ့ အီၪလၧအခၪ့ဖျၪ့နံၫဖျိၪ့ လၧအဖၫ့လၬ လီၫ.",
			"26": "<sup>26</sup> တၭနဘၪမၩနိၪယိၭဘီၩ့လၧၥံၪ့ၡံၭတၫနီၪ, ယဲဘီၩ့ လၧၥံၪ့ပၪလၧတဲၩဆံၫ့ဎံၪလခီၫ, ဒဲနိၪယိၭဘီၩ့ယဲဘီၩ့",
			"27": "<sup>27</sup> လၧတဲၩဆံၫ့ဎံၪလခီၫဒၪအဂး,- ဒဲနိၪယိၭဘီၩ့ယဲဘီၩ့ လၧၥံၪ့ပၪလၧတဲၩဆံၫ့ဎံၪအပၪ လၧမုနုၬလခီၫနံၫခီၫအ",
			"28": "<sup>28</sup> ဂးလီၫ.- တၭနိၪယိၭဘီၩ့လၧအကျၩလဘီၩ့အဖၭထီၫ ဘၪထီၩ့လၧအထုၬလခီၫဖိး လၧအထုၬလခီၫဒၪလီၫ.",
			"29": "<sup>29</sup> တၭဘၪဖၩ့ၥံၪ့ပၪလၧထီၫ့, ဒဲတဲၩ့အခွၩ့ လၧနိၪယိၭ ဘီၩ့အလးလၧထီၫ့တၭ, နဘၪဖၩ့နိၪယိၭဘီၩ့လၧထီၫ့ လီၫ.",
			"30": "<sup>30</sup> တၭနဘၪမၩကဲၪထၪ့တဲၩဆံၫ့ဎံၪနီၪ ဘဲၫဆၧအဒီၩ့ အထ့ၬလၧဆၧဒုၭနဲၪဘၪနၧၩ လၧခိၪလီၩ့ခိၪနီၪအၥိၭ လီၫ.",
			"31": "<sup>31</sup> တၭနဘၪမၩကလကၫ လၧဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭ အလူၪ ဝံၭဎဲၩ့အၥၭ လၧၦမၩဆၧၥ့ၪအဆၧမၩလီၫ. ဘၪမၩဝ့ၫအီၪလၧခ့ၫ",
			"32": "<sup>32</sup> ရူၬလဖၪလီၫ.- တၭနဘၪဘျၭထၪ့ဝ့ၫ လၧၥံၪ့ၡံၭတၫ အထုၪ့လံခုၬဖၩ့ဝ့ၫ လၧထီၫ့တၭ, အီၪဝ့ၫလၧအနိၪပုၭ",
			"33": "<sup>33</sup> ထီၫ့, ဒဲအီၪလၧအခၪ့ဖျၪ့စ့ၩလံဖျိၪ့အဖၫ့ခိၪလီၫ.- တၭ နဘၪဘျၭထၪ့ကလကၫလၧနိၪပုၭလဖၪအဖၫ့လၬ, ဘဲၫ ၥိၭနမိဂဲၫဆိၬဆၧအုၩ့လၩ့ အတလၫလၧကလကၫအ ဖၧၩ့လၧယၫထီးနီၪတၭ, ကလကၫနီၪမိအၪ့နၩ့ဖၭဆၧ အလးဆံၫ့ဎံၪ ဒဲဆၧအလးဆံၫ့ဎံၪ ထုၬအဆၧၫ့နီၪလၧ",
			"34": "<sup>34</sup> နၥံၪအဂးလီၫ.- တၭနဘၪအီၪက့ၪဆၧယၫ့ၥၭအလး လၧဆၧအုၩ့လၩ့အတလၫအဖၫ့ခိၪ လၧဆၧအလးဆံၫ့",
			"35": "<sup>35</sup> ဎံၪထုၬအဖၧၩ့နီၪလီၫ.- တၭနဘၪအီၪက့ၪစပွဲလၧက လကၫလၧခီၫ့လခီၫ, ဒဲမ့ၪဒိၩ့လၩ့ဆဲၩလၧစပွဲလၧတဲၩ ဆံၫ့ဎံၪမုခံၫ့လခီၫ, ဒဲနဘၪအီၪက့ၪစပွဲနီၪ လၧမုဖၩလ ခီၫလီၫ.",
			"36": "<sup>36</sup> တၭလၧတဲၩအတရၫ့အဂးနီၪ, နဘၪမၩဆၧလၩ့ဆဲၩ လဘံၪ့လၧဆၧလၫဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩ ဖျ့ၫလံၬကံၭအလူၪ ဝံၭဎဲၩ့အၥၭ ဆၭကံၪဝ့ၫနီၪလီၫ.",
			"37": "<sup>37</sup> တၭလၧဆၧလၩ့ဆဲၩအဂးနီၪ နဘၪမၩအထုၪ့လၧၥံၪ့ ၡံၭတၫယဲခုၬ, ဒဲဖၩ့ဝ့ၫလၧထီၫ့တၭ, အဝ့ၫၥံၪမိအီၪ လၧအနိၪပုၭထီၫ့ ဒဲနဘၪၥိၫ့အခၪ့ ထီးဝီၩယဲဖျိၪ့ လၧ အဂးလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> တၭနဘၪမၩဆၧလုအလးလၧၥံၪ့ၡံၭတၫအဖၭထီၫ ယဲဖျါ, ဒဲအဒၪ့ဎၩ့ယဲဖျါလီၫ. ဘၪမၩဆၧလုအလးနီၪ",
			"2": "<sup>2</sup> လၧဆၧလံနိၪ့မီၪ့ဎီၩ့ဒဲအဆီၩ့ဆီထၪ့ၥၧၫ့ဖျါလီၫ.- တၭ နဘၪမၩအနိၩ့လဖၪ လၧအနိၪ့လံနိၪ့အဖၫ့ခိၪလၧဆၧ",
			"3": "<sup>3</sup> လမံၩ့ဎးလီၫ. တၭနဘၪဖၩ့ဝ့ၫလၧထီးဝီၩလီၫ.- တၭ နဘၪတဲၩ့ဖၧၩ့လဖၪ လၧအမိဒိၭန့အဖံၫ့ချၪ, ဒဲအဆွး လဖၪ, ဒဲအထွ့ၫလဖၪ, ဒဲအနိၪပုၭယၪလဖၪ, ဒဲအဖၧၩ့, မ့ၪလဖၪလီၫ. ကယဲအဆၧဖိၪဆၧလံၩ ထီးအလူၬနီၪ",
			"4": "<sup>4</sup> နဘၪတဲၩ့လၧထီးဝီၩလီၫ.- တၭနဘၪထဲၫ့ဆၧဎ့ၪလၧ ထီးဝီၩတၭ, နဘၪတဲၩ့အခွၩ့ထီးဝီၩလံခွၩ့လၧဆၧထဲၫ့",
			"5": "<sup>5</sup> ဎ့ၪလံနိၪ့အဖၫ့ခိၪလီၫ.- တၭနဘၪအီၪက့ၪဆၧဝၬဖီၩ့ ဆၧလုလၧအဖၫ့လၬဎၩ့လိၬဆၧလုလးအၥၭကျၩလီၫ.",
			"6": "<sup>6</sup> တၭနဘၪမၩနိၪယိၭဘီၩ့လဖၪ လၧဆၧလုလး အဂး, နိၪယိၭဘီၩ့ ၥံၪ့ၡံၭတၫတၭ, နဘၪဖၩ့ဝ့ၫ လၧထီးဝီၩ",
			"7": "<sup>7</sup> လီၫ.- ၦဘၪဒုၭနုၬနိၪယိၭဘီၩ့လဖၪ လၧအခွၩ့လဖၪ အဖၧၩ့တၭ, နိၪယိၭဘီၩ့လဖၪမိဘၪအီၪလၧဆၧလုအ",
			"8": "<sup>8</sup> လးနံၫပၪအလီၩ့, ဘဲၫၥိၭၦမိဆိၬထၪ့ဝ့ၫဒၪလီၫ.- နဘၪ မၩအဖၧၩ့လၧၥံၪ့ပၪၥံၪ, ဘဲၫဆၧဒုၭနဲၪနၧၩလၧခိၪလီၩ့ ခိၪအၥိၭနီၪ, ၦဘၪမၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.",
			"9": "<sup>9</sup> တၭနဘၪမၩတဲၩဆံၫ့ဎံၪအဝၩ့လီၫ. လၧအပၪလၧမု ခံၫ့လခီၫနီၪ, ဆၧဒီၪ့လၩ့ဆဲၩ လၧဝၩ့အဂး, မၩဝ့ၫလၧ ဆၧဘွၩဖျ့ၫလံၬကံၭ, အလူၪဝံၭဎဲၩ့အၥၭ, အဖၭထီၫ",
			"10": "<sup>10</sup> အဖျါလယၩနီၪ မိဘၪအီၪ လၧလခီၫအဂး,- တၭအ ထုၪ့နံၫဆံၫ, ဒဲအခၪ့ဖျၪ့ထီးဝီၩအဖျိၪ့နံၫဆံၫလီၫ. တၭ ထုၪ့အနိၪပုၭ, ဒဲအဆၧမၩဘုၭထၬလိၬ အၥၭလဖၪမွဲ",
			"11": "<sup>11</sup> လၧစ့ၩလီၫ.- ဘဲၫနီၪအၥိၭလၧအပၪ လၧမုဖၩလခီၫအ ဂးနီၪဆၧဒီၪ့လၩ့ဆဲၩအဖျါလယၩ, ဒဲအထုၪ့နံၫဆံၫ, ဒဲအခၪ့ဖျၪ့ထီးဝီၩအဖျိၪ့နံၫဆံၫနီၪဘၪအီၪလီၫ. အထုၪ့ လဖၪအနိၪပုၭ, ဒဲအဆၧမၩဘုၭထၬလိၬအၥၭ လဖၪ",
			"12": "<sup>12</sup> မွဲလၧစ့ၩလီၫ.- တၭဆၧဒီၪ့လၩ့ဆဲၩအဖျါအဖၭထီၫ ယဲဆံၫမိဘၪအီၪလၧဝၩ့ အဒၪ့ဎၩ့ လၧမုနုၬလခီၫအဂး",
			"13": "<sup>13</sup> နီၪလီၫ. အထုၪ့ဆံၫခုၬဒဲအခၪ့ဖျၪ့ဆံၫဖျိၪ့လီၫ.- တၭဝၩ့ အဒၪ့ဎၩ့ လၧအပၪလၧမုထၪ့လခီၫနီၪ အဖျါယဲဆံၫ.",
			"14": "<sup>14</sup> ဒဲဆၧဒီၪ့လၩ့ဆဲၩ လၧတရၫ့လခီၫအဖၭထီၫလဆံၫယဲ ဖျါ,အထုၪ့ၥၧၫ့ခုၬ ဒဲအခၪ့ဖျၪ့ၥၧၫ့ဖျိၪ့မိဘၪအီၪလီၫ.",
			"15": "<sup>15</sup> တၭဆၧဒီၪ့လၩ့ဆဲၩလၧအဝ့ၫလခီၫနီၪ အဖၭထီၫလဆံၫ ယဲဖျါ, အထုၪ့ၥၧၫ့ထုၪ့, ဒဲအခၪ့ဖျၪ့ၥၧၫ့ဖျိၪ့ မိဘၪအီၪ",
			"16": "<sup>16</sup> လီၫ.- တၭလၧဝၩ့အတရၫ့အဂးနီၪ ဆၧဒီၪ့လၩ့ဆဲၩအ ဖၭထီၫအဖျါနံၫဆံၫမွဲလၧဆၧလၫ, ဒဲလၧဆၧဝီၩလုၭ, ဒဲလၧဆၧဝီၩဒဲလၧဆၧဘွၩဖျ့ၫလံၬကံၭ အလူၪဝံၭဎဲၩ့ အၥၭ ဆၭကံၪဝ့ၫနီၪ ဒဲအထုၪ့လံထုၪ့, ဒဲအခၪ့ဖျၪ့လံ",
			"17": "<sup>17</sup> ဖျိၪ့မိဘၪအီၪလီၫ.- တၭကယဲထုၪ့အီၪဝၬဖီၩ့အဝၩ့မိ ဘၪအီၪလၧအမၩဘုၭထၬလိၬအၥၭလၧစ့ၩ, အနိၪပုၭ",
			"18": "<sup>18</sup> စ့ၩ, ဒဲအခၪ့ဖျၪ့ထီးဝီၩလီၫ.- တၭဝၩ့နီၪအဖၭထီၫမိ အီၪအဖျါလယၩ, ဒဲအဒၪ့ဎၩ့အဖျါယဲဆံၫကိၭစီၪ့ဒ့ၭ, ဒဲအဆီၩ့ ဆီထၪ့ယဲဖျါ လၧဆၧဘွၩဖျ့ၫလံၬကံၭ, အ လူၪဝံၭ ဎဲၩ့အၥၭတၭ, အခၪ့ဖျၪ့ ထီးဝီၩ မိဘၪအီၪ",
			"19": "<sup>19</sup> လီၫ.- တၭကယဲဆၧဖိၪဆၧလံၩ လၧတဲၩဆံၫ့ဎံၪအဂး, ဒဲလၧၦမၩဆၧအဂး ထီးအလူၬလဖၪနီၪ, ဒဲကယဲဆၧ အနိၪစဲၩလဖၪ, ဒဲဝၩ့အနိၪစဲၩလဖၪ ထီးအလူၬနီၪမိ ဘၪအီၪလၧထီးဝီၩလီၫ.",
			"20": "<sup>20</sup> တၭနဘၪမၪလူၬၦအံၫစရ့လၭဖိၪ, ဘဲၫၥိၭအမိဂဲၫ ဆိၬအလဲအိၫ့အၥၪအၥိၪဆံၫ့ လၧမ့ၪဒိၩ့အဂးလၧနအီၪ,",
			"21": "<sup>21</sup> ဘဲၫၥိၭမ့ၪဒိၩ့မိခဲၩထၪ့ လထံၪဎးလီၫ.- လၧဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့ လၧကလကၫလၧခီၫ့လခီၫ လၧအအီၪလၧဆၧအုၩ့လၩ့ အမ့ၬယၫနီၪ, စအၫရၧၫ့ အဖိၪခွၫလဖၪ, ဘၪအီၪတဲၩ့ဝဲၩဆၧ, လၧမုဂၪလၩ့ ထီၩ့လၧမုဂီၩလၧယဟိဝၩအမ့ၬယၫလီၫ. မွဲဆၧမၪလူၬ အဆိၩအကၠၪလၩ့လၧအဆၨၩအဆၬ လၧအံၫစရ့လၭ ဖိၪအဂးလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> တၭနဝ့ၫဒၪယီၩ ဒုၭဂဲၫဘူၭလၧနၧၩ နထၧၫ့ဖုဝဲစအၫ ရၧၫ့ ဒဲအဖိၪခွၫလဖၪ လၧအၥိၭ လၧၦအံၫစရ့လၭဖိၪ အကျၩ, ဘဲၫၥိၭအမိမၩၦလုဆၧအဆၧမၩလၧယဂး, စအၫရၧၫ့ ဒဲစအၫရၧၫ့အဖိၪခွၫ စနၫဒၭ, ဒဲစအဘဲဟုၫ,",
			"2": "<sup>2</sup> ဒဲစအ့ၫလအ့ဇၫဒဲစအံၥမၫလီၫ.- တၭနဘၪမၩဆၧအ ကီၩ့အၥိၭဆံၫ့ဎံၪ လၧအအီၪလၧအလၩအဖၩ့, ဒဲအ",
			"3": "<sup>3</sup> ဎံၫအလၩလၧနထၧၫ့ဖုဝဲစအၫရၧၫ့အဂးလီၫ.- နဝ့ၫဒၪ ယီၩနဘၪအၪ့မၧၫ့ကယဲၦလၧ အၥၭဆၭလၧယမၩဎွ့ၩ ဝ့ၫလၧဆၧကိၪ့ၥ့ၪအၥၭထီးအလူၬ, ဘဲၫၥိၭအဝ့ၫၥံၪမိ မၩစအၫရၧၫ့ အကီၩ့အၥိၭ ဘဲၫၥိၭဆၧမိအီၪက့ၪဆံၫ့ ဎံၪဝ့ၫ, ဘဲၫၥိၭအမိမၩ ၦလုဆၧအဆၧမၩ လၧယဂး",
			"4": "<sup>4</sup> လီၫ.- တၭအယီၩမွဲဆၧအကီၩ့အၥိၭ လၧအဝ့ၫၥံၪဘၪ မၩလဖၪနီၪ, ဆၧၥၭနၫပဒၩ့လဘံၪ့, ဒဲအ့ဖိၭလဘံၪ့, ဆဲၫ့ဖၭထီၫလဘံၪ့, ဒဲဆဲၫ့ဆၭကံၪလဘံၪ့, ဒဲခိၪခဲးလ ဘံၪ့, ဒဲခၧၩ့ယးလဘီၩ့နီၪလီၫ. တၭအဝ့ၫၥံၪဘၪမၩ ဆၧအကီၩ့အၥိၭဆံၫ့ဎံၪ လၧနထၧၫ့ဖုဝဲစအၫရၧၫ့အဂး, ဒဲအဖိၪခွၫလဖၪအဂး, ဘဲၫၥိၭအမိမၩ ၦလုဆၧအဆၧ",
			"5": "<sup>5</sup> မၩလၧယဂးလီၫ.- တၭအဝ့ၫၥံၪဘၪမၩန့ထီၫ့, ဒဲဆၧ လၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭ လီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫၥံၪဘၪမၩအ့ဖိၭလဘံၪ့လၧထီၫ့, လၧဆၧ လၫ, ဒဲလၧဆၧဝီၩလုၭ, လၧဆၧဝီၩ, ဒဲလၧဆၧဘွၩဖျ့ၫ လံၬကံၭအလူၪ ဝံၭဎဲၩ့အၥၭ, ၦမၩဆၧၥ့ၪ အဆၧမၩ",
			"7": "<sup>7</sup> လီၫ.- တၭအခိၬထံၭခိၪနံၫ ဘံၪ့ဘၪဘုၭထၬလိၬအၥၭ ထီးအနဲၩ့ထံၭနံၫစီၪ့း တၭဘၪဘုၭထၬလိၬ အၥၭဘဲၫ",
			"8": "<sup>8</sup> နီၪလီၫ.- တၭအ့ဖိၭအခၧၩ့ယးဆၭကံၪ လၧအအီၪလၧ အဖၫ့ခိၪနီၪ မိဘၪမၩဝ့ၫလၧဆၧလမံၩ့ဎး, ဘဲၫအဆၧ မၩအၥိၭနီၪလၧထီၫ့, လၧဆၧလၫ ဒဲလၧဆၧဝီၩလုၭ,ဒဲ လၧဆၧဝီၩ, ဒဲလၧဆၧဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့အ",
			"9": "<sup>9</sup> ၥၭလီၫ.- တၭနဘၪမၩန့ထၫ့မျါမဟူၫယၫနံၫဖျိၪ့, ဒဲစိၭ",
			"10": "<sup>10</sup> ဖျၩၦအံၫစရ့လၭဖိၪအမံၩ့လၧအလီၩ့လီၫ.- ဎူၫဂၩအ မံၩ့လၧလိးလဖျိၪ့အလီၩ့, ဎူၫဂၩအမံၩ့ အီၪလၩ့ထး လၧလိးလဖျိၪ့ဒၪအလီၩ့, ဘဲၫအအီၪဖျဲၪဝ့ၫ အၥိၭနီၪ",
			"11": "<sup>11</sup> လီၫ.- နဘၪစိၭဖျၩၦအံၫစရ့လၭဖိၪအမံၩ့ လၧလိးနံၫ ဖျိၪ့အလီၩ့လၧၦစိၭဖျၩလိး အဆၧစဲၩနဲၪ့ထၬအဆၧစိၭ ဖျၩဝ့ၫနီၪလီၫ. နဘၪမၩန့အလး လၧထီၫ့တၭအီၪက့ၪ",
			"12": "<sup>12</sup> လၧအဖၧၩ့လီၫ. တၭနဘၪအီၪက့ၪလိးနံၫဖျိၪ့လၧအ့ ဖိၭအခိၬထံၭခိၪ, မွဲလိးနၪ့ထၪ့ထဲၩ့ဆၧ လၧၦအံၫစရ့ လၭဖိၪအဂးလီၫ. တၭစအၫရၧၫ့ဘၪဆိၬ အဝ့ၫၥံၪအ မံၩ့လၧအခိၬထံၭခိၪ လၧယွၩအမ့ၬယၫ, လၧဆၧနၪ့ထၪ့ ထဲၩ့အဂးလီၫ.",
			"13": "<sup>13</sup> တၭနဘၪတဲၩ့အလးလဖၪလၧထီၫ့, ဒဲၥွ့ၫထီၫ့နံၫ",
			"14": "<sup>14</sup> ဘီၩ့လၧအထုၬနံၫခီၫလူၬတၭ,- နဘၪတဲၩ့ဝ့ၫလၧၥွ့ၫၥံၪ အၥၭနီၪ နဘၪစၧၩ့ထၬၥွ့ၫၥံၪအၥၭလဖၪနီၪ လၧမနံၬ ထၫ့မျါအမ့ၬအလးလီၫ.",
			"15": "<sup>15</sup> တၭနဘၪမၩဆၧစ့ၩရၫ့ အၥၭနၫပဒၩ့ လၧၦၡၩမၩ ဆၧၥ့ၪအဆၧမၩဘဲၫအ့ဖိၭအဆၧမၩအၥိၭနီၪ, နဘၪ မၩဝ့ၫလီၫ. နဘၪမၩဝ့ၫလၧထီၫ့လၧဆၧလၫ, ဒဲလၧဆၧ ဝီၩလုၭ, ဒဲလၧဆၧဝီၩ, ဒဲလၧဆၧဘွၩဖျ့ၫလံၬကံၭအ",
			"16": "<sup>16</sup> လူၪဝံၭဎဲၩ့အၥၭလီၫ.- ဘၪကဲၪထၪ့ဆၧလံနိၪ့ မီၪ့ဎီၩ့ လၧအအီၪဝ့ၫနံၫထၧၫ့လီၫ. အထီၫလထၫ, ဒဲအဒၪ့ဎၩ့",
			"17": "<sup>17</sup> လထၫလီၫ.- တၭနဘၪမၩဎွ့ၩဝ့ၫ လၧလိးထၫ့မျါအဂဲး လံဂဲးလီၫ. ထၫ့မျါဆၫ့ၥွံၪလဖျိၪ့, မနံၬဘၩ့အူၭ ၥပၩ ယၩလဖျိၪ့, ဒဲမနံၬယ့ၫမၠၭလဖျိၪ့နီၪ မွဲအခၪ့ထံၭလဂဲး",
			"18": "<sup>18</sup> လီၫ.- တၭနံၫဂဲးလဂဲးနီၪမွဲမနံၬဝီၩလဖျိၪ့, မနံၬနံၫလၫ",
			"19": "<sup>19</sup> လဖျိၪ့, ဒဲမနံၬမဟူၫယၫထီၩ့အၥၭလဖျိၪ့လီၫ.- တၭ ၥၧၫ့ဂဲးလဂဲးနီၪ, မွဲမနံၬဝီၩဘၩ့လဖျိၪ့, မနံၬမဟူၫယၫ",
			"20": "<sup>20</sup> ကံၪကဲၩ့လဖျိၪ့, ဒဲမနံၬယၩ့ဖီၫလဖျိၪ့လီၫ.- တၭလံဂဲး လဂဲးနီၪမွဲမနံၬ ယ့ၫဘၩ့လဖျိၪ့, ဒဲမနံၬမဟူၫယၫလ ဖျိၪ့, ဒဲမနံၬနကၥွ့ၭလဖျိၪ့လီၫ. အဝ့ၫၥံၪမိဘၪဆၧၥီၩ့",
			"21": "<sup>21</sup> လၩ့ဝ့ၫလၧထီၫ့ဖၧၩ့လီၫ.- တၭလိးလဖၪနီၪမိဘၪအီၪ လၧၦအံၫစရ့လၭဖိၪအမံၩ့, လဆံၫနံၫမံၩ့ဘဲၫအမံၩ့အ ၥိၭနီၪ, ဆၧစဲၩနဲၪ့ထၬအစိၭဖျၩဝ့ၫနီၪလီၫ. လဂၩလၧ အမံၩ့ဒၪဝ့ၫဆုၬဆုၬ, ဘဲၫၦလဆံၫနံၫဒီၪ့အၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> တၭနဘၪတဲၩ့ၥွ့ၫထီၫ့ဆံၫ့ထုၬၥံၪအၥၭ လၧဆၧၥၭနၫ",
			"23": "<sup>23</sup> ပဒၩ့အထုၬနံၫခီၫလူၬလီၫ.- တၭနဘၪတဲၩ့ခွၩ့ထီၫ့နံၫ ခွၩ့လၧၥၭနၫပဒၩ့အလီၩ့တၭ, နဘၪအီၪက့ၪခွၩ့နံၫခွၩ့",
			"24": "<sup>24</sup> နီၪလၧၥၭနၫပဒၩ့ အထိၭနၫနံၫခီၫလီၫ.- တၭနဘၪဒုၭ နုၬၥွ့ၫထီၫ့ၥံၪ အၥၭနံၫဘီၩ့ လၧခွၩ့နံၫခွၩ့ လၧအအီၪ",
			"25": "<sup>25</sup> လၧၥၭနၫပဒၩ့အထိၭနၫနံၫခီၫ လူၬအဖၧၩ့လီၫ.- တၭ ၥွ့ၫၥံၪအၥၭအထိၭနၫနံၫခီၫ လူၬနီၪနဘၪစၧၩ့ထၬလၧ မနံၬအမ့ၬတၭ, အီၪက့ၪလၧအ့ဖိၭအခိၬထံၭခိၪလၧအ",
			"26": "<sup>26</sup> မ့ၬယၫလခီၫလီၫ.- နဘၪတဲၩ့ခွၩ့ထီၫ့နံၫခွၩ့တၭ, နဘၪ အီၪက့ၪဝ့ၫ လၧၥၭနၫပဒၩ့ အထိၭနၫနံၫခီၫလူၬ အနဲၩ့",
			"27": "<sup>27</sup> ထံၭလၧအ့ဖိၭအနဲၩ့ထံၭအဖၧၩ့လခီၫလီၫ.- နဘၪတဲၩ့ ခွၩ့ထီၫ့နးနံၫခွၩ့ဒီၭတၭ, နဘၪအီၪက့ၪဝ့ၫလၧအ့ဖိၭအ ခိၬထံၭခိၪနံၫခီၫ, လၧအဖၫ့လၬ လၧအမ့ၬယၫလခီၫနီၪ ဎၩ့လိၬအၥၭလၧဆၧဘုၭထၬလိၬအၥၭ လၧအဂူၫဂၩ,",
			"28": "<sup>28</sup> လၧအ့ဖိၭအခၧၩ့ ယးကံၪကဲၩ့အဖၫ့ခိၪလီၫ.- တၭၦမိ စၧၩ့ထၬဆၧၥၭနၫပဒၩ့ လၧအခွၩ့လၧအ့ဖိၭအခွၩ့ဖၧၩ့ လၧဖျံၩလၫ, ဘဲၫၥိၭအမိအီၪဝ့ၫလၧအ့ဖိၭအခၧၩ့ယး ကံၪကဲၩ့အဖၫ့ခိၪတၭ, ဘဲၫၥိၭၥၭနၫပဒၩ့နီၪလၩ့ဘျူၭ",
			"29": "<sup>29</sup> ခွံၬလၧအ့ဖိၭလၥ့ၪဘၪလီၫ.- ထီးစအၫရၧၫ့လ့ၩနုၬလၧ ဆၧအလးဆံၫ့ဎံၪအဖၧၩ့တၭ, မိဆိၬၦအံၫစရ့လၭဖိၪ အမံၩ့လၧဆၧစ့ၩရၫ့ အၥၭနၫပဒၩ့အဖၧၩ့ လၧအၥၭအ လီၩ့,လၧဆၧနၪ့ထၪ့ထဲၩ့အဂဲး လၧယဟိဝၩအမ့ၬယၫ လထံၪဎးဘီၩ့ဎးလီၫ.",
			"30": "<sup>30</sup> နဘၪအီၪက့ၪယုရံၫ့ဒဲၥုၪ့မံၫ့ လၧဆၧစ့ၩရၫ့အၥၭနၫပ ဒၩ့အဖၧၩ့တၭ, ထီးစအၫရၧၫ့လ့ၩနုၬ လၧယဟိဝၩအ မ့ၬယၫတၭ, မိအီၪလၧအၥၭအလီၩ့လီၫ. တၭစအၫရၧၫ့ မိဆိၬၦအံၫစရ့လၭဖိၪအဆၧစ့ၩရၫ့ လၧအၥၭအလီၩ့ လၧယဟိဝၩအမ့ၬယၫ လထံၪဎးဘီၩ့ဎးလီၫ.",
			"31": "<sup>31</sup> တၭနဘၪမၩအ့ဖိၭအဆဲၫ့ဖၭထီၫ လၧဆၧလၫထၧၫ့ ဘံၪ့ယၫလီၫ.",
			"32": "<sup>32</sup> တၭအခိၪထိၭ အၥၭကျၩနီၪ ဘၪအီၪလၧအဖၧၩ့ လီၫ. မိဘၪအီၪလၧအနဲၩ့ထံၭ ဆၭဒိၭထၪ့အၥၭဝၬဝၬ အဖၧၩ့နီၪဘဲၫၥိၭဆၧၥၭနၫပဒၩ့နီၪ ထီးယၬလၩ့လဂ့ၩ",
			"33": "<sup>33</sup> လီၫ.- တၭလၧဆၭထံၪလၩ့အလီၩ့နီၪ, နဘၪမၩၥလဲၩ ၥၪလၧဆၧလၫ, ဒဲလၧဆၧဝီၩလုၭ, ဒဲလၧဆၧဝီၩ, ဝၬဝၬ အဆၭထံၪလၩ့ဝ့ၫနီၪ, ဒဲဎွံၩ့ၥၪထီၫ့လဖၪ လၧအဝ့ၫၥံၪ",
			"34": "<sup>34</sup> အဘိၩ့ဆၧၩ့ဝၬဝၬလီၫ.- ဎွံၩ့ၥၪထီၫ့လဖျိၪ့ ဒဲၥလဲၩၥၪ လဖျိၪ့,ဎွံၩ့ၥၪထီၫ့လဖျိၪ့ ဒဲၥလဲၩၥၪလဖျိၪ့လၧဆဲၫ့အဆၧ",
			"35": "<sup>35</sup> ဆၭထံၪလၩ့အလီၩ့ဝၬဖီၩ့ဝ့ၫလီၫ.- မိဘၪအီၪလၧစအၫ ရၧၫ့အလီၩ့ဘဲၫၥိၭအမိမၩဆၧအခ့ၫအၡၩ အဆၧတၭ, ထီးအလ့ၩနုၬ လၧဆၧအလးဆံၫ့ဎံၪ လၧယဟိဝၩအ မ့ၬယၫ, ဒဲထီးအဂဲၫထဲၩ့ထၪ့တၭ, အၥီၫမိဂၧၫ့ထၪ့,ဘဲၫ ၥိၭအထီးၥံၫလဂ့ၩလီၫ.",
			"36": "<sup>36</sup> တၭနဘၪတဲၩ့လၧထီၫ့ဆံၫ့ထုၬအပၪလဘံၪ့, ဒဲလၧအ လီၩ့နီၪနမိဘၪစိၭဖျၩ ဘဲၫဆၧစဲၩနဲၪ့ထၬအစိၭဖျၩဝ့ၫ အၥိၭ, ဆၧဆံၫ့ဎံၪ လၧယဟိဝၩ အဂးဆံၭ,",
			"37": "<sup>37</sup> တၭနဘၪအီၪက့ၪဝ့ၫ လၧခိၪခဲးလၫအလီၩ့, ဘဲၫၥိၭအမိ အီၪလၧခိၪခဲးလီၩ့ အမ့ၬယၫလခီၫလီၫ.",
			"38": "<sup>38</sup> မိဘၪအီၪလၧစအၫရၧၫ့အမ့ၬထုးခိၪ, ဘဲၫၥိၭစအၫ ရၧၫ့မိဆိၬဆၧဆံၫ့ဎံၪလဖၪ အဆၧအၧၩ့ လၧၦအံၫစရ့ လၭဖိၪမိအီၪက့ၪဆံၫ့ဎံၪ လၧအမၩဘိၪ့ဆၧဆံၫ့ဎံၪထီး အလူၬအကျၩလီၫ. တၭဘၪအီၪလၧအမ့ၬထုးခိၪလ ထံၪဎးဘီၩ့ဎး, ဘဲၫၥိၭအဝ့ၫၥံၪမိဘၪဆၧထိးဆၧၫ့ဝ့ၫ လၧယဟိဝၩအမ့ၬယၫလီၫ.",
			"39": "<sup>39</sup> တၭနဘၪဆၭကံၪအဆဲၫ့ဘွၩဖျ့ၫလံၬကံၭတၭ, နဘၪ မၩအခိၪခဲးလၧဆၧဘွၩဖျ့ၫလံၬကံၭ ဒဲနဘၪမၩအခၧၩ့ ယးလၧဆၧဆၭကံၪလီၫ.",
			"40": "<sup>40</sup> တၭနဘၪမၩဆဲၫ့လဖၪ လၧစအၫရၧၫ့အဖိၪခွၫလဖၪ အဂး ဒဲနဘၪမၩခၧၩ့ယးလဖၪလၧအဝ့ၫၥံၪအဂး, ဒဲန ဘၪမၩခိၪဖုၪ့လဖၪလၧအဝ့ၫၥံၪအဂး, လၧဆၧလၩဆၧ",
			"41": "<sup>41</sup> ဖၩ့ ဒဲဆၧဎံၫဆၧလၩအဂးလီၫ.- နဘၪဒုၭၥိၭဝ့ၫ လၧ နထၧၫ့ဖုဝဲစအၫရၧၫ့, ဒဲအဖိၪခွၫလဖၪအအီၪလၧအၥိၭ တၭ,နဘၪဂုၪအဝ့ၫၥံၪ, ဒဲအီၪက့ၪလၩ့မဲၩဒၪဆၧ, ဒဲအီၪ က့ၪဆံၫ့ဎံၪဝ့ၫ, ဘဲၫၥိၭအဝ့ၫၥံၪ မိမၩၦလုဆၧအဆၧ",
			"42": "<sup>42</sup> မၩလၧယဂးလီၫ.- တၭနဘၪမၩဆၧဖျၪ့ခဲၫ့ဆၧဘွၩဖျ့ၫ လံၬကံၭလၧအဂး, ဘဲၫၥိၭအမိဖျၪ့ဘၪအယၪ အအီၪ",
			"43": "<sup>43</sup> ဘိၪ့နီၪလၧအယးဒံၩ့ထီၩ့လၩ့လၧအကံၪဒူၪလီၫ.- တၭ ထီးစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ ဂဲၫနုၬလၧတဲၩဆံၫ့ဎံၪ အီၪကီၪ့အဖၧၩ့မွဲဂ့ၩး ထီးအၥုၭဘူၭအၥၭ လၧဆၧလု အလးဘဲၫၥိၭ အမိမၩဆၧအခ့ၫအၡၩအဆၧ လၧဆၧ အလးဆံၫ့ဎံၪအဖၧၩ့မွဲဂ့ၩ, ဘၪအီၪလၧအလီၩ့, ဘဲၫ ၥိၭအထီးဘၪဆၧဒဲၩဘၭဒဲၥံၫလဂ့ၩလီၫ. မွဲဆၧမၪလူၬ အဆိၩအကၠၪလၧအဂး, ဒဲလၧအချံၫအၥၪလၧအလးခဲၫ့ အဂးနီၪလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> တၭအယီၩ မွဲဆၧလၧနဘၪမၩ အဝ့ၫၥံၪဘဲၫၥိၭနမိ မၩဆံၫ့ဎံၪထၪ့ဝ့ၫ လၧအမိမၩ ၦလုဆၧအဆၧမၩလၧ ယဂး မၩန့ချီဖိၪလဒုၩ, ၥိၪဖၫလၧအလၧၫ့အဎွ့ၩနံၫ",
			"2": "<sup>2</sup> ဒုၩ,- ဒဲကိၪအလီၪ့လအီၪဘၪလၧမံၪ, ဒဲကိၪပၪပဲၪလ အီၪဘၪလၧမံၪဘၪလဲၩဎုၬဒဲၥိၪ, ဒဲကိၪပၪပဲၪဘၧၩ့ဖျၪ ဒၪလအီၪဘၪလၧမံၪဂုၪအၥၭလၧၥိၪနီၪဆံၭ. နဘၪမၩ",
			"3": "<sup>3</sup> အဝ့ၫၥံၪလၧဘုၪကၠိၩ့အမုၬလီၫ.- နဘၪဒုၭနုၬအဝ့ၫၥံၪ လၧဒၩ့လဖျိၪ့အဖၧၩ့, ဒဲဂဲၫဆိၬဝ့ၫလၧဒၩ့ဖၧၩ့, ဒဲချီလ",
			"4": "<sup>4</sup> ဒုၩ,ဒဲၥိၪဖၫနံၫဒုၩနီၪလီၫ.- နဘၪဒုၭဂဲၫစအၫရၧၫ့ဒဲအ ဖိၪခွၫလဖၪ လၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪ အတရၫ့",
			"5": "<sup>5</sup> နီၪ,နဘၪၥူၫဝၭခွံၬအဝ့ၫၥံၪလၧထံၫလီၫ.- နဘၪမၩန့ ဆၧအကီၩ့အၥိၭလဖၪနီၪတၭ, ဒုၭၥိၭစအၫရၧၫ့ လၧ ဆဲၫ့,ဒဲအ့ဖိၭအဆဲၫ့ဖၭထီၫ, ဒဲအ့ဖိၭ,ဒဲၥၭနၫပဒၩ့း ဒဲခဲး",
			"6": "<sup>6</sup> ဝ့ၫလၧခၧၩ့ယးကံၪကဲၩ့,- ဒဲနဘၪခဲးထၬခိၪခဲး လၧအ",
			"7": "<sup>7</sup> ခိၪ,ဒဲချႃၬထၪ့ၥရဖူၩဆံၫ့ လၧအဖၫ့ခိၪလီၫ.- နဘၪမၩန့ ၥိၪဂုၪဆၧ, ဒဲလူၫလၩ့ဝ့ၫလၧအခိၪအလီၩ့တၭ, ဂုၪဝ့ၫ",
			"8": "<sup>8</sup> လီၫ.- နဘၪဒုၭဂဲၫအဖိၪခွၫၥံၪတၭ, ဒုၭၥိၭအဝ့ၫၥံၪလၧ",
			"9": "<sup>9</sup> ဆဲၫ့လဖၪ,- နဘၪဒုၭခဲးအဝ့ၫၥံၪ လၧခၧၩ့ယးလဖၪ စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ ဒဲဒုၭဖုၪ့အခိၪ လၧခိၪဖုၪ့ လီၫ. တၭဆၧမၩဘၪဆဲၫ့ လၧၦလုဆၧနီၪ မိကဲၪထၪ့ အဝ့ၫၥံၪအဆၧမၩ လၧဆၧအထူၫအရူၫအဆိၩအကၠၪ လီၫ. တၭနဘၪအီၪက့ၪဆံၫ့ဎံၪစအၫရၧၫ့ဒဲအဖိၪခွၫလ ဖၪလီၫ.",
			"10": "<sup>10</sup> နဘၪဒုၭဂဲၫချီလဒုၩ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အမ့ၬယၫတၭး စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪဘၪအီၪက့ၪ",
			"11": "<sup>11</sup> အစူၪလၧချီနီၪအခိၪလီၫ.- တၭနဘၪမၩၥံၫချီလၧယဟိ ဝၩအမ့ၬယၫထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့",
			"12": "<sup>12</sup> ထံၭလီၫ.- နဘၪမၩန့ချီအၥွံၪလနၩ့တၭ, လၧနစူၪနိၩ့ နီၪ,အီၪက့ၪဝ့ၫလၧဆၧလုလး အနိၩ့ဒဲဂါလၩ့ကယဲဆၧ ၥွံၪလၧအအီၪလၩ့ထးနီၪ လၧဆၧလုလးအခၪ့ထံၭလီၫ.",
			"13": "<sup>13</sup> တၭနဘၪမၩန့ဆၧၥိၪအီၪလၧအဎွံၬအလီၩ့, ဒဲဆၧအီၪ လၧအၥုၪ့အဖၫ့ခိၪ, ဒဲအလ့နံၫဖျိၪ့, ဒဲဆၧၥိၪအီၪလၧ အလီၩ့, တၭဆူၭထၪ့ခွံၬဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪနီၪ",
			"14": "<sup>14</sup> လီၫ.- အ့ၪမွဲချီအယၪ, ဒဲအဖံၭ, ဒဲအအ့ၪလဖၪနီၪနဘၪ ဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလၧၦၥုၪ့တဲၩအလး လၧခီၫ့လ ခီၫနီၪး မွဲဆၧလုလၧဆၧဒဲၩဘၭ အဂးလီၫ.",
			"15": "<sup>15</sup> နဘၪမၩန့ၥိၪဖၫလဒုၩတၭ, စအၫရၧၫ့ဒဲအဖိၪခွၫလ",
			"16": "<sup>16</sup> ဖၪဘၪအီၪက့ၪအစူၪလၧၥိၪဖၫနီၪအခိၪလီၫ.- နဘၪမၩ ၥံၫၥိၪဖၫလဒုၩတၭ, နဘၪမၩန့အၥွံၪနီၪဎွံၪဝၬဝၬလၧ",
			"17": "<sup>17</sup> ဆၧလုလးအဖၫ့ခိၪ,- တၭနဘၪဒၪ့ထ့ၬၥိၪဖၫနီၪလကုၭ လကုၭ, ဒဲၥူၫဝၭဆံၫ့အဎွံၬ, ဒဲအခၪ့, ဒဲအီၪက့ၪကီၪ့အ",
			"18": "<sup>18</sup> ကုၭလဖၪ, ဒဲအခိၪလီၫ.- တၭနဘၪဆူၭခဲၩ ၥိၪဖၫနီၪ ထၧၫ့ဒုၩယၫ လၧဆၧလုလးအဖၫ့ခိၪလီၫ. မွဲဆၧလုမ့ၪ လၧယဟိဝၩအဂး, မွဲဆၧနၧၫ့မၧၫ့မုၬ ဆၧမၩဘိၪ့ မၩ လၧမ့ၪလၧယဟိဝၩအဂးလီၫ.",
			"19": "<sup>19</sup> တၭနဘၪမၩန့ ၥိၪဖၫအဂူၫဂၩလဒုၩနီၪ, စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ ဘၪအီၪက့ၪအစူၪ လၧၥိၪဖၫ အခိၪ",
			"20": "<sup>20</sup> လီၫ.- ထီးနီၪလဖၧၫ့ နဘၪမၩၥံၫၥိၪဖၫလဒုၩနီၪတၭ, အၪ့မၩန့အၥွံၪ, ဒဲအီၪက့ၪလၧစအၫရၧၫ့ အနါကျူၩခိၪ အထွ့ၪ,ဒဲလၧအဖိၪခွၫလဖၪအနါကျူၩခိၪအထွ့ၪ, ဒဲလၧ အစူၪမုအထွ့ၪ, ဒဲလၧအခၪ့မုအထွ့ၪ, ဒဲဎွံၪဆၧၥွံၪနီၪ ဝၬဝၬလၧဆၧလုလးအဖၫ့ခိၪလီၫ.",
			"21": "<sup>21</sup> တၭနဘၪမၩန့ဆၧၥွံၪ လၧအအီၪ လၧဆၧလုလး အဖၫ့ခိၪလနၩ့, ဒဲဆၧၥိၪဂုၪဆၧလနၩ့တၭ, ဎွံၪဝ့ၫလၧ စအၫရၧၫ့အလီၩ့, ဒဲလၧအကီၩ့အၥိၭအလီၩ့, ဒဲလၧအ ဖိၪခွၫလဖၪအလီၩ့, ဒဲလၧအဖိၪခွၫလဖၪအီၪလၧအၥိၭ အကီၩ့အၥိၭအလီၩ့, တၭအဝ့ၫဒၪ မိဆံၫ့ဎံၪထၪ့, အ ဝ့ၫနီၪဒဲအကီၩ့အၥိၭ, ဒဲအဖိၪခွၫလဖၪဒဲအဖိၪခွၫလဖၪ",
			"22": "<sup>22</sup> အကီၩ့အၥိၭလၧအၥိၭဆ့လီၫ.- တၭနဘၪမၩန့ၥိၪဖၫ အၥိၪ,ဒဲအခဲၫ့, ဒဲအၥိၪလၧဎွံၬအလီၩ့, ဒဲဆၧအီၪလၧအ ၥုၪ့အဖၫ့ခိၪ, ဒဲအလ့နံၫဖျိၪ့, ဒဲဆၧၥိၪအီၪလၧအလီၩ့, ဒဲအခိၬထံၭခိၪအထွ့ၪ, အဂဲးဘဲၫယီၩ မွဲၥိၪဖၫလၧဆၧ",
			"23": "<sup>23</sup> အီၪက့ၪဆံၫ့ဝ့ၫလဒုၩ,- ဒဲကိၪလလီၪ့, ဒဲကိၪလဲၩဎုၬလၧ ၥိၪလဘံၪ့, ဒဲကိၪဘၧၩ့ဖျၪဒၪလဘံၪ့ လၧဒၩ့ဖၧၩ့လၧ အအီၪဒဲကိၪလအီၪဘၪလၧမံၪ လၧယဟိဝၩအမ့ၬယၫ",
			"24": "<sup>24</sup> လီၫ.- တၭနဘၪအီၪက့ၪဆၧထီးအလူၬ လၧစအၫရၧၫ့ အစူၪဖၧၩ့, ဒဲလၧအဖိၪခွၫလဖၪအစူၪဖၧၩ့, တၭနဘၪ ဝါဝ့ၫလၧဆၧမၩဘိၪ့ဝါဝ့ၫ လၧယဟိဝၩအမ့ၬယၫလီၫ.",
			"25": "<sup>25</sup> တၭနဘၪမၩန့ဝ့ၫလၧအစူၪဖၧၩ့, ဒဲဆူၭခဲၩခွံၬဝ့ၫလၧ ဆၧလုလးအဖၫ့ခိၪလၧဆၧလုမ့ၪ, လၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအမ့ၬယၫ, ဆၧမၩဘိၪ့ မၩလၧမ့ၪလၧယ",
			"26": "<sup>26</sup> ဟိဝၩအဂးလီၫ.- နဘၪမၩန့ၥိၪဖၫအၥၭနၫၡါလၧအ ဘၪဆဲၫ့ လၧစအၫရၧၫ့အဆၧမၩဆံၫ့ဎံၪဝ့ၫတၭ, ဝါဝ့ၫ လၧဆၧမၩဘိၪ့ဝါဝ့ၫ လၧယဟိဝၩအမ့ၬယၫတၭ, မိကဲၪ",
			"27": "<sup>27</sup> ထၪ့ဝ့ၫလၧနဂးလီၫ.- တၭနဘၪမၩဆံၫ့ဎံၪဆၧမၩဘိၪ့ ဝါဝ့ၫအၥၭနၫၡါ, ဒဲဆၧမၩဘိၪ့ဆိၬထၪ့ဝါဝ့ၫအခိၬထံၭ ခိၪလၧဆၧဝါဝ့ၫ, ဒဲလၧအဘၪဆၧဆိၬထၪ့ဝါဝ့ၫ ဆၧ လၧအဘၪဆဲၫ့ လၧၥိၪဖၫ လၧဆၧအီၪကီၪ့ ဆံၫ့ဎံၪဝ့ၫ နီၪအီၪလၧစအၫရၧၫ့အဂး ဒဲလၧအဖိၪခွၫလဖၪအဂး",
			"28": "<sup>28</sup> လီၫ.- မိဘၪကဲၪထၪ့စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪအဆၧ လၧဆၧအထူၫအရူၫအဆိၩအကၠၪ လၧၦအံၫစရ့လၭ နီၪလီၫ. အဂဲးဘဲၫယီၩ, မွဲဆၧမၩဘိၪ့ ဆိၬထၪ့ဝါဝ့ၫ လီၫ. တၭမိကဲၪထၪ့ ဆၧမၩဘိၪ့ဆိၬထၪ့ဝါဝ့ၫ လၧၦ အံၫစရ့လၭဖိၪ လၧအဆၧလုဘၪလိၬအိၭလိၬဆၧအ ဖၧၩ့, အဆၧမၩဘိၪ့ဆိၬထၪ့ဝါဝ့ၫ လၧယဟိဝၩအဂး",
			"29": "<sup>29</sup> လီၫ.- တၭစအၫရၧၫ့အကီၩ့အၥိၭဆံၫ့ဎံၪနီၪ မိကဲၪထၪ့ အဖိၪခွၫလဖၪ အဆၧလၧအဝ့ၫအလးခဲၫ့, ဘဲၫၥိၭအ ဝ့ၫၥံၪ မိဘၪဆၧဂုၪဝ့ၫလၧအဖၧၩ့, ဒဲဘဲၫၥိၭဆၧမိအီၪ",
			"30": "<sup>30</sup> က့ၪဆံၫ့ဎံၪထၪ့အဝ့ၫၥံၪလၧအဖၧၩ့လီၫ.- တၭအဖိၪခွၫ လၧအကဲၪထၪ့ၦလုဆၧလၧအလးလဂၩနီၪ, ထီးအဂဲၫ နုၬလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့ ဘဲၫၥိၭအမိမၩ ဆၧအခ့ၫအၡၩအဆၧ လၧဆၧအလး ဆံၫ့ဎံၪအဖၧၩ့",
			"31": "<sup>31</sup> တၭ,ဘၪကီၩ့ၥိၭဝ့ၫနွ့ၫနံၩလီၫ.- နဘၪမၩန့ၥိၪဖၫလၧ ဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫတၭ, အၪ့ဎွံအယၪလၧအလး",
			"32": "<sup>32</sup> ဆံၫ့ဎံၪအဖၧၩ့နီၪလီၫ.- တၭစအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ ဘၪအၪ့ၥိၪဖၫအယၪ, ဒဲကိၪအီၪဝ့ၫလၧဒၩ့ဖၧၩ့, လၧ",
			"33": "<sup>33</sup> ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭလီၫ.- တၭ လၧဆၧမၩဖီၩ့ဖျ့ၭဆၧ, ဘဲၫၥိၭအမိအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ ဒဲမၩဆံၫ့ဎံၪဝ့ၫနီၪ အဝ့ၫၥံၪမိအၪ့ဘၪဝ့ၫလီၫ. အ့ၪမွဲၦ လခီၫဘၩ့မုးဖိၪအၪ့ဘၪအ့ၬ. အဂဲးဘဲၫယီၩ မွဲဆၧဆံၫ့",
			"34": "<sup>34</sup> ဎံၪလီၫ.- ဆၧယၪဘၪဆဲၫ့ လၧဆၧအီၪက့ၪဆံၫ့ဎံၪမွဲ ဂ့ၩ,ကိၪမွဲဂ့ၩ, အ့ၪအီၪလၩ့ထးလနၩ့နၩ့ထီးမုဆဲၪ့ထၪ့ နီၪတၭ, နဘၪဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ. ၦအၪ့ဘၪ ဝ့ၫအ့ၬ. မွဲဆၧဆံၫ့ဎံၪအဂဲးလီၫ.",
			"35": "<sup>35</sup> တၭနဘၪမၩစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ ဘဲၫကယဲ ဆၧလၧယမၪလူၬနၧၩအၥိၭနီၪလီၫ. တၭနဘၪအီၪက့ၪ",
			"36": "<sup>36</sup> ဆံၫ့ဎံၪဝ့ၫနွ့ၫနံၩလီၫ.- နဘၪလုထၪ့ချီလဒုၩကိၭနံၩ ဒ့ၭလၧဆၧမၩဖီၩ့ဖျ့ၭအဂးတၭ, ထီးနမၩဆၧဖီၩ့ဖျ့ၭ လၧဆၧလုလးအဖၫ့ခိၪနီၪ, နဘၪမၩဆံၫ့ဝ့ၫ, ဒဲနဘၪဂုၪ",
			"37": "<sup>37</sup> ဝ့ၫဘဲၫၥိၭနမိမၩဆံၫ့ဎံၪဝ့ၫလီၫ.- နွ့ၫနံၩလဖၪနီၪနဘၪ မၩအဆၧဖီၩ့ဖျ့ၭဆၧလၧဆၧလုလးအဖၫ့ခိၪ, ဒဲမၩဆံၫ့ ဎံၪဝ့ၫတၭ, မွဲအမိကဲၪထၪ့ဆၧလုလးဆံၫ့ဎံၪထုၬလီၫ. ကယဲဆၧလၧအထိၭဆၧလုလးလမံၩ့လါလါနီၪ မိဘၪ အီၪဆံၫ့ဎံၪဝ့ၫလီၫ.",
			"38": "<sup>38</sup> တၭအယီၩမွဲဆၧလၧနဘၪလုထၪ့ လၧဆၧလုလးအ ဖၫ့ခိၪ,ၥိၪလနံၪ့ဖိၪနံၫဒုၩး လနံၩအဂးနံၫဒုၩလနံၩအဂး",
			"39": "<sup>39</sup> နံၫဒုၩ, လထံၪဎးဘီၩ့ဎးလီၫ.- ၥိၪဖိၪလဒုၩနီၪနဘၪ လုထၪ့လၧဂီၩလခီၫ, ဒဲၥိၪဖိၪလဒုၩဒၪနီၪနဘၪလုထၪ့",
			"40": "<sup>40</sup> လၧဂၪလခီၫလီၫ.- ဒဲကိၪမုၬလအ့ဇရိၫလဲၩဎုၬလၧၥိၪ အၪ့ထီးလဟံၫ့လံပိၩ့လပိၩ့, ဒဲစဘံၭထံၫလဟံၫ့လံပိၩ့ လပိၩ့လၧဆၧလုအီၩအဂးနီၪ မိဘၪအီၪဝ့ၫလၧၥိၪဖိၪ",
			"41": "<sup>41</sup> လဒုၩလီၫ.- တၭၥိၪဖိၪနံၫဒုၩလဒုၩ နဘၪလုထၪ့လၧ ဂၪလခီၫ, ဒဲနဘၪမၩဝ့ၫဘဲၫဆၧမၩဘိၪ့ကိၪမုၬလၧဂီၩ လခီၫအၥိၭ, ဒဲဘဲၫဆၧလုအီၩအၥိၭ, လၧဆၧနၧၫ့မၧၫ့",
			"42": "<sup>42</sup> မုၬမၩလၧမ့ၪလၧယဟိဝၩအဂးလီၫ.- မွဲဆၧလုမ့ၪလၧ နၥံၪအဆၨၩအဆၬလဆိၩဘၪလဆိၩ လၧဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့ထံၭ လၧယဟိဝၩအမ့ၬယၫ ထီးအလး လၧယမိဒၪလိၬယၥၭလၧနၧၩ ဘဲၫၥိၭယမိ",
			"43": "<sup>43</sup> ချဲၩ့ဆၧလၧနၧၩလီၫ.- ယမိဂဲၫဒၪလိၬယၥၭလၧၦအံၫ စရ့လၭဖိၪထီးနီၪတၭ, ဆၧမိဆံၫ့ဎံၪထၪ့လၧယလၩယ",
			"44": "<sup>44</sup> ဖၩ့အကၠီၩ့လီၫ.- တၭယမိမၩဆံၫ့ဎံၪထၪ့ဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪဒဲဆၧလုအလး, ယမိမၩဆံၫ့ဎံၪထၪ့ဆ့ စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ, ဘဲၫၥိၭအမိမၩၦလုဆၧအ",
			"45": "<sup>45</sup> ဆၧမၩလၧယဂးလီၫ.- ယမိအီၪလၧၦအံၫစရ့လၭဖိၪ",
			"46": "<sup>46</sup> အကျၩတၭ, ယမိကဲၪထၪ့အယွၩလီၫ.- တၭအဝ့ၫၥံၪ မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩ အဝ့ၫၥံၪအယွၩလၧအ ဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫၥံၪလၧခးအံဇံၭအဖၧၩ့, ဘဲၫၥိၭယ မိအီၪလၧအကျၩနီၪလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ အဝ့ၫၥံၪအယွၩလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> တၭနဘၪမၩဆၧလုလး လၧဆၧဆူၭခဲၩဆၧနၧၫ့မၧၫ့",
			"2": "<sup>2</sup> အဂးလီၫ. နဘၪမၩဝ့ၫလၧၥံၪ့ၡံၭတၫလီၫ.- အထီၫလ ဖျါ, ဒဲအဒၪ့ဎၩ့လဖျါ ဘၪအီၪလၧအနိၪ့လံနိၪ့ မီၪ့ဎီၩ့ လီၫ.ဒဲအဆီၩ့ဆီထၪ့နံၫဖျါတၭ, အနိၪ့လဖၪမိဘၪမၩဝ့ၫ",
			"3": "<sup>3</sup> လၧဆၧလမံၩ့ဎးလီၫ.- တၭနဘၪဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့လၧ အဖၫ့ခိၪ, ဒဲလၧအပၪဝၬဝၬ, ဒဲအနိၩ့လဖၪနီၪလီၫ. နဘၪ",
			"4": "<sup>4</sup> မၩခိၪဖဲၩ့ထီၫ့ဝၬဖီၩ့လီၫ.- တၭနဘၪတဲၩ့အခွၩ့ထီၫ့နံၫ ခွၩ့ လၧအခိၪဒၧၩ့အဖၫ့လၬ လၧအနိၪ့နံၫနိၪ့အနဲၩ့ထံၭ လီၫ. နဘၪတဲၩ့ဝ့ၫလၧအပၪနံၫခီၫအလီၩ့လီၫ. တၭအ ဝ့ၫၥံၪမိကဲၪထၪ့အလး လၧနိၪယိၭဘီၩ့အဂး ဘဲၫၥိၭၦ",
			"5": "<sup>5</sup> မိဆိၬထၪ့ဝ့ၫလီၫ.- နဘၪမၩအနိၪယိၭဘီၩ့လၧၥံၪ့ၡံၭ",
			"6": "<sup>6</sup> တၫတၭဖၩ့ဝ့ၫလၧထီၫ့လီၫ.- တၭနဘၪအီၪက့ၪဝ့ၫလၧ ကလကၫအမ့ၬယၫ လၧအအီၪ လၧဆၧအုၩ့လၩ့အတ လၫအနဲၩ့ထံၭ လၧဆၧယၫ့ၥၭ အလးအမ့ၬယၫ, လၧ အအီၪလၧဆၧအုၩ့လၩ့အဖၫ့ခိၪနီၪ ထီးအလးယမိဂဲၫ",
			"7": "<sup>7</sup> ဒၪလိၬယၥၭလၧနၧၩလီၫ.- တၭစအၫရၧၫ့ဘၪဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့ လၧအဖၫ့ခိၪ ကိၭဂီၩဒ့ၭလီၫ. ထီးအအီၪ တဲၩ့ဝဲၩ မ့ၪဒိၩ့လဖၪနီၪတၭ, ဘၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့",
			"8": "<sup>8</sup> လၧအဖၫ့ခိၪလီၫ.- တၭထီးစအၫရၧၫ့စီၩ့ထၪ့မ့ၪဒိၩ့လ ဖၪလၧဂၪလခီၫနီၪ, ဘၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧအဖၫ့ ခိၪလီၫ. မွဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့ လထံၪဎးဘီၩ့ဎး လၧ ယဟိဝၩအမ့ၬယၫ ထီၩ့လၧနၥံၪအဆၨၩအဆၬလဆိၩ",
			"9": "<sup>9</sup> ဘၪလဆိၩလီၫ.- တၭဆၧဆူၭခဲၩနၧၫ့မၧၫ့လၩ့မဲၩမွဲဂ့ၩ, ဆၧလုမ့ၪမွဲဂ့ၩ, ဆၧမၩဘိၪ့ကိၪမုၬမွဲဂ့ၩ, ဆူၭခဲၩလဂ့ၩ, တၭဂါလၩ့ဆၧလုအီၩလၧအဖၫ့ခိၪလဂ့ၩ.",
			"10": "<sup>10</sup> တၭစအၫရၧၫ့ မိဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအနိၩ့အဖၫ့ ခိၪလၧဆၧမၩဖီၩ့ဖျ့ၭ ဆၧဒဲၩဘၭအၥွံၪနီၪလနံၪ့လဖၧၫ့ လီၫ. လနံၪ့လဖၧၫ့နီၪ မိဘၪမၩဖီၩ့ဖျ့ၭဆၧလၧအဖၫ့ ခိၪထီၩ့လၩ့လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩ",
			"11": "<sup>11</sup> လီၫ. မွဲဆၧဆံၫ့ဎံၪထုၬလၧယဟိဝၩအဂးလီၫ.- ယဟိ",
			"12": "<sup>12</sup> ဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ စံၭဝ့ၫဒၪ,- ထီးနဝံထၪ့နၬ ထၪ့ၦအံၫစရ့လၭဖိၪ ဘဲၫအအီၪဝ့ၫဘဲၫအံၩဘဲၫအိၩအ ၥိၭနီၪ, ၦၡၩဘၪဖ့ၪယဟိဝၩ လၧဆၧဎွ့ၩထဲၩ့လၧအ ၥၭၡီၩ့အဂး, လဂၩအဂးဒၪဝ့ၫ, လဂၩအဂးဒၪဝ့ၫ, လၧ နဝံထၪ့ အဝ့ၫၥံၪအခၫနီၪ ဘဲၫၥိၭထီးနဝံထၪ့ အဝ့ၫၥံၪ",
			"13": "<sup>13</sup> တၭ, ဆၧၥံၫခမျၧးထီးဘၪအဝ့ၫၥံၪလဂ့ၩနီၪလီၫ.- တၭ အဝ့ၫၥံၪမိဘၪဖ့ၪလၫ့ဆၧယီၩ, ကယဲၦလၧအကျၩလၧ အလ့ၩဖီၩ့ဝ့ၫ လၧဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လဂၩလါလါနီၪ, ဘၪဖ့ၪလၫ့စ့ၩဖိၭဖၫ့ၡက့လၭ, ဘဲၫအလးဆံၫ့ဎံၪၡက့ လၭအၥိၭ (ၡက့လၭနီၪ မွဲဂ့ရၫနံၫဆံၫလီၫ.) ဖိၭဖၫ့ၡ",
			"14": "<sup>14</sup> က့လၭနီၪမိကဲၪထၪ့ဆၧမၩဘိၪ့ယဟိဝၩလီၫ.- ကယဲ ၦလၧအၥၭၡါ အနံၪ့နံၫဆံၫ ဒဲနံၫဆံၫအဖၫ့ခိၪ လၧအ ကျၩလၧအလ့ၩဖီၩ့ဝ့ၫ လၧအဘၪဆၧဝံထၪ့နၬထၪ့ကိၭ",
			"15": "<sup>15</sup> ဂၩဒ့ၭနီၪ ဘၪမၩဘိၪ့ဆၧလၧယဟိဝၩလီၫ.- ထီးနၥံၪ မၩဘိၪ့ဆၧလၧယဟိဝၩ ဘဲၫၥိၭနၥံၪမိမၩဖီၩ့ဖျ့ၭဆၧ လၧနၥံၪအၥၭၡီၩ့အဂးတၭ, ၦၥထံၫၥံၪဘၪဖ့ၪလၫ့ဖိၭ ဖၫ့ၡက့လၭ အဖၫ့ခိၪအ့ၬ, ဒဲၦၡၪ့ဖိၪယၬဖိၪၥံၪဘၪဖ့ၪ",
			"16": "<sup>16</sup> လၫ့ၡၩနဲၪ့အဝ့ၫနီၪဆ့အ့ၬ.- နဘၪမၩန့ဆၧမၩဖီၩ့ဖျ့ၭ ဆၧအစ့ၩလၧၦအံၫစရ့လၭဖိၪအစူၪဖၧၩ့တၭ, အီၪက့ၪ ဝ့ၫလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪ အဆၧမၩအဂး, ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧနၪ့ထၪ့ထဲၩ့ လၧၦအံၫစရ့လၭ ဖိၪအဂး လၧယဟိဝၩအမ့ၬယၫ ဘဲၫၥိၭအမိမၩဆၧ ဖီၩ့ဖျ့ၭလၧနၥံၪအၥၭၡီၩ့အဂးလီၫ.",
			"17": "<sup>17</sup> နဘၪ တဲၩ့အံၪ့ဒိၫ့ထီးဝီၩအီၪလၧအခၪ့ထီးဝီၩ, ဘဲၫၥိၭၦမိၥူၫ ဝၭဆံၫ့ဆၧလီၫ. တၭနဘၪ အီၪက့ၪလၩ့အဝ့ၫနီၪ လၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ ဒဲဆၧလုလးအဘိၩ့ဆၧၩ့",
			"19": "<sup>19</sup> တၭ,နဘၪအီၪက့ၪထံၫလၧအဖၧၩ့လီၫ.- တၭစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ မိဘၪၥူၫဝၭဆံၫ့အစူၪ ဒဲအခၪ့လၧအ",
			"20": "<sup>20</sup> ဖၧၩ့လီၫ.- ထီးအလ့ၩနုၬ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪအဖၧၩ့တၭ, မွဲအမိဘၪၥူၫဝၭဆံၫ့ဆၧလၧထံၫ, ဘဲၫ ၥိၭအထီးၥံၫလဂ့ၩ, တၭထီးအဝ့ၫၥံၪဂဲၫဘူၭ လၧဆၧ လုအလးဘဲၫၥိၭအမိမၩဆၧ အခ့ၫအၡၩအဆၧ, ဘဲၫ ၥိၭအမိဆူၭခဲၩခွံၬ ဆၧလၧမ့ၪလၧယဟိဝၩ အဂးနီၪ",
			"21": "<sup>21</sup> တၭ,- မိဘၪၥူၫဝၭဆံၫ့အစူၪ ဒဲအခၪ့ဘဲၫၥိၭအထီးၥံၫ လဂ့ၩလီၫ. တၭဆၧမိကဲၪထၪ့ ဆၧအထူၫအရူၫ လၩ့ ဆိၩလၩ့ကၠၪ လၧအဂး လၧအဝ့ၫနီၪ ဒဲအချံၫအၥၪလၧ အဆၨၩအဆၬ လဆိၩဘၪလဆိၩလီၫ.",
			"22": "<sup>22</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩ ချဲၩ့ဆၧလၧစမိစ့ၭတၭ,",
			"23": "<sup>23</sup> စံၭဝ့ၫဒၪ,- နဝ့ၫဒၪယီၩ မၩန့ဆၧနၧၫ့မၧၫ့အစၩ့ထံၫလ ဖၪ,မူရၫ့အထူၭအလယၧးၡက့လၭယဲယၩ, ဒဲကဒါရၫ နၧၫ့မၧၫ့ဎွ့ၩဎီၩ့ဆၧနီၪဖိၭဖၫ့, ၡက့လၭနံၫယၩယဲဆံၫ,",
			"24": "<sup>24</sup> ဒဲလးဟ့ၪၡက့လၭ နံၫယၩယဲဆံၫ,- ဒဲကဒါရၫၡက့ လၭယဲယၩ, ဘဲၫၡက့လၭဘၪဆဲၫ့ လၧအလးဆံၫ့ဎံၪ",
			"25": "<sup>25</sup> အၥိၭနီၪ, ဒဲအလဲအိၫ့အၥိၪလဟံၫ့လီၫ.- နဘၪမၩဝ့ၫ လၧဆၧဂုၪဆံၫ့ဎံၪအၥိၭတၭ, နဘၪအၪ့ထီးလဲၩဎုၬ ဝ့ၫ, ဘဲၫၦအၪ့ထီးလဲၩဎုၬဆၧနၧၫ့မၧၫ့ဖိၪ မၩဝ့ၫအၥိၭ",
			"26": "<sup>26</sup> နီၪလီၫ. တၭမိဘၪကဲၪထၪ့ၥိၪဂုၪဆၧဆံၫ့ဎံၪလီၫ.- တၭ နဘၪဂုၪ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ လၧအဝ့ၫ, ဒဲဆၧ",
			"27": "<sup>27</sup> အုၩ့လၩ့အတလၫ,- ဒဲစပွဲ, ဒဲအထွ့ၫထီးအလူၬ,ဒဲမ့ၪ ဒိၩ့မိၡါဒဲအဆၧဖိၪဆၧလံၩ, ဒဲအဆၧဆူၭခဲၩနၧၫ့မၧၫ့",
			"28": "<sup>28</sup> အဆၧလုအလး,- ဒဲအဆၧလုမ့ၪအဆၧလုအလး,ဒဲ အဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲအံၪ့ဒိၫ့လဖျိၪ့ဒဲအခၪ့",
			"29": "<sup>29</sup> လီၫ.- တၭနဘၪမၩဆံၫ့ဎံၪ အဝ့ၫၥံၪ ဘဲၫၥိၭအမိကဲၪ ထၪ့ဆၧဆံၫ့ဎံၪထုၬလီၫ. ကယဲဆၧလၧအထိၭဘၪအ",
			"30": "<sup>30</sup> ဝ့ၫၥံၪလမံၩ့လါလါနီၪမိဘၪအီၪဆံၫ့ဎံၪဝ့ၫလီၫ.- တၭ နဘၪဂုၪစအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ, ဒဲအီၪက့ၪဆံၫ့ဎံၪ အဝ့ၫၥံၪဘဲၫၥိၭအမိမၩ ၦလုဆၧအဆၧမၩ လၧယဂး",
			"31": "<sup>31</sup> လီၫ.- နဘၪချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫ ၥံၪ,အယီၩ မိကဲၪထၪ့ၥိၪဂုၪဆၧဆံၫ့ဎံၪ လၧယဂးထီၩ့ လၩ့လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩလီၫ.",
			"32": "<sup>32</sup> ဂါလၩ့ဘၪလၧၦၡၩအယၪအလီၩ့လဂ့ၩ, မၩဆၧလၩ့ ဂၬအဝ့ၫ ဘဲၫအလယၧးအီၪဝ့ၫ ဘဲၫအံၩဘဲၫအိၩအၥိၭ နီၪလဂ့ၩ, မွဲဆၧဆံၫ့ဎံၪတၭ, မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪလၧ",
			"33": "<sup>33</sup> နၥံၪအမ့ၬယၫလီၫ.- ၦလၧအအၪ့ထီးလဲၩဎုၬဆၧလၩ့ ဂၬလၧအနီၪတၭ, ၦလၧအအီၪက့ၪဝ့ၫလနၩ့ လၧၦလ ခီၫဘၩ့မုးဖိၪအလီၩ့ လဂၩဂၩနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬ ဝ့ၫလၧအဆၨၩဒၪဝ့ၫအကျၩနီၪလီၫ.",
			"34": "<sup>34</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, အၪ့မၩန့ဆၧနၧၫ့ မၧၫ့လဖၪ ၥံၪ့နၫတဖၭအထူၭ, ဒဲၥံၪ့ၡက့ဎ့လ့ၭအထူၭ, ဒဲဂၪလ ဘၫ့, ဆၧနၧၫ့မၧၫ့လဖၪယီၩ ဒဲလီၫဘၫ့ဆံၫ့, မိဘၪအီၪ",
			"35": "<sup>35</sup> လၧအလယၧးလမံၩ့ဘၪလမံၩ့ဎွ့ၩဎီၩ့လီၫ.- တၭနဘၪ မၩဝ့ၫ လၧဆၧနၧၫ့မၧၫ့ လၧအမၩအၥၭဘဲၫ ၦအၪ့ထီး လဲၩဎုၬ ဆၧနၧၫ့မၧၫ့မၩဝ့ၫအၥိၭနီၪ, မၩဝ့ၫဒဲထံၫလၪ,",
			"36": "<sup>36</sup> ဆံၫ့ဝ့ၫဎံၪဝ့ၫလီၫ.- နဘၪအၪ့ထီးမုၬလနၩ့တၭ, အီၪ ဝ့ၫလၧဆၧအုၩ့လၩ့ အမ့ၬယၫ, လၧဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪဖၧၩ့ ထီးအလးလၧယမိဒၪလိၬယၥၭလၧ နၧၩတၭ, မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪထုၬ လၧနၥံၪအမ့ၬယၫ",
			"37": "<sup>37</sup> လီၫ.- တၭဆၧနၧၫ့မၧၫ့လၧနဘၪမၩဝ့ၫနီၪ, ထီးမၩလၧန ၥံၪအဂးဒၪနၥံၪဝ့ၫ, ဘဲၫအလယၧးဘဲၫအံၩဘဲၫအိၩအ ၥိၭနီၪလဂ့ၩ. မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪလၧယဟိဝၩအဂး",
			"38": "<sup>38</sup> လၧနမ့ၬယၫလီၫ.- ၦလၧအမၩဆၧဘဲၫနီၪၥိၭ, ဘဲၫၥိၭ အမိနၧၫ့မၧၫ့ဘၪဝ့ၫလဂၩဂၩနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩလဆၨၩဒၪဝ့ၫအကျၩနီၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,-ယိခွါ, ဘီၪ, ယကိၭယူၭၦယုဒၫဖိၪ, စဟၧအဖိၪခွၫစယုရဲၫ",
			"3": "<sup>3</sup> အဖိၪခွၫစဘ့ၫဇလံလၭ လၧအမံၩ့လီၫ.- တၭယမၩ ဎွ့ၩအဝ့ၫလၧယွၩအၥၭ, ဒဲဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ, ဒဲအၥၭ ဖၭ, ဒဲဆၧၥ့ၪယၫ, ဒဲကယဲအမၩဆၧ လမံၩ့လါလါ,",
			"4": "<sup>4</sup> ဘဲၫၥိၭ အမိကိၪ့ဆၧကိၪ့ၥ့ၪ, ဘဲၫၥိၭအမိမၩဆၧလၧ",
			"5": "<sup>5</sup> ထီၫ့,ဒဲစ့ၩ, ဒဲထီး,- ဒဲစိၭဖျၩန့လိးလဖၪ ဘဲၫၥိၭအမိၥီၩ့ လၩ့ဝ့ၫလၧအလးနီၪ, ဒဲစိၭဖျၩၥံၪ့, ဘဲၫၥိၭအမိမၩက",
			"6": "<sup>6</sup> ယဲဆၧမၩလမံၩ့လါလါထီးအလူၬလီၫ.- တၭယဝ့ၫဒၪ ယီၩ,ယိခွါ, ယဖ့ၪလၫ့အဝ့ၫလၧၦဒၫ့အဒီၪ့ဖိၪစအဟံ စမၭအဖိၪခွၫစအဟိလအၭ, ဒဲကယဲၦလၧအၥုၪ့ဆၭ ၥၭဆၭထီးအလူၬနီၪ ဖ့ၪလၫ့ဝ့ၫ ဆၧကိၪ့ၥ့ၪ, ဘဲၫၥိၭ",
			"7": "<sup>7</sup> အမိမၩကယဲဆၧလၧယမၪလူၬနၧၩလီၫ.- တၭဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪဒဲဆၧအုၩ့လၩ့အတလၫ, ဒဲဆၧ ယၫ့ၥၭအလးလၧ အအီၪလၧအဖၫ့ခိၪ, ဒဲတဲၩဆံၫ့ဎံၪအ",
			"8": "<sup>8</sup> ဆၧဖိၪဆၧလံၩထီးအလူၬ,- ဒဲစပွဲဒဲအဆၧဖိၪဆၧလံၩ, ဒဲမ့ၪဒိၩ့မိၡါအဆံၫ့, ဒဲအဆၧဖိၪဆၧလံၩ ထီးအလူၬ,",
			"9": "<sup>9</sup> ဒဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့အဆၧလုလး,- ဒဲဆၧလုမ့ၪအဆၧ လုလး ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲအံၪ့ဒိၫ့ဒဲအ",
			"10": "<sup>10</sup> ခၪ့,- ဆၧအကီၩ့အၥိၭ ဘၪဆဲၫ့လၧဆၧမၩဆၧအခ့ၫ အၡၩအဆၧ, ၦလုဆၧစအၫရၧၫ့အကီၩ့အၥိၭဆံၫ့ဎံၪ, ဒဲအဖိၪခွၫလဖၪအကီၩ့အၥိၭ, ဘဲၫၥိၭအမိမၩၦလုဆၧ",
			"11": "<sup>11</sup> အဆၧ,- ဒဲအၥိၪဂုၪဆၧ, ဒဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့လၧဆၧ အလးဆံၫ့ဎံၪအဂး, ဘဲၫကယဲဆၧ လၧယမၪလူၬနၧၩ ထီးအလူၬအၥိၭနီၪ အဝ့ၫၥံၪမိဘၪမၩလီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩချဲၩ့ဆၧ လၧစမိစ့ၭတၭ စံၭဝ့ၫဒၪ, နဝ့ၫဒၪ ယီၩချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, မွဲမၬနၥံၪ",
			"13": "<sup>13</sup> ဘၪထီးန့ယမးၥံၫအနံၩလဖၪလီၫ.- အဂဲးဘဲၫယီၩမွဲ ဆၧမၩနဲၪ့လၧယၧၩ ဒဲနၥံၪအဘိၩ့ဆၧၩ့ထီၩ့လၩ့လၧ နၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩဘဲၫၥိၭနၥံၪမိ ၥ့ၪယၫလၧယမွဲယဟိဝၩ လၧအမၩဆံၫ့ဎံၪနၥံၪလီၫ.",
			"14": "<sup>14</sup> တၭနၥံၪဘၪထီးန့ မးၥံၫအနံၩလီၫ. အဂဲးဘဲၫယီၩ မွဲ ဆၧဆံၫ့ဎံၪလၧနၥံၪအဂးလီၫ. ၦလၧအမၩဘၪၥၭလိၪ ဝ့ၫနီၪမိဘၪဆၧမၩၥံၫဝ့ၫတၡါ ကိၭဂၩဒ့ၭလီၫ. အဂဲး ဘဲၫယီၩ ကယဲၦလၧအမၩဆၧလၧအနံၩနီၪလဂၩလါ လါယီၩ, ၦလဂၩနီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧအဆၨၩ",
			"15": "<sup>15</sup> ဒၪဝ့ၫအကျၩလီၫ.- ၦၡၩမိမၩဘၪအဆၧမၩ လၧဎူၫနံၩ အထးဖၧၩ့လီၫ. အ့ၪမွဲနွ့ၫနံၩလနံၩနီၪ မွဲဆၧအီၪပွံၭဆံၫ့ ဎံၪလၧယဟိဝၩအဂးလီၫ. ၦၡၩလၧအမၩဆၧလၧမး ၥံၫအနံၩလဂၩလါလါနီၪ, မိဘၪဆၧမၩၥံၫ တၡါဝ့ၫ",
			"16": "<sup>16</sup> လီၫ.- တၭၦအံၫစရ့လၭဖိၪ ဘၪထီးန့မးၥံၫအနံၩဘဲၫ ၥိၭအမိအီၪက့ၪမးၥံၫအနံၩ လၧအဆၨၩအဆၬလဆိၩ ဘၪလဆိၩ လၧအမွဲဆၧအုၩ့လၩ့ အဆိၩအကၠၪလီၫ.",
			"17": "<sup>17</sup> မွဲဆၧမၩနဲၪ့လၧယၧၩ ဒဲၦအံၫစရ့လၭဖိၪ အဆိၩအ ကၠၪလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩမၩကဲၪထၪ့မူၭခိၪဒဲ ဂၪ့ခိၪလၧမုဎူၫနံၩအထးဖၧၩ့တၭ, နွ့ၫနံၩလနံၩနီၪအီၪ",
			"18": "<sup>18</sup> ပွံၭဝ့ၫဒဲမုၬထၪ့ဝ့ၫလီၫ.- တၭအဝ့ၫဒၪချဲၩ့ဆၧလၧစမိ စ့ၭလၧခိၪလီၩ့စဲနၫအလီၩ့နီၪဂီၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧအ ဆၧအုၩ့လၩ့အဆၧပၪပဲၪနံၫဘံၪ့, လိးပၪလဖၪဘၪဆၧ ကွ့ၭဝ့ၫလၧယွၩအစူၪနိၩ့လီၫ."
		},
		"32": {
			"1": "<sup>1</sup> ထီးၦခမျၧးဒၪဘၪလၧစမိစ့ၭ မၩယံၬမၩနးအၥၭ လဂဲၫထဲၩ့လၩ့ဘၪလၧခိၪ လီၩ့ခိၪအကၠီၩ့တၭ, ၦခမျၧး အီၪကိၩ့အီၪကီၪ့လၧစအၫရၧၫ့အအီၪ, စံၭဝ့ၫ, ဂဲထုၪ့, တဲၩ့န့ပယွၩ လၧအမိလ့ၩဆၧလၧပမ့ၬယၫဆံၭ. အဂဲး ဘဲၫယီၩစမိစ့ၭ, ၦလၧအဒုၭဂဲၫထၪ့ပၧၩလၧခးအံဇံၭ အဖၧၩ့လဂၩနီၪ, ဆၧမၩအၥၭလၧအဝ့ၫဒၪဘဲၫၥ့ၪလဲၪ",
			"2": "<sup>2</sup> ဘဲၫၥ့ၪလဲၪနီၪပၥ့ၪယၫအ့ၬ.- စအၫရၧၫ့စံၭဝ့ၫ, ထုၭထ့ၬ န့ခွၩ့ထီၫ့လၧအအီၪလၧနၥံၪအမၫ, ဒဲနၥံၪအဖိၪခွၫ,ဒဲန ၥံၪအဖိၪမုၪလဖၪ အနါဖၧၩ့တၭ, ဂဲၫဆိၬ လၧယအီၪ",
			"3": "<sup>3</sup> ဆံၭ.- တၭကယဲၦခမျၧးထုၭထ့ၬအနါခွၩ့ထီၫ့လၧအ အီၪလၧအနါဖၧၩ့ထီးအလူၬး ဂဲၫဆိၬဝ့ၫလၧစအၫရၧၫ့",
			"4": "<sup>4</sup> အအီၪလီၫ.- အဝ့ၫဒၪမၩန့ဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့ ၥိၫ့န့ချီဖိၪလဒုၩဂီၩ့တၭ, တဲၩ့ဝ့ၫလၧနိၪဖျၩလီၫ. တၭ အဝ့ၫၥံၪစံၭ, အံၫစရ့လၭဧ့, အယီၩမွဲနယွၩလၧအဒုၭ",
			"5": "<sup>5</sup> ဂဲၫထၪ့နၧၩလၧခးအံဇံၭအဖၧၩ့လီၫ.- ထီးစအၫရၧၫ့ ဒၪဘၪဝ့ၫတၭ, မၩဆၧလုလးလၧအမ့ၬယၫနီၪ, ဒဲစအၫ ရၧၫ့ ဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ကဲဂီၩခိၬ",
			"6": "<sup>6</sup> နီၪမွဲဆၧမၩဘိၪ့လၧယဟိဝၩအဂးလီၫ.- ဆၧဖၩ့ထၪ့ လနံၩနီၪအဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩတၭ, လုထၪ့ဆၧလုမ့ၪ, ဒဲဂဲၫဆိၬ ဆၧလုဘၪလိၬအိၭလိၬတၭ, ၦခမျၧးဆၧၫ့နၩ့ အၪ့ဆၧအီၩဆၧ, ဒဲဂဲထုၪ့လိၬကွ့ၩလီၫ.",
			"7": "<sup>7</sup> တၭယဟိဝၩ စံၭစမိစ့ၭ, လ့ၩဘီၪ, ထဲၩ့လၩ့ထဲၩ့ ဆံၭ. အဂဲးဘဲၫယီၩ နၡၩခမျၧးလၧနဒုၭဂဲၫထၪ့လၧခး",
			"8": "<sup>8</sup> အံဇံၭအဖၧၩ့နီၪ မၩၥၭလိၪလၩ့အၥၭလီၫ.- အဝ့ၫၥံၪ ကၠၪခွံၬအၥၭချဲၫ့ချဲၫ့ လၧဖၧၩ့ၥၭ လၧယမၪလူၬဝ့ၫလၧ အမိဘၪဖိၬဝ့ၫလီၫ. တၭမွဲအၥိၫ့န့ယူၭချီဖိၪလဒုၩ, ဒဲ ဘၩထၪ့ဝ့ၫ,ဒဲလုထၪ့ဆၧလၧအဝ့ၫတၭ, စံၭဝ့ၫဒၪ,အံၫစ ရ့လၭဧ့, အယီၩမွဲနယွၩ လၧအဒုၭဂဲၫထၪ့နၧၩလၧခး",
			"9": "<sup>9</sup> အံဇံၭအဖၧၩ့လီၫ.- တၭယဟိဝၩစံၭစမိစ့ၭ, ယဒၪဘၪ",
			"10": "<sup>10</sup> ၦခမျၧးယီၩ, ယိခွါ,မွဲဝ့ၫၦလၧအခိၬဆီၪ့လီၫ.- တၭ ဘိၩ့နဲၪ့ယီၩမၩဘူၭယၧၩလဂ့ၩ, ယၥၭထၪ့မိခဲၩထၪ့ ဘၪဝ့ၫ,ဒဲအၪ့ခွံၬဝ့ၫ, တၭယမိဒုၭကဲၪထၪ့နၧၩ လၧၦလ ဆၨၩဖၭဒိၪလီၫ.",
			"11": "<sup>11</sup> စမိစ့ၭအၪ့ယၫအယွၩယဟိဝၩနီၪတၭ, စံၭဝ့ၫဒၪ,ယ ဟိဝၩဧ့, နၥၭထၪ့ခဲၩထၪ့နၡၩခမျၧးလၧနဒုၭစဲၪ့ထၪ့ လၧခးအံဇံၭအဖၧၩ့, ဒဲဆၧအစီၩ့ဒိၪအမၩ့ဒိၪ, ဒဲဆၧ",
			"12": "<sup>12</sup> အစူၪဆီၪ့နီၪမွဲဘၪလဲၪ.- ၦအံဇံၭဖိၪမိချဲၩ့ဆၧတၭစံၭ ဝ့ၫ,မွဲအဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧဆၧအၧၩ့အဂး ဘဲၫၥိၭ အမိမၩၥံၫဝ့ၫလၧခိၪလီၩ့ထိၩ့ချိၬနီၪ, ဒဲမၩဂၭဂီၩ့ဝ့ၫလၧ ဂၪ့ခိၪချိၫ့ယီၩ မွဲဘၪလဲၪ. ကၠၪခွံၬ လၧနၥၭထၪ့အခဲၩ ထၪ့နီၪ, ဒဲနီၫ့ယါလၩ့ထဲၩ့နၥၭလၧဆၧအၧၩ့ယီၩလၧအ",
			"13": "<sup>13</sup> ထၫ့ဒုၪဒၩနၡၩခမျၧးယီၩဆံၭ.- နၪ့ထၪ့ထဲၩ့နခ့ၫနၡၩ စအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစအံၫစရ့လၭလၧနဆိၪလၩ့ နၥၭလၧအဝ့ၫၥံၪလၧနနၫ့ဆါဒၪနဝ့ၫတၭ, စံၭဝ့ၫ, ယမိ မၩအၪထၪ့နၥံၪအချံၫအၥၪ ဘဲၫၡၪၥံၪလၧမူၭခိၪအၥိၭ နီၪတၭ, ဆၧလၧခးလဘံၪ့လၧယချဲၩ့ဆၧလၧအဂဲးအ ကၠီၪ့,ယမိဖ့ၪလၫ့ထၧၫ့ဘံၪ့ယၫ လၧနၥံၪအချံၫအၥၪတၭ,",
			"14": "<sup>14</sup> အဝ့ၫၥံၪမိန့ၥၫဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭယဟိ ဝၩနီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧဆၧအၧၩ့လၧအကိၪ့ထၪ့ မိမၩအၡၩခမျၧးနီၪလီၫ.",
			"15": "<sup>15</sup> တၭစမိစ့ၭကၠၪထဲၩ့အၥၭ ထဲၩ့လၩ့ထဲၩ့လၧခိၪလီၩ့ ခိၪတၭ, ဆၧအုၩ့လၩ့အဆၧပၪပဲၪနီၪအီၪဝ့ၫ လၧအစူၪ ဖၧၩ့လီၫ. ဆၧပၪပဲၪနီၪ ကွ့ၭအၥၭလၧနံၫခီၫလူၬလီၫ. ကွ့ၭအၥၭ လၧအနီၪလခီၫ ဒဲလၧအယီၩ လခီၫလီၫ.",
			"16": "<sup>16</sup> တၭဆၧပၪပဲၪလဖၪနီၪ, မွဲယွၩအဆၧမၩ, ဒဲဆၧကွ့ၭနီၪ မွဲယွၩအဆၧကွ့ၭ, ကွ့ၭဝ့ၫလၧဆၧပၪပဲၪ လဖၪအလီၩ့",
			"17": "<sup>17</sup> လီၫ.- ထီးၦခမျၧးကိၭၡၭထၪ့တၭ, စယီရှုၫအ့ၫနါဂၧၫ့ အၥီၫတၭ, စံၭစမိစ့ၭနီၪ, ဆၧဒုၭလိၬအၥၭ အၥီၫအီၪဝ့ၫ",
			"18": "<sup>18</sup> လၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪစံၭ, မွဲၦမၩ နၧၩ့မၩစၪ ဆၧကိၭထၪ့အၥီၫမွဲအ့ၬ. ဒဲၦစၪဝ့ၫအကိၭ ထၪ့အၥီၫမွဲအ့ၬ. မွဲယနါဂၧၫ့ လၧၦမၩ ထၭခိၪအၥီၫ",
			"19": "<sup>19</sup> လီၫ.- ထီးအဂဲၫဘူၭလၧၦၥုၪ့တဲၩလဖၪ အလးတၭ, ဆၧမၩအၥၭလၧအဒၪဘၪချီဖိၪ, ဒဲၦၡၩဂဲထုၪ့လံတၭ စမိစ့ၭအၥၭထၪ့ခဲၩထၪ့တၭ, ခွံၬလၩ့ခွံၬဆၧပၪပဲၪလၧ အစူၪဖၧၩ့တၭ, မၩထ့ဖၭခွံၬဝ့ၫလၧခိၪလီၩ့အခၪ့ထံၭ",
			"20": "<sup>20</sup> နီၪလီၫ.- အဝ့ၫဒၪ အၪ့မၩန့ချီဖိၪ လၧၦမၩယူၭတၭ, ဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪတၭ မၩလၩ့ဘျ့ၭဝ့ၫ ထီးအလၩ့ မုၬတၭဎွံၪဝ့ၫလၧထံၫကျၩတၭ, ဒုၭအီၩၦအံၫစရ့လၭ ဖိၪလီၫ.",
			"21": "<sup>21</sup> တၭစမိစ့ၭစံၭစအၫရၧၫ့, ၦခမျၧး လၧနဒုၭဂဲၫဘၪဝ့ၫ လၧဆၧဒဲၩဘၭဖၭဒိၪယီၩ, မွဲအမၩနၧၩလၧဆၧနီၪလ",
			"22": "<sup>22</sup> မံၩ့လဲၪ.- တၭစအၫရၧၫ့စံၭဝ့ၫဒၪ, မွဲယကဆါအၥၭ နီၪထီးခဲၩထၪ့လဂ့ၩ, နၥ့ၪယၫၦခမျၧးယီၩ လၧအအီၪ",
			"23": "<sup>23</sup> ဝ့ၫလၧဆၧအၧၩ့ဆၧၥၫ့အဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪစံၭ ယၧၩ,တဲၩ့န့ပကဆါလၧအမိလ့ၩဆၧလၧပမ့ၬယၫဆံၭ. အဂဲးဘဲၫယီၩ ၦလၧအဒုၭဂဲၫထၪ့ပၧၩလၧခးအံဇံၭအ ဖၧၩ့စမိစ့ၭလဂၩနီၪ, မွဲဆၧမၩအၥၭ လၧအဝ့ၫဘဲၫၥ့ၪ",
			"24": "<sup>24</sup> လဲၪဘဲၫၥ့ၪလဲၪနီၪပၥ့ၪယၫအ့ၬ.- တၭယစံၭ, ၦလၧအ အီၪလၧထီၫ့လဂၩဂၩနီၪ, မွဲအထုၭထ့ၬဒၪဝ့ၫဆံၭ. အ ဝ့ၫၥံၪဖ့ၪလၫ့ယၧၩတၭ, ထီးနီၪလဖၧၫ့ယဖျႃၭလၩ့လၧ မ့ၪဖၧၩ့တၭ ဆၧဂဲၫထၪ့လၧချီဖိၪလဒုၩယီၩလီၫ.",
			"25": "<sup>25</sup> တၭစမိစ့ၭဒၪဘၪဝ့ၫလၧၦခမျၧးအီၪဘိၪ့လီၫ. အဂဲး ဘဲၫယီၩစအၫရၧၫ့ဒုၭအီၪဘိၪ့ဝ့ၫ လၧအမ့ၬမဲအဂဲးလၧ",
			"26": "<sup>26</sup> အဒုၪအဒၩအကျၩလီၫ.- စမိစ့ၭဆၧၫ့ထုၪ့လၧၦၥုၪ့တဲၩ အလး အတရၫ့ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, မွဲပလၫအီၪလၧ ယဟိဝၩလခီၫလဲၪ, မွဲအဂဲၫလၧယအီၪဆံၭ. တၭကယဲ ၦလံဝဲၫဖိၪအီၪကိၩ့အီၪကီၪ့လၧအအီၪထီးအလူၬလီၫ.",
			"27": "<sup>27</sup> တၭအဝ့ၫစံၭအဝ့ၫၥံၪ, ယဟိဝၩၦအံၫစရ့လၭအယွၩ စံၭဝ့ၫဘဲၫယီၩ မွဲကယဲၦၡၩအီၪက့ၪအနၭ လၧအကံၪ ထံၭလီၩ့တၭ, စဲၪ့ထၪ့လ့ၩဖျီၫ့လၧၦၥုၪ့တဲၩအလးလၧ တရၫ့ဖိးလၧတရၫ့ကိၭစီၪ့ဒ့ၭတၭ, မၩၥံၫလဂၩအထၧၫ့ ဖုဝဲဒဲလဂၩအၥိၭ, ဒဲလဂၩအၦၡၩအီၪလၧအနဲၩ့ထံၭ",
			"28": "<sup>28</sup> ကိၭဂၩဒ့ၭဆံၭ.- ၦလံဝဲၫဖိၪမၩဝ့ၫဘဲၫစမိစ့ၭအလူအ ၥိၭနီၪတၭ, ဆၧလၧမုလနံၩနီၪ ၦလၩ့ထံၩဖါၥံၫဝ့ၫလၧ",
			"29": "<sup>29</sup> ၦခမျၧးအကျၩ ဖိၭဘိၭၥၧၫ့ထီၫ့လီၫ.- အဂဲးဘဲၫယီၩ စမိစ့ၭစံၭယူၭဝ့ၫဒၪ, ဘဲၫၥိၭအမိဆိၪဂ့ၩနၥံၪလၧမုဆၫ လနံၩယီၩတၭ, မွဲနၥံၪအီၪက့ၪဆံၫ့ဎံၪနၥံၪအနၫ့ဆါဒၪ နၥံၪဝ့ၫလၧယဟိဝၩအဂးနီၪ, ၦလဂၩထၫ့ဒုၪဒၩအဖိၪ ခွၫ, ဒဲအထၧၫ့ဖုဝဲခွၫ ဆုၬဆုၬမုဆၫလနံၩယီၩဆံၭ.",
			"30": "<sup>30</sup> တၭဆၧမၩအၥၭ လၧမုဆဲၪ့ထၪ့လနံၩနီၪစမိစ့ၭစံၭ ၦခမျၧး,နၥံၪမၩမၪဆၧမၪဖၭဒိၪလီၫ. တၭဘိၩ့နဲၪ့ယီၩ ယမိလ့ၩထၪ့လၧယဟိဝၩအအီၪတၭ, ဘၪလဘၪယ",
			"31": "<sup>31</sup> မိမၩဖီၩ့ဖျ့ၭဆၧလၧနၥံၪအဆၧမၪအကၠီၩ့လီၫ.- စမိစ့ၭ ထဲၩ့ထၪ့လၧယဟိဝၩအအီၪတၭ, စံၭဝ့ၫဒၪ, အၩလါၬ ၦခမျၧးယီၩ မၩမၪဆၧမၪဖၭဒိၪတၭ, တဲၩ့န့အယွၩ",
			"32": "<sup>32</sup> ထီၫ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ နအ့ၪမိမၩဖီၩ့မၩဖျ့ၭအဝ့ၫ ၥံၪအဆၧဒဲၩဘၭနီၪ, အ့ၪလမွဲဘၪတၭ ထူၭခွံၬယမံၩ့",
			"33": "<sup>33</sup> လၧနလံၬဖၧၩ့လၧနကွ့ၭယူၭနီၪဆံၭ.- တၭယဟိဝၩစံၭ စမိစ့ၭ, ၦၡၩလၧအမၩမၪဘၪယၧၩနီၪ ယမိထူၭခွံၬအ",
			"34": "<sup>34</sup> ဝ့ၫဒၪအမံၩ့ လၧယလံၬဖၧၩ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, လ့ၩဘီၪ, ၥိၫ့ၦခမျၧးလၧအလး လၧယလီၩဝဲၩယူၭနၧၩ နီၪဆံၭ. ယိခွါ, ယၥီၫ့လဂၩ မိလ့ၩလၧနမ့ၬယၫလီၫ. တၭမုလနံၩထီးယအ့ၪစ့ၩရၫ့ဝ့ၫနီၪ, ယမိစ့ၩရၫ့ဝ့ၫလၧ အဆၧဒဲၩဘၭအကၠီၩ့လီၫ.",
			"35": "<sup>35</sup> တၭမွဲၦခမျၧးတဲၩ့ချီဖိၪ လၧစအၫရၧၫ့တဲၩ့ဝ့ၫအကၠီၩ့ နီၪ, ယဟိဝၩဒုၭဘၪအဝ့ၫၥံၪလၧဆၧဆၫအဖျဲၪလီၫ."
		},
		"33": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, စဲၪ့ထၪ့ခွံၬ ထီးယီၩလ့ၩ ထၪ့ဆံၭ. နဝ့ၫဒၪ, ဒဲၦခမျၧးလၧနဒုၭဂဲၫထၪ့ လၧခးအံ ဇံၭနီၪ, ထီၩ့လၧခးလဘံၪ့ လၧယဆိၪလၩ့ယၥၭလၧ အဂဲးလၧစအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭ, စံၭဝ့ၫ,",
			"2": "<sup>2</sup> ယမိဖ့ၪလၫ့ဝ့ၫ လၧနချံၫနၥၪလီၫ.- တၭယမိအၪ့မၧၫ့ အၥီၫ့လဂၩလ့ၩလၧနမ့ၬယၫလီၫ. တၭယမိနၫ့ထၪ့ခွံၬ ၦကၫနအၫ့ဖိၪ, ၦအၫမိၫဖိၪ, ဒဲၦဟ့ၥၭဖိၪ, ဒဲၦပံရ့ၭဖိၪ, ဒဲၦဟ့ဝဲၭဖိၪ, ဒဲၦယ့ဘုၫဖိၪတၭ, မိၥိၫ့နၧၩ လၧခးလၧ",
			"3": "<sup>3</sup> အယွၩလၩ့ဝ့ၫလၧဆၧနူထံၫ, ဒဲန့ၫစၩ့လီၫ.- အဂဲးဘဲၫ ယီၩ ယမိလ့ၩထၪ့ဘၪလၧနၥၭကျၩအ့ၬ. နမွဲၦလၧအ ခိၬဆီၪ့လဆၨၩအဂဲးတၭး ယမိဒုၭအၪ့ခွံၬဘၪခိၬနၧၩ လၧဖၧၩ့ၥၭလီၫ.",
			"4": "<sup>4</sup> ထီးၦခမျၧးၥံၪနါဂၧၫ့, ဆၧချဲၩ့အၧၩ့အပရၧၫ့နီၪတၭ, အၥုၪ့အုၭအၥၭအုၭတၭ, ကယၧၩ့အၥၭနးဂၩအ့ၬ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭယူၭစမိစ့ၭ, လီၩဘၪၦအံၫ စရ့လၭဖိၪ, နၥံၪမွဲၦအခိၬဆီၪ့လဆၨၩလီၫ. ယအ့ၪဂဲၫ လၧနၥံၪအကျၩလဆိဖိၪတၭ, ယမိမၩလူၬခွံၬနၥံၪလီၫ. တၭဘိၩ့နဲၪ့ယီၩ ယမိမၩနၧၩဘဲၫၥ့ၪလဲၪနီၪ, ဘဲၫၥိၭယ",
			"6": "<sup>6</sup> မိၥ့ၪယၫတၭ, ဘဲၪ့လၩ့ခွံၬနကယၧၩ့ကယီၫဆံၭ.- တၭ ၦအံၫစရ့လၭဖိၪ ဘဲၪ့လၩ့ခွံၬအကယၧၩ့ကယီၫလၧခိၪ လီၩ့ဟိရ့ၭအခၪ့ထံၭလီၫ.",
			"7": "<sup>7</sup> စမိစ့ၭမၩန့ဆၧအတဲၩဆံၫ့ဎံၪလဖျိၪ့နီၪတၭ, ၥုၪ့ဝ့ၫ လၧၥုၪ့တဲၩလဖၪအလးလၧခီၫ့, ယဲၩ့ယိၬလၧၦၥုၪ့တဲၩ အလးတၭ, ကိၭဝ့ၫအမံၩ့လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪလီၫ. တၭဆၧမၩအၥၭ လၧကယဲၦလၧအအၪ့ဎၬ ယဟိဝၩလဂၩဂၩနီၪ လ့ၩထၪ့လၧဆၧအီၪကီၪ့အတဲၩ ဆံၫ့ဎံၪလၧအအီၪ လၧၦၥုၪ့တဲၩလဖၪအလး လၧခီၫ့",
			"8": "<sup>8</sup> လီၫ.- ထီးစမိစ့ၭလ့ၩထၪ့လၧတဲၩဖၧၩ့နီၪတၭ, ဆၧမၩ အၥၭလၧၦခမျၧးဂဲထုၪ့ထီးအလူၬတၭ, ဆၧၫ့ထုၪ့လ ဂၩ လၧအတဲၩအတရၫ့, လဂၩ လၧအတဲၩ အတရၫ့ တၭ,ယိထွ့ၫစမိစ့ၭအခဲၫ့ထီးအလ့ၩနုၬ လၧတဲၩဆံၫ့ဎံၪ ဖၧၩ့နီၪလီၫ.",
			"9": "<sup>9</sup> ထီးစမိစ့ၭလ့ၩနုၬလၧတဲၩဆံၫ့ဎံၪဖၧၩ့နီၪ ဆၧမၩအ ၥၭလၧဆၧအုၪ့အထုၪ့ဂဲၫလၩ့တၭ, ဆၧၫ့ထုၪ့လၧတဲၩ",
			"10": "<sup>10</sup> ဆံၫ့ဎံၪအတရၫ့နီၪ, ယဟိဝၩချဲၩ့ဒုၪ့စမိစ့ၭလီၫ.- ၦခ မျၧးထီးအလူၬ ဒၪဘၪဆၧအုၪ့အထုၪ့ အီၪဆၧၫ့ထုၪ့ လၧတဲၩဆံၫ့ဎံၪ အတရၫ့နီၪတၭ, ၦခမျၧးထီးအလူၬ ဂဲ ထုၪ့ဝ့ၫ, ဒဲဘၩထၪ့ဝ့ၫ, လဂၩလၧအတဲၩအတရၫ့, လ",
			"11": "<sup>11</sup> ဂၩလၧအတဲၩ့အတရၫ့ဆုၬဆုၬလီၫ.- တၭယဟိဝၩ ချဲၩ့ဒုၪ့စမိစ့ၭ ယိဆၧၫ့ယၫဝ့ၫ, ဘဲၫၦၡၩချဲၩ့ဒုၪ့လိၬအ ၥၭအၥိၭနီၪလီၫ. မွဲအထဲၩ့ထဲၩ့လၧၦၥုၪ့တဲၩလဖၪအ လးဖၧၩ့လီၫ. အ့ၪမွဲအခ့ၫအၡၩ, ၦဖိၪၥၪခွၫ, စယီရှုၫ အ့ၫလဂၩနီၪ စဲၪ့ထၪ့လၧတဲၩဆံၫ့ဎံၪဖၧၩ့နီၪအ့ၬ.",
			"12": "<sup>12</sup> တၭစမိစ့ၭစံၭယဟိဝၩ, ယိခွါဘီၪ, နစံၭယၧၩ,ဒုၭ ဂဲၫထၪ့ၦခမျၧးယီၩဆံၭ. တၭနမိအၪ့မၧၫ့ၦလၧယၥိၭ လဂၩလဲၪနီၪ, နဒုၭၥ့ၪယၫယၧၩဒံၭအ့ၬ. မွဲလါနၫ့နစံၭ ယၧၩ, ယၥ့ၪယၫနၧၩ လၧနမံၩ့တၭ, နဘၪခိးဘၪတၩ",
			"13": "<sup>13</sup> လၧယမ့ၬယၫနီၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ယအ့ၪဘၪ ခိးဘၪတၩ လၧနမ့ၬယၫတၭ, ဒုၭၥ့ၪယၫလါယၧၩလၧ နဖၧၩ့ၥၭ, ဘဲၫၥိၭယမိၥ့ၪယၫနၧၩ လၧယမိဘၪခိးဘၪ တၩလၧနမ့ၬယၫဆံၭ. ဒဲယိဆီၫ့မီၪ့လၧၦလဆၨၩယီၩ",
			"14": "<sup>14</sup> မွဲနၡၩခမျၧးဆံၭ.- တၭအဝ့ၫဒၪစံၭ, ယမ့ၬမိလ့ၩဆၧ",
			"15": "<sup>15</sup> လၧနၥိၭဒဲယမိဒုၭအီၪပွံၭနၧၩလီၫ.- အဝ့ၫဒၪစံၭ, နမ့ၬ အ့ၪလလ့ၩဘၪတၭ, ထီးဒုၭလ့ၩထၪ့ခွံၬပၧၩလၧယီၩ",
			"16": "<sup>16</sup> လဂ့ၩ,- တၭၦမိၥ့ၪယၫထီးယီၩ လၧယဘၪခိးဘၪတၩ လၧနမ့ၬယၫ, ယၧၩဒဲနၡၩခမျၧးလၧဆၧနီၪလမံၩ့လဲၪ. မွဲလၧနလ့ၩလၧပၥိၭမွဲအ့ၬဧၪး တၭယၧၩဒဲနၡၩခမျၧး လဖၪနီၪ, မိအီၪလၩ့မဲၩလၧၦဆၨၩၥံၪ အီၪလၧဂၪ့ခိၪ ချိၫ့ထီးအလူၬနီၪလီၫ.",
			"17": "<sup>17</sup> ယဟိဝၩစံၭစမိစ့ၭ, နချဲၩ့ဆၧလမံၩ့ယီၩတၭ, ယမိ မၩဆ့လီၫ. အဂဲးဘဲၫယီၩ နဘၪခိးဘၪတၩလၧ ယမ့ၬ",
			"18": "<sup>18</sup> ယၫတၭ, ယၥ့ၪယၫနၧၩလၧနမံၩ့အကၠီၩ့လီၫ.- တၭအ",
			"19": "<sup>19</sup> ဝ့ၫဒၪစံၭ, ဒုၭဒၪဘၪလါယၧၩလၧနလၩနဖၩ့ဆံၭ.- အ ဝ့ၫဒၪစံၭ, ယမိဒုၭလ့ၩဖီၩ့ခွံၬ ယဆၧဂ့ၩထီးအလူၬလၧ နမ့ၬယၫ, ဒဲယမိဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ ယဟိဝၩအမံၩ့လၧ နမ့ၬယၫ, ဒဲၦလၧယမိဖ့ၪလၫ့ လၧဆၧအခိးအတၩလ ဂၩဂၩနီၪ, ယမိဖ့ၪလၫ့ဆၧအခိးအတၩ လၧအဝ့ၫလီၫ. တၭၦလၧယမိယၫ့ၥၭဝ့ၫလဂၩဂၩနီၪ, ယမိယၫ့ၥၭအ",
			"20": "<sup>20</sup> ဝ့ၫလီၫ.- တၭစံၭဝ့ၫဒၪ နဒၪဘၪယမ့ၬကဲၪအ့ၬ. အဂဲး ဘဲၫယီၩ ၦၡၩလၧအဒၪဘၪယမ့ၬနီၪ မၧၫ့ဘၪအ့ၬ.",
			"21": "<sup>21</sup> တၭယဟိဝၩစံၭဝ့ၫဒၪ, ယိခွါ, အလးလစီၪ့အီၪဘူၭ လၧယၧၩတၭ, နမိဆၧၫ့ထုၪ့ လၧလိးလဖျိၪ့အဖၫ့ခိၪ",
			"22": "<sup>22</sup> လီၫ.- တၭဆၧမိမၩအၥၭလၧယလၩယဖၩ့လ့ၩဖီၩ့ ခွံၬအဘိၩ့ဘၭနီၪ ယမိအီၪက့ၪနၧၩ လၧလိးထ့ဖၭအ ဖၧၩ့တၭ, ယမိချႃၬဘံၭနၧၩ လၧယစူၪထီးယလ့ၩဖီၩ့",
			"23": "<sup>23</sup> ခွံၬလီၫ.- ယမိထုၭထဲၩ့ယစူၪနီၪ, နမိဒၪဘၪယချိၫ့တၭး အ့ၪမွဲယမ့ၬအီၪဖျီၪဘၪအ့ၬ."
		},
		"34": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, တဲၩန့လိးပၪနံၫဘံၪ့လၧနဂး မၩအၥၭဘဲၫအခၪ့ထံၭလဖၪ အၥိၭနီၪဆံၭ. တၭလၧ ဆၧပၪပဲၪလဖၪယီၩ အလီၩ့ယမိကွ့ၭဆၧချဲၩ့ လၧအ",
			"2": "<sup>2</sup> ဝံခိၪလဖၪအလီၩ့ လၧနမၩထ့ဖၭခွံၬဝ့ၫနီၪလီၫ.- အီၪ တဲၩ့ဝဲၩနၥၭလၧဂီၩလခီၫတၭ, ဂဲၫထၪ့လၧခိၪလီၩ့စဲနၫ လၧဂီၩလခီၫတၭ ဒုၭနဲၪနၥၭလၧယၧၩထီးနီၪ လၧခိၪ",
			"3": "<sup>3</sup> လီၩ့ဒၩ့ခိၪနီၪဆံၭ.- တၭဒုၭဂဲၫထၪ့ၦၡၩလၧနၥိၭနးဂၩ လဂ့ၩ, ဒုၭအီၪဖျီၪၦၡၩလၧခိၪလီၩ့အလီၩ့နးစီၪ့နးဂၩ လဂ့ၩ, ဒဲၥိၪဒဲဘ့ၪဒဲချီလဖၪနီၪ, ဒုၭအၪ့အဆၪလၧခိၪ လီၩ့အမ့ၬယၫနီၪလဂ့ၩ.",
			"4": "<sup>4</sup> တၭအဆၧတဲၩန့ လိးပၪနံၫဘံၪ့, မၩအၥၭဘဲၫအဝံ ခိၪလဖၪအၥိၭနီၪလီၫ. မုဆဲၪ့ထၪ့နီၪ စမိစ့ၭဂဲထုၪ့ဂီၩ ဂီၩတၭ, လ့ၩထၪ့လၧခိၪလီၩ့စဲနၫအလီၩ့, ဘဲၫယဟိဝၩ မၪလူၬဝ့ၫအၥိၭနီၪ, လ့ၩန့လိးပၪနံၫဘံၪ့ လၧအစူၪဖၧၩ့",
			"5": "<sup>5</sup> လီၫ.- ယဟိဝၩဂဲၫလၩ့လၧဆၧအုၪ့အဖၧၩ့တၭ, ဆၧၫ့ ထုၪ့လၧအၥိၭထီးနီၪတၭ လီၩဖျီၪထၪ့ယဟိဝၩ အမံၩ့",
			"6": "<sup>6</sup> လီၫ.- ယဟိဝၩလ့ၩဖီၩ့လၧအမ့ၬယၫတၭ, လီၩဖျီၪ ထၪ့,ယဟိဝၩနီၪ, ယဟိဝၩယွၩနီၪ, လၧအၥၭအီၪဆၧ, ဒဲယၫ့ၥၭဆၧ,ၥၭထၪ့ကၪ, ဒဲအခိးအတၩ, ဒဲအမွဲအတီၩ",
			"7": "<sup>7</sup> အီၪဝ့ၫအၪမၬလီၫ.- ခိၭထၬဆၧအခိးအတၩ လဖၪလၧ ၦအထီၫ့လဖၪအဂး, ဖျါခွံၬဆၧအၧၩ့ဆၧၥၫ့ ဒဲဆၧၥူၭ ဆၧမၪ, ဒဲဆၧဒဲၩထူၬဆၧဒဲၩဘၭလီၫ. မွဲလါနၫ့တၭၦ လၧဆၧမၪအီၪလၧအလီၩ့နီၪ, မိကွဲၪဖျါခွံၬပျီၩပျီၩဆ့ အ့ၬး တၭမိအီၪက့ၪဆၧမၪလၧဖါလဖၪ ဒဲလၧဖိၪလဖၪ, ဒဲလၧအဖိၪလဖၪအဖိၪလဖၪအလီၩ့ ထီၩ့လၩ့လၧၥၧၫ့",
			"8": "<sup>8</sup> ဆိၩလဆိၩ, ဒဲလံဆိၩလဆိၩလီၫ.- စမိစ့ၭမၩချဲၫ့ချဲၫ့",
			"9": "<sup>9</sup> တၭ,ၡီၫ့လၩ့အခိၪလၧဂၪ့ခိၪတၭ, ဘၩဆၧလီၫ.- စံၭဝ့ၫ ဒၪ,ယအ့ၪဘၪခိးဘၪတၩလၧနမ့ၬယၫ, ကဆါဧ့,မွဲယ ကဆါလ့ၩဆၧလၧပကျၩဆံၭ. အဂဲးဘဲၫယီၩအယီၩ မွဲၦခမျၧးအခိၬဆီၪ့း မၩဖီၩ့မၩဖျ့ၭပဆၧၥူၭပဆၧမၪ, ဒဲပဆၧဒဲၩထူၬဆၧဒဲၩဘၭတၭ, အီၪက့ၪပၧၩလၧနန့ၥၫ ဆၧနီၪဆံၭ.",
			"10": "<sup>10</sup> တၭအဝ့ၫဒၪစံၭ, ယိခွါ, ယမၩဆၧအုၩ့လၩ့လမံၩ့, နီၪ, လၧနၡၩခမျၧးထီးအလူၬအမ့ၬယၫတၭ, ယမိမၩ ဆၧလၩ့လိလၩ့လၭလၧအလမၩဒံၭဘၪအၥၭ လၧဂၪ့ ခိၪချိၫ့ယီၩ, ဒဲလၧၦၡၩနးဆၨၩဒံၭဘၪအကျၩတၭ, က ယဲၦခမျၧးလၧနအီၪ လၧအကျၩနီၪမိဒၪဘၪ ယဟိဝၩ အဆၧမၩနီၪလီၫ. အဂဲးဘဲၫယီၩ, ဆၧလၧယမိမၩနၧၩ",
			"11": "<sup>11</sup> နီၪ,မွဲဆၧၥၭမဲၪၥၭဖျဲၩ့လီၫ.- ဆၧလၧယမၪလူၬနၧၩ လၧမုဆၫလနံၩယီၩထီးန့ဆံၭ. ယိခွါ, ယမိနၫ့ထၪ့ခွံၬ ၦအၫမိၫဖိၪ, ဒဲၦကၫနအၫ့ဖိၪ, ဒဲၦဟ့ၥၭဖိၪ, ဒဲၦပံရ့ၭ",
			"12": "<sup>12</sup> ဖိၪ,ဒဲၦဟ့ဝဲၭဖိၪ, ဒဲၦယ့ဘုၫဖိၪလၧနမ့ၬယၫလီၫ.- ထီး လၩ့နၥၭဘဲၫၥိၭနထီးမၩဆၧအုၩ့လၩ့ လၧၦခးဖိၪထီး နလ့ၩဆၧနီၪလဂ့ၩ. မိကဲၪထၪ့ဘၪခိၬ ဆၧအဖျံၩခွၩ့လၧ",
			"13": "<sup>13</sup> နၥံၪအကျၩလီၫ.- အ့ၪမွဲနၥံၪဘၪမၩဂၭဂီၩ့ အဝ့ၫၥံၪ အဆၧလုလး, ဒဲမၩခါခွံၬအဆၧဂၩ့, ဒဲခူၬခွံၬအရှ့ရိၫနီၪ",
			"14": "<sup>14</sup> ဆံၭ.- အဂဲးဘဲၫယီၩနဘၩယွၩအဂူၫဂၩအ့ၬ. အဂဲးဘဲၫ ယီၩ ယဟိဝၩမွဲယွၩလၧအမံၩ့ မွဲဆၧၥၭကဲၪ့လဂၩနီၪ,",
			"15": "<sup>15</sup> မွဲအၥၭကဲၪ့ဆၧလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အုၩ့လၩ့ ဆၧလၧၦခးဖိၪလဂ့ၩ. အဝ့ၫၥံၪနီၪ မိမၩမၪဖိၬအယွၩ လဖၪနီၪအခဲၫ့, ဒဲလုထၪ့အယွၩလဖၪတၭ, ၦၡၩကိၭ",
			"16": "<sup>16</sup> နၧၩတၭ, နမိအၪ့ဘၪခိၬအဆၧလုလီၫ. နမိမၩန့ဘၪခိၬ အဖိၪမုၪလဖၪလၧနဖိၪခွၫလဖၪအဂးတၭ, အဝ့ၫၥံၪအ ဖိၪမုၪလဖၪနီၪမိလ့ၩမၩမၪဖိၬအယွၩလဖၪအခဲၫ့, ဒဲမိ ဒုၭမၩမၪဘၪခိၬနဖိၪခွၫလဖၪ လၧအမိဖိၬအဝ့ၫၥံၪ အ ကဆါအခဲၫ့လီၫ.",
			"17": "<sup>17</sup> ထီးတဲၩ့ယွၩလဖၪၥိၫ့အၥၭလၧနဂးလဂ့ၩ.",
			"18": "<sup>18</sup> ဘိၪ့ကိၪလအီၪဘၪလၧမံၪနီၪထီးန့ဆံၭ. နဘၪအၪ့ ကိၪလအီၪဘၪလၧမံၪနီၪနွ့ၫနံၩ, ဘဲၫယမၪလူၬနၧၩလၧ အဆၧၫ့အထီ လၧလၩအၫဘံၭအဖၧၩ့ အၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ နဂဲၫထၪ့ခွံၬလၧအံဇံၭလၧလၩအၫဘံၭ",
			"19": "<sup>19</sup> အဖၧၩ့နီၪလီၫ.- ကယဲဆၧလၧအဝဲထၪ့ဆိၫ အဒၧၩ့ လး, ဒဲကယဲနဆၧဖိၪဆၧဎါအဝဲၡါ, ချီမွဲဂ့ၩ, ၥိၪမွဲဂ့ၩ,",
			"20": "<sup>20</sup> မွဲယဆၧထီးအလူၬလီၫ.- အ့ၪမွဲကၥ့ၪယီၩ့အဖိၪဝဲၡါ နီၪ,နဘၪဎွ့ၩန့ထဲၩ့ဝ့ၫ လၧၥိၪဖိၪလဒုၩလီၫ. တၭနအ့ၪ လဎွ့ၩန့ထဲၩ့ဘၪတၭ, နဘၪမၩခါအခိၬလီၫ. ကယဲနဖိၪ ဝဲၡါလဂၩလါလါနီၪ နဘၪဎွ့ၩန့ထဲၩ့ဝ့ၫလီၫ. တၭထီး အီၪထၪ့လၧယမ့ၬယၫ ပျီၩပျီၩနးဂၩလဂ့ၩ.",
			"21": "<sup>21</sup> ဎူၫနံၩနီၪနမိဘၪမၩဆၧတၭ, အ့ၪမွဲနွ့ၫနံၩလနံၩနီၪ နဘၪအီၪပွံၭလီၫ. ထဲၫဆၧအဆၧၫ့အထီ, ဒဲကူၭဆၧအ",
			"22": "<sup>22</sup> ဆၧၫ့အထီနီၪ, နဘၪအီၪပွံၭလီၫ.- တၭနဘၪထီးန့ ဘိၪ့နွ့ၫလဖၪ, ဒဲဘိၪ့ကူၭဘုၪကၠိၩ့အဆိၫ, ဒဲဘိၪ့အၪ့ ထုၫ့ကီၪ့ဆၧလၧ နံၪ့အထုၬနီၪလီၫ.",
			"23": "<sup>23</sup> လနံၪ့အထးဖၧၩ့နီၪ ကယဲနၥံၪအခွၫၥံၪ ထီးအလူၬ ဘၪဒုၭနဲၪအၥၭလၧကဆါယွၩ, ၦအံၫစရ့လၭအယွၩ",
			"24": "<sup>24</sup> အမ့ၬယၫၥၧၫ့ဖၧၫ့လီၫ.- အဂဲးဘဲၫယီၩ ယမိနၫ့ထၪ့ခွံၬ ၦဆၨၩလဖၪလၧနမ့ၬယၫ, ဒဲမၩလဲထၪ့နခးဆၧၫ့လဖၪ လီၫ. တၭထီးနလ့ၩမၩဖျီၪထၪ့နၥၭ လၧယဟိဝၩနယွၩ အမ့ၬယၫ လၧလနံၪ့အထးဖၧၩ့ၥၧၫ့ဘျၩ့တၭ, ၦၡၩမိ ဆိၫ့န့ဘၪနဂၪ့ခိၪနးဂၩအ့ၬ.",
			"25": "<sup>25</sup> လုထၪ့ယဆၧလုအၥွံၪ အီၪလၧမံၪနီၪလဂ့ၩ. တၭ ဘိၪ့လ့ၩဖၬ အဆၧလုနီၪ, အီၪက့ၪဝ့ၫၥၫ့နၩချီၩ့ ထီးမု",
			"26": "<sup>26</sup> ဆဲၪ့ထၪ့နီၪလဂ့ၩ,- ဂၪ့ခိၪအၥၪဆိၫအဝံခိၪလဖၪနီၪဂဲၫ ဆိၬလၧယဟိဝၩနယွၩအဂံၪ့ဖၧၩ့ဆံၭ. ထီးအၪ့ဎွံထၪ့ ဘ့ၪဖိၪလၧအမိအနူထံၫ အဖၧၩ့နီၪလဂ့ၩ.",
			"27": "<sup>27</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ကွ့ၭလၩ့ဆၧချဲၩ့လဖၪနီၪ ဆံၭ. အဂဲးဘဲၫယီၩ ဘဲၫဆၧချဲၩ့လဖၪယီၩ အဂဲးအကၠီၪ့ အၥိၭနီၪ, ယမၩယူၭဆၧအုၩ့လၩ့ လၧနၧၩဒဲလၧအံၫစ",
			"28": "<sup>28</sup> ရ့လၭအၥိၭဆ့လီၫ.- တၭမွဲအအီၪဝ့ၫထီးနီၪလၧယဟိ ဝၩအၥိၭအနံၩလံဆံၫ ဒဲအနၩလံဆံၫတၭ, မွဲအအၪ့ဘၪ ကိၪ ဒဲအီၩဘၪထံၫအ့ၬ. တၭအဝ့ၫကွ့ၭလၩ့ ဆၧအုၩ့ လၩ့အဆၧချဲၩ့, ဆၧမၪလူၬဆံၫထံၪၥံၪ လၧဆၧပၪပဲၪအ လီၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> တၭထီးစမိစ့ၭ ဂဲၫထဲၩ့လၩ့ လၧခိၪလီၩ့စဲနၫအလီၩ့ နီၪ, အီၪလၧဆၧအုၩ့လၩ့ အပၪပဲၪနံၫဘံၪ့ လၧစမိစ့ၭ အစူၪဖၧၩ့တၭ, ထီးအဂဲၫထဲၩ့လၩ့လၧခိၪလီၩ့နီၪ, ဆၧ မၩအၥၭလၧဆၧချဲၩ့ဒုၪ့အဝ့ၫ အဘိၩ့ဘၭနီၪ အမ့ၬဖံၭ",
			"30": "<sup>30</sup> ဖၩ့ဂိးရှ့ၭဂိးၡီၫတၭ, ၥ့ၪယၫလၩ့အၥၭအ့ၬ.- ထီးစအၫ ရၧၫ့ ဒဲၦအံၫစရ့လၭဖိၪ ထီးအလူၬ ဒၪဘၪစမိစ့ၭတၭ, ယိခွါ, အမ့ၬဖံၭဖၩ့ဂိးရှ့ၭဂိးၡီၫတၭ, အဝ့ၫၥံၪၥုၭဘူၭ",
			"31": "<sup>31</sup> အၥၭလၧအအီၪလဘုၪ့ဘၪလီၫ.- စမိစ့ၭကိၭထၪ့အ ဝ့ၫၥံၪတၭ, စအၫရၧၫ့ဒဲအဆၧအီၪကီၪ့ အၦဒိၪလဖၪထီး အလူၬဂဲၫထဲၩ့ထဲၩ့လၧအအီၪတၭ, စမိစ့ၭချဲၩ့ဒုၪ့အဝ့ၫ",
			"32": "<sup>32</sup> ၥံၪလီၫ.- လၧခဲၫ့ထဲၩ့နီၪ ၦအံၫစရ့လၭဖိၪထီးအလူၬဂဲၫ ဘူၭဝ့ၫတၭ, အဝ့ၫဒၪမၪလူၬဝ့ၫ လၧကယဲဆၧလၧယဟိ ဝၩလီၩဘၪဝ့ၫလၧခိၪလီၩ့စဲနၫအလီၩ့ ထီးအလူၬလီၫ.",
			"33": "<sup>33</sup> တၭစမိစ့ၭချဲၩ့ဒုၪ့အဝ့ၫၥံၪ အဘိၩ့ဘၭနီၪ အီၪက့ၪဆၧ",
			"34": "<sup>34</sup> ချႃၬဘံၭလၧအမ့ၬလီၩ့လီၫ.- အ့ၪမွဲထီးစမိစ့ၭလ့ၩနုၬ လၧယဟိဝၩအမ့ၬယၫ ဘဲၫၥိၭအမိချဲၩ့ဒုၪ့ဝ့ၫတၭ, ဘဲၪ့ လၩ့ခွံၬ ဆၧချႃၬဘံၭ ထီးလၧအမိဂဲၫထဲၩ့ထဲၩ့နီၪလီၫ. မွဲအဂဲၫထဲၩ့ထဲၩ့လီၩလၩ့ ၦအံၫစရ့လၭဖိၪဆၧလၧဆၧ",
			"35": "<sup>35</sup> မၪလူၬဝ့ၫလီၫ.- တၭၦအံၫစရ့လၭဖိၪဒၪဘၪစမိစ့ၭအ မ့ၬ လၧအမ့ၬဖံၭဖၩ့ဂိးရှ့ၭဂိးၡီၫလီၫ. ထီးလၧအလ့ၩ နုၬချဲၩ့ဒုၪ့ဆၧလၧအဝ့ၫဒၪနီၪတၭ စမိစ့ၭအီၪက့ၪထၪ့ ဒီၭဆၧချႃၬဘံၭ လၧအမ့ၬလီၩ့လီၫ."
		},
		"35": {
			"1": "<sup>1</sup> စမိစ့ၭဒုၭအီၪကီၪ့ ၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ ထီးအလူၬတၭ, စံၭဝ့ၫ, အယီၩမွဲဆၧချဲၩ့လၧယဟိဝၩ",
			"2": "<sup>2</sup> မၪလူၬဝ့ၫလၧနၥံၪဘၪထီးန့ဝ့ၫလီၫ.- ဎူၫနံၩလဖၪနၥံၪ ဘၪမၩဆၧမၩလီၫ. အ့ၪမွဲနွ့ၫနံၩလနံၩနီၪ မိကဲၪထၪ့ ဆၧအီၪပွံၭဆံၫ့ဎံၪ လၧနၥံၪအဂး, ဆၧအီၪပွံၭလၧယ ဟိဝၩအဂးလီၫ. ကယဲၦလၧအမၩဆၧမၩ လၧအဖၧၩ့",
			"3": "<sup>3</sup> နီၪမိဘၪဆၧမၩၥံၫဝ့ၫကိၭဂၩဒ့ၭလီၫ.- လၧမးၥံၫအနံၩ နီၪထီးမၩခဲၩမ့ၪလၧနၥံၪအီၪ အလးနးစီၪ့လဂ့ၩ.",
			"4": "<sup>4</sup> စမိစ့ၭချဲၩ့ဒုၪ့ ၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီး အလူၬတၭ, စံၭဝ့ၫဒၪ, ဆၧယီၩမွဲဆၧလၧယဟိဝၩမၪ",
			"5": "<sup>5</sup> လူၬဝ့ၫတၭ, စံၭဝ့ၫဒၪ,- အၪ့မၩန့ဆၧမၩဘိၪ့လၧယဟိ ဝၩအဂး လၧနၥံၪအကျၩနီၪဆံၭ. ထီးဒၪၦလၧအၥၭ အီၪလၧအမိဖ့ၪလၫ့ဒၪဆၧ လဂၩလါလါနီၪ, မွဲအဂဲၫဆိၬ ဆၧမၩဘိၪ့လၧယဟိဝၩအအီၪဆံၭ. ထီၫ့, ဒဲစ့ၩ,ဒဲထီး",
			"6": "<sup>6</sup> ဝီၩ,- ဒဲဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩ",
			"7": "<sup>7</sup> ဖျ့ၫလံၬကံၭ ဒဲဘ့ၪအဆီၪ့,- ဒဲၥိၪဖၫအဖံၭဝီၩ ဒဲတဟၫ",
			"8": "<sup>8</sup> ၡၭအဖံၭ, ဒဲၥံၪ့ၡံၭတၫ,- ဒဲၥိၪလၧမ့ၪဒိၩ့အဂး, ဒဲဆၧ နၧၫ့မၧၫ့လၧၥိၪဂုၪဆၧအဂး, ဒဲလၧဆၧဆူၭခဲၩနၧၫ့မၧၫ့",
			"9": "<sup>9</sup> အဂး,- ဒဲထၫ့မျါမဟူၫယၫ, ဒဲလိးလၧအမၩဎွ့ၩထၪ့ လၧအ့ဖိၭအဂး, ဒဲလၧၥၭနၫပဒၩ့အဂးလီၫ.",
			"10": "<sup>10</sup> တၭကယဲၦလၧအၥၭကိၪ့ဆၧၥ့ၪ လဂၩလါလါနီၪ ဘၪဂဲၫ, ဒဲမၩ ဆၧလၧယဟိဝၩမၪလူၬဝ့ၫ ထီးအလူၬလီၫ.",
			"11": "<sup>11</sup> တဲၩဆံၫ့ဎံၪ, ဒဲအတဲၩ, ဒဲအဆၧခိၪကျၭအနိၪပုၭလဖၪ, ဒဲအၥံၪ့ပၪလဖၪ, အနိၪယိၭဘီၩ့လဖၪ, အထုၪ့လဖၪ,",
			"12": "<sup>12</sup> ဒဲအခၪ့ဖျၪ့လဖၪ,- တလၫဒဲအနိၪယိၭဘီၩ့လဖၪ, ဆၧယၫ့ၥၭအလး, ဒဲဆၧချႃၬဘံၭအဆၧကဲၩ့ယၬတၭ,",
			"13": "<sup>13</sup> စပွဲ,ဒဲအနိၪယိၭဘီၩ့လဖၪ, ဒဲအထွ့ၫထီးအလူၬ, ဒဲဆၧ",
			"14": "<sup>14</sup> မ့ၬယၫအကိၪ,- ဒဲမ့ၪဒိၩ့မိၡါလၧဆၧဖၩ့အဂး, ဒဲအဆၧ ဖိၪဆၧလံၩလဖၪ, ဒဲအမ့ၪဒိၩ့လဖၪ, ဒဲၥိၪလၧဆၧဖၩ့",
			"15": "<sup>15</sup> အဂး,- ဒဲဆၧလုလးဆူၭခဲၩဆၧနၧၫ့မၧၫ့, ဒဲအနိၪယိၭဘီၩ့ လဖၪ ဒဲၥိၪဂုၪဆၧဒဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့, ဒဲဆၧလၩ့ဆဲၩနီၪ လၧတရၫ့အဂး လၧဆၧလ့ၩနုၬလၧတဲၩဆံၫ့ဎံၪအဖၧၩ့,",
			"16": "<sup>16</sup> ဒဲဆၧလုမ့ၪအလး, ဒဲအဖံၫ့ချၪထီးဝီၩ, အနိၪယိၭဘီၩ့ လဖၪ, ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ, အံၪ့ဒိၩ့ဒဲအ",
			"17": "<sup>17</sup> ခၪ့,- ဆၧအဝၩ့အဆၧလၩ့ဆဲၩလဖၪ, အထုၪ့လဖၪဒဲအ ခၪ့ဖျၪ့လဖၪ, ဒဲဝၩ့အတရၫ့အဆၧလၩ့ဆဲၩလဖၪတၭ,",
			"18": "<sup>18</sup> တဲၩဆံၫ့ဎံၪအနိၪစဲၩလဖၪ, ဒဲဝၩ့အနိၪစဲၩလဖၪ, ဒဲအ",
			"19": "<sup>19</sup> ဖျံၩလဖၪ,- ဆၧအကီၩ့အၥိၭဘၪဆဲၫ့ လၧဆၧမၩအခ့ၫ အၡၩအဆၧ လၧအမိမၩဆၧလၧလးဆံၫ့ဎံၪအဖၧၩ့, ဆၧအကီၩ့အၥိၭဆံၫ့ဎံၪ လၧၦလုဆၧစအၫရၧၫ့အဂး, ဒဲအဖိၪခွၫလဖၪ အကီၩ့အၥိၭ ဘဲၫၥိၭအမိမၩၦလုဆၧ အဆၧမၩလီၫ.",
			"20": "<sup>20</sup> တၭၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ ထီးအလူၬနီၪ",
			"21": "<sup>21</sup> စဲၪ့ထၪ့ခွံၬလၧစမိစ့ၭအမ့ၬယၫလီၫ.- တၭအဝ့ၫၥံၪဂဲၫ ထီၩ့ဝ့ၫကယဲၦလၧအၥၭထိၪဂဲၩဝ့ၫ ဒဲကယဲၦလၧအၥၭ အီၪထၪ့ဒၪဆၧလဖၪဆုၬဆုၬနီၪ, မွဲအဂဲၫဆိၬဆၧမၩ ဘိၪ့ယဟိဝၩ လၧဆၧမၩဘၪဆဲၫ့ လၧဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪအဂး, ဒဲလၧအဆၧမၩထီးအလူၬ အဂး,",
			"22": "<sup>22</sup> ဒဲလၧဆၧအကီၩ့အၥိၭဆံၫ့ဎံၪအဂးလီၫ.- အဝ့ၫၥံၪ ဂဲၫလၧၦခွၫဒဲၦမုၪ ကယဲၦလၧအၥၭ အီၪထၪ့ဒၪဆၧ တၭ,ဂဲၫဆိၬအထဲၫ့ဎွံၪ, ဒဲနါဒံၭ, ဒဲစူၪၥံၭဒဲဖဲၫ, အက ယၧၩ့ထီၫ့ထီးအလူၬလီၫ. ၦလၧအမၩဘိၪ့ဆၧနီၪ, မၩ ဘိၪ့ထီၫ့ၥံၪ လွ့ၫၥံၪ လၧယဟိဝၩအဂး ကိၭအဂၩဒ့ၭ",
			"23": "<sup>23</sup> လီၫ.- တၭကယဲၦလၧအအီၪလၧဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭ, ဒဲဘ့ၪအဆီၪ့ ဒဲၥိၪဖၫ ဖံၭဝီၩ, ဒဲတဟၫၡၭအဖံၭနီၪ ဂဲၫဆိၬဝ့ၫကိၭအဂၩဒ့ၭ",
			"24": "<sup>24</sup> လီၫ.- တၭကယဲၦလၧအမၩဘိၪ့ဆၧလၧစ့ၩ, ဒဲထီးဝီၩ နီၪ, ဂဲၫဆိၬယဟိဝၩအဆၧမၩဘိၪ့လီၫ. တၭကယဲၦခွၫ လၧအအီၪလၧၥံၪ့ရှံၭတၫလၧဆၧမၩ လမံၩ့လါလါအ",
			"25": "<sup>25</sup> ဂးနီၪ, ဂဲၫဆိၬဝ့ၫကိၭအဂၩဒ့ၭလီၫ.- ကယဲၦမုၪလၧအ ကိၪ့ဆၧၥ့ၪလဂၩလါလါနီၪ, ဝံၭဎဲၩ့လူၪလၧအစူၪတၭ, ဂဲၫဆိၬဆၧလၧအဝံၭဝ့ၫနီၪ, ဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲ",
			"26": "<sup>26</sup> ဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭလီၫ.- ကယဲၦမုၪလၧအ",
			"27": "<sup>27</sup> ၥၭထိၪဂဲၩအကိၪ့ဆၧၥ့ၪနီၪ, ဝံၭဘ့ၪအဆီၪ့လီၫ.- တၭ ၦဒိၪလဖၪဂဲၫဆိၬထၫ့မျါမဟူၫယၫ, ဒဲလိးလၧအမိမၩ",
			"28": "<sup>28</sup> ဎွ့ၩအ့ဖိၭအဂး, ဒဲလၧၥၭနၫပဒၩ့အဂး,- ဒဲဆၧနၧၫ့မၧၫ့, ဒဲၥိၪလၧဆၧဖၩ့အဂး, ဒဲၥိၪလၧဂုၪဆၧအဂး, ဒဲလၧဆၧ",
			"29": "<sup>29</sup> ဆူၭခဲၩနၧၫ့မၧၫ့အဂးလီၫ.- တၭၦအံၫစရ့လၭဖိၪ, ဘဲၫ အၥၭအီၪထၪ့ဒၪဆၧအၥိၭနီၪ, ဂဲၫဆိၬအဆၧမၩဘိၪ့ လၧယဟိဝၩအအီၪ, ကယဲၦမုၪ ဒဲၦခွၫ လၧအၥၭထိၪ ဂဲၩဝ့ၫ, ဘဲၫၥိၭအမိဂဲၫဆိၬဆၧ လၧကယဲဆၧမၩအဂး, လၧယဟိဝၩမၪလူၬ လၧအမိဘၪဆၧမၩဝ့ၫ လၧစမိစ့ၭ အစူၪဖၧၩ့ ထီးအလူၬလီၫ.",
			"30": "<sup>30</sup> တၭစမိစ့ၭစံၭၦအံၫစရ့လၭဖိၪ, ယိခွါဘီၪ, ယဟိဝၩ ကိၭထၪ့ၦယုဒၫအဒီၪ့ဖိၪ, စဟၧအဖိၪခွၫ, စယုရဲၫအ",
			"31": "<sup>31</sup> ဖိၪခွၫ, စဘ့ၫဇလံလၭလၧအမံၩ့,- တၭမၩဎွ့ၩဝ့ၫလၧ ယွၩအၥၭ, ဒဲဆၧကိၪ့ၥ့ၪ ဒဲဆၧကိၪ့ဆၧဆၭ, ဒဲဆၧၥ့ၪ",
			"32": "<sup>32</sup> ယၫ,ဒဲဆၧမၩဆၧကိၭအမံၩ့ဒ့ၭ,- ဘဲၫၥိၭအမိကိၪ့ထၪ့ ဖၭလၩ့ဆၧကိၪ့, လၧအမိမၩဆၧလၧထီၫ့ဒဲစ့ၩ, ဒဲထီး",
			"33": "<sup>33</sup> ဝီၩ,- ဒဲလၧအမိတဲၩလိးၥံၪ, ဒဲအီၪက့ၪဝ့ၫလၧအလး, ဒဲလၧအစိၭဖျၩၥံၪ့ၥံၪ, ဘဲၫၥိၭအမိမၩဆၧအကိၪ့ထၪ့",
			"34": "<sup>34</sup> ဖၭလၩ့အဆၧမၩကိၭမံၩ့ဒ့ၭလီၫ.- တၭမွဲအဒုၭနုၬဆၧ လၧအၥၭခံဖၧၩ့ဘဲၫၥိၭအမိၥီၪ့လိၪဆၧ, အဝ့ၫနီၪ,ဒဲၦဒၫ့ အဒီၪ့ဖိၪ, စအဟံစမၭအဖိၪခွၫ, စအဟိလအၭလီၫ.",
			"35": "<sup>35</sup> မၩဎွ့ၩအဝ့ၫၥံၪအၥၭ လၧဆၧကိၪ့ၥ့ၪ ဘဲၫၥိၭအမိမၩ ကယဲဆၧမၩ, ၦစိၭဖျၩဆၧအဆၧမၩ, ဒဲၦအကိၪ့ထၪ့ ဖၭလၩ့အဆၧမၩ, ဒဲၦလၧအဆၭကံၪဆၧလၧဆၧလၫ ဒဲလၧဆၧဝီၩလုၭ, လၧဆၧဝီၩ, ဒဲလၧဆၧဘွၩဖျ့ၫလံၬ ကံၭ, ဒဲၦလၧအထၭထၪ, ၦလၧအမၩဆၧမၩလမံၩ့ လါလါ, ဒဲၦလၧအကိၪ့ထၪ့ဖၭလၩ့ ဆၧကိၪ့လဖၪလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စဘ့ၫဇလံလၭ ဒဲစအဟိလအၭ,ဒဲ ကယဲၦလၧအကိၪ့ဆၧၥ့ၪ လၧယဟိဝၩဒုၭနုၬဆၧကိၪ့ ၥ့ၪဒဲဆၧကိၪ့ဆၧဆၭ လၧအၥၭခံဖၧၩ့ ဘဲၫၥိၭအမိၥ့ၪ ယၫမၩကယဲဆၧမၩ လမံၩ့လါလါ လၧအလးဆံၫ့ဎံၪ အဆၧမၩအဂးနီၪ, မၩဝ့ၫဘဲၫကယဲဆၧလၧယဟိဝၩ မၪလူၬဝ့ၫထီးအလူၬအၥိၭနီၪလီၫ.",
			"2": "<sup>2</sup> တၭစမိစ့ၭကိၭန့ စဘ့ၫဇလံလၭ,ဒဲစအဟိလအၭ, ဒဲကယဲၦအၥၭလၧ အကိၪ့ဆၧၥ့ၪ လၧယဟိဝၩဒုၭနုၬဆၧ ကိၪ့ၥ့ၪလၧအၥၭခံဖၧၩ့ လဂၩလါလါ, ကယဲၦလၧအၥၭ",
			"3": "<sup>3</sup> ထိၪဂဲၩဝ့ၫ ဘဲၫၥိၭအမိဂဲၫမၩဆၧနီၪလီၫ.- တၭအဝ့ၫၥံၪ ဒိၭန့ဆၧမၩဘိၪ့ လၧၦအံၫစရ့လၭဖိၪဂဲၫဆိၬယူၭ လၧ အလးဆံၫ့ဎံၪ အဆၧမၩမိကဲၪထၪ့ဝ့ၫအဂး လၧစမိစ့ၭ အစူၪဖၧၩ့, ဘဲၫၥိၭအမိမၩဝ့ၫလီၫ. တၭၦဂဲၫဆိၬဒံၭဆၧ မၩဘိၪ့လၧအဖ့ၪဒၪဆၧ လၧဂီၩလခီၫကိၭဂီၩဒ့ၭလီၫ.",
			"4": "<sup>4</sup> တၭကယဲၦလၧအကိၪ့ဆၧၥ့ၪ လၧအမၩအလးဆံၫ့ဎံၪ အဆၧမၩလဂၩလါလါနီၪ, ဂဲၫထဲၩ့လၧအဆၧမၩဝ့ၫ",
			"5": "<sup>5</sup> အအီၪကိၭဂၩဒ့ၭ,- အဝ့ၫၥံၪချဲၩ့ဒုၪ့စမိစ့ၭတၭ, စံၭဝ့ၫ ဒၪ,ၦၡၩၥံၪဂဲၫဆိၬဆၧ လၧအမၩဆၧအဂးလၧယဟိ",
			"6": "<sup>6</sup> ဝၩမၪလူၬဝ့ၫနီၪ, အၪလၨၪလီၫ.- စမိစ့ၭမၪလူၬဆၧ တၭ,ၦၡၩဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ လၧၦၥုၪ့တဲၩအလးဖၧၩ့ ဎံၩ့ဎံၩ့လ့ၬတၭ, စံၭဝ့ၫဒၪ, ၦမုၪမွဲဂ့ၩၦခွၫမွဲဂ့ၩ, မွဲအ ထီးမၩလၧၩ့ဆၧမၩဘိၪ့ လၧဆၧအလး ဆံၫ့ဎံၪအဂး လဂ့ၩး တၭၦခမျၧးဘၪဆၧပဒၩ့ထၬဝ့ၫ လၧအဂဲၫဆိၬ",
			"7": "<sup>7</sup> ဆၧနီၪလီၫ.- အဂဲးဘဲၫယီၩ ဆၧလၧၫ့ဎွ့ၩ ဒဲကယဲဆၧ လၧအဆၧမၩအဂး ဘဲၫၥိၭအမိမၩဝ့ၫနီၪ, အီၪဝ့ၫအၪ လၨၪလီၫ.",
			"8": "<sup>8</sup> တၭကယဲၦအၥၭ လၧအကိၪ့ဆၧၥ့ၪလၧအကျၩလၧ အမၩတဲၩဆံၫ့ဎံၪ အဆၧမၩနီၪမၩဝ့ၫကလကၫ, လၧ ဆၧဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့အၥၭ, ဒဲဆၧလၫ,ဒဲ ဆၧဝီၩ, ဒဲခ့ၫရူၬလဖၪ လၧၦမၩဆၧၥ့ၪမၩဝ့ၫဆံၫဘံၪ့",
			"9": "<sup>9</sup> နီၪလီၫ.- တၭကလကၫလဘံၪ့အဖၭထီၫနံၫဆံၫဎိၭဖျါ, အဒၪ့ဎၩ့လံဖျါလီၫ. ကလကၫလဖၪနီၪထီးအလူၬထီၫ",
			"10": "<sup>10</sup> ဎီၩ့လိၬအၥၭလီၫ.- တၭကလကၫယဲဘံၪ့နီၪအဝ့ၫဒၪမၩ ဘုၭထၬလိၬအၥၭလဘံၪ့ဒဲလဘံၪ့း ဒဲကလကၫယဲဘံၪ့ ဒၪ, အဝ့ၫဒၪ မၩဘုၭထၬလိၬ အၥၭ လဘံၪ့ ဒဲလဘံၪ့",
			"11": "<sup>11</sup> လီၫ.- တၭမၩဝ့ၫအနါလဖၪ လၧဆၧလၫလၧကလကၫ လဘံၪ့အနဲၩ့ထံၭလၧအအီၪလၧဆၧဘုၭထၬလိၬအၥၭ ထီးအထုၬလီၫ. မၩဆၧဘဲၫနီၪၥိၭ လၧကလကၫလဘံၪ့ လၧအအီၪလၧဆၧဘုၭထၬလိၬအၥၭ နံၫဘံၪ့ လဘံၪ့",
			"12": "<sup>12</sup> လၧအထုၬနီၪလီၫ.- မၩအနါလဖၪ ယဲဆံၫ လၧကလ ကၫလဘံၪ့အလီၩ့, ဒဲဆဲၫဎၩ့လိၬအၥၭ လၧအဝ့ၫနီၪ, မၩအနါလဖၪ ယဲဆံၫလၧကလကၫ လဘံၪ့ဒၪအလီၩ့ လၧအအီၪလၧဆၧဘုၭထၬလိၬအၥၭနံၫဘံၪ့လဘံၪ့ထီး",
			"13": "<sup>13</sup> အထုၬလီၫ.- မၩနိၪပုၭယဲဆံၫတၭ, ဒုၭဘုၭထၬအက လကၫလဖၪလၧနိၪပုၭတၭ, ကဲၪထၪ့တဲၩဆံၫ့ဎံၪလဖျိၪ့ ဎးလီၫ.",
			"14": "<sup>14</sup> အဝ့ၫမၩကလကၫလဖၪ လၧဘ့ၪအဆီၪ့ဆံၫလဘံၪ့ လၧတဲၩလၧအအီၪလၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪအဂးလီၫ.",
			"15": "<sup>15</sup> တၭကလကၫလဘံၪ့ဘံၪ့အဖၭထီၫနီၪအဖျါၥၧၫ့ဆံၫ, ဒဲအဒၪ့ဎၩ့လံဖျါ, ဒဲကလကၫဆံၫလဘံၪ့နီၪ မွဲန့ၫဎီၩ့",
			"16": "<sup>16</sup> လိၬအၥၭလီၫ.- တၭအဝ့ၫဒၪမၩဘုၭထၬလိၬအၥၭက လကၫယဲဘံၪ့လစီၪ့, ဒဲကလကၫဎူၫဘံၪ့လစီၪ့ဒၪနီၪ",
			"17": "<sup>17</sup> လီၫ.- တၭမၩဝ့ၫလၧအနါလဖၪ ယဲဆံၫလၧကလကၫ လဘံၪ့အနဲၩ့, လၧအအီၪလၧဆၧဘုၭထၬလိၬ အၥၭ ထီးအထုၬလီၫ. ဒဲအနါလဖၪယဲဆံၫ လၧကလကၫလ ဘံၪ့အနဲၩ့ လၧအအီၪလၧဆၧဘုၭထၬလိၬအၥၭ နံၫ",
			"18": "<sup>18</sup> ဘံၪ့လဘံၪ့ထီးအထုၬလီၫ.- တၭမၩနိၪပုၭထီးဝီၩဘဲၫ ၥိၭအမိပုၭထၬတဲၩတၭ, မိကဲၪထၪ့ဆၧလဖျိၪ့ဎးလီၫ.",
			"19": "<sup>19</sup> တၭအဝ့ၫဒၪမၩဆၧချႃၬဘံၭ လၧၥိၪဖၫအဖံၭဝီၩလၧ တဲၩအဂး ဒဲဆၧချႃၬဘံၭအဖၫ့ခိၪနီၪ လၧတဟၫၡၭအ ဖံၭလီၫ.",
			"20": "<sup>20</sup> တၭအဝ့ၫဒၪမၩၥံၪ့ပၪ လၧၥံၪ့ၡံၭတၫအီၪဆၧၫ့ထုၪ့",
			"21": "<sup>21</sup> ဝ့ၫလၧတဲၩဆံၫ့ဎံၪအဂးနီၪလီၫ.- ၥံၪ့ပၪလဘံၪ့နီၪအ ဖၭထီၫအီၪအဖျါလဆံၫတၭ, အဒၪ့ဎၩ့လဖျါထၫလီၫ.",
			"22": "<sup>22</sup> ၥံၪ့ပၪလဘံၪ့အီၪလၧအခၪ့နံၫခီၫဆဲၫဎၩ့လိၬအၥၭလီၫ. မွဲအမၩတဲၩဆံၫ့ဎံၪအၥံၪ့ပၪ ဘဲၫနီၪအၥိၭ ထီးအလူၬ",
			"23": "<sup>23</sup> လီၫ.- ဒဲအမၩၥံၪ့ပၪလဖၪလၧတဲၩဆံၫ့ဎံၪအဂး, လၧမု",
			"24": "<sup>24</sup> ခံၫ့လခီၫအဂးၥံၫ့ပၪအဘံၪ့နံၫဆံၫလီၫ.- တၭလၧၥံၪ့ ပၪအဘံၪ့နံၫဆံၫအဖၫ့လၬနီၪ, တဲၩ့ဝ့ၫအခၪ့ဖျၪ့စ့ၩအ ဖျိၪ့လံဆံၫလီၫ. အခၪ့ဖျၪ့နံၫဖျိၪ့လၧၥံၪ့ပၪလဘံၪ့အဖၫ့ လၬလၧအခၪ့နံၫခီၫအဂး, ဒဲအခၪ့ဖျၪ့နံၫဖျိၪ့ လၧၥံၪ့ပၪ",
			"25": "<sup>25</sup> လဘံၪ့ဒၪလၧအခၪ့နံၫခီၫအဂးလီၫ.- တၭတဲၩဆံၫ့ဎံၪ အပၪလခီၫဒၪ လၧမုဖၩလခီၫနီၪ မၩၥံၪ့ပၪ အဘံၪ့နံၫ",
			"26": "<sup>26</sup> ဆံၫ,- ဒဲအခၪ့ဖျၪ့စ့ၩအဖျိၪ့လံဆံၫလီၫ. ၥံၪ့ပၪလဘံၪ့အီၪ လၧအခၪ့ဖျၪ့နံၫဖျိၪ့လၧအဖၫ့လၬ, ၥံၪ့ပၪလဘံၪ့ဒၪအီၪ",
			"27": "<sup>27</sup> လၧအခၪ့ဖျၪ့နံၫဖျိၪ့လၧအဖၫ့လၬလီၫ.- တၭမၩၥံၪ့ပၪ ဎူၫဘံၪ့လၧတဲၩဆံၫ့ဎံၪအပၪလၧမုနုၬလခီၫအဂးလီၫ.",
			"28": "<sup>28</sup> တၭမၩၥံၪ့ပၪနံၫဘံၪ့ လၧတဲၩဆံၫ့ဎံၪအနိၪ့လဖၪလၧ",
			"29": "<sup>29</sup> အပၪနံၫခီၫလီၫ.- တၭအီၪထံးကံၭလၧအဖၫ့လၬ, ဒဲအီၪ ထံးလိၬအၥၭ လၧအခိၪအဖၫ့ခိၪ လၧအခွၩ့လခွၩ့ဎး လီၫ. မၩဝ့ၫလၧနံၫဘံၪ့လူၬဘဲၫနီၪလၧနံၫနိၪ့အဂးလီၫ.",
			"30": "<sup>30</sup> တၭၥံၪ့ပၪဎိၭဘံၪ့ ဒဲအခၪ့ဖျၪ့စ့ၩလဆံၫဎူၫဖျိၪ့အီၪဝ့ၫ လီၫ. ၥံၪ့ပၪလဘံၪ့ဘၪလဘံၪ့အီၪလၧအခၪ့ဖျၪ့နံၫဖျိၪ့ လၧအဖၫ့လၬဆုၬဆုၬကိၭအဘံၪ့ဒ့ၭလီၫ.",
			"31": "<sup>31</sup> ဒဲအမၩနိၪယိၭဘီၩ့လၧၥံၪ့ၡံၭတၫလီၫ. ယဲဘီၩ့လၧ",
			"32": "<sup>32</sup> ၥံၪ့ပၪလၧတဲၩဆံၫ့ဎံၪလခီၫအဂး,- တၭနိၪယိၭဘီၩ့ ယဲဘီၩ့လၧၥံၪ့ပၪလၧတဲၩဆံၫ့ဎံၪလခီၫဒၪအဂး, ဒဲနိၪ ယိၭဘီၩ့ယဲဘီၩ့လၧၥံၪ့ပၪလၧတဲၩဆံၫ့ဎံၪအပၪ လၧမု",
			"33": "<sup>33</sup> နုၬလခီၫအဂးလီၫ.- တၭနိၪယိၭဘီၩ့အကျၩလဘီၩ့ နီၪဒုၭထီၩ့ဝ့ၫ လၧအထုၬလခီၫဖိးလၧအထုၬလခီၫဒၪ",
			"34": "<sup>34</sup> လီၫ.- တၭအဝ့ၫဒၪဖၩ့ၥံၪ့ပၪလၧထီၫ့, ဒဲတဲၩ့အခွၩ့ထီၫ့, လၧအမိကဲၪနိၪယိၭဘီၩ့အလး ဒဲဖၩ့နိၪယိၭဘီၩ့လၧ ထီၫ့လီၫ.",
			"35": "<sup>35</sup> တၭအဝ့ၫမၩကလကၫလဘံၪ့ လၧဆၧလၫ,ဒဲဆၧဝီၩ လုၭ, ဒဲဆၧဝီၩဒဲဆၧဘွၩဖျ့ၫလံၭကံၭအလူၪဝံၭဎဲၩ့အ ၥၭလီၫ. မၩဝ့ၫအီၪလၧခ့ၫရူၬအဂၩ့လဖၪ လၧၦမၩဆၧ",
			"36": "<sup>36</sup> ၥ့ၪအဆၧမၩလီၫ.- မၩၥံၪ့ၡံၭတၫအထုၪ့လံထုၪ့တၭ ဖၩ့ဝ့ၫလၧထီၫ့လီၫ. တၭအနိၪပုၭလဖၪနီၪမွဲထီၫ့, ဒဲၥိၫ့ ဝ့ၫလၧအခၪ့ဖျၪ့စ့ၩ လံဖျိၪ့လၧအဂးလီၫ.",
			"37": "<sup>37</sup> တၭလၧတဲၩဆံၫ့ဎံၪ အတရၫ့အဂးနီၪ မၩဆၧလၩ့ ဆဲၩလဘံၪ့လၧဆၧလၫ, ဒဲလၧဆၧဝီၩလုၭ, ဒဲလၧဆၧ ဝီၩ,ဒဲလၧဆၧဘွၩဖျ့ၫလံၬကံၭ အလူၪဝံၭဎဲၩ့အၥၭအ",
			"38": "<sup>38</sup> ဆၭကံၪဝ့ၫနီၪ,- ဒဲအထုၪ့ယဲခုၬ, ဒဲအနိၪပုၭလဖၪလီၫ. တၭဖၩ့အထုၪ့အခိၪလဖၪ, ဒဲအဆၧဘုၭထၬလိၬအၥၭ လဖၪနီၪလၧထီၫ့လီၫ. အ့ၪမွဲအခၪ့ဖျၪ့ယဲဖျိၪ့လဖၪနီၪ မွဲထီးဝီၩလီၫ."
		},
		"37": {
			"1": "<sup>1</sup> တၭစဘ့ၫဇလံလၭနီၪ မၩတလၫလၧၥံၪ့ၡံၭတၫလီၫ. အဖၭထီၫနံၫဖျါထၫ, ဒဲအဒၪ့ဎၩ့လဖျါထၫ, ဒဲအဆီၩ့ဆီ",
			"2": "<sup>2</sup> ထၪ့လဖျါထၫလီၫ.- တၭလၧအချိၫ့မွဲဂ့ၩ, လၧအဖၧၩ့မွဲ ဂ့ၩဘၪဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့ထုၬလီၫ. တၭအခိၪဖဲၩ့ထီၫ့",
			"3": "<sup>3</sup> ဝၬဖီၩ့လၧအဖၫ့ခိၪလီၫ.- ၥိၫ့အခွၩ့ထီၫ့လံခွၩ့ လၧအဂး တၭအီၪက့ၪဝ့ၫ လၧအနိၪ့လံနိၪ့တၭ အခွၩ့နံၫခွၩ့အီၪ",
			"4": "<sup>4</sup> လၧလခီၫ, ဒဲအခွၩ့နံၫခွၩ့အီၪလၧလခီၫဒၪလီၫ.- တၭ မၩနိၪယိၭဘီၩ့လဖၪ လၧၥံၪ့ၡံၭတၫတၭ, ဖၩ့ဝ့ၫလၧ",
			"5": "<sup>5</sup> ထီၫ့လီၫ.- တၭဖျၪ့နုၬနိၪယိၭဘီၩ့လဖၪ လၧခွၩ့အဖၧၩ့ လၧတလၫအပၪ, ဘဲၫၥိၭၦမိဆိၬတလၫလၧအဝ့ၫလီၫ.",
			"6": "<sup>6</sup> တၭမၩဆၧယၫ့ၥၭအလးလၧထီၫ့ဆံၫ့ထုၬ, အဖၭထီၫ",
			"7": "<sup>7</sup> နံၫဖျါထၫ, ဒဲအဒၪ့ဎၩ့လဖျါထၫလီၫ.- တၭအဝ့ၫတဲၩ့ ခ့ၫရူၬထီၫ့နံၫဒုၩတၭး မၩဝ့ၫ လၧအလီၪ့ လလီၪ့ဎး တၭ, အီၪက့ၪဝ့ၫလၧဆၧယၫ့ၥၭအလး အထုၬလါခီၫ",
			"8": "<sup>8</sup> လ့ၬနီၪလီၫ.- ခ့ၫရူၬလဒုၩလၧအထိၭနၫအယီၩလခီၫ, ခ့ၫရူၬလဒုၩလၧအထိၭနၫလၧအနီၪလခီၫလီၫ. တဲၩ့ခ့ၫ ရူၬလဖၪ ထီးဆၧယၫ့ၥၭအလး အထိၭနၫ နံၫခီၫလူၬ",
			"9": "<sup>9</sup> လီၫ.- တၭခ့ၫရူၬလဖၪအီၪလၧအဒံၭယၩ့ထၪ့အၥၭ, အဒံၭချႃၬဘံၭဆၧ ယၫ့ၥၭအလးတၭ, အမ့ၬယိဆၧၫ့ ယၫလိၬအၥၭလီၫ. ခ့ၫရူၬလဖၪအမ့ၬအီၪတီၩလၧဆၧ ယၫ့ၥၭအလးအီၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> တၭအဝ့ၫမၩဆ့စပွဲ လၧၥံၪ့ၡံတၫနီၪး အဖၭထီၫ",
			"11": "<sup>11</sup> နံၫဖျါ, ဒဲအဒၪ့ဎၩ့လဖျါ, အဆီၩ့ဆီထၪ့လဖျါထၫလီၫ.",
			"12": "<sup>12</sup> ဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့ထုၬ, မၩအခိၪဖဲၩ့ထီၫ့ဝၬဖီၩ့ဝ့ၫလီၫ.- မၩအခိၪဖဲၩ့လဖံၭဝၬဖီၩ့တၭ, မၩဆၧခွၩ့ထၬထီၫ့လၧ",
			"13": "<sup>13</sup> အခိၪဖဲၩ့အဖၫ့ခိၪဝၬဖီၩ့ဝ့ၫလီၫ.- တၭၥိၫ့ခွၩ့ထီၫ့လံခွၩ့ လၧအဂးတၭအီၪက့ၪဝ့ၫ လၧအနိၪ့လံနိၪ့ လၧအအီၪ",
			"14": "<sup>14</sup> လၧအခၪ့လံခီၫအလီၩ့လီၫ.- ခွၩ့လဖၪနီၪအီၪဎၩ့လၧ အခိၪဖဲၩ့လၧနိၪယိၭဘီၩ့အလးအဂး, လၧၦၡၩမိဆိၬ",
			"15": "<sup>15</sup> ထၪ့စပွဲအဂးလီၫ.- မၩနိၪယိၭဘီၩ့ လၧၥံၪ့ၡံၭတၫ တၭ,ဖၩ့ဝ့ၫလၧထီၫ့, ဘဲၫၥိၭၦၡၩမိဆိၬထၪ့စပွဲလၧနိၪ",
			"16": "<sup>16</sup> ယိၭဘီၩ့လီၫ.- တၭတဲၩ့ထွ့ၫလၧအအီၪလၧစပွဲအဖၫ့ ခိၪ,အထွ့ၫလဖၪ, ဒဲအနိၪထိၩ့လဖၪ, ဒဲအလိၫ့လၧပဂါ လၩ့ဆၧအဂးလဖၪ, ဒဲအခိၪချႃၬလၧအမိချႃၬဘံၭဆၧ လဖၪနီၪလၧထီၫ့ဆံၫ့ထုၬလီၫ.",
			"17": "<sup>17</sup> တၭတဲၩ့ဝ့ၫမ့ၪဒိၩ့မိၡါ လၧထီၫ့ဆံၫ့ထုၬ မ့ၪဒိၩ့နီၪ မၩဝ့ၫလၧထီၫ့ခိလီၪ့လလီၪ့ဎးလီၫ. အဘီၩ့ဒဲအထဲၩ့လ ဖၪ, အခိၪမၪ့လဖၪ, အဒိၪမိၬလဖၪ, ဒဲအဖီၫလဖၪနီၪမွဲ",
			"18": "<sup>18</sup> လၧဆၧနီၪလမံၩ့ဎးလီၫ.- တၭအထဲၩ့ဎူၫထဲၩ့ဂဲၫထၪ့ လၧအပၪလဖၪလီၫ. မ့ၪဒိၩ့မိၡါအထဲၩ့ၥၧၫ့ထဲၩ့လၧ",
			"19": "<sup>19</sup> အလခီၫ, ဒဲအထဲၩ့ၥၧၫ့ထဲၩ့လၧလခီၫဒၪလီၫ.- အခိၪမၪ့ လၩ့ဂၬၡကၭၥၪၥၧၫ့ဖျိၪ့, အဒိၪမိၬလဖျိၪ့ဒဲဖီၫလမုအီၪ လၧအဝ့ၫလထဲၩ့လီၫ. ဘဲၫနီၪအၥိၭ လၧထဲၩ့ဎူၫထဲၩ့",
			"20": "<sup>20</sup> လၧအဂဲၫထၪ့လၧမ့ၪဒိၩ့မိၡါလီၫ.- တၭမ့ၪဒိၩ့မိၡါနီၪ အီၪလၧအခိၪမၪ့လၩ့ဂၬၡကၭၥၪလံဖျိၪ့, အဒိၪမိၬလဖၪ,",
			"21": "<sup>21</sup> ဒဲအဖီၫလဖၪလီၫ.- တၭအဒိၪမိၬလဖျိၪ့အီၪလၧထဲၩ့ နံၫထဲၩ့အဖၫ့လၬ လၧဆၧလမံၩ့ဎး, ဒဲအဒိၪမိၬလဖျိၪ့ အီၪလၧထဲၩ့နံၫထဲၩ့အဖၫ့လၬ လၧဆၧလမံၩ့ဎး, ဘဲၫ အထဲၩ့ဎူၫထဲၩ့အီၪဝ့ၫအၥိၭနီၪလီၫ. အဒိၪမိၬလဖၪ",
			"22": "<sup>22</sup> ဒဲအထဲၩ့လဖၪမွဲဆၧလမံၩ့ဎးလီၫ.- အဆၧထီးအလူၬ မွဲထီၫ့ဆံၫ့ထုၬလလီၪ့ဎးလီၫ. တၭတဲၩ့ဝ့ၫအမ့ၪဒိၩ့နွ့ၫ",
			"23": "<sup>23</sup> ဖျိၪ့,ဒဲအနိၪထံၬမ့ၪ, ဒဲအနိၪထံၬအထွ့ၫလဖၪလၧထီၫ့",
			"24": "<sup>24</sup> ဆံၫ့ထုၬလီၫ.- တၭတဲၩ့ဝ့ၫအမိၡါဒဲအဆၧဖိၪဆၧလံၩ လဖၪထီးအလူၬနီၪ လၧထီၫ့ဆံၫ့ထုၬအလယၧး လကံ ကၫလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫဒၪမၩဆၧလုလးဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧ ၥံၪ့ၡံၭတၫလီၫ. အဖၭထီၫလဖျါအဒၪ့ဎၩ့လဖျါ, အီၪ လၧအနိၪ့လံနိၪ့မီၪ့ဎီၩ့, ဒဲအဆီၩ့ဆီထၪ့ နံၫဖျါလီၫ.",
			"26": "<sup>26</sup> တၭအနိၩ့လဖၪမွဲလၧဆၧလမံၩ့ဎးလီၫ.- တၭဖၩ့ဝ့ၫ လၧထီၫ့ဆံၫ့ထုၬလၧအဖၫ့ခိၪ, ဒဲလၧအပၪၥံၪဝၬဖီၩ့ဝ့ၫ, ဒဲအနိၩ့လဖၪနီၪလီၫ. တၭမၩဆၧခွၩ့ထၬထီၫ့ဝၬဖီၩ့",
			"27": "<sup>27</sup> ဝ့ၫလီၫ.- တၭတဲၩ့အခွၩ့ထီၫ့နံၫခွၩ့လၧအဂး, လၧဆၧ ခွၩ့ထၬအဖၫ့လၬလၧအနိၪ့လံနိၪ့အနဲၩ့ လၧအပၪနံၫ ခီၫအလီၩ့လီၫ. မွဲအလးလၧနိၪယိၭဘီၩ့အဂးဘဲၫၥိၭ",
			"28": "<sup>28</sup> ၦမိဆိၬထၪ့ဝ့ၫလီၫ.- မၩအနိၪယိၭဘီၩ့လၧၥံၪ့ၡံၭတၫ တၭ,ဖၩ့ဝ့ၫလၧထီၫ့လီၫ.",
			"29": "<sup>29</sup> တၭမၩၥိၪဂုၪဆၧဆံၫ့ဎံၪ ဒဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့ ဆံၫ့, ဘဲၫၦလဲၩဎုၬဆၧနၧၫ့မၧၫ့ဖိၪ မၩဝ့ၫအၥိၭနီၪ လီၫ."
		},
		"38": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪ မၩဆၧလုမ့ၪအလး လၧၥံၪ့ၡံၭတၫ, အဖၭထီၫယဲဖျါ, ဒဲအဒၪ့ဎၩ့ယဲဖျါလီၫ. မွဲဆၧလံနိၪ့မီၪ့",
			"2": "<sup>2</sup> ဎီၩ့, ဒဲအဆီၩ့ဆီထၪ့ၥၧၫ့ဖျါလီၫ.- တၭမၩအနိၩ့လဖၪ လၧအနိၪ့လံနိၪ့အဖၫ့ခိၪနီၪ, အနိၩ့ၥံၪမွဲလၧဆၧလမံၩ့",
			"3": "<sup>3</sup> ဎးလီၫ. တၭဖၩ့ဝ့ၫလၧထီးဝီၩလီၫ.- တၭတဲၩ့ဆၧလု လးအဆၧဖိၪဆၧလံၩထီးအလူၬ, အဖၧၩ့လဖၪ, ဒဲအ ဆွးလဖၪ, ဒဲအလိၫ့ဎွံၪဆၧလဖၪ, အနိၪပုၭယၪလဖၪ,ဒဲ အဖၧၩ့မ့ၪလဖၪလီၫ. တဲၩ့အဆၧဖိၪဆၧလံၩ လၧထီး",
			"4": "<sup>4</sup> ဝီၩထီးအလူၬလီၫ.- တၭထဲၫ့ဎ့ၪလၧထီးဝီၩဘဲၫၦထဲၫ့ ၡၬၥံၪအၥိၭ လၧဆၧဝၬဖီၩ့ဆၧလုလး အဖၫ့လၬတၭ, ဎၩ့ဝ့ၫလၧဆၧလုလး အဖိၭဖၫ့ လၧဆၧလုလးအဂး",
			"5": "<sup>5</sup> လီၫ.- တၭၥိၫ့အခွၩ့ထီးဝီၩလံခွၩ့ လၧထီးဝီၩဎ့ၪလံနိၪ့",
			"6": "<sup>6</sup> အဂးလၧနိၪယိၭဘီၩ့လဖၪအလးအဂးလီၫ.- တၭမၩ နိၪယိၭဘီၩ့လဖၪ လၧၥံၪ့ၡံၭတၫတၭ, ဖၩ့ဝ့ၫလၧထီး",
			"7": "<sup>7</sup> ဝီၩလီၫ.- တၭဒုၭနုၬနိၪယိၭဘီၩ့လဖၪ လၧခွၩ့လဖၪ အဖၧၩ့, ဘဲၫၥိၭၦၡၩမိဆိၬထၪ့ဝ့ၫလီၫ. မၩဆၧလုလး လၧၥံၪ့ပၪအီၪလၧအဖၧၩ့အိၩလီၫ.",
			"8": "<sup>8</sup> တၭမၩအံၪ့ဒိၫ့လဖျိၪ့ လၧထီးဝီၩ, ဒဲအခၪ့လၧထီး ဝီၩ, ဒဲၦမုၪလ့ၩထၪ့ဝ့ၫလဖၪ, လၧအလ့ၩထၪ့လၧဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့နီၪ အမ့ၬထံၫလၩၥံၪ လီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫဒၪ မၩဆၧအီၪအလးအဝၩ့လီၫ. လၧအ ပၪလၧမုခံၫ့လခီၫနီၪ, ဆၧဒီၪ့လၩ့ဆဲၩလၧဝၩ့အဂးမၩ ဝ့ၫလၧဆၧဘွၩဖျ့ၫလံၬကံၭ, အလူၪဝံၭဎဲၩ့အၥၭအဖၭ",
			"10": "<sup>10</sup> ထီၫအဖျါလယၩ,- တၭအထုၪ့အီၪနံၫဆံၫ, ဒဲအခၪ့ ဖျၪ့ထီးဝီၩအဖျိၪ့နံၫဆံၫလီၫ. တၭထုၪ့အနိၪပုၭလဖၪ,",
			"11": "<sup>11</sup> ဒဲအဆၧဘုၭထၬလိၬအၥၭလဖၪနီၪမွဲစ့ၩလီၫ.- တၭလၧ အပၪလၧမုဖၩလခီၫ အဂးနီၪ ဆၧဒီၪ့လၩ့ဆဲၩအဖၭ ထီၫအဖျါလယၩ, ဒဲအထုၪ့နံၫဆံၫ, ဒဲအခၪ့ဖျၪ့ထီးဝီၩ အဖျိၪ့နံၫဆံၫနီၪအီၪဝ့ၫလီၫ. အထုၪ့ၥံၪအနိၪပုၭလဖၪ,",
			"12": "<sup>12</sup> ဒဲအဆၧဘုၭထၬလိၬအၥၭလဖၪနီၪ မွဲစ့ၩလီၫ.- တၭ ဆၧဒီၪ့လၩ့ဆဲၩအဖျါယဲဆံၫအီၪဝ့ၫလၧဝၩ့အမုနုၬလ ခီၫအဂးနီၪလီၫ. အထုၪ့ဆံၫခုၬ, ဒဲအခၪ့ဖျၪ့ဆံၫဖျိၪ့အီၪ ဝ့ၫလီၫ. အထုၪ့အနိၪပုၭလဖၪ ဒဲအဆၧဘုၭထၬလိၬအ",
			"13": "<sup>13</sup> ၥၭလဖၪမွဲစ့ၩလီၫ.- တၭဝၩ့လၧအနဲၩ့ဖၩမုထၪ့, လၧမု",
			"14": "<sup>14</sup> ထၪ့လခီၫနီၪအဖျါယဲဆံၫ,- တၭဆၧဒီၪ့လၩ့ဆဲၩလၧ တရၫ့လခီၫနီၪအဖၭထီၫလဆံၫယဲဖျါအထုၪ့ၥၧၫ့ခုၬ,",
			"15": "<sup>15</sup> ဒဲအခၪ့ဖျၪ့ၥၧၫ့ဖျိၪ့အီၪဝ့ၫလီၫ.- တၭလၧဝၩ့အတရၫ့ လၧအလခီၫဒၪ, ဆၧဒီၪ့လၩ့ဆဲၩလၧယီၩလခီၫဒဲအနီၪ လခီၫအဖၭထီၫလဆံၫယဲဖျါ, အထုၪ့ၥၧၫ့ခုၬ, ဒဲအခၪ့",
			"16": "<sup>16</sup> ဖျၪ့ၥၧၫ့ဖျိၪ့အီၪဝ့ၫလီၫ.- တၭကယဲဝၩ့ အဆၧဒီၪ့လၩ့ ဆဲၩဝၬဝၬနီၪမွဲဆၧဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့အၥၭ",
			"17": "<sup>17</sup> ထီးအလူၬလီၫ.- တၭထုၪ့အခၪ့ဖျၪ့လဖၪနီၪ မွဲထီးဝီၩ, ဒဲထုၪ့အနိၪပုၭလဖၪ, ဒဲဆၧဘုၭထၬလိၬ အၥၭလဖၪ နီၪမွဲစ့ၩ, ဒဲအခိၪဖၩ့အၥၭလၧစ့ၩတၭ, ဝၩ့အထုၪ့ထီး အလူၬ, အီၪလၧဆၧဘုၭထၬလိၬအၥၭ လၧစ့ၩလီၫ.",
			"18": "<sup>18</sup> တၭဆၧဒီၪ့လၩ့ဆဲၩ လၧဝၩ့အတရၫ့ အဂးနီၪ မွဲဆၧ ဆၭကံၪလၧဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧ ဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့အၥၭလီၫ. အဖၭထီၫမွဲ အဖျါနံၫဆံၫ ဒဲအဒၪ့ဎၩ့ယဲဖျါ, ဘဲၫဝၩ့အဆၧဒီၪ့လၩ့",
			"19": "<sup>19</sup> ဆဲၩအၥိၭနီၪလီၫ.- တၭအထုၪ့မွဲလံထုၪ့, ဒဲအခၪ့ဖျၪ့ ထီးဝီၩလံဖျိၪ့, ဒဲအနိၪပုၭမွဲစ့ၩ, တၭအခိၪထိၬလဖၪ ဘၪဖၩ့အၥၭလၧစ့ၩ, ဒဲအဆၧဘုၭထၬလိၬအၥၭလဖၪ",
			"20": "<sup>20</sup> နီၪမွဲစ့ၩလီၫ.- တၭကယဲဆၧအနိၪစဲၩဘၪဆဲၫ့လၧတဲၩ ဆံၫ့ဎံၪ, ဒဲဝၩ့အီၪဝၬဖီၩ့နီၪ မွဲထီးဝီၩထီးအလူၬလီၫ.",
			"21": "<sup>21</sup> တၭအယီၩ မွဲဆၧမၩဎွ့ၩအံၩဎွ့ၩအိၩဘၪဆဲၫ့လၧ တဲၩဆံၫ့ဎံၪ, ဆၧထိးအၥၭ အတဲၩဆံၫ့ဎံၪနီၪဘဲၫအ ဘၪဆၧဝံထၪ့နၬထၪ့ လၧၦလုဆၧစအၫရၧၫ့ အဖိၪခွၫ စအံၫၥမၫအစူၪဖၧၩ့ အၥိၭနီၪ, ဘဲၫစမိစ့ၭ အဆၧမၪ",
			"22": "<sup>22</sup> လူၬ,ၦလံဝဲၫဖိၪအဆၧမၩအၥိၭနီၪလီၫ.- တၭၦယုဒၫ အဒီၪ့ဖိၪစဟၧအဖိၪခွၫ, စယုရဲၫအဖိၪခွၫ, စဘ့ၫဇလံ လၭလဂၩမၩကယဲဆၧလၧယဟိဝၩမၪလူၬစမိစ့ၭနီၪ",
			"23": "<sup>23</sup> လီၫ.- တၭၦအီၪလၧအဝ့ၫအၥိၭမွဲစဒၫ့အဒီၪ့ဖိၪစအဟံ စမၭအဖိၪခွၫစအဟိလအၭ, ၦစိၭဖျၩဖိၪ, ဒဲၦကိၪ့ဆၧ ဘၪ, ဒဲၦလၧအဆၭကံၪဆၧလၧဆၧလၫ ဒဲလၧဆၧဝီၩ လုၭ,ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၭကံၭလီၫ.",
			"24": "<sup>24</sup> တၭကယဲထီၫ့လၧအလူၬ လၧဆၧမၩဘၪဆဲၫ့လၧ အလးဆံၫ့ဎံၪအဆၧမၩထီးအလူၬ, ထီၫ့လၧၦဝံၦနၬ ဝ့ၫနီၪမွဲနံၫဆံၫခွံၫကံကၫ, ဒဲၡက့လၭနွ့ၫယၩ ၥၧၫ့ဆံၫ, ဘဲၫၡက့လၭ ဘၪဆဲၫ့လၧအလးဆံၫ့ဎံၪ အၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> တၭစ့ၩလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫ ဘၪဆဲၫ့လၧ ဆၧအီၪကီၪ့လဖၪအစ့ၩနီၪ, မွဲကံကၫလယၩ, ဒဲလထီၫ့ နွ့ၫယၩနွ့ၫဆံၫယဲၡက့လၭ, ဘဲၩၡက့ၭလၭဘၪဆဲၫ့လၧ",
			"26": "<sup>26</sup> အလးဆံၫ့ဎံၪအၥိၭ,- လကံကၫလၧၦလဂၩ ဆုၬဆုၬ အဂး, မွဲဖိၭဖၫ့ၡက့လၭ, လၧကယဲၦလၧအလ့ၩဘၪ ဆၧဝံထၪ့ဝ့ၫလၧအၥၭၡါအနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪ အဂး လၧၦၡၩဎူၫကုၬ, ၥၧၫ့ထီၫ့ယဲယၩယဲဆံၫအဂး",
			"27": "<sup>27</sup> လီၫ.- တၭၦၥိၫ့ဆၧအလးဆံၫ့ဎံၪအခၪ့ဖျၪ့ၥံၪ, ဒဲဆၧ ဒီၪ့ဘျၭထၪ့အၥၭ အခၪ့ဖျၪ့ၥံၪ လၧစ့ၩကံကၫလယၩ လီၫ. လဖျိၪ့လကံကၫ, လဖျိၪ့လကံကၫ, အခၪ့ဖျၪ့လ",
			"28": "<sup>28</sup> ယၩနီၪ,ကံကၫလယၩလီၫ.- တၭတဲၩ့နိၪပုၭလၧထုၪ့ အဂး,ဒဲဖၩ့အခိၪ, ဒဲဆၧဘုၭထၬလိၬအၥၭနီၪလၧစ့ၩလ",
			"29": "<sup>29</sup> ထီၫ့နွ့ၫယၩနွ့ၫဆံၫယဲၡက့လၭလီၫ.- တၭထီးဝီၩလၧ ဆၧမၩဘိၪ့ဝ့ၫနီၪ, မွဲကံကၫနွ့ၫဆံၫဒဲၡက့လၭနံၫထီၫ့လံ",
			"30": "<sup>30</sup> ယၩလီၫ.- တၭလၧဆၧနီၪမၩဝ့ၫလၧဆၧအီၪကီၪ့အတဲၩ ဆံၫ့ဎံၪအတရၫ့အခၪ့ဖျၪ့ၥံၪ, ဒဲဆၧလုအလးလၧထီး ဝီၩ,ဒဲထဲၫ့ဎ့ၪလၧထီးဝီၩလၧအဂး, ဒဲကယဲဆၧလုလး",
			"31": "<sup>31</sup> အဆၧဖိၪဆၧလံၩ,- ဒဲဝၩ့ဝၬဖီၩ့အခၪ့ဖျၪ့ၥံၪ, ဒဲဝၩ့အတ ရၫ့အခၪ့ဖျၪ့ၥံၪဒဲကယဲနိၪစဲၩၥံၪဘၪဆဲၫ့ လၧတဲၩဆံၫ့ ဎံၪ, ဒဲဝၩ့ဝၬဖီၩ့ဝ့ၫ အနိၪစဲၩၥံၪ ထီးအလူၬလီၫ."
		},
		"39": {
			"1": "<sup>1</sup> တၭလၧဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩနီၪမၩဝ့ၫ လၧဆၧအခ့ၫအၡၩအဆၧမၩ အကီၩ့အၥိၭဘဲၫၥိၭအ မိမၩဆၧလၧအလးဆံၫ့ဎံၪအဖၧၩ့, ဒဲမၩအကီၩ့အၥိၭ ဆံၫ့ဎံၪလၧစအၫရၧၫ့အဂး, ဘဲၫယွၩမၪလူၬ စမိစ့ၭအ",
			"2": "<sup>2</sup> ၥိၭနီၪလီၫ.- တၭအဝ့ၫမၩအ့ဖိၭနီၪလၧထီၫ့, ဒဲဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭအလူၪ",
			"3": "<sup>3</sup> ဝံၭဎဲၩ့အၥၭလီၫ.- တၭနဲၫ့ထီၫ့ထီးအကဲၪထၪ့အပၪပဲၪ ဘၧၩ့ဖျၪဒၪတၭ, ထံၬဝ့ၫဒုၭကဲၪထၪ့ဖျံၩတၭ, ၥံၪနုၬဝ့ၫ လၧဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬ",
			"4": "<sup>4</sup> ကံၭ, လၧၦမၩဆၧၥ့ၪအဆၧမၩလီၫ.- တၭမၩဝ့ၫအခိၬ ထံၭခိၪလဖၪ ဘဲၫၥိၭ အမိမၩဘုၭထၬလိၬအၥၭတၭ,",
			"5": "<sup>5</sup> အနဲၩ့ထံၭနံၫခီၫနီၪမၩဘုၭထၬဝ့ၫဒၪလီၫ.- တၭအ့ဖိၭ အခၧၩ့ယးကံၪကဲၩ့လၧအအီၪဝ့ၫ လၧအဖၫ့ခိၪမွဲဝ့ၫလၧ ဆၧလမံၩ့ဎးနီၪလၧထီၫ့, ဒဲဆၧလၫ, ဒဲဆၧဝီၩလုၭ,ဒဲဆၧ ဝီၩ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭ အလူၪဝံၭဎဲၩ့အၥၭ, ဘဲၫ",
			"6": "<sup>6</sup> ယွၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.- တၭမၩဝ့ၫလၧထၫ့ မျါမဟူၫယၫ, အမ့ၬထီၫ့အီၪဝၬဖီၩ့ဝ့ၫတၭ, ကွ့ၭဝ့ၫလၧ ၦအံၫစရ့လၭဖိၪအမံၩ့ ဘဲၫဆၧစဲၩနဲၪ့ထၬ ဘၪဆၧစိၭ",
			"7": "<sup>7</sup> ဖျၩဝ့ၫအၥိၭလီၫ.- တၭအီၪက့ၪဝ့ၫလၧအ့ဖိၭအခိၬထံၭ ခိၪ,လၧဆၧနၪ့ထၪ့ထဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪအဂး ဘဲၫယွၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> တၭမၩဆၧစ့ၩရၫ့အၥၭနၫပဒၩ့ လၧၦမၩဆၧၥ့ၪအ ဆၧမၩဘဲၫအ့ဖိၭအဆၧမၩအၥိၭနီၪ, မၩဝ့ၫလၧထီၫ့, လၧဆၧလၫ, လၧဆၧဝီၩလုၭ, ဒဲလၧဆၧဝီၩ, ဒဲလၧဆၧ",
			"9": "<sup>9</sup> ဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့အၥၭနီၪလီၫ.- မၩၥၭနၫ ပဒၩ့အီၪဝ့ၫနံၫထၧၫ့တၭ, မွဲဆၧလံနိၪ့မီၪ့ဎီၩ့လီၫ. အဖၭ",
			"10": "<sup>10</sup> ထီၫလထၫ, ဒဲအဒၪ့ဎၩ့လထၫခါချံၭအၥၭလီၫ.- တၭ မၩဎွ့ၩဝ့ၫ လၧလိးအဂဲးလံဂဲးလီၫ. ထၫ့မျါဆၫ့ၥွံၪလ ဖျိၪ့,ထၫ့မျါဘၩ့အူၭၥဖၫယၩလဖျိၪ့, ဒဲထၫ့မျါယ့ၫမၠၭ",
			"11": "<sup>11</sup> လဖျိၪ့နီၪမွဲအခၪ့ထံၭလဂဲးလီၫ.- တၭနံၫဂဲးလဂဲးနီၪ မွဲထၫ့မျါဝီၩလဖျိၪ့, ထၫ့မျါနံၫလၫလဖျိၪ့း ဒဲထၫ့မျါမ",
			"12": "<sup>12</sup> ဟူၫယၫထီၩ့အၥၭလဖျိၪ့လီၫ.- ၥၧၫ့ဂဲးလဂဲးနီၪ မွဲထၫ့ မျါဝီၩဘၩ့လဖျိၪ့, ထၫ့မျါမဟူၫယၫ ကံၪကဲၩ့လဖျိၪ့,",
			"13": "<sup>13</sup> ဒဲထၫ့မျါတကီၩဖီၫလီၫ.- တၭလံဂဲးလဂဲးနီၪ မွဲထၫ့မျါ ယ့ၫဘၩ့လဖျိၪ့, ဒဲထၫ့မျါမဟူၫယၫလဖျိၪ့, ဒဲထၫ့မျါ နကၥွဲၭလဖျိၪ့လီၫ. အမ့ၬထီၫ့အီၪဝၬဖီၩ့ဝ့ၫလၧထၫ့မျါ",
			"14": "<sup>14</sup> အလးအဖၧၩ့လီၫ.- တၭလိးလဖၪနီၪ မိဘၪအီၪလၧ ၦအံၫစရ့လၭဖိၪအမံၩ့, လဆံၫနံၫမံၩ့ ဘဲၫအမံၩ့အၥိၭ နီၪ, ဆၧစဲၩနဲၪ့ထၬ အဆၧစိၭဖျၩနီၪလီၫ. လဂၩလၧ အမံၩ့ဒၪဝ့ၫ, လဂၩလၧအမံၩ့ဒၪဝ့ၫ, ဘဲၫၦလဆံၫနံၫဒီၪ့",
			"15": "<sup>15</sup> အၥိၭနီၪလီၫ.- တၭၥံၪၥွ့ၫထီၫ့ဆံၫ့ လၧၥၭနၫပဒၩ့အ",
			"16": "<sup>16</sup> ထိၭနၫလီၫ.- တၭတဲၩ့ထၫ့မျါအလးအမ့ၬထီၫ့နံၫဖျိၪ့, ဒဲခွၩ့ထီၫ့နံၫခွၩ့လၧဆၧၥၭနၫပဒၩ့အလီၩ့တၭ, အီၪက့ၪ ခွၩ့နံၫခွၩ့နီၪလၧဆၧၥၭနၫပဒၩ့ အထိၭနၫနံၫခီၫလီၫ.",
			"17": "<sup>17</sup> တၭဒုၭနုၬၥွ့ၫထီၫ့ၥံၪအၥၭနံၫဘီၩ့ လၧခွၩ့နံၫခွၩ့ အီၪ",
			"18": "<sup>18</sup> လၧဆၧၥၭနၫပဒၩ့ အထိၭနၫလဖၪအဖၧၩ့လီၫ.- တၭ ၥွ့ၫၥံၪအၥၭအထိၭနၫနံၫခီၫလူၬနီၪ စၧၩ့ထၬဝ့ၫလၧထၫ့ မျါအလးအမ့ၬတၭ, အီၪက့ၪဝ့ၫလၧအ့ဖိၭ အခိၬထံၭ",
			"19": "<sup>19</sup> ခိၪလၧအမ့ၬယၫလခီၫလီၫ.- တဲၩ့ခွၩ့ထီၫ့နံၫခွၩ့တၭ, အီၪက့ၪဝ့ၫလၧဆၧၥၭနၫပဒၩ့အထိၭနၫနံၫခီၫလၧအခိၬ",
			"20": "<sup>20</sup> ထံၭလၧအ့ဖိၭအနဲၫ့ထံၭ လၧအဖၧၩ့လခီၫလီၫ.- တၭ တဲၩ့ခွၩ့ထီၫ့အဂူၫဂၩနံၫခွၩ့တၭ, အီၪက့ၪဝ့ၫလၧအ့ဖိၭ အခိၬထံၭခိၪနံၫခီၫ လၧအဖၫ့လၬ လၧအမ့ၬယၫလခီၫ နီၪ,ဆဲၫဎၩ့ဒဲအဆၧဘုၭထၬလိၬအၥၭဂူၫဂၩ, လၧအ့ဖိၭ",
			"21": "<sup>21</sup> အခၧၩ့ယးကံၪကဲၩ့ အဖၫ့ခိၪလီၫ.- တၭစၧၩ့ထၬဆၧ ၥၭနၫပဒၩ့လၧအခွၩ့ဒဲအ့ဖိၭအခွၩ့လၧဖျံၩအလၫ, ဘဲၫ ၥိၭအမိအီၪဝ့ၫလၧအ့ဖိၭအခၧၩ့ယးကံၪကဲၩ့ အဖၫ့ခိၪ နီၪ, ဘဲၫၥိၭၥၭနၫပဒၩ့နီၪ ဖျ့ၭထၪ့ခွံၬလၧအ့ဖိၭ လၥ့ၪ ဘၪ ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> တၭမၩအ့ဖိၭအဆဲၫ့ လၧဆၧလၫထၧၫ့ဘံၪ့ယၫလီၫ.",
			"23": "<sup>23</sup> တၭအီၪဒဲအဖိးလၧအဆဲၫ့အၥၭကျၩလီၫ. အီၪဝ့ၫဒဲအနဲၩ့ ထံၭဆၭဒိၭထၪ့ဝ့ၫဝၬဖီၩ့အဖိး ဘဲၫဆၧၥၭနၫပဒၩ့ထီးယၬ",
			"24": "<sup>24</sup> လၩ့လဂ့ၩလီၫ.- တၭလၧအဆၧဆၭကံၭလၩ့အလီၩ့နီၪ မၩဝ့ၫၥလဲၩၥၪလၧဆၧလၫ, ဒဲလၧဆၧဝီၩလုၭ, ဒဲလၧ ဆၧဝီၩ, ဒဲလၧဆၧဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့အၥၭ",
			"25": "<sup>25</sup> လီၫ.- တၭတဲၩ့ဎွံၩ့ၥၪထီၫ့ဆံၫ့ထုၬတၭ, အီၪက့ၪဎွံၩ့ၥၪ နီၪလၧၥလဲၩၥၪလဖၪအဘိၩ့ဆၧၩ့ဝၬဖီၩ့လၧဆဲၫ့အခၪ့",
			"26": "<sup>26</sup> ထံၭအနဲၩ့ထံၭလီၫ.- ဎွံၩ့ၥၪထီၫ့လဖျိၪ့ ဒဲၥလဲၩၥၪလ ဖျိၪ့, ဎွံၩ့ၥၪထီၫ့လဖျိၪ့ၥလဲၩၥၪလဖျိၪ့ လၧအဆဲၫ့အခၪ့ ထံၭအနဲၩ့ထံၭဝၬဖီၩ့ဝ့ၫ ဘဲၫယွၩမၪလူၬ စမိစ့ၭအၥိၭ နီၪလီၫ.",
			"27": "<sup>27</sup> တၭအဝ့ၫၥံၪထၭန့ဆဲၫ့လၧဆၧဘွၩဖျ့ၫလံၬကံၭလၧ",
			"28": "<sup>28</sup> စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪအဂး,- ဒဲခိၪလူၬလၧဆၧ ဘွၩဖျ့ၫလံၬကံၭ, ဒဲခၪ့ဖျၪ့မွဲဂ့ၩလၧဆၧဘွၩဖျ့ၫလံၬကံၭ, ဒဲဆၧဖျၪ့ခဲၫ့ လၧဆၧဘွၩဖျ့ၫလံၬကံၭ အလူၪဝံၭဎဲၩ့အ",
			"29": "<sup>29</sup> ၥၭ,- ဒဲခၧၩ့ယးလၧဆၧဘွၩဖျ့ၫလံၬကံၭအလူၪဝံၭဎဲၩ့ အၥၭ,ဒဲဆၧလၫ, ဒဲဆၧဝီၩလုၭ, ဒဲဆၧဝီၩ, ဆၧဆၭကံၪ ဘဲၫယွၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫၥံၪတဲၩ့ခိၪလူၬဆံၫ့ဎံၪ အဆၧပၪပဲၪ လၧထီၫ့ ဆံၫ့ထုၬလဘံၪ့တၭ, ဘဲၫဆၧစဲၩနဲၪ့ထၬအဆၧစိၭဖျၩ အၥိၭနီၪ, ကွ့ၭဝ့ၫလၧအလီၩ့, မွဲဆၧဆံၫ့ဎံၪလၧယဟိဝၩအဂးဆံၭ.",
			"31": "<sup>31</sup> တၭစၧၩ့ထၬဝ့ၫလၧဖျံၩပၪပဲၪ ဆၧလၫလဘီၩ့ဘဲၫၥိၭအ မိမၩထၬလၧဆၧထၪ့ထီၫလၧခိၪလူၬအလီၩ့ဘဲၫယဟိ ဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.",
			"32": "<sup>32</sup> တၭတဲၩဆံၫ့ဎံၪအဆၧအီၪကီၪ့ အတဲၩအဆၧမၩဂီၩ့ လူၬဝ့ၫတၭ, ၦအံၫစရ့လၭဖိၪမၩဝ့ၫဘဲၫကယဲဆၧလၧယ ဟိဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪ မၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.",
			"33": "<sup>33</sup> တၭအဝ့ၫၥံၪနီၪဂဲၫဆိၬတဲၩဆံၫ့ဎံၪ, တဲၩ, ဒဲအဆၧ ဖိၪဆၧလံၩထီးအလူၬလၧစမိစ့ၭအအီၪ, ဒဲအနိၪကွၭ လဖၪ, အၥံၪ့ပၪလဖၪ, ဒဲအနိၪယိၭဘီၩ့လဖၪ, ဒဲအထုၪ့",
			"34": "<sup>34</sup> လဖၪ, ဒဲအခၪ့ဖျၪ့လဖၪ.- ဒဲဆၧချႃၬဘံၭလၧၥိၪဖၫအ ဖံၭဝီၩ, ဒဲဆၧချႃၬဘံၭလၧတဟၫၡၭအဖံၭ, ဒဲဆၧချႃၬ",
			"35": "<sup>35</sup> ဘံၭအဆၧဒီၪ့ချႃၬဘံၭဆၧ,- ဆၧအုၩ့လၩ့အတလၫဒဲ",
			"36": "<sup>36</sup> နိၪယိၭဘီၩ့လဖၪ, ဒဲဆၧယၫ့ၥၭအလး - စပွဲအထွ့ၫ ထီးအလူၬ, ဆၧမ့ၬယၫအကိၪ, ဒဲမ့ၪဒိၩ့မိၡါအဆံၫ့ဒဲအ",
			"37": "<sup>37</sup> မ့ၪဒိၩ့ၥံၪ,- မ့ၪဒိၩ့လၧအဘၪတဲၩ့ဝဲၩဝ့ၫ, ဒဲအဆၧဖိၪ",
			"38": "<sup>38</sup> ဆၧလံၩထီးအလူၬ, ဒဲၥိၪလၧဆၧဖၩ့အဂး,- ဒဲဆၧလု လးထီၫ့, ဒဲၥိၪဂုၪဆၧ, ဒဲဆၧဆူၭခဲၩနၧၫ့မၧၫ့, ဒဲဆၧလၩ့",
			"39": "<sup>39</sup> ဆဲၩလၧတဲၩတရၫ့အဂး,- ဆၧလုလးထီးဝီၩဒဲထီးဝီၩ အထဲၫ့ဎ့ၪနီၪ, အနိၪယိၭဘီၩ့လဖၪ, ဒဲအဆၧဖိၪဆၧလံၩ",
			"40": "<sup>40</sup> ထီးအလူၬ, အံၪ့ဒိၫ့, ဒဲအခၪ့,- ဆၧအဝၩ့အဆၧဒီၪ့လၩ့ ဆဲၩလဖၪ, အထုၪ့လဖၪ, ဒဲအခၪ့ဖျၪ့လဖၪ, ဒဲဆၧဒီၪ့ ချႃၬဘံၭလၧဝၩ့အတရၫ့အဂး, ဖျံၩလဖၪ, ဒဲအနိၪစဲၩ လဖၪတၭ, ကယဲအဆၧဖိၪဆၧလံၩ ဘၪဆဲၫ့လၧတဲၩ",
			"41": "<sup>41</sup> ဆံၫ့ဎံၪအဆၧမၩလၧဆၧအီၪကီၪ့အတဲၩအဂး,- ဆၧ အခ့ၫအၡၩ အဆၧမၩအကီၩ့အၥိၭ, ဘဲၫၥိၭအမိမၩ ဆၧလၧအလးဆံၫ့ဎံၪအဖၧၩ့, ဒဲအကီၩ့အၥိၭဆံၫ့ဎံၪ လၧၦလုဆၧစအၫရၧၫ့အဂး, ဒဲအဖိၪခွၫလဖၪ အကီၩ့",
			"42": "<sup>42</sup> အၥိၭဘဲၫအမိမၩၦလုဆၧ အဆၧလုလဖၪလီၫ.- ဒဲက ယဲဆၧလၧယွၩမၪလူၬ စမိစ့ၭအၥိၭနီၪ ၦအံၫစရ့လၭ ဖိၪမၩထီးအလူၬလီၫ.",
			"43": "<sup>43</sup> တၭစမိစ့ၭ ယိကယဲအမၩဆၧထီးအလူၬတၭ,ယိ ခွါ, ၦမၩယူၭဝ့ၫဘဲၫယဟိဝၩမၪလူၬဆၧအၥိၭ, မၩဝ့ၫ ဘဲၫနီၪအၥိၭလီၫ. တၭစမိစ့ၭဆိၪဂ့ၩအဝ့ၫၥံၪလီၫ."
		},
		"40": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လၩ အခၪ့ထံၭ လၩထၪ့လနံၩနီၪ, နဘၪဆၪ့ထၪ့ဆၧအီၪ",
			"3": "<sup>3</sup> ကီၪ့အတဲၩအတဲၩဆံၫ့ဎံၪနီၪဆံၭ.- တၭနဘၪအီၪက့ၪ ဆၧအုၩ့လၩ့အတလၫလၧအဖၧၩ့, ဒဲမၩကဒုၩထၬတ",
			"4": "<sup>4</sup> လၫနီၪလၧကလကၫလီၫ.- နဘၪဂဲၫဆိၬနုၬစပွဲ, ဒဲဆၧ လၧဆၧဘၪတဲၩ့ဝဲၩအၥၭ လၧအဂးလဖၪနီၪ အီၪက့ၪ ဎၩ့လၧအလီၩ့တၭ, နဘၪဂဲၫဆိၬနုၬမ့ၪဒိၩ့မိၡါ, ဒဲစီၩ့",
			"5": "<sup>5</sup> ထၪ့အမ့ၪဒိၩ့လဖၪ,- တၭနဘၪအီၪက့ၪဆၧလုအလး ထီၫ့လၧဆူၭခဲၩဆၧနၧၫ့မၧၫ့အဂး လၧဆၧအုၩ့လၩ့အ တလၫအမ့ၬယၫ ဒဲအီၪက့ၪဆၧလၩ့ဆဲၩ လၧတဲၩဆံၫ့",
			"6": "<sup>6</sup> ဎံၪအတရၫ့အဂးလီၫ.- တၭနဘၪအီၪက့ၪဆၧလုလး ဆူၭခဲၩမ့ၪ လၧဆၧအီၪကီၪ့အတဲၩ အတရၫ့အမ့ၬယၫ",
			"7": "<sup>7</sup> လီၫ.- နဘၪအီၪက့ၪအံၪ့ဒိၫ့လၧဆၧအီၪကီၪ့အတဲၩဒဲ ဆၧလုလးအဘိၩ့ဆၧၩ့တၭ, နဘၪအီၪက့ၪထံၫလၧအ",
			"8": "<sup>8</sup> ဖၧၩ့လီၫ.- နဘၪၥုၪ့ထၪ့ဝၩ့ဝၬဖီၩ့ဝ့ၫတၭ, ဘျၭထၪ့က",
			"9": "<sup>9</sup> လကၫလၧဝၩ့အတရၫ့နီၪဆံၭ.- နဘၪမၩန့ၥိၪဂုၪဆၧ တၭ,ဂုၪတဲၩဆံၫ့ဎံၪနီၪ, ဒဲကယဲဆၧလၧအအီၪလၧအ ဖၧၩ့, ဒဲမၩဆံၫ့ဎံၪဝ့ၫ ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ",
			"10": "<sup>10</sup> တၭ,မွဲအမိကဲၪထၪ့ဆၧဆံၫ့ဎံၪဆံၭ.- နဘၪဂုၪဆၧလု လးဆူၭခဲၩမ့ၪ, ဒဲအဆၧဖိၪ ဆၧလံၩထီးအလူၬ, ဒဲမၩ ဆံၫ့ဎံၪအဆၧလုလးဆံၭ,- မွဲအမိကဲၪထၪ့အဆၧလု",
			"11": "<sup>11</sup> လးဆံၫ့ဎံၪထုၬလီၫ.- နဘၪဂုၪအံၪ့ဒိၫ့ဒဲအခၪ့တၭ,မၩ",
			"12": "<sup>12</sup> ဆံၫ့ဎံၪဝ့ၫဆံၭ.- တၭနဘၪဒုၭဂဲၫစအၫရၧၫ့ဒဲအဖိၪခွၫ လဖၪလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့တၭ,ၥူၫ",
			"13": "<sup>13</sup> ဝၭဆံၫ့ဝ့ၫလၧထံၫဆံၭ. တၭနဘၪဒုၭၥိၭထၪ့စအၫရၧၫ့ လၧဆၧအကီၩ့အၥိၭဆံၫ့ဎံၪ, ဒဲဂုၪဝ့ၫ, ဒဲမၩဆံၫ့ဎံၪဝ့ၫ, ဘဲၫၥိၭ အမိမၩယဆၧလၧၦလုဆၧ အဆၧမၩဆံၭ.",
			"14": "<sup>14</sup> နဘၪဒုၭဂဲၫထၪ့အဖိၪခွၫလဖၪတၭ ဒုၭၥိၭဝ့ၫလၧဆဲၫ့",
			"15": "<sup>15</sup> လဖၪဆံၭ.- တၭနဘၪဂုၪအဝ့ၫၥံၪဘဲၫနဂုၪအဖါအၥိၭနီၪ, ဘဲၫၥိၭအမိမၩယဆၧလၧၦလုဆၧအဆၧမၩဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဂုၪဆၧနီၪမိဘၪကဲၪထၪ့ ၦလုဆၧအဆၧမၩအဆိၩအကၠၪ, ထီၩ့လၧအဆၨၩအဆၬ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"16": "<sup>16</sup> စမိစ့ၭ မၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ. ဘဲၫကယဲဆၧလၧ ယဟိဝၩမၪလူၬဝ့ၫအၥိၭ မွဲအမၩဝ့ၫဘဲၫနီၪၥိၭလီၫ.",
			"17": "<sup>17</sup> တၭဆၧမၩအၥၭလၧနံၫနံၪ့လနံၪ့ လၧလၩခၪ့ထံၭ လၩထၪ့လနံၩနီၪ တဲၩဆံၫ့ဎံၪ ဘၪဆၧဆၪ့ထၪ့ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> စမိစ့ၭဆၪ့ထၪ့တဲၩဆံၫ့ဎံၪတၭ, မၩခၧၫ့အခၪ့ဖျၪ့တၭ, အီၪက့ၪဆၧၫ့ထုၪ့အၥံၪ့ပၪတၭ, ဒုၭနုၬအနိၪဘီၩ့ၥံၪ",
			"19": "<sup>19</sup> တၭ, ဘီၩ့ထၪ့အထုၪ့လီၫ.- ပၠၪထၪ့တဲၩလၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪတၭ, အီၪက့ၪဆၧချႃၬဘံၭတဲၩ လၧအဖၫ့",
			"20": "<sup>20</sup> ခိၪ,ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.- မၩန့ဝ့ၫတၭ ဒုၭနုၬဆၧအုၩ့လၩ့လၧတလၫဖၧၩ့တၭ, အီၪက့ၪနိၪယိၭဘီၩ့ လၧတလၫနီၪ, ဒဲအီၪက့ၪ ဆၧယၫ့ၥၭအ",
			"21": "<sup>21</sup> လးလၧတလၫအဖၫ့ခိၪလီၫ.- အဝ့ၫဒၪဂဲၫဆိၬတလၫ လၧတဲၩဆံၫ့ဎံၪအဖၧၩ့တၭး ဘျၭထၪ့ကလကၫတၭ, မၩကဒုၩခွံၬ ဆၧအုၩ့လၩ့အတလၫ, ဘဲၫယဟိဝၩမၪ လူၬစမိစ့ၭအၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> တၭအဝ့ၫဒၪအီၪက့ၪစပွဲ လၧဆၧအီၪကီၪ့အတဲၩဖၧၩ့ လၧတဲၩဆံၫ့ဎံၪအပၪလၧမုဖၩလခီၫ လၧကလကၫဘျၭ",
			"23": "<sup>23</sup> ထၪ့အၥၭလၧခီၫ့လခီၫလီၫ.- တၭအီၪက့ၪဎၩ့ကိၪလၧ အဖၫ့ခိၪ လၧယဟိဝၩအမ့ၬယၫ, ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"24": "<sup>24</sup> တၭအီၪက့ၪမ့ၪဒိၩ့မိၡါ လၧဆၧအီၪကီၪ့အတဲၩဖၧၩ့, ဆဲဎၩ့လၧစပွဲလၧတဲၩဆံၫ့ဎံၪအနဲၩ့ဖၩ လၧမုခံၫ့လခီၫ",
			"25": "<sup>25</sup> လီၫ.- တၭစီၩ့ထၪ့မ့ၪဒိၩ့လၧယဟိဝၩအမ့ၬယၫ, ဘဲၫ ယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> တၭမွဲအအီၪက့ၪဆၧလုလးထီၫ့ လၧတဲၩဆံၫ့ဎံၪအ",
			"27": "<sup>27</sup> ဖၧၩ့ လၧကလကၫအမ့ၬယၫလီၫ.- ဒဲဆူၭခဲၩဆၧနၧၫ့ မၧၫ့လၧအဖၫ့ခိၪ, ဘဲၫယဟိဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪ လီၫ.",
			"28": "<sup>28</sup> ဒဲဘျၭထၪ့ဆၧလၩ့ဆဲၩ လၧတဲၩဆံၫ့ဎံၪအတရၫ့နီၪ",
			"29": "<sup>29</sup> လီၫ.- တၭအီၪက့ၪဆၧလုလးဆူၭခဲၩမ့ၪ လၧတဲၩဆံၫ့ဎံၪ,ဆၧအီၪကီၪ့အတဲၩအတရၫ့အနဲၩ့တၭ, လုထၪ့ဆၧလုမ့ၪ ဒဲဆၧမၩဘိၪ့လၧအဖၫ့ခိၪ, ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"30": "<sup>30</sup> ဒဲအအီၪက့ၪအံၪ့ဒိၫ့ လၧဆၧအီၪကီၪ့အတဲၩဒဲဆၧလုလးအဘိၩ့ဆၧၩ့တၭ အီၪက့ၪထံၫလၧအဖၧၩ့, ဘဲၫၥိၭ",
			"31": "<sup>31</sup> ၦၡၩမိၥူၫဝၭဆံၫ့ဆၧလီၫ.- တၭစအၫရၧၫ့ဒဲအဖိၪခွၫလ",
			"32": "<sup>32</sup> ဖၪၥူၫဝၭဆံၫ့အစူၪဒဲအခၪ့ထီးနီၪလီၫ.- ထီးအလ့ၩနုၬ လၧဆၧအီၪကီၪ့အတဲၩဖၧၩ့တၭ, ထီးအလ့ၩဘူၭလၧ ဆၧလုလးတၭ, အဝ့ၫၥံၪနီၪ, ၥူၫဝၭဆံၫ့ဆၧဘဲၫယဟိ",
			"33": "<sup>33</sup> ဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.- မၩကဲၪထၪ့ဝၩ့အီၪဝၬ ဖီၩ့တဲၩဆံၫ့ဎံၪ ဒဲဆၧလုအလးတၭ, ဘျၭထၪ့တရၫ့အ ဆၧလၩ့ဆဲၩလီၫ. တၭစမိစ့ၭမၩဂီၩ့အဆၧမၩလီၫ.",
			"34": "<sup>34</sup> တၭဆၧအုၪ့ချႃၬဘံၭဆၧအီၪကီၪ့အတဲၩတၭ, ယ ဟိဝၩအလၩအဖၩ့ ဎွ့ၩထၪ့တဲၩဆံၫ့ဎံၪအဖၧၩ့လီၫ.",
			"35": "<sup>35</sup> တၭစမိစ့ၭလ့ၩနုၬလၧဆၧအီၪကီၪ့အတဲၩဖၧၩ့ၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧအုၪ့အီၪဝ့ၫလၧအဖၫ့ခိၪတၭ, ယဟိ",
			"36": "<sup>36</sup> ဝၩအလၩအဖၩ့ဎွ့ၩထၪ့တဲၩဆံၫ့ဎံၪနီၪလီၫ.- တၭထီး ဆၧမၩန့ထၪ့ခွံၬဆၧအုၪ့ လၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪတၭ, ၦအံၫစရ့လၭဖိၪ လ့ၩဆၧလၧအဖၧၩ့ၥၭလဖၪ ထီးအ",
			"37": "<sup>37</sup> လူၬလီၫ.- တၭဆၧအုၪ့နီၪအ့ၪလဘၪဆၧမၩန့ထၪ့ဝ့ၫ တၭ,အဝ့ၫၥံၪလလ့ၩဘၪထီးမုနံၩ လၧဆၧမၩန့ထၪ့ဝ့ၫ",
			"38": "<sup>38</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩအဆၧအုၪ့အီၪဝ့ၫလၧ တဲၩဆံၫ့ဎံၪအဖၫ့ခိၪ လၧမုဆၫလခီၫ, ဒဲမ့ၪအီၪဝ့ၫလၧ အဖၫ့ခိၪ လၧမုနၩလခီၫလၧၦအံၫစရ့လၭအဂံၪ့ဖိၪ ထီး အလူၬအမ့ၬယၫ ထီးဒၪအဝ့ၫၥံၪလ့ၩဆၧလစီၪ့လါလါ ကိၭစီၪ့ဒ့ၭလီၫ."
		}
	}
};
module.exports = book;